INSERT INTO `company` VALUES (390, '2025-04-08 15:15:31.889499', '2025-04-08 15:15:31.889499', NULL, '优力检测服务（广州）有限公司东莞松山湖分公司', 2, 486, '礼宾路1号创新科技园10栋', 'Daisy', 'daisy.jiang@ul.com', NULL, NULL, '•	关于UL Solutions\r\n作为全球安全科学领域专家，UL Solutions 129年来行稳致远，为全球100多个国家和地区的客户提供测试、检验和认证服务以及软件产品和咨询服务，肩负安全使命，为科技创新保驾护航。\r\n为中国品牌助力创新，走向世界\r\nUL Solutions进入中国四十多年来，已在全国拥有2400多名员工，设有12个分支机构以及众多获得UL认可的第三方合作实验室和客户实验室，服务于超过22,000家客户，为中国企业的全球化高质量发展提供与时俱进的创新安全解决方案。\r\n我们的行业和服务 \r\n电器 暖通空调制冷 照明 水和管道 技术和电子产品 \r\n电池和组件 医疗保健和生命科学 汽车和移动出行\r\n零售和消费品 建筑与施工 能源和公共事业  工业产品和系统\r\n化学品和材料 电线电缆 金融和投资服务 其他服务\r\n\r\n•	品牌荣誉\r\n成为优秀人才的首选雇主，UL Solutions拓耕不止，一路前行，近年来屡获最佳雇主殊荣，彰显雇主品牌的实力和雄心。\r\n•	2022年亚洲最佳企业雇主奖\r\n•	中国人才势能奖之社交招聘Top10\r\n•	人力资源管理杰出奖\r\n•	大苏州最佳雇主\r\n•	2021卓越培训创新应用奖\r\n•	2022年卓越学习运营奖', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.ulsolutions.com.cn/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (391, '2025-04-08 15:15:32.290694', '2025-04-08 15:15:32.290694', NULL, '爱奇迹（深圳）技术有限公司', 2, 487, '劳动社区万庭大厦1号楼1206（一照多址企业）', '于乔竹', 'mini.yang@heavengifts.com', NULL, NULL, '爱奇迹源于 2007 年，陪伴中国电子雾化产业迅速成长。2009年建立独立贸易平台HEAVEN GIFTS，并逐渐成为国内电子雾化产品出海的首选平台。2020年始，爱奇迹正式从渠道出海转向品牌出海，相继推出了ELFBAR、LOST MARY等国际一线品牌，并快速成为电子雾化行业的头部企业。\r\n如今，爱奇迹业务遍及全球 100 +市场，全球零售网点10万+，服务全球3,000万+用户。公司始终坚持全球视野，吸纳世界各地的优秀人才，并在全球多地设有分支机构，持续深耕海外市场。\r\n未来，爱奇迹将一如既往地遵循“让伙伴生活更美好，让烟民身心更健康”的使命，以“服务全球烟民，打造广受喜爱和信赖的新型烟草品牌”为愿景，为电子雾化产业发展和中国品牌出海贡献力量。', '15865562527', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (392, '2025-04-08 15:15:32.724751', '2025-04-08 15:15:32.724751', NULL, '招商证券股份有限公司深圳南山南油大道证券营业部', 2, 488, '南海大道新能源大厦A座5楼', '魏维', 'weiw@cmschina.com.cn', NULL, NULL, '一、公司介绍\r\n招商证券是百年招商局旗下金融企业，经过三十余年创业发展，各项业务和综合实力均进入国内十强，2020年7月，公司经证监会评定为 A 类 AA 级券商，上市代码600999。\r\n1、品牌优势（百年招商局旗下的金融证券龙头企业，口碑极好）\r\n2．上市券商（AA级券商、实力雄厚）\r\n3．业务全面（全牌照的证券公司，涵盖业务广）\r\n二、营业部介绍\r\n1、招商证券深圳南山南油营业部作为招商证券第一家营业部，营业部综合实力一直位居券商营业部前列；\r\n2、本营业部地处深圳南山区中心，客户资源丰富；\r\n3、交通便利，公司楼下有公交站和地铁口（9号南山书城站和12号南光站）；\r\n4、团队凝聚力强，有激情活力四射，团结互助，相处融洽，生活工作丰富多彩。', '15099906192', 50, NULL, NULL, NULL, NULL, 'https://www.newone.com.cn/', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (393, '2025-04-08 15:15:32.915367', '2025-04-08 15:15:32.915367', NULL, '深圳市芯斐电子有限公司', 2, 489, '北站社区鸿荣源北站中心B塔2401', '蒋小姐', 'hr1@phisemi.com', NULL, NULL, '深圳市芯斐电子有限公司是一家基于智能驾驶、智能安防、智慧城市、智能家居、智能物联、智能工业、智能感知、新能源等八大核心产业布局的高科技芯片设计、方案开发和销售的公司，旗下拥有六家深圳市芯斐科技有限公司、欣芯半导体(香港)有限公司、芯斐电子(香港)有限公司、芯斐科技(香港)有限公司、深圳市欣芯半导体有限公司、深圳市芯斐存储技术有限公司六家全资子公司，公司业务覆盖全国各地，并先后在香港、杭州、苏州、上海、成都、重庆、广州、厦门等地设立分支机构。公司凭借自身研发实力，可以根据客户需求进行客制化生产和服务，为客户提供最具价值的产品。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440309', 0, NULL);
INSERT INTO `company` VALUES (394, '2025-04-08 15:15:33.309968', '2025-04-08 15:15:33.309968', NULL, '广东凯讼律师事务所', 2, 490, '华凯活力中心17楼', '田益丰', '604356683@qq.com', NULL, NULL, '广东凯讼律师事务所是经广东省司法厅依法批准设立的综合性合伙制律师事\r\n务所，2023年获得国家知识产权局许可颁发的专利代理机构许可证、商标代理机构\r\n许可证，是兼具综合性和专业性的律师事务所。本所秉承“团结创新，勤勉敬业，\r\n求真务实，优质高效”的服务宗旨，坚持“以服务质量求生存，以信誉求发展”的\r\n经营理念，以专业化服务为立所之本，以“团队服务”为基本运作要求，以诉讼业\r\n务为主，同时兼顾非诉讼业务。广东凯讼律师事务所坐落于广东省东莞市南城区簪\r\n花路华凯豪庭办公楼（活力中心）1707-1710，拥有宽敞明亮办公场所、现代化的\r\n办公硬件设施。律所以“受人之托，忠人之事”为宗旨，致力于全面可持续地发展\r\n，努力推进律所品牌化、专业化、规模化、规范化建设，实现律所高质量发展，目\r\n前已建立包括知识产权部、企业法律事务部、房地产与建设工程部、刑事辩护与风\r\n控部、婚姻家事与财富传承部、执行与破产法律事务部、政府法律顾问及行政诉讼\r\n部等八大服务部门，专业细致的分工、灵活创新的服务模式，确保为客户提供多层\r\n次、全方位优质法律服务。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (395, '2025-04-08 15:15:33.710125', '2025-04-08 15:15:33.710125', NULL, '东莞市丰佳通讯实业有限公司', 2, 491, '横沥村一路', '15817786157', '15817786157@139.com', NULL, NULL, '东莞市丰佳通讯实业有限公司成立于2007年，是一家主营手机、智能电动汽车电脑数码、穿戴、智慧屏电视、智能家居等产品、智慧家装和移动信息化建设、施工、安装的连锁企业。总部位于东莞，历经18载的不懈努力和发展，现有直营门店80多家，员工800多名，遍布东莞各大镇街核心地段和大型shopping mall。\r\n公司一直秉承着合作共赢的经营理念运营商建立了密切的与手机生产合作关系。是华为全系列代理核心经销商金种子重点客户、中国移动核心战略合作伙伴、连续八年被评为“广东省守合同重信用企业”。', '15817786157', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (396, '2025-04-08 15:15:34.195315', '2025-04-08 15:15:34.195315', NULL, '广东宏源物流供应链有限公司', 2, 492, '南城碧桂园湾区国际1号楼2003室、2004室', '林晓媛', 'linxy@gdhywl.com', NULL, NULL, '广东宏源物流供应链有限公司成立于2014年，是集货运、收汇为一体的一站式综合物流服务企业；总部位于东莞，2006年就开始为各大中小企业执行代理报关服务，至今服务生产、贸易型企业累计超过1000家，报关单量累计超200万份；目前宏源物流旗下自有报关公司、运输车队、储存仓库（普通仓与监管仓）、贸易公司及收汇平台；公司遍布深圳、广州、厦门、宁波、上海、大连、青岛、广西、中国香港及越南、泰国等地；在美国、德国、中国台湾、日本、韩国等拥有可靠专业的代理网点，为1000多家国内外企业提供了外贸综合服务，先后获得交通部、海关、市场监督局、税务局等部门颁发的《无船承运人（NVOCC）》、《AEO认证企业》、《全国优秀报关企业》、《守合同重信用企业》等资质、荣誉。', '15768184081', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (397, '2025-04-08 15:15:34.527399', '2025-04-08 15:15:34.527399', NULL, '广东法制盛邦（东莞）律师事务所', 2, 493, '会展北路东莞会展国际大酒店三楼', '邓女士', '未公开', NULL, NULL, '法制盛邦（东莞）律师事务所成立于2003年，是全国优秀律师事务所、广东省规模最大的律师事务所之一的广东法制盛邦律师事务所在东莞设立的分所。该所于2012年3月与原广东三恩律师事务所、2012年12月与原广东湛清律师事务所合并,成为目前东莞地区最大型的综合性、专业化律师事务所之一，荣获2012年度东莞市优秀律师事务所称号。\r\n    法制盛邦（东莞）律师事务所是东莞市首家通过强强联合方式组建的团队化运营的律师事务所，同时也是国家律师联盟网的成员。目前与北京、上海、天津、武汉、南京、杭州、长沙、海口以及香港、澳门等地的多家律师事务所建立了密切的协作关系，能够最大限度地为企业提供广泛的法律支持。\r\n法制盛邦（东莞）律师事务所以专业化发展为导向、以团队化运营为模式、以法律服务产品化为手段，在打造知识产权保护、企业并购与破产管理、金融产品深度合作等专业法律服务品牌的同时，更创新性地开展了以企业法律风险管理为核心的法律顾问服务新模式，从企业设立到公司治理，从对外投资融资到人力资源管理，为企业提供全方位的法律服务，让法律成为企业和企业高级管理人员真正的保护伞，让律师成为企业家身边的风险管理大师。\r\n  法制盛邦（东莞）律师事务所现有执业律师160多名，全所工作人员逾240多名。其中合伙人均为原律师事务所的精英骨干，三分之二以上具有研究生以上学历，已执业多年，既有丰富的实践经验，又有扎实的理论功底；其他的律师及律师助理也经过严格的挑选和培训，大部分具有企业工作经历，能够为企业提供最贴心的法律服务。\r\n  法制盛邦（东莞）律师事务所具有广泛的客户群体，既有政府机关和社会团体，也有世界500强和本地龙头企业；既有金融、地产、旅游等服务型企业，也有机械、通信、电子、玩具和服装等制造业企业。丰富的客户服务经历造就了法制盛邦律师目前的综合服务能力。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (398, '2025-04-08 15:15:34.921607', '2025-04-08 15:15:34.921607', NULL, '东莞市大深教育咨询有限公司', 2, 494, '和创金融大厦5楼501、10楼1001', '曾国艳', '66540387@qq.com', NULL, NULL, '教育咨询服务；健康咨询服务；企业形象策划；个人商务服务；信息咨询服务；咨询策划服务；礼仪服务；文艺创作；组织文化艺术交流活动；会议及展览服务。', '18938239409', 50, NULL, NULL, NULL, NULL, '“大岭山大深”公众号', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (399, '2025-04-08 15:15:35.303853', '2025-04-08 15:15:35.303853', NULL, '东莞市众橙网络技术有限公司', 2, 495, '富康大厦16楼1606', '任小敏', 'carmen_ren1@163.com', NULL, NULL, '东莞市众橙网络科技有限公司是阿里巴巴中供拍档，是阿里巴巴国际站外贸企业的跨境电商（莞东）服务中心，为外贸企业提供跨境贸易整体解决方案。\r\n阿里巴巴国际站（www.alibaba.com）帮助中小企业拓展国际贸易的出口营销推广服务，它基于全球领先的企业间电子商务网站阿里巴巴国际站贸易平台，通过向海外买家展示、推广供应商的企业和产品，进而获得贸易商机和订单，是口企业拓展国际贸易的首选网络平台。\r\n传承阿里文化，“认真工作，开心生活”，秉承阿里巴巴理念坚守客户第一，打造一支有使命、愿景、价值观的销售铁军。', '13428644862', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (400, '2025-04-08 15:15:35.634961', '2025-04-08 15:15:35.634961', NULL, '广东卓建（东莞）律师事务所', 2, 496, '东莞市南城区东莞大道116号东莞轨道交通大厦19楼', '郭龙雨', 'guoly_gm@lawzj.cn', NULL, NULL, '广东卓建（东莞）律师事务所于2022年1月26日经广东省司法厅正式批准设立，隶属于广东卓建律师事务所，系卓建所在中国大陆的第12家分所，践行卓建全面布局粤港澳大湾区的战略。卓建（东莞）律所将全面延续总所先进的文化理念和经营管理经验，继续发挥专业优势，为建设“湾区都市、品质东莞”做出新贡献。', '13685523579', 50, NULL, NULL, NULL, NULL, 'http://www.lawzj.cn/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (401, '2025-04-08 15:15:35.925102', '2025-04-08 15:15:35.925102', NULL, '中国人民财产保险股份有限公司东莞市分公司', 2, 497, '区东源路9号人保大厦', '伍永俊', '未公开', NULL, NULL, '中国人民财产保险股份有限公司（PICC，简称“中国人保财险”）是“世界500强”企业中国人民保险集团股份有限公司旗下标志性主业，是目前中国内地最大的非寿险公司，其前身是1949年10月20日成立的中国人民保险公司。2003年11月6日，中国人保财险在香港联交所成功挂牌上市，成为中国内地大型国有金融企业海外上市“第一股”。凭借综合实力，中国人保财险相继成为2008年北京奥运会、2010年上海世博会以及2010年广州亚运会保险合作伙伴。2015年，国际权威评级机构穆迪公司授予公司中国内地企业最高信用评级Aa3级，公司多次荣获“全球最佳创新管理”、“亚洲最佳财险公司”、“中国企业社会责任杰出企业奖”、“年度最具影响力保险品牌”。\r\n在2019年美国《财富》杂志500强榜单中，中国人保位列121位。\r\n中国人民财产保险股份有限公司东莞市分公司是中国人民财产保险股份有限公司在东莞市的派出机构，现有员工一千多人，60多个分支机构遍布全市各镇区。东莞市场上最大的财产保险公司，无论是保费规模、公司效益，还是经营利润都一直领先于其他保险公司。人保财险东莞市分公司在行业中积淀了极佳的知名度和美誉度，也有众多的拥护者和追随者，保险服务已经渗透到全市经济生活的各个领域，以优质的服务屹立于东莞市保险市场。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (402, '2025-04-08 15:15:36.201497', '2025-04-08 15:15:36.201497', NULL, '东莞泰鑫通讯设备有限公司', 2, 498, '洪金路联科滨海智造港2栋6楼602', '王英', 'Emily@teksins.com', NULL, NULL, '东莞泰鑫通讯设备有限公司是一家集研发、生产、销售和服务为一体的国家级高新科技企业。公司致力于为客户提供无线网络优化、传输与接入等整体解决方案及产品；我们拥有出色的研发、制造和现场服务能力。目前公司产品已远销泰国、越南、印度尼西亚、塞尔维亚、英国、俄罗斯、印度等国家。公司坐落于东莞市洪梅镇联科滨海智造港 2栋6楼602。\r\n泰鑫在飞速发展的同时，期待有更多的有志之士能加入我们，为公司注入源源不断的活力，为实现企业的远大目标而共同努力。', '17324400370', 50, NULL, NULL, NULL, NULL, 'www.teksins.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (403, '2025-04-08 15:15:36.503100', '2025-04-08 15:15:36.503100', NULL, '崇辉半导体（深圳）有限公司', 2, 499, '江边社区江边第三工业区创业六路2号厂房1栋101', '梁小姐', '未公开', NULL, NULL, '崇辉半导体有限公司成立于2021年，注册地：中国广东江门市国家高新区；\r\n崇辉半导体（深圳）有限公司”成立于2000年，经过近20年的发展，已成为一家集研发、生产和销售于一体的半导体封装材料\r\n（蚀刻、冲压、电镀及后工序全制程）的综合性集团公司；\r\n公司拥有3个自有产权园区，江门崇辉半导体科技园、深圳崇辉工业园、江西信丰崇辉工业园，下设芯联电半导体（江门）有限公司、崇辉半导体（深圳）有限公司、信丰崇辉科技有限公司。\r\n占地面积及规模：\r\n公司总占地面积约255亩（深圳25亩、江西100亩、江门130亩），现厂房建筑面积约15万平方米，员工1000多名。\r\n具有合法电镀资质及牌照；通过SGS认证的ISO9001质量管理体系；IATF16949汽车质量管理体系；ISO14001环境管理体系认证。\r\n业务与产品\r\n半导体照明材料-LED SMD支架系列、Mini LED支架。主要应用领域：LED照明、LED显示屏、LED背光等。\r\n集成电路材料-IC框架系列。主要应用领域：人工智能、物联网、大数据、5G及各类消费电子等。\r\n光伏材料-金刚石切割线。主要应用领域：光伏单晶硅/多晶硅、蓝宝石衬底、磁材等碎性材料的切割。\r\n芯片切割刀具。主要应用于IC芯片的切割。\r\n\r\n品质方针： “顾客至上、品质第一、持续改进、顾客满意”\r\n核心价值观：“与合作者共赢、引领行业发展、服务回报社会”\r\n经营理念： “高效、低耗、质量第一“，“热情、诚信、顾客至上”\r\n产品目标： “最优的品质、最佳的服务、最适的价格”', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (404, '2025-04-08 15:15:36.890194', '2025-04-08 15:15:36.890194', NULL, '东莞市东城中海未来实验小学', 2, 500, '东泰商业街23号', '杨老师', 'dgzhwlhr@163.com', NULL, NULL, '东莞市中海未来实验小学是由中海地产创办的现代化省一级小学。学校坐落于广东省东莞市东城区黄旗山下，城市中央，占地面积26539.98平方米，现有45个教学班，师生两千余名。\r\n    2002年开办至今，学校凯歌高奏，声传莞邑：中国特色民办学校、全国首批科技体育传统校、全国优秀家长学校、全国优秀少先队集体、全国消防安全示范校；广东省一级学校、广东省绿色学校、广东省校园足球推广学校、广东省英特尔未来教育示范基地学校、广东省红领巾示范校；东莞市一级学校，东莞市慕课试点学校、东莞市创客特色学校。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (405, '2025-04-08 15:15:37.188812', '2025-04-08 15:15:37.188812', NULL, '广东小天才科技有限公司', 2, 501, '宵边社区东门中路168号', '车晓毅', 'xiaoyuan@eebbk.com', NULL, NULL, '小天才专注于打造高品质儿童智能产品，目前旗下拥有“小天才”“步步高”两大品牌。过去的30年，小天才&步步高持续深耕儿童智能穿戴和教育电子行业，带着满满的爱与责任，将心注入，用产品见证和陪伴一代又一代中国孩子的成长。\r\n我们曾先后推出了步步高复读机、电子词典、点读机“哪里不会点哪里so easy!”等众多经典产品。步步高学习机、词典笔、小天才电话手表、护耳耳机等一系列行业创新性产品问世后，深受孩子和家长喜爱，并成为了儿童智能穿戴行业和中国教育电子行业的领导品牌。\r\n未来，我们将不忘初心，持续创新，用科技探索未至，让童年更加精彩！\r\n梦想的篇章已经开启，智慧童年，为爱创造，期待你的加入！', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (406, '2025-04-08 15:15:37.627315', '2025-04-08 15:15:37.627315', NULL, '润加物业服务（深圳）有限公司东莞分公司', 2, 502, '华润幸福里', '鲍秋月', 'baoqiuyue3@crland.com.cn', NULL, NULL, '华润万象生活是世界500强华润集团旗下华润置地下属子公司，华润万象生活物业深圳中心成立于2001年11月08日，是一家具有独立法人资格，具备国家一级资质中国领先的物业管理及商业运营服务供应商。', '18477413334', 50, NULL, NULL, NULL, NULL, 'http://www.crmixclifestyle.com.cn/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (407, '2025-04-08 15:15:37.985623', '2025-04-08 15:15:37.985623', NULL, '维布络安舍（广东）日用品有限公司', 2, 503, '东莞市莞龙路段狮龙路莞城科技园', '曲小姐', 'hr@wipro-unza.com.cn', NULL, NULL, '维布络是一家全球业务多元化的跨国上市公司，业务主要有信息科技/个人护理和照明/基础设施工程等，总部设在印度班加罗尔，员工180000+，来自全球100多个国家。\r\n  维布络日用品有限公司在中国个护家清业务主要由两家公司、两大生产基地12大品牌构成。东莞及增城生产基地集研发、生产、品牌、销售、物流配送及综合体系运作中心，总占地面积超过60000平方米，合计总投资额过亿元，拥有家清、个护生产许可证、妆字号等国内及出口生产资质。通过ISO9001：94版ISO9001：2000版国际质量认证，为消费者及客户提供高品质的产品和完善的保障服务。近10万多个销售网点，全渠道覆盖，包括出口港澳、东南亚等国家，是东南亚个人护理用品及家居清洁用品市场领先品牌。\r\n  维布络安舍公司始创于 1979 年，经过40多年来的辛勤耕耘，旗下拥有 48 个品牌，275 个产品，1500 多种包装形式，且每年不断扩充，覆盖整个个人护理和家居清洁领域。领先品牌有“艾诗”、SAFI、“柔美”、DASHING、CARRIE、“罗曼诺”等个人护理品品牌，以及“威洁”、MAXKLEEN 等家居用品品牌。\r\n公司地址：广东省东莞市莞龙路段狮龙路莞城科技园。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (408, '2025-04-08 15:15:38.608982', '2025-04-08 15:15:38.608982', NULL, '惠州市荣丰供应链有限公司', 2, 504, '惠阳经济开发区惠澳大道古岭村地段荣丰工业园', '张先生', 'hrzp@wingfung.com.cn', NULL, NULL, '荣丰创建于1990年，是一家生产制造配套包装产品的制造型企业。从包装产品的设计、生产制造、销售到物流配送为客户提供一体化服务，致力于快速服务各区域客户的全面需求。自成立以来，秉持贴近服务的经营理念，始终坚持“持续改善、追求卓越、客户满意、永续经营”的质量方针，立志践行“一站式包装材料供应商”企业使命。先后在深圳、惠州、东莞、佛山、杭州、滁州、郑州等地建立多个分子公司，荣获“深圳300家最具成长性企业”、“全国电子信息产品包装（深圳）研发基地”等荣誉称号。官网：http://www.wingfung.com.cn', '13798188303', 50, NULL, NULL, NULL, NULL, '荣丰包装', '441300', '440000', '441303', 0, NULL);
INSERT INTO `company` VALUES (409, '2025-04-08 15:15:39.015152', '2025-04-08 15:15:39.015152', NULL, '广东亮剑工程装备服务有限公司', 2, 505, '港口大道上河居旁中建三局内广东亮剑公司', '陈正煊', '545786146@qq.com', NULL, NULL, '广东亮剑工程装备服务有限公司是专业从事建筑工程机械设备安拆、维修、保养、技术咨询和设备租赁企业，公司组建于2006年至今年已有17年的历史。我公司已成为珠江三角洲乃至于国内起重机械设备租赁行业发展强劲、品牌价值凸显的工程技术设备供应商。', '13528560056', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (410, '2025-04-08 15:15:39.416219', '2025-04-08 15:15:39.416219', NULL, '广州小鹏汽车科技有限公司', 2, 506, '岑村松岗大街8号', '徐红梅', '未公开', NULL, NULL, '#关于小鹏#\r\n小鹏汽车是中国领先的智能电动汽车设计及制造商，也是融合前沿互联网和人工智能创新的科技公司。我们致力于通过数据驱动智能电动汽车的变革，引领未来出行方式。\r\n立足全球，服务本土是小鹏汽车的战略格局。成立至今，小鹏汽车完成了全球化布局，公司研发总部位于广州，并在北京、上海、深圳、硅谷、圣地亚哥、广东肇庆和郑州建立设计、研发、生产制造与营销机构，通过全球化布局组建了一支规模化、多元化、重自研的跨界团队。截至2021年7月，公司员工超10000人，除一线员工外，研发人员占比约60%。\r\n小鹏汽车认为，新能源汽车不等于下一个汽车时代。智能汽车（AI+互联网+汽车）才是下一个汽车时代的全新赛道。数字化+电动化组成的“双擎”驱动的互联网基因智能电动车是小鹏汽车产品最大的差异化特色。\r\n小鹏汽车在打磨产品品质的同时，全面布局销售、售后以及充电服务等各项工作，通过产品运营闭环和服务运营闭环，满足产品全生命周期的用户全触点体验。\r\n2020年8月和2021年7月，小鹏汽车分别在纽约证券交易所、香港联交所挂牌上市，成为在美国纽约、中国香港两地双重上市的智能汽车第一股。\r\n在小鹏，我们推崇简单做人、高效做事，彼此以同学相称。期待善思、实干，有激情，有责任心，热爱创新、快速成长的你，加入我们，一起共赴远方，让想象发生。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440106', 0, NULL);
INSERT INTO `company` VALUES (411, '2025-04-08 15:15:39.844260', '2025-04-08 15:15:39.844260', NULL, '深圳市名扬时代电子有限公司', 2, 507, '松和社区东环一路144号7栋2层', '黎玉玲', '未公开', NULL, NULL, '深圳市名扬时代电子有限公司成立于2005年，坐落于深圳重点建设的龙华新区，交通极为便利，专注于视频图像产品十余载，是以移动视频技术和云台控制技术为核心的软硬件解决方案提供商。\r\n产品研制聚焦于公共安全防范，视频智能控制，结合图像识别技术和自主研发终端产品，为行业用户提供领先的解决方案和专业化，定制化产品。为客户提供产品全方位的OEM/ODM服务，产品广泛应用电力，消防，公安，武警，铁路，石油，安检，机场，港口，边海防，海事船舶，森林防火，应急救援，教育行业，视频会议系统，录播系统等众多领域。\r\n目前，我们拥有一支300多名年轻，专业，优秀的研发业务制造团队，核心产品通过CE、FCC、ROSE、SGS、国家公安部一所检测中心等权威机构认证，同时拿到多项实用新型专利，外观专利和软件著作权。产品远销海内外，与国内众多知名企业和海外客户建立多年长久合作。公司荣获“中国平安城市推荐品牌”、“百家诚信安防供应商”、“中国安防十大新锐产品”、“海康威视风雨同舟奖”等殊荣。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440309', 0, NULL);
INSERT INTO `company` VALUES (412, '2025-04-08 15:15:40.099154', '2025-04-08 15:15:40.099154', NULL, '东莞泛美光电有限公司', 2, 508, '天安数码城A6栋', '董小姐', '505017771@qq.com', NULL, NULL, '东莞泛美光电有限公司位于东莞市中堂镇天安数码城 A6 栋，是一家\r\n绿色节能环保灯具制造的高新技术企业，集研发、设计、生产制造、销\r\n售出口于一体，致力发展绿色健康照明。有着经验丰富的研发团队和\r\n先进的生产制造设备，能够为客户提供优质的产品和高效的服务。质\r\n量是公司发展的生命，“优质、高效、服务、持续创新”是公司的经营理\r\n念。公司通过了 9001 质量体系认证，产品通过了 TUV、CCC、ROHS、\r\nFCC、UL 认证，年销售规模超过 3 个亿，产品远销欧美、中东、东南亚\r\n等市场。', '13713275876', 50, NULL, NULL, NULL, NULL, 'https://www.panamericanelectronics.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (413, '2025-04-08 15:15:40.519779', '2025-04-08 15:15:40.519779', NULL, '广州华图化妆品科技有限公司', 2, 509, '绿地空港中心4号地3栋10-11楼', '昌小姐', '未公开', NULL, NULL, '柳丝木2013年成立于广州的北大门——花都区国家级广州空港经济区。集团从创建之初就秉承“科技创新、品质为本”的经营理念，从自然中聚汲活力能量，通过高科技的多元萃取，将蕴藏在大自然中的卓越能量融入到产品中，坚持自然美学。\r\n柳丝木将持续深耕日化行业，确立“一横一纵”战略：以柳丝木产品为中心，孵化多个子品牌；坚持绿色化、规模化、品牌化和国际化。未来10到20年，柳丝木的目标是成为中国化妆品公司TOP10，在国际上树立“柳丝木”这一品牌，同时在隔离、防晒、卸妆三个品类成为行业领头羊。\r\n我们希望实现“立足中国，走向世界”的宏大愿景，也希望与各位小伙伴共同见证这一未来，分享这一成就，期待你的加入！', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440114', 0, NULL);
INSERT INTO `company` VALUES (414, '2025-04-08 15:15:40.928723', '2025-04-08 15:15:40.928723', NULL, '企知道科技有限公司', 2, 510, '北站社区鸿荣源北站中心B塔4303', '李金涛', 'lijintao@chinaweizheng.com', NULL, NULL, '企知道集团是中国科创企业全要素资源搜索、匹配、管理、运营服务商，国家高新技术企业、专精特新企业，被国家工信部认定为全国唯一的科创服务类大数据产业发展试点示范项目。公司独创“4+”服务模式和“4x5”服务能力，并通过全国60多家分子公司，为20多个省市的政府部门和千万企业提供服务。\r\n公司旗下“企知道”科创服务大数据平台，汇集了全球6.9亿家企业数据4.8亿期刊论文数据、1.78亿专利数据、4700多万产业政策数据、900多万技术成果数据和200多万科研专家数据，公司汇集、治理全球科创数据，构建AI模型，加速创新要素向企业集聚，致力打造中国第一、国际一流的科创服务大数据基础设施。', '18128565920', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440309', 0, NULL);
INSERT INTO `company` VALUES (415, '2025-04-08 15:15:41.280884', '2025-04-08 15:15:41.280884', NULL, '东莞市云通通讯科技有限公司', 2, 511, '华南工业城金富路13号A栋001号', '文龙', 'wangjingjing@yuntongdg.com', NULL, NULL, '东莞市云通通讯科技有限公司成立于2014年，是中国卫星导航产业首家上市公司北斗星通旗下企业，是集团实现“北斗+通信”战略的重要举措。云通通讯坐落于美丽的东莞市香市古镇寮步镇，是一家集研发、生产基站天线为一体的专业制造商，是通信天线领域中二级集成商的领导者。公司占地面积9800平方米，拥有员工300余人，其中研发技术人员40人，每年的研发经费占到销售额的5%。\r\n主要产品有：基站板状天线、美化天线、室分天线和小区覆盖天线等。随着研发技术的不断更新，本公司将逐步拓展其它产品生产线，增强市场份额，产品完全符合中国国家标准以及行业标准。本公司奉行以一流的研发技术雄踞天线领域，为中国的通讯行业提供高质量、短交货期、个性化的终端产品。', '13532953975', 50, NULL, NULL, NULL, NULL, 'http://www.ytbdstar.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (416, '2025-04-08 15:15:41.656319', '2025-04-08 15:15:41.656319', NULL, '光大证券股份有限公司东莞长安长青南路证券营业部', 2, 512, '长青南路303号地王广场3栋207室', '陈美艺', '未公开', NULL, NULL, '光大证券是世界500强企业的核心金融服务平台之一。光大证券先后于2009年8月18日和2016年8月18日分别在上海证券交易所及香港联合交易所主板上市，是一家A+H股上市券商。\r\n东莞长安营业部地处长安中心区核心地段，交通便利，毗邻镇政府。因业务发展需要，急需管理及营销人才，诚邀各路有志之士加盟。公司提供有竞争性、激励性的薪酬待遇及良好的发展空间。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (417, '2025-04-08 15:15:42.006776', '2025-04-08 15:15:42.006776', NULL, '广东壹号律师事务所', 2, 513, '珠江东路32号利通广场自编2603单元', '许馨匀', 'xuxinyun@unitoplaw.com', NULL, NULL, '壹号简介\r\n        广东壹号律师事务所是经广东省司法厅批准设立的律师事务所。壹号律所是一家综合性法律服务机构，现有工作人员过百人，线上线下累计服务客户超过二十万人，目前已设立广州所、深圳所、东莞所、佛山所、武汉所并正在筹建更多全国分支机构。\r\n\r\n\r\n\r\n       一、   使命-人人享有优质法律服务\r\n\r\n\r\n\r\nØ  壹号律所业务领域多元，服务范围涵盖民商事诉讼、刑事辩护、劳动人事仲裁、公司法律顾问等内容，曾代理众多影响重大的民商事案件、刑事案件及大型非诉交易项目，曾多次荣获省级、市级律师协会等专业机构颁发的“业务成果奖” “理论成果奖”“社会责任贡献奖”等专业奖项；在众多疑难复杂案件中，通过精准的法律方案为客户争取到更多权益，获得客户的高度评价。\r\n\r\n\r\n\r\nØ  壹号律所定位是一家“亲民”“便民”的律师事务所，壹号律师既有高度专业化的专业知识，也有积极服务的服务意识，秉承“律师服务=专业意见+商业服务”的理念，在追求案件结果的基础上重视客户服务体验和情感关怀，通过各种方式实现法律服务的主动化、可视化及高频化。\r\n\r\n\r\n\r\nØ  壹号律所坚持总部直营的一体化管理，有统一的内部工作流程和服务标准，设有统一的售后服务中心，不做律师团队挂靠，为客户提供品质稳定的法律服务体验。\r\n\r\n \r\n\r\n    二、  目标-帮助法律人终身成长\r\n\r\n\r\n\r\nØ  壹号律所已经形成了“平等、坦诚、活力、自省”的工作氛围，律所崇尚充满激情、不断迭代、永争第一的精神，以奋斗为荣的工作氛围不断激励和鼓舞着每一位壹号法律人。\r\n\r\n\r\n\r\nØ  壹号律所已经形成了行之有效的法律专业技能培训体系，通过新人培训营、实践技能分析会、疑难案件讨论会、“善战者说”专题培训及一对一指导复盘，实现工作技能和工作方法不断优化、全员共享、迅速提升。\r\n\r\n\r\n\r\nØ  壹号律所坚持所有分所主任及团队负责人均来自内部培养（非加盟），为从业人员提供充分的职业生涯发展支持与发展机会。在壹号律所，有明确清晰的岗位及晋升路径设计，壹号律所的全国化战略、高速发展状态及开放的合伙人机制，为律师及从业人员提供了更多展现自身潜质及实现跨越式发展的机会。\r\n\r\n\r\n\r\n三、  路径-法律服务科技化\r\n\r\n\r\n\r\nØ  壹号律所坚定拥抱法律服务的“互联网+”趋势和“数字化转型”大潮，律所设有科技研发部门，自主研发了律所办公办案系统“壹律Cloud”，实现法律服务全流程的在线化、数据化、智能化。\r\n\r\n\r\n\r\nØ  壹号律所借助信息系统工具，与众多政府机构、公益机构和商业机构落地了“智慧法律服务”的合作项目，深入社区、深入群众使社会大众能够方便、快捷地获取律师服务，获得广泛好评，取得良好的社会效果。\r\n\r\n\r\n\r\nØ  壹号律所通过科技手段实现了大部分法律服务环节的标准化，通过自有信息系统的搭建，极大地提高了律所成员的办案与协作效率；通过大数据分析，为律师办案和团队管理提供决策依据；通过流程管控，确保稳定的法律服务品质。\r\n\r\n \r\n\r\n       壹号律所始终以“客户第一”作为服务理念，坚持以“帮助律师终身成长”作为发展目标，努力探寻“法律服务科技化”的创新路径，致力于成为一家让“人人享有优质法律服务”的律师事务所。\r\n\r\n壹号律所，您的壹号选择！', '15902067103', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440106', 0, NULL);
INSERT INTO `company` VALUES (418, '2025-04-08 15:15:42.362024', '2025-04-08 15:15:42.362024', NULL, '广东富凯尔化工新材料有限公司', 2, 514, '华侨工业园', '钟楚红', 'hong@reachinchem.com', NULL, NULL, '广东富凯尔化工新材料有限公司成立于2021年10月，是广州锐兴化工科技有限公司属下生产企业，集研发、生产、销售一体。我们拥有专业化研发团队和强大的技术服务团队，不仅对原料有深入理解，更熟知原料在配方中的性能表现，从而有能力为客户设计独特和创新的配方。富凯尔生产基地拥有先进的生产设备，符合ISO9001的质量管理体系，年生产能力达5000吨以上。产品远销欧美、加拿大、澳洲、韩国、东南亚、中东等30多个国家和地区。', '13726955986', 50, NULL, NULL, NULL, NULL, '', '441800', '440000', '441881', 0, NULL);
INSERT INTO `company` VALUES (419, '2025-04-08 15:15:42.705687', '2025-04-08 15:15:42.705687', NULL, '东莞锐新科技有限公司', 2, 515, '光大We谷B1-1栋714-715室', '叶小姐', '183297138@qq.com', NULL, NULL, '东莞锐新科技有限公司创办于2014年，总部位于东莞松山湖光大we谷，属国家高新技术企业。我们专注于移动互联网信息技术研发，为政府、企业、高校提供小程序、智慧门店、文化云、移动支付、电商等SaaS系统解决方案。\r\n自创办以来，锐新科技秉持“锐意进取，开拓创新”的核心理念，提供从方案设计、产品研发、程序开发、系统管理、技术支持的全链条综合服务。目前已拥有几百项项目经验，主要合作伙伴包括：东莞市政府、松山湖管委会、东莞报业传媒、东莞理工学院、广东医科大学、东莞市委网信办、马可波罗控股股份有限公司、茶山镇文化服务中心、东华集团、松山湖材料实验室等。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.rethk.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (420, '2025-04-08 15:15:42.949367', '2025-04-08 15:15:42.949367', NULL, '金碧物业有限公司', 2, 516, '黄埔大道西78号3101房之三', '黎小姐', '526430759@qq.com', NULL, NULL, '金碧物业，国家一级物业管理资质，1997年起提供全方位物业综合服务，2020年在香港联交所成功上市（股票代码6666.HK），历经27年的发展与沉淀，是中国物业管理龙头企业。员工9万人，拥有一支本科率超90%的高素质、高学历、年轻化的中层管理团队。\r\n金碧物业始终秉承“贴心服务，真诚相伴”的服务理念，坚持“标准化运营、专业化服务、智慧化管理、市场化发展”，为客户提供高质量的物业管理服务、社区增值服务及非业主增值服务，服务涵盖住宅、商写、产业园，以及政府大楼、高铁、机场等城市管理全业态。截至2024年6月30日，在管面积约5.55亿平方米、合约面积约7.94亿平方米、遍布全国300多个主要城市、服务超3000个项目、在管业主户数近380万户。', '15876965509', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440106', 0, NULL);
INSERT INTO `company` VALUES (421, '2025-04-08 15:15:43.307189', '2025-04-08 15:15:43.307189', NULL, '东莞证券长安分公司', 2, 517, '长青南路303号地王广场一区401', '施祖林', '1137106836@qq.com', NULL, NULL, '东莞证券成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。 截止至2018年底，公司拥有分支机构77家（其中营业网点75家，上海分公司1家，深圳分公司1家），营业网点遍布珠三角、长三角及环渤海经济圈，“扎根东莞、迈向全国”的格局基本形成。公司全资拥有东证锦信投资管理有限公司（从事私募基金业务），并控股华联期货有限公司。 公司紧跟国家政策和行业发展动态，不断丰富公司业务品种，大力优化收入来源结构。当前，公司以经纪、资管、投行三大业务为核心，积极发展两融、直投、债融、新三板和投资咨询等业务，实现了从收入来源单一型券商向收入来源多元化型券商的转型。 企业文化 开放、包容、分享 \r\n经营理念 规范、诚信、专业、创新 \r\n核心价值观 智慧创造财富、专业成就价值', '13549232283', 50, NULL, NULL, NULL, NULL, '东莞证券长安分公司', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (422, '2025-04-08 15:15:43.993358', '2025-04-08 15:15:43.993358', NULL, '广东仙津保健饮料食品有限公司', 2, 518, '大草铺路48号', '张小姐', 'zhangxiaoyan@xianjingroup.com', NULL, NULL, '仙津饮料厂成立于1985年，位于东莞市横沥镇，1992年变更为东莞市仙津保健饮料食品有限公司，是一家专注于各类饮料及养生食品领域，集产品研发、生产、销售和品牌发展为一体的大型民营企业。通过30多年的发展，已成为以广东仙津集团有限公司为首的集团公司，旗下有16家子公司。\r\n公司驰骋市场35载，产品涉及植物蛋白饮料、碳酸饮料、果味饮料、苏打酒及食疗养生健康食品等，旗下拥有“仙津”、“动力火车”等品牌。通过不断实施技术升级改造、产品创新，市场营销已逐渐发展为饮料行业的领先品牌，深得消费者青睐。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (423, '2025-04-08 15:15:44.365535', '2025-04-08 15:15:44.365535', NULL, '广东凯信知识产权有限公司', 2, 519, '宏图路86号南信产业国际4栋701、702号', '毛小姐', '未公开', NULL, NULL, '【发展历程】\r\n广东凯信知识产权有限公司成立于2010年，公司业务涵盖了为企业提供国内和国际知识产权的创造、保护，运用、管理等知识产权的全链服务以及全方位的科技政策咨询和申报等服务。\r\n\r\n公司总部位于广东东莞市南城总部基地南信产业国际D栋七楼，目前在惠州、佛山等地设立了分公司或子公司，公司员工近150人；\r\n\r\n公司自成立以来，一直秉承“诚信为本，长期服务”的经营理念服务市场，截至到目前，公司及旗下公司先后服务过的科研院校和企业有：广州医科大学、东莞理工学院，西北大学、中国农业科学院生物技术研究所、宜安科技股份、正业科技股份、佳禾智能、胜蓝股份、技研新阳、华亚数控、乔锋智能等近万家。十二年来，公司及旗下公司为各类型的企业提供知识产权代理、咨询、诉讼及科技项目等相关业务超过5万件。\r\n\r\n公司锐意进取，积极创新，不断提升行业服务能力，帮助各类型企业转型升级，提升企业的核心竞争力，赢得了广大客户的认可和一致好评。\r\n\r\n【企业文化】\r\n发展愿景：成为企业尊敬的知识产权服务商，成为强国建设的主力军；\r\n我们的使命：在追求全体员工物质和精神双幸福的同时，帮助企业提升核心竞争力，推动中国企业走向国际舞台，为建设社会主义强国做出贡献；\r\n我们的价值观：诚信 利他 专业 创新；\r\n经营理念：诚信为本，长期服务。\r\n\r\n【福利体系】\r\n1.岗前培训：公司为应聘者提供系统的岗前培训，帮助新伙伴快速融入团队，具备工作胜任能力，为每位员工规划及搭建清晰的职业发展通道和广阔的职业发展空间；\r\n2.员工活动：每年免费旅游、每季度员工生日会、每月度节日福利活动、每周活力互动游戏，不定期下午茶，丰富新颖的员工关怀活动，轻松和谐的工作氛围；\r\n3.假期福利：各类带薪休假（法定假日、年假、婚假、产假、陪产假、带薪年假等），健全的社保体系；\r\n4.奖金丰厚：年度金币奖励、季度、月度、周奖励（挑战奖、项目奖、团队奖、新客户奖、后勤奖等）等，荣誉+现金双丰收，拿奖拿到手软；\r\n5. 能力提升：完善的培养体系，丰富的培训资源，内部专业的讲师团队，为各岗位人员提供不同成长阶段所需的专业知识、技能、方法、管理等培训，不断提升和强化各岗位人员的能力塑造；\r\n6.晋升通道：完善的晋升体系将激发您的潜力，提倡内部培养，专业岗、市场岗、管理岗多元纵深晋升的人事理念,通过人才盘点和培养体系，我们为每位员工提供明确的晋升标准和通道，挖掘个人潜力的同时提供广阔的发展平台和晋升空间。\r\n\r\n公司总部\r\n广东凯信知识产权有限公司\r\n地址：广东省东莞市南城区宏图路86号南信产业国际D栋701室\r\n\r\n凯信合伙人公司\r\n东莞市凯信云方电子商务有限公司\r\n地址：广东省东莞市南城区宏图路86号南信产业国际D栋704室\r\n东莞市科凯伟成知识产权代理有限公司\r\n地址：广东省东莞市南城区宏图路86号南信产业国际D栋705室\r\n东莞市科安知识产权代理事务所\r\n地址：广东省东莞市南城区宏图路86号南信产业国际D栋706室\r\n广东良马（东莞）律师事务所\r\n地址广东省东莞市南城区宏图路86号南信产业国际D栋604室\r\n\r\n佛山分公司\r\n公司地址：佛山市禅城区同济西路12号永丰大厦808-811室\r\n\r\n惠州分公司\r\n公司地址：惠州市惠城区麦地路63号麦科特大厦1015室\r\n\r\n【工作时间】\r\n周一到周五08:20-12:00；13:30-18:00；周六08:20-12:00；\r\n周六下午和周日正常休息；每月第三周双休；国家节假日正常放假。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (424, '2025-04-08 15:15:44.642270', '2025-04-08 15:15:44.642270', NULL, '太平人寿保险有限公司广东电话销售中心', 2, 520, '兴塘社区汇峰路1号汇峰中心F区十层01单元', '邓玥', '45886904@qq.com', NULL, NULL, '太平人寿是中国太平保险集团旗下的专业寿险公司。拥有95年品牌历史，1929年始创于上海，1956年移师海外，2001年恢复国内经营。是我国大型寿险公司之一，副部级央企。总部设在上海，注册资本金100.3亿元，目前已开设37家分公司和1100余家三、四级机构，服务网络基本覆盖全国。\r\n太平人寿依托中国太平综合性、多元化经营平\r\n台，在个人代理、银邮代理、电话销售、网络销售等渠道，提供涵盖人寿、意外、健康、年金等多种类型的保险产品，为客户提供周全的保险保障和一站式、一揽子金融理财服务。', '18576821306', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (425, '2025-04-08 15:15:44.983969', '2025-04-08 15:15:44.983969', NULL, '东莞金拱门食品有限公司', 2, 521, '城区向阳路18号', '李经理', 'liyanrong.li@cn.mcd.com', NULL, NULL, '麦当劳中国\r\n麦当劳是全球知名的餐饮服务品牌，近40,000家餐厅遍及全球，每天接待顾客人次超过6,800万。每一家麦当劳餐厅都立足于本地社区，为社区邻里提供美味和凝聚力，让美味与美好，人人轻松可得。\r\n麦当劳于1990年进入中国内地市场。2017年，麦当劳中国市场成为麦当劳全球最大的为国际发展特许市场，中信联合体成为控股股东。麦当劳中国进入“金拱门时代”，为加快本地化发展提供了新的赋能。截至2023年12月底，全国有近6,000家麦当劳餐厅，员工超过20万, 麦当劳中国已成为麦当劳全球第二大市场，也是发展最快的市场。 \r\n麦当劳中国致力于提供随时随地的美味与优价。麦当劳中国拥有巨无霸、薯条、麦辣鸡腿堡、麦麦脆汁鸡等当家产品，并通过餐厅、外送、麦咖啡、甜品站、得来速等业务平台为顾客带来超级便利。麦当劳中国积极践行“用美味与热爱，凝聚社区邻里” 的初心，通过绿色增长引擎推动业务高速发展，发展绿色餐厅、绿色供应链、绿色包装和绿色回收，并长期投入青年就业和“麦当劳叔叔之家”实体公益项目，展现对美味、地球、人员和社区的热爱。', '18927391602', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (426, '2025-04-08 15:15:45.433148', '2025-04-08 15:15:45.433148', NULL, '广州洁生日化有限公司', 2, 522, '北龙路100号自编1栋（厂房I-1）', '许燕霞', 'zhaopin2@gzjoyson.com', NULL, NULL, '【公司简介】 广州洁生日化有限公司成立于2015年， 是一家研发、生产和销售新型日化洗涤清洁产品的高新企业。 主要有洗衣片，干衣柔顶香片，洗衣留香珠等产品， 出口欧美、日韩等发达国家市场。 公司严格按照ISO9001管理体系运营，并获得30多项发明或新型实用产品专利。 【主要经营】 主营产品有洗衣片、干衣柔顺香片、洗衣留香珠等产品。 【企业资质】 我们的主要产品均是该产品的国家行业标准或团体标准的主要起草者。 我们的工厂获得ISO9001、BSCI、ISO45001、SEDEX、IFS-HPC、FSC等国际认证。\r\n\r\n中国日化百强企业； 中国日用化工协会家居护理专业委员会副主任委员单位； 中国洗涤协会科技委员会单位； 中国新型洗涤行业睿星奖； 中国纺织品协会理事单位等\r\n\r\n【洁生释义】 洁净生活，走进千家万户。 【企业使命】 提供安全环保实用的衣物洗涤清洁产品； 【企业愿景】 做最好的洗衣片工厂 让洗衣片成为大众日常衣物洗涤用品； 【企业价值观】 以人为本、开拓创新 放眼长远、脚踏实地 为消费者创造真正有价值的产品 【质量方针】 质量是企业的生命，质量源于管理。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440115', 0, NULL);
INSERT INTO `company` VALUES (427, '2025-04-08 15:15:45.714114', '2025-04-08 15:15:45.715016', NULL, '东莞市思勤文化有限公司', 2, 523, '东城中路与宝怡街交汇处-大地大厦', '黄小姐', '371599814@qq.com', NULL, NULL, '思勤文化，是一所扎根于社区、全直营的中学生教育培训机构。思勤文化牢记“用教育智慧落实教育公平”的教育使命，通过规划前置与项目式学习，让学生在安全、便捷的条件下，就能获得有规划性的、优质、高效的教育服务。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (428, '2025-04-08 15:15:45.996375', '2025-04-08 15:15:45.996375', NULL, '招商证券股份有限公司深圳深南中路证券营业部', 2, 524, '深南中路汉国中心18楼', '刘经理', '未公开', NULL, NULL, '招商证券股份有限公司（简称“招商证券”）是具有百年历史的招商局集团旗下的证券公司，传承了招商局集团长期积淀的创新精神、市场化管理理念、国际化运营模式及稳健经营的风格，经过三十年的发展，已成为国内拥有证券市场业务全牌照的一流券商。\r\n      招商证券于2009年11月首次公开发行A股并在上交所主板上市（代码600999），于2016年10月首次公开发行H股并在港交所主板上市（代码06099）。截至目前，招商证券已成为中证100、上证180、沪深300等多个指数的成分股。\r\n      招商证券具有稳定持续的盈利能力、科学合理的风险管理架构、全面专业的服务能力。拥有多层次客户服务渠道，在国内设有259家证券营业部，拥有5家一级全资子公司——招商证券国际有限公司、招商期货有限公司、招商证券资产管理有限公司、招商致远资本投资有限公司、招商证券投资有限公司；参股博时基金管理公司、招商基金管理公司。同时，以香港公司为国际化平台，在英国、新加坡、韩国设立子公司，构建起国内、国际业务一体化的综合证券服务平台。\r\n      招商证券致力于“全面提升核心竞争力，打造中国最佳投资银行”。我们将以卓越的金融服务实现客户价值增长，推动证券行业进步，立志打造产品丰富、服务一流、能力突出、品牌卓越的国际化金融机构，成为客户信赖、社会尊重、股东满意、员工自豪的优秀企业。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440304', 0, NULL);
INSERT INTO `company` VALUES (429, '2025-04-08 15:15:46.764884', '2025-04-08 15:15:46.764884', NULL, '广东钻石世家国际珠宝有限公司', 2, 525, '东莞市', '程女士', '447685152@qq.com', NULL, NULL, '钻石世家国际珠宝集团 \r\n钻石世家，创立于2002年，以“Keep loving KeepShining”为品牌价值理念，以专业专注、匠心品质和温暖情感，缔造传承永恒爱意的“世家的珠宝”。\r\n\r\n旗下拥有ShiningHouse钻石世家、瑰宝殿、黄金屋等众多子品牌，覆盖50多个一二线城市，拥有超过500家门店。\r\n\r\n钻石世家以全新探索之态，突破传统格局，不仅研发“极慕之星”等高品质钻石，更以“时光银行”的真情服务和“钻石节”等消费体验，彰显不凡。\r\n\r\n作为艺术珠宝设计典范，钻石世家是夏纳国际电影节、ELLE 风尚大典、苗莎慈善盛典、华语电影节等国内外盛事的合作珠宝，以珠宝展现新一代女性优雅绽放的全新姿态。\r\n\r\nKeeploving KeepShining\r\n钻石世家以“Keeploving KeepShining\"为品牌价值理念，展现时代新贵优雅绽放的耀目姿态。鼓励每一个人无论在任何境遇，坚守初心、坚持热爱;鼓励每一个人坚定信心与勇气，越磨砺越璀璨，闪耀如钻石般的光芒。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (430, '2025-04-08 15:15:47.066359', '2025-04-08 15:15:47.066359', NULL, '深圳市固测创新技术有限公司', 2, 526, '创投大厦1栋505室', '王麒麟', '993410047@qq.com', NULL, NULL, '深圳市固测创新技术有限公司企业简介\r\n\r\n固测愿景：成为中国传感器行业的创新先锋\r\n\r\n深圳市固测创新技术有限公司，简称GUCE固测，是一家专注于工业传感器解决方案的高新技术企业。企业前身东莞市中昊自动化科技有限公司，自2008年成立以来，公司秉承“专业、专注、创新、感恩”的经营理念，坚守“可以成功、可以失败、但不可以放弃”的固测精神。致力于成为中国传感器行业的创新先锋，为客户提供卓越的产品和服务。\r\n\r\n主营业务与产品：\r\nGUCE固测的核心业务涵盖工业传感器的研发、生产与销售，包括但不限于光电传感器、光纤传感器、安全光栅、称重测力传感器、颜色色标传感器、条码阅读器、视觉传感器等。公司产品广泛应用于工厂自动化、物流自动化、3C自动化、锂电池、食品医药、纺织工业、木工家具、仓储物流、印刷包装、半导体、煤炭、港口等多个领域，以高精度、高可靠性和出色的性能赢得了市场的广泛认可。\r\n\r\n企业价值观：\r\nGUCE固测坚持\r\n成就客户：以客户为中心，满足需求，创造价值；\r\n开放合作：携手伙伴，资源共享，共创共赢；\r\n价值创造：追求卓越，以创新和效率驱动成长；\r\n持续改善：精益求精，不断优化产品与服务。\r\n\r\n\r\n研发与创新：\r\n公司注重技术创新和产品研发，拥有一支由资深工程师和研发人员组成的专业团队。GUCE固测不断追求技术突破，以满足市场对传感器技术的多样化需求。公司已获得多项技术专利，并与国内外多家知名企业建立了合作关系。\r\n\r\n服务与支持：\r\nGUCE固测提供全面的技术支持和售后服务，确保客户在使用过程中能够得到及时有效的帮助。公司在全球范围内建立了销售和服务网络，能够快速响应客户需求，提供定制化的解决方案。\r\n\r\n未来愿景：\r\n展望未来，GUCE固测将继续加大研发投入，拓展全球市场，以创新科技驱动企业发展，以优质服务赢得客户信任，成为中国传感器行业的创新先锋，为全球工业自动化贡献力量。\r\n\r\n未来使命：\r\n让传感器的选择与使用更简易。\r\n\r\n有意加入GUCE固测大家庭（0769-22 89 91 99），欢迎投中/英文简历。\r\n成功筛选出的简历，HR将会直接通过电话首轮面试。', '18819518664', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (431, '2025-04-08 15:15:47.402061', '2025-04-08 15:15:47.402767', NULL, '东莞朗勤电子科技有限公司', 2, 527, '东坑沿河东一路135号', '苏苹果', 'apple.su@longtech.cc', NULL, NULL, '东莞朗勤电子科技有限公司是深圳朗特智能控制股份有限公司的全资子公司，主要为国内外中、高端品牌客户提供配套产品，专注与智能控制类产品配套研发、制造与销售为一体的技术型企业。朗勤主要产品：消费类电子，充电桩，智能镜子；电动牙刷；物联网产品；\r\n朗勤建立科学完善管理体制；并配备国际先进的研发、生产设备和仪器，并于CSR、Broadcom、Marvell、MTK等知名企业在IOT产品领域进行深入合作。同时朗勤还与广东工业大学建立战略合作关系，保证我司研发技术始终处于科技前沿。\r\n朗勤拥有雄厚的研发实力、卓越的产品质量、敏捷和专业的服务理念；先后与知名企业Severin; Delonghi、Johnson、TTI、Buzz、BYD、GLP等建立战略合作伙伴关系。', '15015232006', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (432, '2025-04-08 15:15:47.728435', '2025-04-08 15:15:47.728435', NULL, '东莞市龟仙屋食品科技有限公司', 2, 528, '良信大厦', '纪', '863033417@qq.com', NULL, NULL, '龟仙屋属于东莞市良信企业旗下的子公司，是一家专注于新媒体行业的创新型企业，我们专注于为客户提供全方位的传媒服务，包括IP账号、电商、直播、团播等。逐步成长为一家集数字营销服务、品牌孵化、MCN内容生产、电商综合服务、城市生活服务为一体的综合型数字营销科技公司。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (433, '2025-04-08 15:15:48.100174', '2025-04-08 15:15:48.100174', NULL, '深圳市北测检测技术有限公司', 2, 529, '固戍奋达科技创新园E栋', '余小姐', 'hr2@ntek.org.cn', NULL, NULL, '北测集团（以下简称\"NTEK\"），作为国家级高新技术企业、新型材料及电子产品综合公共测试平台，是中国第三方检测认证服务的开拓者，也是国内最早从事商品检验、鉴定、测试、认证等服务的专业机构之一。\r\n\r\nNTEK经过十余年发展，在华南、华东、华中、华北、西南分别建有大型综合检测基地。具有行业顶尖的电磁兼容（EMC）、无线射频（RF）、新能源（各类电池、充电桩）、电气安全、能效节能、理化分析（电子电气禁限物质、玩具及婴童用品、服装纺织品、皮革鞋材、饰品箱包类、食品及接触材料）、金属及非金属材料检测分析、环境可靠性、失效分析、防疫物资、生物安全、可降解材料、汽车及零部件的VOC、ELV、气味、雾化、可靠性、功能性测试，汽车电子EMC等实验室，为全球客户提供多元化、一站式检测认证服务。\r\n\r\nNTEK实验室严格按照ISO/IEC17025:2017标准建立与实施管理，并通过中国合格评定国家认可委员会（CNAS：L5516）和国际实验室认可合作组织（ILAC）认可的实验室。获得国家质量监督检验检疫总局颁发的进出口商品检验鉴定机构资格证书，是国家强制性产品认证（CCC）指定实验室、中国质量认证中心（CQC）签约检测实验室、计量认证（CMA）实验室。\r\n\r\nNTEK获得美国CPSC、UL、A2LA、FCC、CEC、ETL、Eurofins-MET、德国TUV 莱茵、TUV南德、英国ITS、西班牙Applus、澳洲SAA、加拿大CSA、ISED、挪威NEMKO、智利SEC、巴西INMETRO、香港机电署EMSD、韩国KTC等国际机构认可授权，检测报告具有权威公信力。\r\n\r\nNTEK的博士后创新基地拥有多名海内外博士和众多相关标委会委员，范围覆盖全国汽车标准化技术委员会（NTCAS）、全国胶黏剂标准化技术委员会（SAC/TC185）、全国皮革工业标准化技术委员会（SAC/TC252）、全国电工电子产品与系统的环境标准化技术委员会（SAC/TC297）、全国无线电干扰特别委员会（CISPR）等，参与多项国标/行标的制修订工作。\r\n\r\nNTEK致力于建设安全、环保、健康的和谐社会，力图在检验、鉴定、测试、认证及质量研究领域成为最受人信赖的机构。我们承诺会严格遵守作业程序、执行检验检测标准，坚持客观独立、公平公正的诚信原则、刻守职业道德、承担相应社会责任，始终如一地向全球客户提供质量和安全服务。\r\n\r\n公司网址：www.ntek.org.cn  \r\n总部地址：深圳市宝安区航城街道三围奋达科技园E栋、C栋、B栋     \r\n联系方式：0755-23200050, 23200090；\r\n余小姐 18588205248\r\n简历投递邮箱：hr@ntek.org.cn\r\n乘车路线：\r\n公交：深圳市宝安区航城街道西乡奋达科技站或西乡安居花园站；（PS，公交站在深圳宝安大道沿线，距离公司所在的园区50米）\r\n地铁：深圳地铁1号线，固戍地铁站C出口右转往公交站方向直行800米奋达科技创新园。\r\n公司薪酬福利：\r\n1.	五天八小时工作制，提供免费宿舍，良好的写字楼式办公环境；\r\n2.	入职即享有五险一金保障，商业保险、带薪休假、年度旅游、年度体检、节日及生日礼品等福利；\r\n3.	薪酬激励：提供具有竞争力的薪酬，季度、年度优秀员工奖励、项目激励、专利发明开发奖励等；\r\n4.	完善的管理与培训机制、学习班、研讨会、交流会、学习平台；\r\n5.	发展通道：技术线、管理线发展双通道，提供良好的晋升通道和发展平台；\r\n6.	文化活动：篮球队、羽毛球队等各种兴趣小组，年度运动会，年会等；', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (434, '2025-04-08 15:15:48.400499', '2025-04-08 15:15:48.400499', NULL, '广东玉兰集团股份有限公司', 2, 530, '莞龙路段狮龙路莞城科技园内', '黎小姐', 'lxj@yulangroup.cn', NULL, NULL, '广东玉兰集团股份有限公司（玉兰股份，股票代码：836867），创立于1984年，是一家集研发、设计、生产、营销墙纸与软装产品为一体的综合性现代化企业集团，是中国室内装饰协会副会长单位，中国室内装饰协会墙纸墙布专业委员会会长单位，荣获中国家居产业百强企业、中国驰名商标等多项荣誉称号，公司先后组建了广东省墙纸工程技术研究开发中心、广东省省级企业技术中心，并与广州美术学院合作成立了产学研合作基地——广东省广美玉兰软装艺术创意研究院。\r\n玉兰集团一直保持着健康、稳定、快速的增长态势。目前，公司旗下拥有玉兰、布朗彩、沃兰诺、兰居尚品、迪士尼等多个战略品牌，产品涵盖墙纸、墙布、布艺、家居用品、软装一体化等行业，公司以家纺、家具、家饰为主，集专业设计、生产、销售流程一体化，服务优势涵盖原创设计、成品生产、专业配套、项目工程、品牌推广、导购体验、招商加盟等。一站式打造整体软装家居品牌，以设计引领消费，极致发挥整体家居品牌价值，秉承原创，品味生活，引领整体家居品牌的商业发展模式和产业发展新趋势。公司产品获得省级科技成果多项，获得国家专利60余项，参与制定国家行业标准多项。\r\n在软装产品高端项目应用方面，玉兰集团已成为行业权威。专业化的经营管理、高品质的产品、良好的品牌影响力、特色的项目服务体系给玉兰赢得了持续的市场关注与青睐，先后与万科地产、绿城集团、招商地产等大型企业集团建立了战略合作伙伴关系。 \r\n目前，玉兰集团已经在全国各地建立了强大的营销网络，在北京、上海、南京、西安，广州建有直旗舰店，1000多家经销店与服务网点覆盖全国县级以上城市，并在国外设有超过300多个经销、代理机构。\r\n展望未来，玉兰集团将通过持续稳健发展，实现将玉兰锻造成为创新型、服务型、整合型品牌企业集团的战略目标。', '0769-22677203', 50, NULL, NULL, NULL, NULL, 'http://www.yulanwallpaper.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (435, '2025-04-08 15:15:48.775308', '2025-04-08 15:15:48.775308', NULL, '广东金拓信息科技有限公司', 2, 531, '鸿福社区黄金路1号东莞天安数码城F区1号科研楼804-805', '李小姐', 'hounannan@zgkingtop.com', NULL, NULL, '广东金拓信息科技有限公司成立于2010年，是一家致力于企业信息化建设的高新技术企业。\r\n       金拓坚持“为客户创造价值”为企业宗旨，专业为企业提供各种信息化管理解决方案、企业IT规划与建设，主要从事金蝶ERP软件销售与服务、云计算方案咨询与供应，是目前珠三角地区规模较大的信息化建设整体解决方案供应商之一。\r\n       金拓是金蝶软件在东莞地区最高级的白金级别伙伴，也是金蝶在东莞地区最大的合作伙伴。当前公司部署了销售部、实施部、开发部、服务部的组织架构，总共有超过60多人的专业团队，超过95%的员工具备大专及以上学历，可以为企业提供专业的全方面信息化解决方案，为客户创造价值。', '19902482636', 50, NULL, NULL, NULL, NULL, 'www.zgkingtop.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (436, '2025-04-08 15:15:49.096585', '2025-04-08 15:15:49.096585', NULL, '东莞市猫星人传媒有限公司', 2, 532, '八一路良信大厦A栋1楼', '钟王伟', '1369286580@qq.com', NULL, NULL, '创新传媒公司，致力于为客户提供全方位的品牌传播与数字营销服务。我们融合创意策划、内容制作与先进科技，打造精准高效的传播方案，助力企业塑造品牌形象，提升市场竞争力，实现商业价值的最大化。', '13528607896', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (437, '2025-04-08 15:15:49.341487', '2025-04-08 15:15:49.341487', NULL, '上海晶岳电子有限公司深圳分公司', 2, 533, '海裕社区82区华美居商务中心D区1号楼丰泰楼401', '李姝霖', 'lisl@sscsemi.com', NULL, NULL, '上海晶岳电子有限公司是一家专注于功率器件研发的集成电路设计公司。公司目前主要有五条产品线：\r\n中低压功率器件：12～150V MOSFET，包含沟槽工艺和SGT工艺的产品。\r\n中高压功率器件：200V-700V Plane Mosfet和650V/1200V 深沟槽FS-IGBT。\r\nTVS/ESD：20W～10000W，应用于各类型接口和电池静电和浪涌防护。\r\n电源管理：包含了LDO,OVP,RESET IC,基准电压IC,充电管理IC，电池保护IC等电源管理芯片。\r\n二/三极管：包含了BJT、数字晶体管、肖特基二极管、开关二极管、稳压二极管、快恢复二极管、整流二极管等半导体材料产品。\r\n公司在上海、重庆都建有成熟的产品研发，技术支持团队，核心功率器件及集成电路设计人员均拥有15年以上的设计研发经验。公司历来十分重视研发端的投入，荣获高新技术企业，小巨人企业，“专精特新”企业。通过多年的研发积累，上海晶岳电子有限公司拥有数十项发明专利。\r\n公司在深圳和上海分别建立了专业的销售，技术支持和运营团队。核心销售、运营人员均有10年以上的从业背景。\r\n公司的晶圆流片合作伙伴包括华润上华（CSMC）、广州粤芯（Cansemi）、上海新进（BCD）、扬州晶新、青岛芯恩（SiEn）、上海鼎泰（WSS）等公司。在晶圆表面处理上投资入股晶鑫电子共同开发BGBM/化镀产品线。公司在封测端分别投资创立浙江潮芯电子和投资入股丰源电子以保障产品线产能，其它封测合作伙伴还包括长电科技、气派科技、集佳科技等大陆企业。晶岳电子同主要的流片及封装厂商均有多年的合作经历，建立了亲密的合作关系。\r\n公司能够提供包括MOSFET、LDO、OVP、ESD/TVS、充电管理及保护、电压基准IC、二极管、三极管、复位IC等系列产品，在便携式智能硬件（手机，智能手环/手表，蓝牙耳机，平板笔电，电子烟，无线充等），智能家电领域（扫地机，吸尘器，智能电视，蓝牙音箱，网通，各类小家电等），功率器件及逆变领域（PD充电器，电池管理系统（BMS），充电桩，逆变器等）等领域有着广泛的客户群体，是许多行业头部公司的重要供应商。\r\n晶岳电子有限公司秉承“质量第一，服务至上；精益求精，实现共赢”的管理理念，公司建立了完备的质量管理体系，严格的执行产品的质量体系，通过了 IS09001:2015版体系在“集成电路设计开发、销售和服务”领域的认证。晶岳电子承诺所有IC物料的潮湿敏感等级均能满足MSL3,且可定制MSL1等级的产品。公司着力于为客户提供卓越的产品、为创建世界一流品牌而不断努力。', '18883296336', 50, NULL, NULL, NULL, NULL, 'https://www.sscsemi.com/', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (438, '2025-04-08 15:15:49.595280', '2025-04-08 15:15:49.595280', NULL, '北京三快在线科技有限公司', 2, 534, '望京东路4号恒基伟业C座', '薛雪', '未公开', NULL, NULL, '美团的使命是“帮大家吃得更好，生活更好”。作为一家生活服务电子商务平台，公司聚焦“Food +Platform”战略，以“吃”为核心，通过科技创新，和广大商户与各类合作伙伴一起，努力为消费者提供品质生活，推动生活服务业需求侧和供给侧数字化升级。\r\n\r\n2018年9月20日，美团正式在港交所挂牌上市。美团将始终坚持以客户为中心，不断加大在科技研发方面的投入，更好承担社会责任，更多创造社会价值，与广大合作伙伴一起发展共赢。', '未公开', 50, NULL, NULL, NULL, NULL, '', '110100', '110000', '110105', 0, NULL);
INSERT INTO `company` VALUES (439, '2025-04-08 15:15:49.950918', '2025-04-08 15:15:49.950918', NULL, '中国银河证券股份有限公司东莞虎门大道证券营业部', 2, 535, '虎门大道129号217室中国银河证券', '龙嘉雯', 'longjiawen@chinastock.com.cn', NULL, NULL, '中国银河证券股份有限公司(下称“公司”，股票代码: 601881.SH，06881.HK)，中国最大的国有证券公司之一。 公司 根植中国资本市场20余年，服务中国及“一带一路”沿线超1700 万客户，客户托管资产超5万亿元，已发展成为国内分支机构最 多、亚洲网络布局最广的投资银行。 公司实际控制人为中央汇金 投资有限责任公司，其母公司为中国投资有限责任公司，是世界 知名国家主权财富基金。 凭借独特的历史、品牌和股东优势，公 司资本规模、盈利水平、业务实力和风险管理能力位居行业前 列。公司为个人、企业、机构、国际及资本市场客户提供财财富 管理、投资银行、机构业务、国际业务、投资交易等全方位、多 层次、专业高效的综合金融服务，致力于打造受人尊敬的现代投 资银行。', '15920204748', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (440, '2025-04-08 15:15:50.370120', '2025-04-08 15:15:50.370120', NULL, '北京品源专利代理有限公司东莞分公司', 2, 536, '华凯广场B座1702-03', '黄靖文', '未公开', NULL, NULL, '品源始创于2004年，是一家能够提供知识产权综合服务的专业代理机构，致力于在知识产权领域为公众及各大企业提供专业全面的法律及技术支持。目前已成长为与国际接轨的知名公司。连续多年，荣获“中国专利代理十强”、“全国十佳知识产权代理所”、“中国十佳专利事务所”、“中国十佳商标代理机构”、“优质客户知识产权诉讼代理机构”、“IP STARS”等荣誉。总部设在北京，现有员工千余人，东莞是隶属总部的直营分公司，公司所有业务及人力资源的管理都是由总部统一管理的。', '15220415107', 50, NULL, NULL, NULL, NULL, 'www.boipdg.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (441, '2025-04-08 15:15:51.249412', '2025-04-08 15:15:51.249412', NULL, '东莞贝易品牌管理有限公司', 2, 537, '元美东路3号丰泰大夏1栋701室02', '刘小姐', '454033787@qq.com', NULL, NULL, '公司主营网络技术开发，计算机软硬件开发，企业形象策划服务', '15818232695', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (442, '2025-04-08 15:15:51.664098', '2025-04-08 15:15:51.664098', NULL, '深圳美的智慧家电器销售有限公司', 2, 538, '汇海广场', '扈女士', '374228436@qq.com', NULL, NULL, '工作平台：科技尽善，生活尽美”，美的是一家覆盖智能家居、楼宇科技，工业技术、机器人与自动化和数字化创新业务五大业务板块为一体的全球化科技集团。我们致力诠释“智慧生活可以更美的”，为千万家庭带来舒适的智能家居解决方案。\r\n\r\n用人单位：悦服好工是一家为企业客户提供全方位人力资源服务的专业化公司。核心经营团队大都是人力资源行业、互联网行业、财税行业的资深干，并有一个从业经验超过20年的人力资源专家小组提供专业顾问支持。悦服是美的、VIVO、OPPO、飞鹤乳业、神州优车、德邦物流、极免速递等众多行业龙头企业的核心人力资源服务合作伙伴。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440309', 0, NULL);
INSERT INTO `company` VALUES (443, '2025-04-08 15:15:51.993161', '2025-04-08 15:15:51.993161', NULL, '东莞证券股份有限公司东莞南城东莞大道证券营业部', 2, 539, '浙商大厦1幢24楼', '李小姐', '425809227@qq.com', NULL, NULL, '东莞证券成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。公司业务范围涵盖了经纪、投资咨询、财务顾问、承销与保荐、证券自营、资产管理、基金代销、期货IB、直接投资、融资融券、做市、股票期权等领域。 截止至2015年7月底，公司有分支机构61家（其中营业网点58家，上海分公司1家，深圳分公司1家，北京办事处1家），营业网点遍布珠三角、长三角及环渤海经济圈，“立足东莞、面向华南、走向全国”的格局基本形成。公司全资拥有东证锦信投资管理有限公司，并参股华联期货有限公司。', '13480036172', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (444, '2025-04-08 15:15:52.290645', '2025-04-08 15:15:52.290645', NULL, '惠州市指南测控技术有限公司', 2, 540, '惠城区仲恺陈江东星路56号大欣工业区指南测控技术有限公司', '叶女士', '2813532117@qq.com', NULL, NULL, '深圳市指南测控技术有限公司 致力于智能穿戴行业的音频&电声、射频的自动化测试及全智能无人化测试设备的研发、制造、销售及售后，经国家认定为高新技术企业、专精特新小巨人、科技型中小企业、四上企业，已通过ISO9001:2015质量体系认证，取得专利60多项。公司下设有深圳研发中心、东莞销售服务中心及惠州生产基地，拥有专业的技术工程师及售后团队，形成研发、销售、制造及售后的完整体系。同时，公司本着持续发展及创新理念一直招揽行业的顶尖人才加入队伍。 指南测控可提供音频类产品从SMT段、半成品组装段及成品和包装段的整套自动化测试的解决方案及设备。公司秉承“让制造更智能”的企业使命，以“专业、可信赖、持续创新”为核心价值观，不断吸取先进的技术理念，优化制造系统，笃志成为“全球领先的智能制造方案服务商”，为各制造工厂提供高效率，高品质的自动化测试设备一站式定制服务。', '18218771330', 50, NULL, NULL, NULL, NULL, '', '441300', '440000', '441302', 0, NULL);
INSERT INTO `company` VALUES (445, '2025-04-08 15:15:52.669410', '2025-04-08 15:15:52.669410', NULL, '东莞市太粮米业有限公司', 2, 541, '桥头第四工业区太粮集团', '苏颖', '未公开', NULL, NULL, '东莞市太粮米业有限公司成立于2000年5月，注册资金人民币2.6亿元，员工已超1000人，是广东省内一家以优质大米加工为主的农业产业化国家重点龙头企业。\r\n公司集稻米种植、收购、储运、生产、销售于一体，打造完整产业链经营模式。经过“太粮人”二十年的努力奋斗，公司取得迅速发展，通过了ISO22000食品安全管理体系认证，先后被评为“ 全国守合同重信用企业”、“中国大米加工50强企业”、“ 东莞市上市后备企业”、“ 东莞市倍增计划试点企业”等。除总公司外，下设东莞厚街分公司、广州分公司、杭州分公司、广西子公司、江苏子公司及深圳、湛江、海口、厦门、华东、西南六大营销中心，现已成长为华南地区颇具规模与知名度的大米经营企业之一。公司目前拥有现代化精米加工厂5个、高标准原粮收储加工基地2个，总占地面积超过28万㎡，年加工大米能力达40万吨，配套仓容30万吨，软、硬件设施行业一流。\r\n在当今移动互联网技术飞速发展的新时代，太粮米业正在加快建设智能数字化工厂，逐步实现产业集群发展工业4.0新阶段。生产线选用瑞士布勒集团公司和日本佐竹公司的新型设备、全自动化包装码垛系统，通过组织研发生产管理系统（Production Management System），从粒粒原粮到颗颗精米，全程监控原粮投料、排期加工、订单输送、销售分析等关键环节，对采购质检、生产加工、粮食储备、销售物流四大模块作进一步升级改造，用互联网+技术引领太粮米业最终实现运营全数字化。\r\n凭借对高标准现代化生产工艺的至臻追求，公司始终如一重视市场推广与品牌培育，目前拥有“太粮”、“靓虾王”、“金太粮”、“米皇坊”、“宫粥”、“良谷纪”等在内的300多个注册商标，并根据消费者需求进行多样化定制。目前太粮已累计进驻家乐福、沃尔玛、大润发、永旺、嘉荣、华润万家、易初莲花等高知名度的超市卖场，以及天猫，京东，盒马鲜生等各大电商主流平台，拥有超400人的销售精英团队。除珠三角地区作为我们的核心销售区域外，还辐射广西、海南、福建等省份，同时在2020年开始陆续进驻华东区与西南区，向全国市场积极扩张。\r\n“努力创造新生活！”是太粮米业企业文化的精髓。未来我们将持续以市场为导向，通过不断地深化产业链各环节自主运作能力，打造更多强势大米品牌；以人为本，通过科学管理，将公司打造成中国粮食行业标杆型企业。', '未公开', 50, NULL, NULL, NULL, NULL, 'www.tai-liang.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (446, '2025-04-08 15:15:53.022906', '2025-04-08 15:15:53.022906', NULL, '中信建投证券股份有限公司东莞东莞大道证券营业部', 2, 542, '卡布斯国际广场C座111号', '莫振邦', '未公开', NULL, NULL, '中信建投证券股份有限公司是一家成立于2005年的全国性大型综合证券公司，总部位于北京市。该公司由中国证监会批准设立，业务涵盖证券经纪、证券承销与保荐、财务顾问、证券投资咨询、证券自营、证券资产管理等多个领域。此外，中信建投还提供融资融券、为期货公司提供中间介绍业务等服务，并拥有全资子公司开展期货业务与直接投资业务。', '18928273243', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (447, '2025-04-08 15:15:53.265371', '2025-04-08 15:15:53.265371', NULL, '东鹏饮料（集团）股份有限公司海丰云莲天然水厂', 2, 543, '海丰县莲花山128县道南100米', '戴依贝', 'daiyibei@szeastroc.com', NULL, NULL, '东鹏饮料，上交所主板上市公司（605499），旗下拥有东鹏特饮、东鹏大咖、东鹏补水啦、鹏友上茶、VIVI鸡尾酒、多喝多润、海岛椰等多个饮料品牌，为亿万消费者提供高品质饮品，致力于成为中国领先的饮料集团。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441500', '440000', '441521', 0, NULL);
INSERT INTO `company` VALUES (448, '2025-04-08 15:15:53.985094', '2025-04-08 15:15:53.985094', NULL, '广东九方万匠人力资源有限公司', 2, 544, '莞太路厚街段187号8号楼', '王小姐', '1528375459@qq.com', NULL, NULL, '2025成立于广东省东莞市 ，隶属于中警盾（广东）警用装备实业有限公司，长期专注于制造业、零售业、房地产、消费电子、互联网、政府、金融、酒店、汽车等行业的人力资源服务。专门为企业客户提供猎头、面试指导、人才测评、管理咨询、企业培训、职业规划等方面的服务。', '18938176168', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (449, '2025-04-08 15:15:54.396518', '2025-04-08 15:15:54.396518', NULL, '东莞市大众社会工作服务中心', 2, 545, '东莞市南城簪花岭9号泰安阁三栋3楼大众社工', '黎楚婷', '未公开', NULL, NULL, '东莞市大众社会工作服务中心是在东莞市民政局大力培育扶持下成立的全市首家社会工作专业服务机构。机构承接政府及社会团体等委托的公共服务项目，提供专业服务。机构现有人数300余人，分布在东莞、佛山两个地区，服务领域广泛，主要服务方向涉及社会工作岗位服务、社区综合服务中心运营、项目运作三大板块。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (450, '2025-04-08 15:15:54.788955', '2025-04-08 15:15:54.788955', NULL, '广州易初莲花连锁超市有限公司', 2, 546, '广州市白云区三元里大道268号宏泰大厦19楼', '刘小姐', '未公开', NULL, NULL, '正大集团的历史：        \r\n正大集团成立于1921年，是泰籍华人谢易初先生创办的知名跨国企业，在泰国亦称卜蜂集团，英文为Charoen Pokphand Group，简称CP Group。        \r\n正大集团秉承“利国、利民、利企业”的经营宗旨，历经近百年的蓬勃发展，已从经营单一业务的“正大庄种子行”，发展成以农牧食品、批发零售、电信电视三大事业为核心，同时涉足金融、地产、制药、机械加工等10多个行业和领域的多元化跨国集团公司。集团业务遍及全球100多个国家和地区，员工约35万人，2019年全球销售额约680亿美元，拥有正大饲料、正大食品、正大鸡蛋、正大种子、正大种植、卜蜂莲花、正大广场、正大乐城、正大中心、正大优鲜、正大电商、正大制药、正大置地、正大机电、易初工业、大阳摩托、正大国成、正信银行、正大综艺、正大音乐等具有广泛知名度的企业、品牌和产品。 \r\n卜蜂莲花购物中心简介：        \r\n卜蜂莲花是正大集团旗下的现代商业零售旗舰品牌，自1997年6月23日在中国上海开出第一家门店，24年以来已在全中国开设了一百多家门店，成功地把先进的零售概念带入中国，并建立了完整、高效的采购、仓储和配运体系，优化成本，把具有价值的商品带给顾客。现在，卜蜂莲花旗下全渠道零售业态不仅包括卜蜂莲花大型超市、卜蜂中心社区购物中心、正大优鲜社区型生活超市和LOTUS PLUS高端精品超市等B2C商业渠道，还依托正大集团全产业链产品，通过集团“正鲜生”平台，与外部企业开展B2B业务；以及通过“莲花GO”线上商城开展O2O业务。        \r\n卜蜂莲花秉承正大集团“利国、利民、利企业”的三利原则，力求建立一个强大的社区零售体验平台，成为家庭生活中的亲密伙伴。        \r\n卜蜂莲花秉承正大集团“利国、利民、利企业”的三利原则，贯彻践行“爱是正大无私的奉献”理念，在企业发展的同时谨记社会责任，从未忘记回报社会。卜蜂莲花根据零售行业女性顾客和女性员工多的特点，本着“关爱女性”的初心，在“粉红春天”公益品牌的基础上，2010年3月，携手广东省妇联共同创立“粉红春天关怀基金”，动员爱心企业捐款，链接公益促销活动筹集资金，专门救助粤东、粤西、粤北经济欠发达地区罹患女性“两癌”的贫困妇女。粉红春天关怀基金点亮了世界最高塔广州塔，搭乘粉红专列，用万人瑜伽创造了世界纪录，粉红了卢浦大桥，点亮了东方明珠。卜蜂莲花将继续延续关爱女性的公益主题，唤起社会对女性的感恩之心。   \r\n\r\n正大集团官方网站： www.cpgroup.cn', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440111', 0, NULL);
INSERT INTO `company` VALUES (451, '2025-04-08 15:15:55.173559', '2025-04-08 15:15:55.173559', NULL, '广东军辉达进出口贸易有限公司', 2, 547, '松山湖天安云谷', '李女士', 'service@cfid-ug.com', NULL, NULL, '广东军辉达（海外主体中林国际）是一家致力于通过人性化的科学管理，将非洲得天独厚的自然资源及人力资源高效利用的林产行业领军企业，公司处于高速发展的创业阶段，急需大量优秀的储备干部。\r\n秉承“人才培养优先”的原则，公司每年面向国内高校招聘“校园管培生”岗位10名，为公司高速发展源源不断输送储备管理人才。', '13326894715', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (452, '2025-04-08 15:15:55.501754', '2025-04-08 15:15:55.501754', NULL, '东莞伟峰纸品印刷有限公司', 2, 548, '茶山伟兴路55号101室', '曾先生', '未公开', NULL, NULL, '东莞金沛锋投资集团有限公司\r\n成立于2019年，是一家多元化发展的企业集团。集团旗下拥有多家子公司，包括：顺裕纸业、伟峰纸品、裕铧物流、金华峰物业、伟峰智能包装、莞锋物业等，业务涵盖投资管理、造纸、瓦楞纸制造、物业管理等多个领域。\r\n东莞伟峰纸品印刷有限公司\r\n是集团旗下核心企业之一，成立于2007年，位于东莞市茶山镇。公司专注于瓦楞纸板和瓦楞纸箱的设计、生产、制造与销售，致力于为客户提供高质量的包装解决方案。2022年，集团投资升级了纸板生产线，建成了年生产能力达4亿平方米的自动化生产与物流瓦楞纸制造车间，产品服务覆盖珠三角地区，并逐步向全国市场拓展。\r\n自成立以来，公司始终秉持“团结拼搏，争创一流”的企业精神，坚持“以人为本，和谐共进，互进双赢，开拓创新”的经营理念。以市场为导向，注重信誉与服务，推动科学发展，努力实现全面、协调和可持续发展。依托集团产业链的协同优势，伟峰纸品致力于打造成为智能、环保、服务珠三角地区的优质瓦楞纸品牌供应商，为客户创造更大价值，为社会贡献更多力量。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (453, '2025-04-08 15:15:55.905822', '2025-04-08 15:15:55.905822', NULL, '东莞朗特新能源科技有限公司', 2, 549, '南祥高新产业园5楼', '15815592627', 'yanhong.li@longtech.cc', NULL, NULL, '东莞朗特新能源科技有限公司主要从事智能控制器、智能产品及新能源产品的研发、设计、生产和销售，专注于为智能家居及家电、太阳能充电、汽车电子和新型消费电子等领域提供各类智能控制器产品及相应解决方案，以及电池pack研发、设计和生产。', '15815592627', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (454, '2025-04-08 15:15:56.302586', '2025-04-08 15:15:56.302586', NULL, '东莞市超业精密设备有限公司', 2, 550, '新河路51号12栋601室', '钟先生', '未公开', NULL, NULL, '东莞市超业精密设备有限公司成立于2012年，目前员工1400余人，隶属于福能东方装备科技股份有限公司（股票简称：福能东方，股票代码：300173，福能东方是一家国资背景的大型上市企业）。公司为东莞市“倍增计划”试点企业，荣获广东省高新成长企业，东莞市及广东省工程技术研究中心等多项荣誉，拥有发明专利、实用新型专利及软件著作权近100项。\r\n超业是一家专业从事锂电池自动化生产线研发、生产和销售，产品主要运用于锂电池生产的中段和后段生产环节，可为锂电池生产企业提供覆盖：制片、叠片、极耳焊接、铝塑膜成型封装包膜、注液、除气终封成型等生产环节的一站式自动化解决方案。展望未来，超业将继续致力于服务国内市场领先的中、大型锂电池生产企业，积极布局高端智能制造，形成竞争优势的产业体系。', '未公开', 50, NULL, NULL, NULL, NULL, '东莞市超业精密设备有限公司', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (455, '2025-04-08 15:15:56.627881', '2025-04-08 15:15:56.627881', NULL, '冠佳技术股份有限公司深圳分公司', 2, 551, '大宝路83号美生慧谷美谷6栋二楼', '柳女士', 'hr@bidipower.com', NULL, NULL, '关于我们：\r\n冠佳技术股份有限公司深圳分公司是成立于2006年的冠佳技术股份有限公司的分支机构，是致力于电子电源行业的老化测试设备、自动化设备的研发、制造、销售和服务的国家高新技术企业、东莞市后备上市企业。建有广东省节能型电子负载工程技术中心，曾荣获东莞市科技进步一等奖，东莞市专利技术金奖和中国专利优秀奖，凭借稳定的产品质量和优质的服务，获华为、Dell、Apple、Samsung、HP、IBM、台达、光宝、群光、康舒、艾默生、联想等国际大公司的一致认可和推荐。\r\n冠佳技术股份有限公司深圳分公司以高频电力电子变换与控制为核心技术，从事电能双向变换的研发型新能源高科技公司。产品涵盖电源老化双向电源模块，电池化成分容双向电源模块，储能双向电源模块，测试仪器等。\r\n公司位于深圳宝安美生慧谷科技园核心区，环境优美、交通便捷、配套完善。现诚邀怀揣梦想的同行者加入，与我们共创未来！', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (456, '2025-04-08 15:15:57.068311', '2025-04-08 15:15:57.068311', NULL, '东莞市贝克摩尔高性能材料有限公司', 2, 552, '粤海大道粤海智造产业园A25A贝克摩尔', '张小姐', '未公开', NULL, NULL, '贝克摩尔公司是一家专注于高性能材料技术研发和制造的开发型企业，总公司贝克合成成立于2006年，落地深圳；贝克摩尔于2020在东莞谢岗注册成立，是一家集高性能硅橡胶件研发、生产、应用于一体的公司，总投资2亿元人民币，贝克公司经过近二十年的发展，服务于多家知名五百强企业，产品广泛应用于医疗、汽车、新能源、家电等行业，获得国家高新技术企业、专精特新企业认证。', '18902610150', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (457, '2025-04-08 15:15:57.518346', '2025-04-08 15:15:57.518346', NULL, '深圳市中科蔚来电子有限公司', 2, 553, '区铁仔路60号奋成智谷大厦A座1504室', '李小晶', 'xiaojing.li@zhongkeweilai.com', NULL, NULL, '深圳市中科蔚来电子有限公司，成立于2017年，总部位于深圳市宝安区，是以新一代的4G/5G无线通信技术为基础，以万物互联的物联网行业为依托，专注于5G/IoT/AI等核心技术的解决方案供应商；目前公司有一线研发人员达到50人等。\r\n      其中本科以上历员工达到80%以上，均来自于国内知名高校通信及电子相关专业，分别建立了完整的产品测试、分析及环境/可靠性试验室，配置各类研发、测试、分析设备仪器、工器具等。超过70%的工程师拥有10年以上的工作经验，在专业技能覆盖多项核心技术领域，尤其是在4G/5G协议栈，多载波射频设计方面有丰富的经验。在7余年的发展中，企业先后获得“国家高新技术企业”、“国家专精特新”、“软件产品证书”、“质量管理体系认证证书”、“电信设备进网许可证”等荣誉称号；企业及产品通过|So9001:2015、CCC等认证，拥有多 项专利，软件著作权；为国内外知名厂商提供优质的产品和服务。目前中科蔚来业务领域涉及基于2G/3G/4G/5G的功能机，平板、PDA手持终端、智能机及硬件等产品。未来中科蔚来以先进技术和强劲的创新力，为品牌、行业客户提供可信赖的有竞争力智能解决方案供应商和产品服务，用科技为客户实现最大的价值。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.zkwldz.com/', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (458, '2025-04-08 15:15:57.979762', '2025-04-08 15:15:57.979762', NULL, '中国大地财产保险股份有限公司广东分公司', 2, 554, '东莞市南城区黄金路天安数码城D1栋17层', '容文超', 'rongwcdx@ccic-net.com.cn', NULL, NULL, '集团背景：\r\n   中国再保险集团是由国家财政部和中央汇金投资有限公司共同发起设立，注册资本金361亿元，是目前国内最大的再保险公司。\r\n公司情况：\r\n1.中国大地财产保险股份有限公司于2003年10月15日在上海成立，是经国务院同意，中国保监会批准成立的全国性财产保险公司，是中国再保险 （集团）股份有限公司（股票代码：01508.HK）旗下唯一的财险直保公司，注册资本金151亿元。\r\n2.中国大地保险已设立分公司36家，营业部1家，航运保险运营中心1家，机构总数超过2100家，营业机构覆盖全国各个省份，系统员工人数超6.5万人。\r\n2014年至2020年，连续七年获得贝氏评级公司（A.M. Best Co.）“A（优秀）” 财务实力评级（FSR）和“a”发行人信用评级（ICR），评级展望均为“稳定”。\r\n公司连续多年进入亚洲品牌500强和中国企业500强榜单，2020年分别位列428位、418位。公司还荣获金融时报社“年度最佳科技创新保险公司奖”，以及证券时报社“2020高质量发展保险公司方舟奖”、“2020中国保险业抗疫先进事迹方舟奖”等。\r\n部门简介：2007年12月公司在上海浦东成立了电子商务事业部， 部门自成立取得了跨越式发展， 2015年初在东莞筹建华南电子商务中心目前1000余人，发展目标5000人，各岗位空缺较多，职业发展空间巨大。', '19902631070', 50, NULL, NULL, NULL, NULL, '公司简介', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (459, '2025-04-08 15:15:58.306808', '2025-04-08 15:15:58.306808', NULL, '泰康人寿保险有限责任公司广东东莞中心支公司', 2, 555, '宏六路1号国金大厦10楼', '温小姐', 'wenzz02@taikanglife.com', NULL, NULL, '泰康人寿保险有限责任公司（简称泰康人寿）是泰康保险集团股份有限公司（简称泰康保险集团）的子公司。泰康保险集团前身为泰康人寿保险股份有限公司,成立于1996年，总部位于北京。泰康人寿注册资本30亿元，目前，泰康人寿在全国设有36家分公司，覆盖中国大陆所有省级行政单位，累计服务个人客户 2亿人，累计赔付件数 680.5万件，累计赔付金额467.5亿元。\r\n       泰康26年深耕寿险，厚积薄发。泰康人寿以诚信经营与客户体验为首要原则，通过覆盖全国、深入县乡的经营网络以及完善的个人保险、银行保险、电话销售、网络销售及经纪代理全渠道，为个人及家庭提供全方位的人身保障和投资理财产品与服务。2022年，泰康人寿新单价值，个险挺进前三、银保市场第一、新业务超越10亿元平台。\r\n       泰康人寿依托实力强大的泰康保险集团，拥有丰富资源，公司外延和内生增长动力更加强劲。泰康保险集团是一家涵盖保险、资管、医养三大核心业务的大型保险金融服务集团。2022年连续五年荣登《财富》世界500强，位列第346位。旗下拥有泰康人寿、泰康资产、泰康养老、泰康健投、泰康在线等多家子公司。业务范围全面涵盖寿险、互联网财险、养老保险、企业年金、资产管理、医疗养老、健康管理、商业不动产、海外业务等多个领域。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (460, '2025-04-08 15:15:58.829559', '2025-04-08 15:15:58.829559', NULL, '奥比中光科技集团股份有限公司', 2, 556, '学府路63号高新区联合总部大厦12楼', '吴怡玲', 'campus@orbbec.com', NULL, NULL, '奥比中光科技集团股份有限公司成立于2013年1月，总部位于深圳，在上海、西安、美国密歇根设有分支机构。奥比中光是国内率先开展3D视觉感知技术系统性研发，并实现产业化应用的企业之一，也是全球少数几家全面布局六大3D视觉感知技术路线的公司。\r\n\r\n奥比中光掌握了“全栈式技术研发能力+全领域技术路线布局”的3D视觉感知技术体系，可提供全套自主知识产权3D视觉感知产品，在消费电子、生物识别、AIoT、工业三维测量等市场上实现了多项具有代表性的商业应用，服务全球超1000家客户及众多开发者。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (461, '2025-04-08 15:15:59.873362', '2025-04-08 15:15:59.873362', NULL, '深圳市易联鑫云技术有限公司', 2, 557, '大富社区大富工业区3号金胜晖科技园D栋办公楼506、406', '林小燕', 'hr02@e-linkchina.com.cn', NULL, NULL, '深圳市易联鑫云技术有限公司成立于2011年，总部位于深圳，是中国领先的视频、通信传输产品制造商。主要产品有HDMI光端机、DVI光端机、SDI光端机、光纤收发器、交换机、PoE供电器/分离器等。凭借产品的高质量以及服务方面的高响应能力在广播电视，安防监控和光纤通信领域内源源不断的赢得客户的信赖。', '18128879419', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440309', 0, NULL);
INSERT INTO `company` VALUES (462, '2025-04-08 15:16:00.206376', '2025-04-08 15:16:00.206376', NULL, '上海聚翰船务有限公司', 2, 558, '虹口区花园路128号5街区A座5楼', '蒋梦瑶', 'mengyao@leagueshipping.com', NULL, NULL, '聚翰船务有限公司是一家经过国家外经贸部(现商务部)批准成立的国际性船务公司，致力于为客户提供全方位、高品质的物流解决方案。作为一家专业的海洋运输服务提供商，我们提供包括整箱订舱、拼箱、散货运输、冷链运输、特种货物运输等海洋运输服务，此外我们还提供一系列增值服务，如仓储，拖车，报关等。我们的运输网络覆盖全球各大港口，确保货物能够高效、安全地到达目的地。\r\n      我们的宗旨：秉承\"让物流更便捷”的使命，确保客户以合理的价格，享受最优质的服务，保证货物能够安全快速地到达目的地。\r\n      我们的愿景：“做通往世界各地最值得信赖的物流企业”，向前迈进。\r\n      我们的战略：将“客户满意为基础，诚信经营为根本\"，坚守初心，蓬勃发展。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.leagueshipping.com/', '310100', '310000', '310109', 0, NULL);
INSERT INTO `company` VALUES (463, '2025-04-08 15:16:00.507605', '2025-04-08 15:16:00.507605', NULL, '瑞幸咖啡（深圳）有限公司', 2, 559, '深圳市南山区科技园社区高新中一道2号长园新材料港6栋2楼', '邓姣', 'jiao.deng@lkcoffee.com', NULL, NULL, '品牌使命： luckin coffee（瑞幸咖啡）总部位于厦门，是中国门店数最大的连锁咖啡品牌之一。瑞幸咖啡以“创造幸运时刻，激发美好生活热望”为使命，充分利用移动互联网和大数据技术的新零售模式，与各领域优质供应商深度合作，打造高品质的消费体验，为顾客创造幸运时刻。  \r\n品牌愿景： 以“创造世界级咖啡品牌，让瑞幸成为人们日常生活的一部分”为愿景，围绕“求真务实、品质至上、持续创新、非我莫属、互信共赢”核心价值观，瑞幸咖啡正在通过产品和服务，努力渗透日常生活每一处，传递美好生活的理念，激发对美好生活的热切期望。  \r\n截至2022年6月，瑞幸咖啡全国门店数已突破7000家，结合无人咖啡机“瑞即购”，为顾客提供高品质、高性价比、高便利性的服务。瑞幸咖啡连续四年在IIAC国际咖啡品鉴大赛斩获金奖，“SOE耶加雪菲”荣获IIAC2021国际咖啡品鉴大赛铂金奖。2021年，瑞幸咖啡首个烘焙基地正式投产，基地总投资2.1亿元、占地面积4.5万㎡、咖啡豆年烘焙产能1.5万吨，采用国际先进技术、配备全套进口先进生豆处理设备，是国内较为领先的全产线自动化智慧型烘焙基地，标志着瑞幸咖啡将逐步打通并实现全产业链的延伸。', '18025432205', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (464, '2025-04-08 15:16:00.897500', '2025-04-08 15:16:00.897500', NULL, '东莞隽思印刷有限公司', 2, 560, '东山工业区', '梁小姐', 'leungnm@qpp.com', NULL, NULL, '隽思集团控股有限公司（股票代号：1412.HK）成立于1982年，总部设立于香港，主要生產纸质品类的产品，有贺卡、卡牌、礼品盒类、书刊类、棋盘游戏卡、拼图. 儿童玩具等,也有公司自己接单的网站业务。\r\n我们的愿景：成为行业中首选及最可靠的合作伙伴，奉行“以人为本”的宗旨，重视人才开发与培训，诚邀有干劲精英加盟隽思共享蓬勃的现在和共创光明的未来。', '0769-87712112', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (465, '2025-04-08 15:16:01.186383', '2025-04-08 15:16:01.186383', NULL, '东莞市龙鸿电子设备有限公司', 2, 561, '卢溪银通路2号6号楼301室', '张小姐', '未公开', NULL, NULL, '东莞市龙鸿电子设备有限公司始创于2013年12月，注册资金500万，公司座落在风光秀丽的中国制造业名城——东莞市高埗镇卢溪银通路2号6号楼301室，是一家专门从事研发设计、生产制造各类电测治具、自动化流水线、非标自动化设备的专业公司。\r\n公司的主要业务，是满足电子生产加工企业优化产品质量、提高生产效率、减少用人用工、 增加经济效益的需求，为其设计、制作各种非标自动化设备。凭借卓越的产品和服务，树立了良好的品牌形象，业务持续拓展，市场份额稳步增长。目前，公司正处于快速发展阶段，期待更多优秀人才的加入，共同开启新的征程。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (466, '2025-04-08 15:16:01.473221', '2025-04-08 15:16:01.473221', NULL, '东莞巨正源科技有限公司', 2, 562, '虎门港立沙岛', '李先生', 'hr_dgkj@jzyjt.cn', NULL, NULL, '东莞巨正源科技有限公司（下称“公司”）是巨正源股份有限公司（新三板挂牌、简称“巨正源”、股票代码“831200”）的全资子公司。巨正源是省属大型国有企业广东省广物控股集团有限公司（营业收入约1000亿元）的控股企业。公司是混合所有制企业，同时兼有国企和民企的双重优势。\r\n公司正在投资建设120万吨/年丙烷脱氢制高性能聚烯项目，该项目已被列为东莞市重大项目和广东省重点项目。项目分两期建设，其中一期占地近700亩，总投资近50亿元，2019年8月29日PDH装置投产，项目一期第一阶段全线打通，2019年9月26日，实现量产。一期项目主要包括：1套60万吨/年丙烷脱氢装置、2套30万吨/年聚丙烯装置、1套2000吨/年氢气提纯装置、丙烷低温储存系统，以及与生产配套的各种辅助设施。', '15573215083', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (467, '2025-04-08 15:16:01.951560', '2025-04-08 15:16:01.951560', NULL, '东莞证券股份有限公司东莞清溪证券营业部', 2, 563, '居民聚富路聚富商城1号柏思酒店四楼401', '余东杰', '120061060@qq.com', NULL, NULL, '东莞证券有限责任公司成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。公司业务范围涵盖了经纪、投资咨询、财务顾问、承销与保荐、证券自营、资产管理、基金代销、期货IB、直接投资、融资融券等领域。', '13592757521', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (468, '2025-04-08 15:16:02.312473', '2025-04-08 15:16:02.312473', NULL, '广东东鹏饮料有限公司', 2, 564, '市三江荔三公路746号', '潘美凤', '未公开', NULL, NULL, '东鹏饮料成立于1987年，前身为深圳市老字号企业的原国有饮料生产企业，也是国内首家引进利乐包生产线的饮料公司，集技术开发、生产、销售于一身，拥有先进的生产设备和雄厚的技术开发队伍及一套完整的饮料销售、推广管理体系。现有八家注册企业，分别是广州、东莞、安徽滁州、广西南宁、海丰、重庆、华南七大生产基地以及位于深圳的营销计划中心。2015年起，东鹏饮料相继在西南、华东、华北建立生产基地，由华东、华南地区逐步向内陆地区扩散，实现东鹏饮料生产基地全国布局。迄今，东鹏饮料已发展为一个拥有6000人以上的跨地区饮料集团', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440118', 0, NULL);
INSERT INTO `company` VALUES (469, '2025-04-08 15:16:02.976920', '2025-04-08 15:16:02.976920', NULL, '东莞海弘智能科技有限公司', 2, 565, '沿河北路7号松湖智谷科创中心2栋501室', '郭燕杰', 'guoyanjie@hacint.com.cn', NULL, NULL, '东莞海弘智能科技有限公司位于广东省东莞市松山湖大道与石大路交叉口松湖智谷产业园，是鹤壁海昌智能科技股份有限公司全资子公司，成立于2019年，现有人员40余人，主要产品有超细线全自动下线压接机，压接模具，扭力工作站，新能源线缆同轴机，逆变器线束加工中心，家电与通讯行业智能装备等自动化设备。广泛应用于汽车、轨道交通、家电、通讯，光伏和IT产业。 \r\n“品质决定未来”是海弘人永恒不变的信念，“杰出，超越客户的期望”是海弘人孜孜追求的目标，计划未来3年内成为国内家电与通讯线束行业、逆变器线束行业的行业领导者。', '13423220658', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (470, '2025-04-08 15:16:03.427698', '2025-04-08 15:16:03.427698', NULL, '力得机械科技（东莞）有限公司', 2, 566, '霞边村元下路2号', '胡小姐', '326921289@qq.com', NULL, NULL, '力得科技于2015年成立“力得机械科技（深圳）有限公司”，2016年将制造工厂迁至东莞，并注册“力得机械科技（东莞）有限公司”；2017年在江苏注册成立“常州力众得机械科技有限公司”，致力服务华东客户群。\r\n       本公司专业提供CCL/PCB厂之“自动叠合拆解回流线/基本裁切/自动包装系统”及压合周边自动化设备的规划、设计、制造服务；并积极开发其它自动化生产系统应用于各行各业；并成功应用到覆铜板，多层线路板，软硬结合板，铝基板，高频板，盖垫板，防火板等多个压合生产线，并在多个领域实现“业界首创”自动化生产线。\r\n       公司技术团队深耕CCL/PCB行业十多年，经验丰富，积极创新，为客户量身打造优质方案，提供高性价比/高智能化设备；不断探索“自动化设备如何为工厂提高品质、产量，降低人工、能耗、管理成本”，是一家专业CCL/PCB回流线/自动化生产线设备制造商。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (471, '2025-04-08 15:16:03.759494', '2025-04-08 15:16:03.759494', NULL, '东莞捷足网络科技有限公司', 2, 567, '东莞市学府一号', '黄女士', '283881192@qq.com', NULL, NULL, '东莞捷足成立于2016年，公司自主设计、生产和销售自有品牌的婴童鞋，配备专业的美工设计团队及多家合作工厂，着重开发新产品，是婴童鞋行业的电商引领者；目前入驻的跨境电商平台有Amazon、Walmart、SHEIN、Aliexpress、Alibaba、Shopee、TikTok、Joom、Shopify等，国内平台有1688、淘宝、拼多多、抖音等；已成为广交会、德国科隆、俄罗斯等多个展会的“常驻客”；\r\n目前公司正式成员已超100人，团队成员多为90后、00后，氛围轻松活泼，与东莞理工学院紧密合作，吸收了大批实习生/毕业生，已成为其教学实习基地。', '13380162530', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (472, '2025-04-08 15:16:04.022603', '2025-04-08 15:16:04.022603', NULL, '东莞市肯泰医疗用品有限公司', 2, 568, '阿里山路19号1栋301室、401室', '谭先生', 'hrm@convertek.cn', NULL, NULL, '东莞肯泰医疗用品限公司隶属于深圳市肯泰精密科技有限公司分公司，于2020年成立，座落于东莞市松山湖产业化中心，周边邻近华为研发基地、蓝思科技等。\r\n\r\n主要提供医疗级贴合解决方案及精准加工服务的专业化公司，和全球领先的医用原材料生产厂商合作，致力于成为客户可依赖、专业、高效的合作伙伴。\r\n\r\n肯泰为客户提供从研发到生产的全套解决方案至今已有16年，从产品设计、材料的选取，搭配到精密模切，产品组装、包装完成等全系列服务。\r\n\r\n注: 请应聘者面试时带齐第二代身份证、毕业证。', '18926811392', 50, NULL, NULL, NULL, NULL, 'http://www.convertek.cn/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (473, '2025-04-08 15:16:04.438886', '2025-04-08 15:16:04.438886', NULL, '碧桂园生活服务集团股份有限公司东莞分公司', 2, 569, '碧桂园中心', '莫先生', 'moweiqiu@bgyfw.com', NULL, NULL, '碧桂园服务控股有限公司（简称“碧桂园服务”，股票代码HK.6098）创立于1992年。于2018年6月19日正式登陆港交所，目前稳居港股物企市值与估值龙头。经过32年的稳健发展，公司业务涵盖住宅、商业、写字楼、产业园、学校、公园及公建等多种业态。\r\n截至2023年12月31日，碧桂园服务遍及超过 400+个城市以及海外，重点覆盖包括珠三角、长三角、长江中游、京津冀及成渝五大经济发达城市群，合同管理总面积约为16.33亿平方米。目前有超5万人的服务团队为约465万户业主及商户提供专业细致的社区服务。 \r\n2024年奖项：2024中国物业服务百强企业第一名、2024中国物业服务百强企业服务规模TOP10第一名、2024中国物业服务百强企业经营绩效TOP10”第一名、2024中国智慧城市服务领先企业第一名 、2024中国物业服务最佳雇主企业。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://app.mokahr.com/campus-recruitment/bgyfw', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (474, '2025-04-08 15:16:04.749779', '2025-04-08 15:16:04.749779', NULL, '顺丰速运有限公司', 2, 570, '顺丰总部大厦', '刘燕虹', 'zhangxain270@sf-express.com', NULL, NULL, '顺丰是中国及亚洲最大、全球第四大综合物流服务提供商，公司围绕物流生态圈持续完善服务能力与产品体系，业务拓展至时效快递、经济快递、快运、冷运及医药、同城即时配送、国际快递、国际货运及代理、供应链等物流板块，为客户提供国内及国际端到端一站式供应链服务；同时，依托领先的科技研发能力，公司致力于构建数字化供应链生态，成为全球智慧供应链的领导者。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (475, '2025-04-08 15:16:05.371159', '2025-04-08 15:16:05.371159', NULL, '东莞赛诺家居用品有限公司', 2, 571, '沙湖大结领路一号', '陈思', 'chensi@sinomax.com', NULL, NULL, '一、公司简介：\r\n   盛诺集团于2000年成立于东莞塘厦镇沙湖村盛诺工业城，占地面积超越14万平方米，公司人数超过3000人，集团总部设于香港，在中国大陆、澳门及美国均设有子公司，业务遍及欧洲、美洲、中国、日本等地。目前有五大国内生产基地，两个美国生产基地及两大物流仓，越南一个生产基地；\r\n   集团于2014年7月10日成功在香港上市，股份名称：盛诺集团，股份代码：HK1418.\r\n   根据弗若斯特沙利文，按二零一三年零售额计，集团是美国第二大慢回弹健康及保健主流产品供货商，占市场份额30.2%，并在香港及中国慢回弹健康及保健产品零售市场中排名首位，分别占市场份额41.9%及4.4%。凭借领先的市场地位及集团的良好布局，将受惠于未来几年的市场增长，尤其在对优质产品的需求持续增加及健康生活的意识日渐增强的中国市场。\r\n    盛诺集团秉承“诚信、包容、创新、共赢”的核心价值观，用科技诠释健康理念，“创享优质家居生活”，为全球消费者提供盛诺式的健康家居生活。东莞赛诺家居用品有限公司为盛诺集团子公司之一。\r\n二、盛诺企业文化\r\n    企业使命：创享优质家居生活\r\n    企业愿景：全球健康家居产品的引领者\r\n    核心价值观：诚信 包容 创新 共赢\r\n    企业文化冠名：“海文化”\r\n    企业口号：诚信包容，创新共赢\r\n三、盛诺企业管理理念\r\n    经营理念：诚信为本、客我共赢\r\n    管理理念：以人为本、精益管理\r\n    服务理念：至微至善、超越期望\r\n    人才理念：以德为先、人尽其才、共同成长\r\n    质量理念：精细、精益、精品\r\n    创新理念：积极创新、持续改进\r\n    安全理念：安全是我们的生命线，我们是安全的责任人\r\n四、员工薪资福利待遇：\r\n  1. 实行每周5天8小时工作制； \r\n  2. 公司为所有员工提供食宿（另提供伙食补贴），宿舍配置空调、独立洗手间与阳台、提供热水等；\r\n  3. 入职即办理社会保险（养老、医疗、工伤及失业保险）及公积金；\r\n  4. 提供国家法律规定的所有法定假期，另有年假、婚假、产假、陪产假、丧假等；\r\n  5. 为员工提供系统的培训：入职培训、在岗培训、素质提升培训及晋级教育，为勇于进取的员工提供充足的个 人发展空间；\r\n  6. 每月定期发放生日礼物，另享有年终奖、过节费、旅游等；', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (476, '2025-04-08 15:16:05.668209', '2025-04-08 15:16:05.668209', NULL, '中国大地财产保险股份有限公司东莞分公司', 2, 572, '胜和路3号1栋401室', '周丽珍', 'zhoulzdg@ccic-net.com.cn', NULL, NULL, '中国大地财产保险股份有限公司成立于2003年，是一家具有“国字品牌”、央企背景的全国性财产保险公司，注册资本金151.16亿元，是中国再保险（集团）股份有限哦公司旗下唯一的财险质保公司。中国大地保险已设立分公司39家，营业部1家，机构总数超2100家。2022年，公司实现保费收入461亿元，公司业务规模一致稳居财险市场前六。\r\n      中国大地保险东莞分公司是在原东莞中心支公司基础上，于2020年10月16日升格为总公司直管的城市型分公司。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (477, '2025-04-08 15:16:06.057372', '2025-04-08 15:16:06.057372', NULL, '小仓离合机（东莞）有限公司', 2, 573, '鹤田厦科技工业园区富园路8号', '彭亚琼', 'ocd-sonmu1@oguraclutch.com.cn', NULL, NULL, '本公司是一家日本独资跨国性集团公司，主要是生产汽车空调用的离合器。集团以开发制造各式各样的离合器、制动器而位居世界***，在全世界获得了1/3的市场占有率。其技术力和信赖性在世界中被广泛承认。本公司作为在海外的第六家公司位于广东省东莞市石碣镇科技工业园，总投资700万美元。\r\n公司位于石碣镇科技工业园，环境优美，空气清新，拥有新建厂房和宿舍。工作环境优良，车间内设有空调，机械设备高度自动化。公司严格遵守国家劳动法，福利待遇如下：\r\n1.实行五天工作制，加班费按国家规定计算。\r\n2.良好的住宿环境，宿舍配有空调、洗衣机。\r\n3.包三餐，食堂配有空调、电视。\r\n4.每年4月全员调薪。\r\n5.年底享有年终奖金。', '13686297996', 50, NULL, NULL, NULL, NULL, 'https://www.oguraclutch.co.jp/en/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (478, '2025-04-08 15:16:06.416032', '2025-04-08 15:16:06.416032', NULL, '中国银河证券股份有限公司东莞东城中路证券营业部', 2, 574, '东城中路君豪商业中心802号', '孔雪萍', 'kongxueping@chinastock.com.cn', NULL, NULL, '中国银河证券股份有限公司（下称“公司”，股票代码：601881.SH，06881.HK），中国最大的国有证券公司之一。\r\n公司根植中国资本市场20余年，服务中国及“一带一路”沿线超1700万客户，客户托管资产超5万亿元，已发展成为国内分支机构最多、亚洲网络布局最广的投资银行。\r\n公司实际控制人为中央汇金投资有限责任公司，其母公司为中国投资有限责任公司，是世界知名国家主权财富基金。\r\n凭借独特的历史、品牌和股东优势，公司资本规模、盈利水平、业务实力和风险管理能力位居行业前列。公司为个人、企业、机构、国际及资本市场客户提供财财富管理、投资银行、机构业务、国际业务、投资交易等全方位、多层次、专业高效的综合金融服务，致力于打造受人尊敬的现代投资银行。', '13560831818', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (479, '2025-04-08 15:16:06.736655', '2025-04-08 15:16:06.736655', NULL, '蒂业技凯（中国）投资有限公司', 2, 575, '开发区学府南街5号-B', '公艳艳', '未公开', NULL, NULL, '蒂业技凯（中国）投资有限公司（简称THK中国）是由日本THK株式会社全额出资，于2005年设立的子公司，注册资本3.2亿美元。本公司同时也是THK集团在中国的总部，地处美丽的大连。\r\nTHK 以创造性的构思和独有的技术在世界上率先研发了直线运动系统。直线运动系统产品广泛应用在数控机床、半导体制造装置、机器人、医疗器械等各种工业领域，成为这些工业领域中不可或缺的零部件。THK集团生产的直线运动系统产品在全球拥有极高的市场占有率。作为直线运动系统的先驱，THK集团一直致力于新产品的研究开发，以满足世界各地顾客的需要。2010年THK集团在大连成立了集团在海外的第一个研发中心。\r\n此外，THK集团在中国的大连、无锡、常州等地设有多个制造工厂，主要生产直线导轨、滚珠丝杠、滚珠花键、直线引动器等直线运动系统产品。在全国拥有近30个销售网点，目前仍在不断扩大在中国市场的发展。', '未公开', 50, NULL, NULL, NULL, NULL, '', '210200', '210000', '210213', 0, NULL);
INSERT INTO `company` VALUES (480, '2025-04-08 15:16:07.522687', '2025-04-08 15:16:07.522687', NULL, '隽天保险经纪（上海）有限责任公司东莞市第一营业部', 2, 576, '东莞大道东城段13号2307室、2308室', '叶淑雯', 'Liangyuting0520@163.com', NULL, NULL, '隽天保险经纪(上海)有限责任公司是经原中国保险监督管理委员会批准设立的全国性专业保险中介公司，注册资本2.25亿元人民币，总部位于上海。\r\n隽天，作为一家新时代保险经纪公司，客户与科技驱动我们不断前进。天于2020年至2021年连续2年蝉联中国财经风云榜年度竞争力保险经纪公司，通过标准化的咨询服务流程，高附加值的专业服务、创新的科技平台、优选的价值产品、合规高效的专业团队,打造安全+，服务+，持续+，全服务体系，不断探索需求演变，提升服务体验，在您保单的全生命周期，伴随您一生成长。隽天，让未来值得期待!', '13798727455', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (481, '2025-04-08 15:16:08.050986', '2025-04-08 15:16:08.050986', NULL, '广州盈林装饰材料有限公司', 2, 577, '天河区潭村路348号珠江商务大厦1501', '林珊花', '2715783319@qq.com', NULL, NULL, '大自然品牌创始于1995年，总部在：佛山顺德。\r\n连续多年获得亚洲500强企业认证\r\n2023年品牌价值高达876.12亿\r\n产销量遥遥领先，是亚洲木地板行业领军品牌。\r\n广州、东莞大自然地板公司成立于2000年，主要经营大自然地板、大自然原装进口地板、大自然木门等品类，至今广州、东莞莞两地拥有30+家专卖店，60+家合作渠道公司，团队人数达150余人。', '13533163638', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440106', 0, NULL);
INSERT INTO `company` VALUES (482, '2025-04-08 15:16:08.365731', '2025-04-08 15:16:08.365731', NULL, '深圳市正运动技术有限公司', 2, 578, '大广发综合楼五楼', '乔玉莲', 'hr@zmotion.com.cn', NULL, NULL, '一、公司简介\r\n正运动技术专注于运动控制技术研究和通用运动控制软硬件产品的研发，是国家级高新技术企业。正运动技术汇集了来自华为、中兴等公司的优秀人才，在坚持自主创新的同时，积极联合各大高校协同运动控制基础技术的研究，是国内工控领域发展最快的企业之一，也是国内少有、完整掌握运动控制核心技术和实时工控软件平台技术的企业。\r\n正运动技术的运动控制产品包括2-24轴脉冲型嵌入式运动控制器、2-128轴总线型嵌入式运动控制器、2-24轴脉冲型网络运动控制卡、2-128轴总线型PCI运动控制卡、2-32轴视觉运动控制一体机、人机界面、各类扩展模块等。\r\n正运动技术的视觉运动控制器一体机，在运动功能的基础上叠加了视觉定位、测量、轮廓匹配和二维码/条码检测等机器视觉功能，极大地降低了机器视觉应用的门槛，硬件高集成小体积，软件一站式易开发。\r\n正运动技术的运动控制产品具备优异的开发性，除支持各种操作系统和编程语言调用函数库自由开发外，持续完善All In One的国产工业应用开发软件平台ZDevelop，可支持一站式HMI开发、Basic/梯形图混合运动开发、机器视觉开发等，可实时仿真和在线跟踪Debug，缩短开发周期，降低开发风险。\r\n正运动技术的软硬件产品均严格遵循华为的IPD-CMM开发流程，具备电信级的稳定性和可靠性，具有良好的软硬件兼容性和扩展性。质量管控上，从市场需求、产品定义、设计开发、料件供应、生产加工、客户服务等全流程严格执行ISO9001质量管理体系，可有效保障输出高质量的产品和服务。\r\n正运动技术一直致力于做最好用的运动控制产品，经过众多合作伙伴多年的应用开发，产品广泛地应用于3C电子、印刷包装、纺织服装、激光加工、机器人、医疗保健、舞台娱乐等领域。正运动技术坚持把产品质量置于商业利益之上，坚持以满足需求为中心、以创造价值为根本、以提升体验为追求，将锲而不舍地为智能制造提供更有价值的运动控制产品。\r\n二、 企业发展\r\n\r\n-2013年深圳市正运动技术有限公司注册成立,并推出脉冲型运动控制器；\r\n\r\n-2014年推出多轴脉冲型运动控制器+手持示教盒；\r\n\r\n-2015年推出自主研发的网络型运动控制卡；\r\n\r\n-2016年推出国内首款实现64轴EtherCAT运动控制器；国内首个支持ZBasic、ZPLC、ZHMI功能混合编程的运动控制型PLC\r\n\r\n-2017年公司获得***高新技术企业认证、苏州办事处成立、佛山办事处成立;\r\n\r\n-2018年推出双总线型运动控制器，并成立印度分公司、东莞办事处成立、厦门办事处成立；\r\n\r\n-2019年推出ZMIO总线IO模块，公司品牌全新升级、青岛办事处成立；\r\n\r\n-2020年国内首款嵌入式运动控制+机器视觉一体机VPLC516E；\r\n\r\n三、企业荣誉\r\n\r\n国家高新企业\r\n\r\n深圳市高新技术企业\r\n\r\n运动控制领域最具投资价值奖\r\n\r\n运动控制领域新锐企业\r\n\r\nISO9001认证\r\n\r\n。。。。。。。。\r\n\r\n四、公司地址和交通\r\n\r\n深圳总部：深圳市宝安区钟屋一路70号大广发综合楼5楼\r\n\r\n公司路线指引：1)公交站台：“钟屋”站，5分钟至公司(公交路线：331路、337路、\r\n\r\n362路、629路、727路、866路、M242路、M335路、M395路、M526路、M531路、m246路、m350路、m413路、m526路、高快巴士29路);\r\n\r\n2）地铁1号线“后瑞站”A出口，步行20分钟至公司\r\n\r\n3）车辆导航：“大广发综合楼”或“正运动技术”', '18926590551', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (483, '2025-04-08 15:16:08.783009', '2025-04-08 15:16:08.783009', NULL, '望友工业软件（广东）有限公司', 2, 579, '广东省东莞市松山湖园区科技二路5号1栋608室', '李芳莉', '未公开', NULL, NULL, '望友工业软件（广东）有限公司是上海望友信息技术有限公司的全资子公司，是全球领先优质的PCBA工艺设计仿真&制造一体化工业软件供应商。主张通过运用数字化的电子工艺设计仿真软件帮助企业从设计源头解决品质缺陷，助力电子行业整体制造能力的提升，是企业落实数字化智能制造的优质伙伴。望友现已拥有完全自主知识产权的软件产品30多个及20多项国内外发明专利，是国家级高新技术企业。目前望友的NPI系列软件产品（DFM、SMT、Test、Stencil、Document、View、SPI等）已在全球20多个国家及地区应用。同时，望友在全球范围与众多SMT、Tester、SPI、AOI等设备厂商及EDA供应商建立了共赢合作联盟。我司总部在上海，西安、东莞设有子公司，在北京、深圳、东莞、成都、武汉均设有营销办事处。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (484, '2025-04-08 15:16:09.038789', '2025-04-08 15:16:09.038789', NULL, '东莞威保运动器材有限公司', 2, 580, '寮浮路112号', '胡小姐', '未公开', NULL, NULL, '东莞威保运动器材有限公司成立于公元2004年9月,占地11000平方米,现有员工2000余人,主要生产Nike、Decathlon、puma、Dicks、UA、Academy等世界著名品牌之运动护具、手套及其它运动用品,产品广销世界各地。\r\n   本公司拥有现代化的生产设备、健全的管理体系、高效的团队以及优厚的福利待遇。\r\n\r\n我们的产品包括﹕ \r\n \r\n1、足球用护腿板﹐护膝﹐护肘…\r\n2、各种手套(守门员手套﹐棒球手套﹐健身手套﹐滑雪手套﹐溜冰手套﹐滑水手套﹐高尔夫球手套…)   \r\n3、英式和美式橄榄球护具  \r\n4、滑雪/摩托车护具          \r\n5、运动用医疗用品(NEOPRENE类)等', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (485, '2025-04-08 15:16:09.360735', '2025-04-08 15:16:09.360735', NULL, '光大证券股份有限公司东莞寮步香市路证券营业部', 2, 581, '香市路69号南美世贸中心1栋106室、107室', '梁先生', 'liangyg@ebscn.com', NULL, NULL, '光大证券成立于1996年，总部位于上海，是中国证监会批准的首批三家创新试点证券公司之一，也是世界500强企业——中国光大集团的核心金融服务平台之一。公司于2016年首次入选《财富》中国500强，曾连续三年蝉联\"年度最佳证券公司\"，连续四年跻身“亚洲品牌500强”和“中国品牌500强”，荣获“2020金融创新百强”“2020年度本土最佳投行”荣誉称号。光大证券东莞寮步石大路营业部，位于东莞市寮步镇石大路银基大厦411，是东莞地区成立时间较久的营业部，综合实力位居东莞证券营业部前列。', '未公开', 50, NULL, NULL, NULL, NULL, 'http://www.ebscn.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (486, '2025-04-08 15:16:09.684782', '2025-04-08 15:16:09.684782', NULL, '美尔德电器（东莞）有限公司', 2, 582, '水口村水常二路8号', '罗女士', '未公开', NULL, NULL, '美尔德电器有限公司成立于2018年，坐落于制造业名城东莞大朗。\r\n \r\n公司专注于研发、设计、生产无刷直流水泵，磁力泵，三相直流水泵，太阳能水泵，无刷直流变频水泵的高科技厂家。在产品生产方面，我们严格把控每一个环节，从原材料的选择到精细的加工工艺，确保为客户提供高品质、性能卓越的产品。\r\n \r\n我们拥有一支专业的团队，他们在行业内积累了丰富的经验。从产品研发环节开始，团队成员凭借创新的思维和精湛的技术，不断推陈出新，致力于开发更高效、更环保、更智能的产品，以满足市场不断变化的需求。在销售方面，我们的团队以客户为中心，提供专业、周到的服务，为客户解答疑问，根据客户的需求提供个性化的解决方案。\r\n \r\n美尔德电器始终坚持以质量求生存，以创新求发展，以服务赢市场的经营理念。在未来的发展中，我们将继续努力，不断提升产品质量和服务水平，为客户创造更大的价值，为推动行业的发展贡献自己的力量。', '18938265881', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (487, '2025-04-08 15:16:10.114310', '2025-04-08 15:16:10.114310', NULL, '东莞市旭峰网络科技有限公司', 2, 583, '东莞市鸿福社区黄金路1号东莞天安数码城F区1号科研楼1101号', '胡佳', '未公开', NULL, NULL, '东莞旭峰网络科技有限公司是一家专注从事网络安全服务、数据安全服务和系统集成的专业公司；为政府机关、企事业单位提供全面的网络安全解决方案、数据安全方案和系统集成方案，集产品销售、服务、培训为一体。可以提供包括：咨询、规划、实施、培训、维护等全程网络安全、数据安全和系统集成服务。\r\n    我们信奉的理念是：以行业标准为依托，以用户需求为导向，以互动咨询为过程，以专业技术为手段，帮助客户建立有效、稳定、持久并不断发展的信息管理体系。\r\n    企业经营，诚信为本，凭借诚实的经营作风，东莞旭峰网络科技有限公司先后与国内外众多产品开发商和供应商建立了非常紧密的合作伙伴关系。分别成为深信服、IP-guard、思科、华为、IBM、HP、宝利通、赛门铁克、微软等厂商在东莞的核心合作伙伴。\r\n 公司以“著名的网络安全产品”+“本地化快捷专业服务”，为用户提供全面的网络安全和系统集成解决方案。\r\n我们将不懈的努力，为您提供最优秀的软硬件产品、最优质、高效的售后服务以及最完美的解决方案！我们将珍视每一个与您合作的契机！希望我们携手共进，一起在信息化领域里共存、共赢、共益、共腾！\r\n   旭峰正在高速成长的同时，期待你的加入。\r\n    \r\n    福利待遇：\r\n    1、公司实行每周5.5天8小时工作制；\r\n    2、公司企业文化活动丰富多彩如：生日派对、年度聚餐、年终抽奖、年度旅游等；\r\n    3、享国家劳动法各种带薪假期；\r\n    4、公司提供可发展的职业培训计划；\r\n    5、公司设立季度销售奖，年终奖；\r\n公司地址：东莞市南城街道鸿福社区黄金路1号天安数码城F1栋1101号\r\n欢迎致电：0769-22233555', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (488, '2025-04-08 15:16:10.715140', '2025-04-08 15:16:10.715140', NULL, '东莞证券股份有限公司东莞大岭山营业部', 2, 584, '玉屏路领尚天地商住区4栋商铺1087-1089号', '张总监', '530783277@qq.com', NULL, NULL, '东莞证券大岭山营业部成立于二零一二年五月，大岭山营业部是东莞本土区域龙头券商－东莞证券倾力打造的新型营业部。也是大岭山镇唯一一家证券营业部，大岭山营业部将秉持“以客户服务为中心导向，为客户赢取最大利益”的经营理念，遵循“公开、公平、公正”的三公原则，以准确快捷的市场信息、先进安全的交易系统，为客户提供优质的全方位的证券交易服务。', '13592735338', 50, NULL, NULL, NULL, NULL, 'www.dgzq.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (489, '2025-04-08 15:16:11.052447', '2025-04-08 15:16:11.052447', NULL, '广东三正集团有限公司', 2, 585, '塘厦三正半山酒店行政楼3楼', '张先生', '未公开', NULL, NULL, '广东三正集团有限公司创立于1995年6月23日。\r\n\r\n集团自成立以来，始终坚持“树正气、走正道、出正果”的企业精神，以创办一个“科学、实力、祥和、永续”的国际化企业集团为奋斗目标，在集团董事局的正确领导下，依靠社会各界的大力支持，三正人凭借自己的聪明才智和艰苦努力，使集团的资产规模和经营规模保持了持续、稳健、快速的增长势头。目前，集团已发展成为以房地产业和酒店业为龙头，兼营资产管理、股权投资、物业服务、环保、洗衣等产业的企业集团，拥有分布于香港、广东、海南等地的10余家成员企业以及数千名员工。\r\n三正集团这些年能够跨行业并得以稳健发展，得益于有着一种非常健康、良性的企业文化。在三正人的心灵契约——《三正行动纲领》的指引下，三正集团以“价值源于创造”为核心价值观，按照“五年打基础，十年练内功，二十年名扬商海”的战略部署，通过持续不断地创造，永远致力于为顾客创造价值、为企业创造效益、为个人创造幸福、为社会创造财富，从而实现让全体三正人和社会大众都生活得更有意义的崇高使命。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (490, '2025-04-08 15:16:11.301943', '2025-04-08 15:16:11.301943', NULL, '光大证券股份有限公司东莞分公司', 2, NULL, '三元路2号粤丰大厦办公1701A号', '梁斯斯', 'liangsisi@ebscn.com', NULL, NULL, '光大证券股份有限公司（以下简称“光大证券”）成立于1996年，总部位于上海，是中国证监会批准的首批三家创新试点公司之一，也是“世界500强企业”中国光大集团股份公司（以下简称“光大集团”）的核心金融服务平台。公司先后于2009年8月18日和2016年8月18日分别在上海证券交易所及香港联合交易所主板上市（股票代码：601788.SH，6178.HK），是一家A+H股上市券商。\r\n        成立二十余年来，光大证券秉承“以客户为中心”的服务理念和“为国家图富强，为天下聚财富”的核心价值观，坚持“综合化经营、国际化战略、创新引领、合规稳健”的经营管理理念，各业务条线均衡发展，主要业务稳居行业前列。继2016首次入选《财富》中国500强后，光大证券连续三年蝉联“年度最佳证券公司”，连续三年跻身“亚洲品牌500强”、“中国品牌500强”，荣获“最受投资者信赖的上市券商”等行业重要奖项，品牌知名度和社会影响力持续提升。\r\n        光大证券总部位于上海，已在全国32个省级行政单位的114个城市设立了14家分公司和 222家营业部。目前公司托管资产近万亿元，服务客户逾340万户。依托线上线下全面布局，形成了7*24小时的立体化用户服务体系。光大证券海外业务立足香港，服务全球，致力打造光大新鸿基品牌，为境内外客户提供包括证券经纪、投行、财富管理等全方位的金融产品与服务。\r\n        作为拥有全业务牌照的综合金融服务商，光大证券围绕零售客户、机构客户、金融同业与战略客户等市场主体，着力打造经纪和财富管理、信用业务、机构证券业务、投资管理及海外业务等业务板块。同时，作为一家拥有完整业务链的上市证券公司，光大证券目前拥有拥有资产管理、期货、国际业务、基金、另类投资、融资租赁和互联网金融等11家专业化子公司，证券控股的金融集团框架已基本形成。\r\n        展望未来，光大证券将依托中央直属大型金融控股集团——光大集团的协同效应和品牌优势，有序推进综合化、国际化经营，争做投融资的安排者、市场的组织者、产品的创设者、流动性的提供者和风险的管理者，致力于将公司打造成为中国一流投资银行。\r\n        光大证券东莞分公司是光大证券在东莞地区设立的全牌照分支机构，扎根东莞已有22年，辖下现有12家营业部分布于莞城、南城、长安、厚街、虎门、石龙、寮步、大朗、松山湖、常平等区域，分公司将秉承公司\"打造中国一流投资银行\"核心价值观，坚持创新引领为投资者及企业提供优质专业的金融服务。\r\n        我们将为员工提供一流的“全牌照”央企券商平台、科学完善的晋升通道以及有市场竞争力的薪酬激励制度，诚邀您的加入!', '13763181458', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (491, '2025-04-08 15:16:11.734461', '2025-04-08 15:16:11.734461', NULL, '东莞证券股份有限公司运河西路营业部', 2, 586, '东莞市东城区运河西一路东盛大厦裙楼四楼', '吴振荣', '84540584@qq.com', NULL, NULL, '东莞证券成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。\r\n\r\n截止至2019年10月，公司拥有分支机构79家（其中营业网点77家，上海分公司1家，深圳分公司1家），营业网点遍布珠三角、长三角及环渤海经济圈，“扎根东莞、迈向全国”的格局基本形成。公司全资拥有东证锦信投资管理有限公司（从事私募基金业务）、东莞市东证宏德投资有限公司（从事另类投资业务），并控股华联期货有限公司。\r\n\r\n公司紧跟国家政策和行业发展动态，不断丰富公司业务品种，大力优化收入来源结构。当前，公司以经纪、资管、投行三大业务为核心，积极发展两融、直投、债融、新三板和投资咨询等业务，实现了从收入来源单一型券商向收入来源多元化型券商的转型。', '13650365695', 50, NULL, NULL, NULL, NULL, 'www.dgzq.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (492, '2025-04-08 15:16:11.948714', '2025-04-08 15:16:11.948714', NULL, '东莞市汇益社会服务发展中心', 2, 587, '旗峰路国泰大厦1506室', '陈先生', '未公开', NULL, NULL, '东莞市汇益社会服务发展中心致力东莞市社会工作、社会服务专业发展、研究以及拓展的专业服务支持型社会组织。汇益中心组建“多元智力”的专家顾问库，由社会服务行业知名学者教授领衔指导，汇聚理论、实务、基金会、法律、社会企业等多方面的专业精英，共同为社会工作、社会服务组织等发展提供专业支持。汇益中心针对于此，以“专业、聚焦、创新、发声”为愿景，以“有希望、有态度、有力量”为理念，为社会服务或社会组织提供全程或过程管理咨询（督导或介入等）、战略合作伙伴等服务，同时汇益中心自身也积极发掘东莞市社会服务力量，促活行业态度，实现行业的发展。目前，机构涉及的社工服务领域：社区工作、居家养老服务、残疾人康复、妇女工作等。', '未公开', 50, NULL, NULL, NULL, NULL, 'www.dghysc.org', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (493, '2025-04-08 15:16:12.232266', '2025-04-08 15:16:12.232266', NULL, '华图教育科技有限公司广州分公司', 2, 588, '环市东路教学仪器厂华图教育', '刘少婉', 'gzhr@huatu.com', NULL, NULL, '华图教育成立于2001年，秉承“以教育推动社会进步”的使命，以职业教育为核心，主营业务涵盖了公务员、事业单位、教师、金融、医疗、部队转业干部、军队文职等各类人才招录考试培训业务，旗下拥有华图教育、山鼎设计、华图在线、华图图书、华图投资、华图卓坤、华图金领人、华图公遴选等多个教育品牌。\r\n近20年来，华图教育坚持“以客户为中心”的经营理念，在全国设有1000多家学习中心，拥有10000多名员工，推出的“模块教学法”、“红领培优”等产品和授课形式有口皆碑、经久不衰，树立了职业教育培训的行业标准。 \r\n每年，有超过600万名学员，通过华图的门店、图书、网站、移动应用等平台体验、学习华图的各类课程；每年进入公务员、教师、医疗等公职系统的从业人员中，有超过一半参加过华图的培训。“华图”商标于2015年被国家工商总局商标局认定为“中国驰名商标”。2018-2019年，华图教育连续两年入围北京民营企业百强榜。', '13138280765', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440104', 0, NULL);
INSERT INTO `company` VALUES (494, '2025-04-08 15:16:12.538935', '2025-04-08 15:16:12.538935', NULL, '广东龙行天下科技有限公司', 2, 589, '北王路高埗段1号', '周小姐', 'jane.zhou@v-fw.com', NULL, NULL, '广东龙行天下集团总部坐落于美丽的东莞东江之畔--高埗，距离东莞市中心仅十分钟车程。1998年开创首家模具厂，经20世纪末到21世纪初民族模具鞋材的高速发展，以及2008年金融风暴后逆向跨入成品鞋制造领域并实现跨越式发展后，成为集创新、开发、生产于一体化的大型民族鞋业集团。目前集团拥有近20000多名员工，年产值达到人民币86亿多元；自主经营品牌Longsall，并与国内外知名品牌“Nike、Adidas、Under Armour、Olukai 、Merrell、Specialized、NB、李宁、安踏等”深度合作，旗下分布广东、湖南、江西、湖北、越南等区域生产基地设有模具、橡胶、射出、面料、飞织、工艺、底材、成型、生产制造等30家工厂，建立了“一站式服务”的完整产业链，集团以制鞋产业为核心，并在产业延伸上涉足并大力发展运动器材、自动化设备研发、智能制造系统和3D打印等前沿领域。\r\n    集团除了持续增加越南基地的产能规模外，并同步规划中长期在柬埔寨、缅甸、印度、非洲等国家和地区设厂，并已经对未来在中南美洲甚至美国设厂进行前期评估和规划，进一步加强和完善集团的国际化战略布局。\r\n集团发展迄今，一直坚持“以奋斗者为本，以质量为中心、以客户满意度为导向、以智能制造为目标、以研发创新为驱动力”的原则，在保持企业高速发展的同时，善尽企业的社会责任，不断创造更多就业机会和更好的就业平台，来回馈国家和社会。携手共进，未来可期，集团将一如既往地秉承“责任、创新、共赢”的经营理念，为民族工业的发展谱写一幅宏伟的篇章！', '13829107566', 50, NULL, NULL, NULL, NULL, '广东龙行天下科技有限公司招聘简章', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (495, '2025-04-08 15:16:12.803406', '2025-04-08 15:16:12.803406', NULL, '惠州瑞捷科技有限公司', 2, 590, '惠州仲恺高新区东江村委', '杨俊生', '未公开', NULL, NULL, '公司于2012年05月28日成立。法定代表人李小辉，公司经营范围包括：生产、销售：导热管、导热材料、散热模组、电子机械设备、电子材料及耗材、五金制品；制定集散热方案、电子设备技术服务等', '未公开', 50, NULL, NULL, NULL, NULL, '', '441300', '440000', '441302', 0, NULL);
INSERT INTO `company` VALUES (496, '2025-04-08 15:16:13.214452', '2025-04-08 15:16:13.214452', NULL, '东鹏饮料（集团）股份有限公司', 2, 591, '珠光北路142号众冠红花岭工业西区3栋1楼', '袁秀华', 'yuanxiuhua@szeastroc.com', NULL, NULL, '东鹏饮料（集团）股份有限公司始创于1987年，是深圳老字号饮料生产企业，2003年9月完成国有企业向民营股份制改制，并得到长足发展。主营功能型饮料，现市场年销售达40亿元人民币。', '15622512291', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (497, '2025-04-08 15:16:13.514685', '2025-04-08 15:16:13.514685', NULL, '深圳市赛元微电子股份有限公司', 2, 592, '深圳市南山区高新区南区粤兴三道8号中国地质大学产学研基地中地大楼B610', '李芳', 'orchid.li@socmcu.com', NULL, NULL, '深圳市赛元微电子有限公司是一家专注于工业级半导体设计和销售的集成电路设计公司，研发高抗干扰、高可靠性8位和32位微控制器（MCU）产品。\r\n公司是国家高新技术企业，国家级专精特新“小巨人”企业（重点小巨人），总部坐落在被誉为中国硅谷的深圳市南山科技园区，并设有上海、东莞、郑州分公司，顺德、无锡、杭州、天津、青岛办事处等分支机构。\r\n公司核心团队拥有20年以上的一流半导体公司的研发和运营经验，产品全部拥有自主知识产权，技术具有行业领先地位。\r\n公司以自主核心技术、先进的设计能力及数字模拟整合能力为客户提供高性能MCU产品；拥有完善的品质管控和外包管理系统；与国际国内一流的晶圆代工厂、封测厂商战略合作，提供高品质国产MCU芯片；并保持行业中有较强的产品和服务创新能力。\r\n在不断推出满足市场需求 MCU产品的同时，也在不断完善产品的生态系统，致力于为客户提供可靠性高、平台化优、易用性强、资源丰富的 MCU 产品。产品广泛应用于大小家电、工业控制、消费电子、智能家居、物联网、安防等领域，具有非常广阔的市场发展前景。公司致力成为中国国产MCU领导品牌，用户首选品牌。把持续创新，持续提供优质产品和服务，为用户持续提供竞争力和价值作为公司使命。\r\n目前公司处于高速发展期，欢迎对芯片设计行业感兴趣的优秀新毕业生加盟。加入赛元，发挥你的创造力、接受全新挑战、实现梦想。加入赛元，与公司共同见证国产MCU的强势发展，为国产芯片发展贡献青春，也必将获得更高的回报和成就感！', '13510369910', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (498, '2025-04-08 15:16:13.995152', '2025-04-08 15:16:13.995152', NULL, '广州大画文化传播有限公司', 2, 593, '天慧路3号广州互联网产业园3楼整层', '黄淑怡', '未公开', NULL, NULL, '广州云图动漫设计有限公司成立于2013年，位于广州智慧城，致力于成为最专业的“泛娱乐数字艺术服务”公司，总部设于广州，坐落天河智慧城电子产业园，整层3楼办公面积达3057平方米，配套宿舍，饭堂，运动等设施。员工人数已达中型企业规模，目前600人以上，专业技术人员占比90%以上，拥有创作高质量“原创动画漫画IP”的内容团队，承制动画番剧： 《诛仙》 、《王者荣耀》《剑来》，原创动画番剧：《逆转次元：AI崛起》、《幻梦山海谣》，原创动画漫画：《恋爱云书》、《茶楼浮生梦》，同时孵化《小云兽》《鹿蜀》等形象IP，与腾讯、网易、阿里、完美、畅游等业内公司保持了密切的业务合作，目前是华南地区最大的游戏美术，影视动画制作企业，泛娱乐数字产业促进会会长单位，2018年度广州最具关注文化企业。\r\n广州大画文化传播有限公司为广州云图动漫设计有限公司旗下的教育品牌（云图赋能）、广东省职业院校教学指导委员会-艺术设计类专业企业单位，云图赋能产业学院设立在云图总部，占地面积为825平方米，负责云图动漫的产教融合板块，配套制作设备及教学工位达250个以上，充分满足教学，生产一体化条件，其中双师素质型企业导师达50名以上，多为3-5年以上生产与教学经验的企业教师，并与各大高校开展深度产教融合，将企业岗位生产过程与教学生产过程对接，打造“双元”育人教学新模式，2021-2026年被中央美术学院国际学院认定游戏人才培养标准并共建数字艺术研究中心，联合研发前沿课程体系，目前在广东省共计服务学校超120所，其中设立产业学院校区有6所，是广东省第一批产教融合型企业，广东省第一批现代学徒制试点企业，广东省动画制作1+X职业技能等级证书管理中心。\r\n除了云图总部以外，在新塘太阳城设立产教融合创新创业基地，办公面积为1000平方米，配套实操机房，宿舍，饭堂等设施，可同时满足200位学生，教师进行实习实训的校外实践课，1+X技能等级证书考证，国家，省级师资培训，等各项产教融合校企合作项目，具备影视动画，游戏美术产业完善的一体化生产条件。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440106', 0, NULL);
INSERT INTO `company` VALUES (499, '2025-04-08 15:16:14.378466', '2025-04-08 15:16:14.378466', NULL, '中科赛凌（中山）科技有限公司', 2, 594, '中山市翠亨新区东汇路53号A座601室', '梁先生', '1031083344@qq.com', NULL, NULL, '中科赛凌公司成立于2008年，前身为中国科学院理化技术研究所的中试车间，经过多年发展，现已成为一家专业从事环境测试设备、超低温项目研发制造、销售服务于一体的科技型企业，是国家高新技术企业、专精特新企业、环试设备行业国标的参与制定者、博士后科研工作站单位。公司目前在全国拥有北京市和广东中山市两大生产基地。\r\n公司目前主要产品有高低温（湿热）试验箱、冲击试验箱、转台/隔振温湿试验箱、低气压试验箱、温湿振三综合试验箱、步入式及汽车环境仓、超低温设备等10类设备。多项为非标定制，属国内首创，实现了进口替代。产品广泛应用于航天航空、军工装备、电子电器、半导体、新能源、汽车交通等行业，成为众多航天军工、高等院校、科研机构、大型企业的重要合作伙伴，获得国内外客户广泛的好评与信赖。\r\n公司建立了行业先进的研发制造、运营管理体系，拥有博士和高级工程师领军的研发团队，迄今累计获得各项知识产权和国家发明专利多达76项，并多次参与行业国标拟定工作，先后通过ISO 9001 和GJB 9001 双重质量管理体系认证。公司核心的专利技术“混合工质节流制冷技术”荣获国家技术发明二等奖，利用单压缩机即可实现-190°的高效制冷，该项技术达到国际先进水平。', '13528235152', 50, NULL, NULL, NULL, NULL, '', '442000', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (500, '2025-04-08 15:16:14.791070', '2025-04-08 15:16:14.791070', NULL, '东莞华贸供应链管理有限公司', 2, 595, '松山湖园区研发五路2号3栋1404室', '13652521099', '未公开', NULL, NULL, '东莞华贸供应链管理有限公司由一群有着多年工作经验的优秀团队创建，致力于为客户提供成本最优、时效最好、客户体验最佳的物流解决方案。华贸拥有一批年轻有为、努力进取的专业人才，在全体员工的不懈努力下，华贸必将扬帆起航，永往直前。\r\n\r\n客户的信赖是华贸持续发展的动力，员工的支持是华贸事业成功的保证。华贸一直坚持“以人为本”的人性化管理理念。以诚信待人，以正气服人，以合作聚人；要求每一位华贸人对客户负责，对团队负责，对自身负责；并与华贸一起，共同学习进步，积极创新求发展。前进的动力，源自对成功的渴望与追求，我们始终本着实事求是，回报社会的价值观念，不断地创造与实现每一个华贸人的理想与追求！', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (501, '2025-04-08 15:16:15.101867', '2025-04-08 15:16:15.101867', NULL, '东莞平晶微电子科技有限公司', 2, 596, '小坑村文德路13号', '向小姐', 'Xyxiang@pingjingsemi.com', NULL, NULL, '东莞平晶微电子科技有限公司成立于2016年，主要致力于半导体分立器件的研发，并建立自主生产基地；公司总部位于广东省东莞市寮步镇，并先后在东莞、深圳、北京、上海、杭州、长沙、南京、成都、厦门、武汉、济南、宁波等地建立销售和服务中心。\r\n公司可提供完整的分立器件解决方案，产品种类囊括各类场效应管（MOS）、低压差线性稳压器（LDO）、IC、晶体管、整流管、稳压管、瞬态电压抑制管（TVS）、肖特基（SBD）等；公司拥有近万平米制造厂房，引进大批DISCO、ASM、PowerTech、Juno等全新自动化生产和测试设备，持续为客户提供优品质、高可靠性产品 。', '13538432437', 50, NULL, NULL, NULL, NULL, 'http://www.pingjingsemi.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (502, '2025-04-08 15:16:15.393165', '2025-04-08 15:16:15.393165', NULL, '东莞市钰成精密机械有限公司', 2, 597, '上沙社区中南南路6号科谷工业园', '刘小姐', 'HR@ycjmjx.cn', NULL, NULL, '东莞市钰成精密机械公司成立于2014年， 是一家充分掌握智能贴标运用核心技术，实现自动化贴标的公司。历时多年的发展，现已拥有强大的研发和服务团队，并一直致力于培养优秀的技术型和管理型人才，并形成高效合作的专业团队。 \r\n公司以“科技创新，创造生产力的概念”，不断提高专业技术，在管理全面推行流程化、标准化和可量化的企业管理制度。公司产品和技术方案已广泛应用于手机3C、汽车、医疗、工业等行业；诚意创新，协力行动，坚持以客户为中心，为客户解决所有产品的自动化贴标技术改善问题。', '18128596831', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (503, '2025-04-08 15:16:15.760204', '2025-04-08 15:16:15.760204', NULL, '东莞市一盼文化传媒有限公司', 2, 598, '鸿福路200号第一国际百安中心1栋1706室', '王一然', '未公开', NULL, NULL, '本司致力于艺人孵化，主营直播、短视频拍摄以及个人ip打造。\r\n抖音“视频宫格”赛道东莞头部传媒公司，23年度嘉年华签约艺人荣获东莞赛区第一。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (504, '2025-04-08 15:16:16.156467', '2025-04-08 15:16:16.156467', NULL, '东莞市凯融光学科技有限公司', 2, 599, '汀山社区东莞市凯融光学科技有限公司', '袁赐群', 'yuancq@kw-0769.com', NULL, NULL, '东莞市凯融光学科技有限公司，聚焦于超精密塑胶模具及钨钢模具的研发、制造，专注“光成像非球面镜片模具、光电传感器透镜模具、光通信阵列透镜模具、医疗超精密模具、玻璃非球面钨钢模具等”核心技术，以拥有自主知识产权的模具结构为基础，以快速为客户提供个性化的解决方案为主要经营模式，为客户提供更精准、更前沿的产品解决方案。\r\n       凯融光学在模具行业深耕发展二十载年，拥有丰富的研发、制造经验及强大的人才队伍，凯融人对创新和未来充满探索热情，敢为人先、不断创新突破，致力成为超精密模具解决方案的引领者。', '18027098962', 50, NULL, NULL, NULL, NULL, 'http://www.kw-0769.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (505, '2025-04-08 15:16:16.501140', '2025-04-08 15:16:16.501140', NULL, '广东中职信会计师事务所（特殊普通合伙）东莞分所', 2, 600, '东莞大道南城段428号寰宇汇金中心8栋20层', '黄玉莲', 'huangyulian@fortunecc.com', NULL, NULL, '公司介绍\r\n广东中职信会计师事务所（特殊普通合伙）成立于 2008 年 10 月，\r\n2020 年 6 月完成特殊普通合伙改制。成立 15 年来，坚持党建引领、坚持诚信经营、坚持一体化管理、坚持“三个不做”、坚持专业分工、坚持质量优先、坚持多元融合、坚持智能审计、坚持廉洁从业、坚持服务取胜。在鉴证、增信、增值服务等方面积累了丰富的经验和良好的口碑。\r\n现有团队 700 余人，其中会计所 550 多人，税务和造价咨询等专业\r\n机构 150 人。财政部高端人才 5 人，税务总局高端人才 4 人，广东省高\r\n端人才 12 人，广州市高端人才 4 人。团队平均年龄不到 30 岁，团队年轻富有活力，凝聚力、战斗力、创新力和服务供给能力不断增强。总部广州员工 500 人，基本形成了 70 后主导、80 后主力、90 后后备的人才梯队。\r\n广东中职信会计师事务所(特殊普通合伙)东莞分所 2019 年成立。\r\n为东莞注册会计师协会副会长单位，现有团队 70 余人，其中注册会计师 11 名、中高级会计师 15 名、税务师 7 名、资产评估师 3 名、绩效评\r\n价师 2 名。东莞分所基本形成 70-80 后主导、90 后主力后备人才梯队，总分所一体化管理。\r\n核心理念：持正守中、恪尽职守，诚实守信。\r\n公司的愿景：一流的团队、一流的专业、社会广泛尊敬。\r\n公司的价值观：工作快乐、快乐工作，服务社会、成就自我。\r\n优秀中职信人的核心能力要求：诚信、专业、服务、高效、开拓、\r\n团结、善于沟通。\r\n我们倡导的团队氛围：感恩、简单、乐观、积极、理解、换位、平\r\n和、包容。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (506, '2025-04-08 15:16:16.981598', '2025-04-08 15:16:16.981598', NULL, '广州广汽商贸物流有限公司', 2, 601, '金荷二路6号', '黄勇', 'huangyong@gbl-gz.com', NULL, NULL, '广州广汽商贸物流有限公司，是世界500强广汽集团下属全资子公司广汽商贸有限公司100%投资设立的专业物流公司，企业性质为国企。是股东方倾力打造的首家承接多个汽车主机厂全方位物流业务的综合性汽车物流企业。\r\n公司成立于2010年1月18日，注册资金5.5亿元。公司在广州拥有自有物流中心占地面积29.32万平方米，已建成仓库面积18.04万平方米，包括广汽商贸乘用车物流基地、广汽埃安物流配送中心、广汽番禺汽车城物流中心等。\r\n公司目前主要业务为向广汽传祺、广汽埃安及其配套零部件厂家提供采购、生产、销售、售后等环节全方位的物流服务，业务内容包括运输、仓储、装卸、包装等。\r\n主要客户：广汽传祺汽车有限公司，广汽埃安新能源汽车股份有限公司，广州小鹏汽车科技有限公司。\r\n公司本着“服务客户 奋力拼搏 专注专业 持续改善”的宗旨，以世界一流为目标，全力以赴，为中国汽车产业发展提供最佳的物流服务。持续加强“标准化、自动化、数字化、智能化”的建设，提升现代化物流服务水平，打造成为一家客户信赖、市场认可的智慧物流企业。', '13580563904', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440113', 0, NULL);
INSERT INTO `company` VALUES (507, '2025-04-08 15:16:17.239736', '2025-04-08 15:16:17.239736', NULL, '深圳市锐傲视讯有限公司', 2, 602, '桥头社区福盈工业区C3301', '17362620104', 'caokanghui@ralcam.com', NULL, NULL, '深圳市锐傲视讯有限公司\r\n\r\n锐傲视讯是一家专门从事工业内窥镜产品研发、生产、销售一体的高科技企业，起步并立足于中国深圳特区，积极投身于环保产业的大潮中，为我国环保产业贡献出自已的智慧、热情和执着。\r\n公司自2010年成立以来，一直响应党和国家的号召，坚持自主创业，提倡匠心精神，为汽车后市场提供冠军品质的工业内窥镜。随着人们生活水平的提高，汽车每年极速增量，人们对生活品质要求的提高。2017年锐傲成功研制并量产可视汽车空调清洗内窥镜：\r\n1、为全国各地的4S店，汽修店解决了汽车空调清洗的难题，与传统的清洗方法相比，大大提升了清洗的效率和品质；\r\n2、真正实现了让“坐在车里的每一个人都能呼吸新鲜空气”的使命三赢模式。\r\n锐傲一直坚信，产品质量是企业发展和成长的根本，我们精心构建品质，坚持聚焦战略，对内窥镜制作工艺及定制化开发持续进行研发投入，在近百名锐傲人中，有20多名技术人员从事产品研发、工业设计、工艺改进和创新，占员工总数20%以上，我们已累积获得15项实用新型专利，已具备行业领先的专利核心竞争力，在中国我们的销售范围以珠三角、长三角为重点，覆盖全国24个省、直辖市及行政区；在海外，我们已成功为欧洲、北美、东南亚等10个国家和地区的客户提供了高品质的产品和服务。\r\n我们秉承节约能源、保护环境的发展理念，积极致力于社会经济的可持续发展，我们坚持不采购非环保原料、不设立非环保制作过程、不销售非环保产品，构建负责任的企业形象。\r\n我们坚持走自主创业的道路，公司的发展是我们锐傲人的责任，为此，所有锐傲人正在不断学习，提升自已，为汽车后市场可视化设备行业贡献出我们的力量，为锐傲的明天，也为自已的明天努力工作，集体奋斗！', '17362620104', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440306', 0, NULL);
INSERT INTO `company` VALUES (508, '2025-04-08 15:16:17.558902', '2025-04-08 15:16:17.558902', NULL, '长城证券股份有限公司东莞东莞大道证券营业部', 2, 603, '东莞市东莞大道东城段17号汇业写字楼211室', '赵婧', 'zhaojing@cgws.com', NULL, NULL, '1995年，长城证券获中国人民银行批准，在原深圳长城证券部和海南汇通国际信托投资公司所属证券机构合并基础上组建设立。公司办公地址在广东省深圳市福田区金田路2026号能源大厦南塔楼10-19层，法定代表人：张巍。2015年4月，长城证券整体变更设立股份有限公司。2018年10月26日，长城证券股份有限公司首次向社会公开发行股票并在深圳证券交易所上市交易，证券简称“长城证券”，证券代码“002939”。截至目前，长城证券拥有员工3000余人，在北京、上海、广州、杭州等地设有十余家分公司，在全国主要城市设有一百余家营业部。公司控股宝城期货有限责任公司、深圳市长城证券投资有限公司、深圳市长城长富投资管理有限公司等多家子公司，同时是长城基金管理有限公司、景顺长城基金管理有限公司两家基金公司的主要股东。目前，华能资本服务有限公司为长城证券第一大股东，实际控制人为中国华能集团有限公司，公司其他主要股东包括深圳新江南投资有限公司、深圳能源集团股份有限公司等。作为国内较早成立的综合类证券公司之一，经过二十余年的发展壮大，长城证券已经形成了多功能协调发展的金融业务体系。经营范围覆盖：证券经纪；证券投资咨询；与证券交易、证券投资活动有关的财务顾问；证券承销与保荐；证券自营；证券资产管理；融资融券；证券投资基金销售；为期货公司提供中间介绍业务；代销金融产品；证券投资基金托管。', '13149906123', 50, NULL, NULL, NULL, NULL, 'www.cgws.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (509, '2025-04-08 15:16:17.927408', '2025-04-08 15:16:17.927408', NULL, '东莞市微科光电科技有限公司', 2, 604, '蚬涌工业路8号', '庾紫莹', '745106296@qq.com', NULL, NULL, '东莞市微科光电科技有限公司成立于2010年，座落于东莞市万江区，占地面积约40亩，隶属于“湖北东田光电材料科技有限公司”全资子公司，是一家集生产制造、加工及研发为主的光学镀膜，光学设计的高新科技企业，拥有专利70余项，旗下员工约1000人，年营业额逾3.5亿元，其主打产品光学滤光组立件是手机摄像头模组核心元器件，公司秉承“专注、开放、执着、共享 纯粹”的经营精神，致力于为手机模组厂和手机终端提供稳定的光学产品和镀膜技术解决方案。\r\n先进的技术、高效的生产、卓越的品质及优秀的团队，为公司未来的发展奠定了坚实良好的基础，现已成为世界多家知名企业的配套供应商。公司秉承以人为本，致力构建客户、员工和企业同生共长的大平台！为引领技术、为中国、乃至世界光电产业发展而努力创新！', '15220317345', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (510, '2025-04-08 15:16:18.249951', '2025-04-08 15:16:18.249951', NULL, '深圳特发东智科技有限公司', 2, 605, '南山区琼宇路3号特发信息港B栋7楼', '王雨曼', 'wangyuman@sdgi.com.cn', NULL, NULL, '深圳特发东智科技有限公司，成立于2004年,是上市国有控股、国家高新技术企业（简称：特发信息，股票代码 : 000070.SZ）旗下公司，目前集力于设计、开发、生产和销售为一体的专业电子制造服务商，公司立足于光通讯领域，发展智能接入终端、智能穿戴、智慧安防等板块，同时聚焦移动5G时代、物联网的基础设施建设、提供智慧网络工程、运营维护和相关产品的一体化，能够为客户提供多元通信产品，从产品制造到交付、从规划设计到运营服务的综合解决方案，同时也成为国内外一流通讯设备制造商的ODM合格供应商及OEM合作伙伴。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (511, '2025-04-08 15:16:18.646926', '2025-04-08 15:16:18.646926', NULL, '东莞市腾信精密制造股份有限公司', 2, 606, '东莞市塘角村朗尾大路5号', '罗小姐', 'Tx_HR02@turnxon.cn', NULL, NULL, '东莞市腾信精密制造股份有限公司（以下简称“TurnXon”）成立于2011年，是一家以高精度金属组件制造装配等为一体的现代化国际企业，“国家高新技术企业”、“东莞市倍增企业”、“东莞市重点项目企业”。在东莞、深圳、越南及墨西哥均设有工厂，共有员工1200余人。\r\n“TurnXon”东莞工厂现占地面积近三万平方米，拥有员工1000人左右，专业技术人员达400余人，其中行业技术资深专业人员达到近150人，拥有各种先进中大型生产设备近500台，主要为从国外进口高精度CNC机床和精密测量仪器。\r\n作为全球精密的机加工专家，“TurnXon”十年来专注于机加行业的研发和制造，坚守做安全优质的创新产品，拥有30多项专利产品，并先后通过了FDA、ISO9001、IATF16949、ISO13485、AS9100等国际体系和安规认证。\r\n“TurnXon”以精益的制造能力、创新的技术优势，坚持为客户提供最优质的产品及解决方案，专注为客户效益最大化创造价值，通过不断努力，产品广泛应用于航空航天、医疗器械、光通信、分析仪器、石油勘探等先进领域，产品远销20多个国家及地区，成为众多世界知名品牌及500强企业的优质供应商，并被客户认定为最可依赖的合作伙伴之一。\r\n    秉承数十年耕耘的力量，“TurnXon”将迸发出持之以恒的努力及持续创新的热情，服务客户，再次远航。\r\n公司网址：www.turnxon.com\r\n二、公司福利\r\n1、全员空调车间，全员空调宿舍，并24小时提供热水；\r\n2、免费提供食宿，每餐四菜一汤（夏季每个宿舍补贴300度电左右）；\r\n3、法定假期、法定社保及员工享有有薪年假；\r\n4、每年三月份根据市场行情及公司效益进行统一调薪；\r\n5、年底将根据公司效益、职位及年度考核指标发放年终奖；\r\n6、子女入学补贴，员工入职满一年，子女自费在东莞上学可享受学费一半的补贴（最高上限5000元）；\r\n7、员工成长补贴，员工入职满二年，参与专业技能进修、学历提升等，申请批准后，可享受一定的津贴补助（视情况全额、半额不等）；\r\n8、员工生日可获得嘉荣超市购物卡一张或举行员工生日会；\r\n9、公司每年的年底晚会，均有丰富的奖品及奖励；\r\n10、宽阔的内部晋升通道，公司内部管理、技术岗位80%来自于内部人员竞聘。', '13528669028', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (512, '2025-04-08 15:16:19.062799', '2025-04-08 15:16:19.062799', NULL, '东莞市与光同行科技有限公司', 2, 607, '拥军路136号1栋2楼', '张小姐', 'hr@gaciron.com', NULL, NULL, '加雪龙（Gaciron）是专业的自行车灯具品牌，由户外运动发烧友陈祥宝先生2008年于深圳创立，品牌生产基地位于东莞市大岭山镇光辉智谷工业园，集设计、研发制造于一体。加雪龙秉持“与光明同行”的品牌理念，致力于为全球自行车运动爱好者提供专业照明设备，让户外运动更安全。', '13543707015', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (513, '2025-04-08 15:16:19.369378', '2025-04-08 15:16:19.369378', NULL, '深圳万乘联合投资有限公司东莞第二分公司', 2, 608, '元美西路2号财富广场1栋10楼、12楼', '陈春花', '未公开', NULL, NULL, '万乘金融集团成立于2008年，是中国大陆最大的金融服务外包商。现已在全国设立了一百多家分支机构，在职员工已达1万多人，为员工提供了广阔的发展平台。\r\n东莞第二分公司成立于2021年8月，目前人员规模近200人。公司企业文化氛围浓厚，工作氛围轻松，团队成熟稳定，人员幸福感及归属感强。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (514, '2025-04-08 15:16:19.745669', '2025-04-08 15:16:19.745669', NULL, '东莞证券股份有限公司东莞桥头证券营业部', 2, 609, '桥兴金融街7楼733室', '陈俊杰', '826178452@qq.com', NULL, NULL, '东莞证券桥头营业部位于桥头镇中心，交通便利，办公环境舒适和富有竞争力的薪酬体制，完善的培训体系和晋升机制。期待你的加入。', '13926820213', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (515, '2025-04-08 15:16:20.141394', '2025-04-08 15:16:20.141394', NULL, '中山粤海能源有限公司（火力发电）', 2, 610, '圃南路18号', '吴加伟', 'zshdzhaopin@gdhpower.com', NULL, NULL, '中山粤海能源有限公司成立于1993年10月，是广东省政府直属企业粤海控股的成员企业，由港交所上市的粤海投资有限公司（港交所股票代码0270，股权75%）与中山市国资委下属兴中集团有限公司（股权25%）合作经营。公司位于中山市北部，是粤港澳大湾区及珠三角经济发展核心腹地，房价适中，生活成本低，为国内少有的宜居城市；中山位置优越，境内高速公路、高铁、轻轨四通八达，处于广州、珠海、澳门、东莞、深圳、香港等繁华城市群“一小时”生活圈之内。\r\n   热电联产是粤海能源的核心竞争优势:\r\n 1.承担着为广东省电网输送电力的职责；\r\n 2.作为中山市北部镇区唯一热源点，为周边四镇工业企业提供蒸汽；\r\n 3.全资成立售电子公司，主营电力销售业务，成为公司另一大利润增长点，助推公司向更强发展。\r\n公司大力推行 “感恩，敬业，协同，进取”的企业精神，一直致力于“打造样板型精品热电联产企业”，秉承“共赢立心，廉洁立身，当责立行”的核心价值观及“聚焦成长、聚焦公平”的人才理念。 \r\n      福利待遇：\r\n      1.优良的工作环境及舒适的工作生活场所，亲切的管理团队、和谐的工作氛围；\r\n      2.广阔、有挑战的发展空间和极具竞争力的薪酬福利，各种专业、管理、素质培训机会；\r\n      3.各类法定假期齐全，入职交通补贴，提供落户中山、住宿、工作餐、免费年度体检、高温及节日慰问等福利，年度团建活动；\r\n     4.完善的五险二金（住房公积金、企业年金）及商业保险等保障。', '未公开', 50, NULL, NULL, NULL, NULL, '', '442000', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (516, '2025-04-08 15:16:20.538795', '2025-04-08 15:16:20.538795', NULL, '苏比克国际贸易（深圳）有限公司东莞分公司', 2, 611, '工业西路9号2A栋', '罗冬英', 'nancy@sodick.com.tw', NULL, NULL, '苏比克国际贸易（深圳）有限公司东莞分公司属于台湾苏比克股份公司有限公司且为日本沙迪克集团亚太区域的直属成员，成立于2000年；主要从事沙迪克旗下品牌之线切割机(EDW)、电火花机（EDW）、加工中心机（CNC）、注塑机（IMM）、金属3D打印机（3DP）及电子光束机（EBM）的销售及售后服务，更在东莞松山湖高新区设置行业领先的“华南技术中心”，为用户提供更优加工技术方案、破除技术壁垒。\r\n    目前，公司销售和服务网络遍及全国各地，并在东莞松山湖和苏州高新区设有分公司，为客户提供全面、方便和快捷的服务支持。\r\n    展望未来，公司将弘扬[创造(so)].[实行(di)].[辛苦.克服(ck)]的企业精神，打造“尊才爱才”的人文理念，坚持以市场和用户需求为导向，以完善的管理体系和质量保证体系为基础，持续为广大金属加工用户提供效率、高品质的专业服务。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (517, '2025-04-08 15:16:20.932490', '2025-04-08 15:16:20.932490', NULL, '深圳市乐凯撒比萨餐饮管理有限公司', 2, 612, '深圳市南山区前海周大福金融大厦5楼', '林挺阅', 'liintingyue@lacesar.com', NULL, NULL, '2010年，乐凯撒首创的榴莲披萨给餐饮界带来了一场革命，同年乐凯撒开始了披萨事业本土化与现代化的全新道路，特别关注意式制作工艺与本土化食材以及现代生活场景需求的融合，选用新鲜的原材料，纯手工拍制，创造出全新的用餐体验，主张“一块乐，一块乐凯撒”，承诺榴莲披萨“皮薄肉厚，真真真果肉”。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (518, '2025-04-08 15:16:21.260449', '2025-04-08 15:16:21.260449', NULL, '国金证券股份有限公司东莞东莞大道证券营业部', 2, 613, '轨道交通大厦3201、3202', '黄小姐', 'huangyl@gjzq.com.cn', NULL, NULL, '国金证券是一家资产质量优良、专业团队精干、创新能力突出的上市证券公司，是沪深300指数、上证180指数、上证180金融股指数、MSCI新兴市场指数成份股，注册地在四川省成都市，连续9年在券商分类监管评级中获A类A级。\r\n\r\n公司目前控股国金期货有限责任公司、国金鼎兴投资有限公司、国金创新投资有限公司、国金道富投资服务有限公司、国金证券（香港）有限公司、国金财务（香港）有限公司。参股国金基金管理有限公司、国金涌富资产管理有限公司。截止到目前，公司下设7家分公司，有68家证券营业部，分布在全国23个省（直辖市、自治区）的重要中心城市。\r\n\r\n国金证券肩负“让金融服务更高效、更可靠”的使命，以“成为举足轻重的金融服务机构”为愿景，秉承“客户至上”、“视人才为公司最重要的资本”、“以开放的心态真诚沟通”、“团队合作”、“专业规范”、“持续优化”、“追求卓越”的核心价值观，致力于为客户提供交易、投融资、财富管理等全方位的金融服务。', '18825053821', 50, NULL, NULL, NULL, NULL, 'www.gjzq.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (519, '2025-04-08 15:16:21.600574', '2025-04-08 15:16:21.600574', NULL, '东莞市纸木及文化传播有限公司', 2, 614, '科创路398号4栋1单元412室', '余丹丹', '未公开', NULL, NULL, '东莞市纸木及文化传播有限公司旗下现有拿趣拼、拿趣玩两大品牌。专注于潮流IP，拼图、盲盒、木质DIY文创产品等品类，致力于为全球消费者提供有想象力、创造性的产品体验。以“拼出创意，玩出精彩”为品牌宗旨，围绕IP打造符合年轻消费群体审美的潮流产品。\r\n如今，纸木及已与王者荣耀、海贼王、高达等国际知名品牌达成深度合作，共同推出深受年轻人喜爱的潮流文创产品。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (520, '2025-04-08 15:16:21.913786', '2025-04-08 15:16:21.913786', NULL, '沃格（广东）实业集团有限公司', 2, 615, '工业东路20号', '曹先生', '未公开', NULL, NULL, '沃格（广东）实业集团有限公司位于东莞松山湖，其旗下江西沃格光电股份有限公司，于2018年4月在上交所主板上市(股票代码: 603773)。公司成立初始主营业务为FPD液晶显示面板精加工业务，产品主要应用于智能显示行业，是国内显示行业的领先企业之一。自2018年上市起，公司将主营业务从传统玻璃精加工业务向新一代半导体显示(Mini/Micro LED背光/直显)、半导体封装、CPI/PI膜材等产品领域扩展，旨在将公司打造为一家新材料科技型企业。截至目前，公司拥有10余家分子公司分别位于北京、深圳、东莞、江西、湖北、香港等地，共涉及9个业务模块，并已实现玻璃基MLED显示模组产品从上游原材料到中游制造以及下游应用端全方位解决方案', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (521, '2025-04-08 15:16:22.377387', '2025-04-08 15:16:22.377387', NULL, '东莞证券股份有限公司东莞中堂新兴路证券营业部', 2, 616, '新兴路一号502室', '刘经理', '406186791@qq.com', NULL, NULL, '东莞证券成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。\r\n公司简介：东莞证券中堂营业部成立于2014年1月17日，位于中堂繁华的商业中心区，环境舒适、交通便利。中堂营业部是我司把握水乡经济快速发展的重要决策成果，立足中堂这一方宝地，依托粤港澳大湾区优势和我司强大的综合金融服务平台，必将在水乡地区开创新局面，为东莞水乡的经济发展带来新的动力，也为公司做大做强注入活力。', '13480004439', 50, NULL, NULL, NULL, NULL, 'https://www.dgzq.com.cn/dz-ow/pcfront/#/dz/indexMa', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (522, '2025-04-08 15:16:22.672755', '2025-04-08 15:16:22.672755', NULL, '建诚恒瑞（惠州市）电子有限公司', 2, 617, '园洲大道558号建诚恒瑞电子有限公司', '黄叶媚', '452742901@qq.com', NULL, NULL, '建诚集团于1996年成立，现下设绵阳高新区恒奥电子科技有限公司、绵阳建诚恒瑞集团有限公司东莞分公司、建诚恒瑞（惠州市）电子有限公司等。总部位于四川省绵阳市高新区，占地1000余亩，厂房面积500000m²，拥有员工3000余人。建诚集团主营产品有光伏逆变器系列、UPS系列、数据中心系列、5G通信系列、新能源系列、插箱系列（7U/13U/22U 机箱、嵌入式电源机箱），以及钣金检测仪、自动售药机、美团取餐柜等等。\r\n东莞分公司拥有700多名员工，经营范围包括：建诚恒瑞（东莞市）科技有限公司主要从事移动通信电源及新能源产品的生产和销售，以及全行业的OEM、ODM整体解决方案。公司设有绵阳智造基地、东莞智造基地及惠州智造基地。公司自主研发产品有：通讯电源、IDC数据中心、服务器室内室外柜、服务器冷通道、高压直流柜、风能、逆变器等，涉及电信、汽车行业、新能源光伏等多个领域，所生产的产品除国内外，远销东南亚、非洲、欧州、北美州等区域。主要客户为华为、维缔技术、特变电工、诺基亚、中国铁塔、宁德时代、绿能慧充等国内外知名企业，是全球通信电源生产基地之一。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441300', '440000', '441322', 0, NULL);
INSERT INTO `company` VALUES (523, '2025-04-08 15:16:23.079950', '2025-04-08 15:16:23.079950', NULL, '东莞华誉精密技术有限公司', 2, 618, '江源路189号1栋301室', '奚小姐', 'xibh@huayu-dg.com', NULL, NULL, '东莞华誉精密技术有限公司，是以智能手机、平板电脑、VR/AR、智能音响、POS机终端、移动电源、智能家居等精密模具制造为基础，为客户提供塑胶制品成型，NMT成型工艺、IMD/IML、五金冲压及表面处理、辅料组装等一站式服务制造企业。\r\n    公司工业园面积为18万多平方米，拥有宽大、明亮的现代化厂房及员工配套生活区，提供舒适的工作和生活环境。\r\n目前拥有员工5000人左右，包括拥有经验丰富，高素质的专业管理人员和一批技术精湛的工程技术人员。我们提倡“管理以人为本，经营诚信为本，生产质量为本”的管理理念，并拥有先进的Oracle管理系统。\r\n华誉以“精益求精，创造未来”的经营理念，坚持“高起点、高技术 、高品质”的经营模式，追随一流品牌，争当手机、数码IT配套产品等塑胶件、五金产品行业领跑者。', '13602484241', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (524, '2025-04-08 15:16:23.694358', '2025-04-08 15:16:23.694358', NULL, '东莞市南城学通华特英语培训中心有限公司', 2, 619, '福民大厦北楼403', '伦明晖', '799943614@qq.com', NULL, NULL, '学通华特成立于2006年9月，以发展素质教育为办学方针，以英语语言素质能力培训为载体，培养学生适应未来发展的综合素质能力。华特教育时刻关注学生身心灵的健康成长，从本质上来说，我们关注的是“培养学生成为什么样的人”这一根本的教育问题。学通华特坚持以教育为本，把素质教育作为教育教学的核心，对内视每位老师为品牌，对外视学生成长为己任，肩负教育使命与社会责任，全面打造学通华特特质的品牌个性，成就行业内最具特色的素质教育品牌。\r\n我们的产品结构为“一主两副”三大教育产品:\r\n1、英语语言素质教育；2、启智润心青少年研学；3、学通华特英语阅读；\r\n学通华特语言素质教育以英语语言培训为媒介，通过英语语言教学对学生进行语言运用、学习策略及人文素养的培养，发展学生潜能与个性，形成健全的人格，以教文来育人。\r\n在英语语言教学过程中，培养和提高学生正确理解和运用英语语言的能力，如口语交际能力、个人表达能力、表演呈现能力等，养成良好的学习习惯，培养发现、探究、解决问题的能力，为学生继续学习和终身发展打好基础。学通华特启智润心青少年研学是学通华特基于过去多年对少年儿童教育教学的研究与实践，以“培养人”为发展理念，为适应国家素质教育改革的大趋势，培养适应社会发展需要的人才而诞生的特色项目。华特研学以“人”的全面发展为核心，带学生从传统的小课堂走进世界的大教室，通过探究式、体验式、启发式教育让学生成为自主探索世界的独立个体。学通阅读是我们打造的国内首个儿童英语有声阅读，以阅读促进孩子认知系统的多元化发展，让英语的有声阅读成为孩子认知能力发展的窗口，结合特色的英语阅读导读课，形成线上线下完整的阅读体系，培养孩子阅读意识、阅读习惯，进而提升阅读水平。成立17年来，我们始终坚持育人为本，以培养员工成为适应社会发展的优秀人才为企业发展的根本。我们与多所高校签订校企合作人才培养协议，形成持续发展且独具特色的人才引进模式，培养了大批优秀的教职人才。企业人才培养体系完善，为每位员工提供专业、全面的学习和深造平台，拥有强大且稳定的教育教学师资团队与客户服务团队。\r\n学通华特为东莞本土语言素质教育品牌，以“肩负教育使命，专注做好一件事”的办学信念立足东莞扎根经营，在东莞拥有10家直营学校，以南城总校为总管理中心，并成功开设石龙、虎门、寮步、大朗、塘厦、厚街、东城、大岭山、石鼓分校，在校生4000余人。展望未来，学通华特将继续帮助东莞更多家庭，提升家庭综合竞争力，本着“服务社会，服务家长与学员”的宗旨，永葆初心，不断向前！', '18929259767', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (525, '2025-04-08 15:16:23.973049', '2025-04-08 15:16:23.973049', NULL, '广东京邦达供应链科技有限公司东莞麻涌分公司', 2, 620, '京东亚洲一号智能物流园', '林静涵', 'jinghan1@jd.com', NULL, NULL, '京东集团2007年开始自建物流，并于2017年4月25日宣布成立京东物流集团，2021年5月，京东物流于香港联交所主板上市。京东物流是中国领先的技术驱动的供应链解决方案及物流服务商，以“技术驱动，引领全球高效流通和可持续发展”为使命，致力于成为全球最值得信赖的供应链基础设施服务商。京东物流正坚持“体验为本、技术驱动、效率制胜”核心发展战略，携手社会各界共建全球智能供应链基础网络（GSSC），为客户提供一体化供应链解决方案，为消费者提供“有速度更有温度”的高品质物流服务。', '13609725902', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (526, '2025-04-08 15:16:24.707156', '2025-04-08 15:16:24.707156', NULL, '东莞市盛雄激光先进装备股份有限公司', 2, 621, '新宝二街23号', '彭韦柳', 'hrc@stronglaser.com', NULL, NULL, '东莞盛雄激光成立于2008年，注册资本5100万，是国家高新技术企业、国家级专精特新小巨人企业、东莞市上市后备企业，成立至今共申请专利133 项，其中发明专利申请44项，拥有多学科交叉优势，尤其在高功率皮秒飞秒激光器、超快激光微加工工艺、激光加工算法软件和机器视觉方面具有丰富的经验和技术支撑。14年的时间，东莞盛雄激光从一家普通的激光打标机制造商发展成为中国超快激光微纳加工系统细分领域前三强，设备单价以100-500万元为主，并且拥有自研核心高功率超快激光光源，目前公司主营业务聚焦于新能源动力电池和太阳能光伏，全球首创300W大功率皮秒激光器叠片电池正极极片制片装备。\r\n盛雄激光先后荣获：“工信部国家级专精特新‘小巨人’企业”、“国家高新技术企业”、“广东省高成长中小企业”、“广东省微细激光制造装备工程技术研究中心”、“广东省战略性新兴产业骨干企业”、“东莞市实施重点企业规模与效益倍增计划试点企业”、“东莞市第十一批上后备企业”以及“东莞市专利优势企业”等荣誉称号与资质。', '18902695215', 50, NULL, NULL, NULL, NULL, 'http://www.stronglaser.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (527, '2025-04-08 15:16:25.031359', '2025-04-08 15:16:25.031359', NULL, '陆家国泰人寿保险有限责任公司广东分公司东莞中心支公司', 2, 622, '国贸中心T1栋8楼804/805号', '罗素冰', '未公开', NULL, NULL, '陆家嘴国泰人寿保险有限责任公司是第一家海峡两岸合资寿险公司，总部设在上海。公司注册资本30亿元人民币，于2005年1月正式对外销售保单。开业以来，陆家嘴国泰人寿已顺利筹设江苏、浙江、福建、北京、山东、广东、辽宁、天津、厦门、四川、河南11家分公司，同时在近50个城市设立了营销网点。\r\n\r\n到目前为止，陆家嘴国泰人寿已开发和销售包括寿险、健康险、意外险、年金险在内的百余种商品，其长期看护类产品填补了业内在此方向的空白，荣获多种奖项。同时，不断扩展的营销渠道及服务平台也为保户快速了解产品及享受服务提供了便利。截至2023年底，陆家嘴国泰人寿总资产超过260亿元人民币。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.cathaylife.cn/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (528, '2025-04-08 15:16:25.467146', '2025-04-08 15:16:25.467146', NULL, '东莞市盼诺服饰有限公司', 2, 623, '第一国际商务大厦F座1812', '陈小姐', '2386465121@qq.com', NULL, NULL, '销售：服装，纺织品，箱包，袋，帽等进出口货物\r\n公司有三个平台，主做阿里国际站平台，做定制类产品', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (529, '2025-04-08 15:16:25.796112', '2025-04-08 15:16:25.796112', NULL, '东莞市耀欣切削刀具有限公司', 2, 624, '宵边社区新河路32号耀欣中心', '杨小姐', '未公开', NULL, NULL, '东莞市耀欣切削刀具有限公司成立于2003年， 总部位于东莞市长安镇， 公司一直致力于数控刀具的研发、生产与销售， 是首家推出SE夹持系统的创新型企业。耀欣发展至今，拥有员工300余人， 总部面积达5000㎡， 拥有高精尖技术研发团队40余人，平均从业经验10年以上， 创新研发， 产品取得各类知识产权、商标、专利近百余项， 旗下拥有：仕柯达 SCODAK(刀具配件)、 山柯高博 SCGO(高效刀柄SE夹持系统)、思高 SCG(孔加工工具)、圣龙山姆SLONS(车削刀具)、西杰仕CGS(钨钢铣刀)等自主品牌。\r\n      耀欣一直坚持\"自主品牌、连锁经营\"的发展之路，立足广东，面向全国，走向世界，为客\r\n户提供更高效的服务， 先后成立近百家门店，门店分布于：东莞、深圳、南海、顺德、中山、江门、襄阳、长春、洛阳、许昌、惠州、汕头、肇庆、 阳江、珠海、广州、揭阳、青岛、重庆、武汉、荆门、厦门、浙江等地， 产品远销海内外， 并获得众多知名客户的一致信赖与好评。\r\n       未来，耀欣也将继续秉承“诚信、合作、服务、进取、 目标、价值”的企 业价值观，  坚持“诚信经营、合作发展”的经营理念，依靠在CNC车、铣行业中 有着多年实践经验的销售和研发团队， 帮助客户解决切削难题，为“耀欣商业联盟”创造产业生态圈，耀欣始终践行“振兴中国数控刀具行业，服务全球客户”的企业使命，为实现“让机器更高效”的企业愿景而不懈努力！', '未公开', 50, NULL, NULL, NULL, NULL, 'www.yasam.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (530, '2025-04-08 15:16:26.509742', '2025-04-08 15:16:26.509742', NULL, '东莞市艾轮商贸有限公司', 2, 625, '矮岭冚沿河东街42号', '曹小春', 'caoxiaochun@zxjtmco.com', NULL, NULL, '东莞市艾轮商贸有限公司隶属江苏众星集团，集团创建于1991年，是国家级大型集团公司，座落于中国摩托、电动车生产基地之一——江苏无锡，是国家发改委《公告》内摩托车、发动机、电动车生产企业，公司占地25万多㎡，总资产超5亿元，员工近千人。公司积极回报社会，先后多次捐助慈善事业，2020年单笔捐赠30万元，支持中国防疫物资。继往开来，众星集团集二十余年沉淀打造的摩托车、电动车、发动机产品，是公司集体智慧的再次升华，是高起点、高标准、高要求的精心之作，公司始终以确保向经销商和广大消费者提供最具竞争力的产品为宗旨，让最普通的工薪阶层也能骑上优质名牌车是我们的心愿，成为“大众之星”是我们永远的追求。', '13826212202', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (531, '2025-04-08 15:16:26.972071', '2025-04-08 15:16:26.972071', NULL, '东莞市博钺电子有限公司', 2, 626, '厚街科技大道7号13号楼6-9室', 'Jennyhan', '未公开', NULL, NULL, '东莞市博钺电子有限公司,始创于2012年,自公司成立以来,致力于贴片保险丝与低压熔断器的研发和生产,并在大电流和高电压的小型化上面有独到研究.产品涵盖消费电子,通信保护,HVDC,数字仪表DMI,光伏PV,电动EV/混合动力HEV等领域\r\n公司通过ISO9001、ISO14001，IATF16949、QC080000、ISO45001等体系。公司产品广泛用于电动汽车，混合动力汽车，消费电子和电池保护。我司属于国家高新技术企业之一。同时公司也是东莞市倍增，“小巨人”企业', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (532, '2025-04-08 15:16:27.266593', '2025-04-08 15:16:27.266593', NULL, '北京德恒（东莞）律师事务所', 2, 627, '东莞市南城区袁屋边社区居委会宏二路1号蜂汇广场1栋办公楼3101至3108', '郑慧珍', '未公开', NULL, NULL, '德恒律师事务所是中国规模最大的综合性律师事务所之一，1993年 1月经中华人民共和国司法部批准创建于北京，原名中国律师事务中心，1995年更名为德恒律师事务所。 为了响应国家创建粤港澳大湾区，同时更好的服务于东莞市产业转型升级，协助东莞市有实力的企业加快完成股份制改造，登陆IPO资本市场。由原广东旗峰律师事务所、广东沃金律师事务所全员及广东理而行、星啸、中亚律师事务所部分资深律师带领的团队，为适应现代法律服务专业化、规模化、品牌化、全球化的发展而合并组建。2017年8月21日，经北京市司法局批复同意设立北京德恒（东莞）律师事务所， 2018年2月26日,北京德恒（东莞）律师事务所正式成立。 经整合后的德恒（东莞）律所执业律师70人以上，律师助理30人以上，含行政团队人员超100人规模的东莞地区大所。办公地点位于东莞市南城商务中心总部基地蜂汇广场31楼整层，办公面积近2000㎡的甲级写字楼，步行到南城汽车站、地铁站、候机楼均在5分钟内的距离，交通非常便利。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (533, '2025-04-08 15:16:27.691950', '2025-04-08 15:16:27.691950', NULL, '冠恒建设集团有限公司', 2, 628, '长虹百荟22栋1109室', '邓海德', '未公开', NULL, NULL, '冠恒建设集团有限公司是从事房屋建筑工程、装修装饰工程、工程设计、机电安装工程、电子与智能化工程、建筑幕墙工程、消防设施工程、钢结构安装工程 、 市政公用工程、园林绿化工程、净化工程、环保工程及家具配套生产的多元化企业。\r\n       公司在管理、工程施工和工程设计等方面推行一系列国际标准体系，目前已通过ISO9001:2015质量管理体系认证 、GB/T28001-2011职业健康安全管理体系认证、 GB/T24001-2016环境管理体系认证 。公司始终奉行“以人为本，诚信创优”经营理念，已连续十一年被市市场监督管理局评为“广东省守合同重信用企业”单位、连续九年荣获市 “建筑装饰行业优秀施工企业”、“绿色装饰施工示范单位”和\"AAA级质量服务诚信企业”。2018年被评为国家高新技术企业。\r\n      公司近年来先后完成数百项工程施工及设计，承接了包括房屋建筑、写字楼、地产精装、商业广场、工业园区、星级酒店、休闲会所、别墅家居等各种类型的工程，遍布全国各大中等城市，深受建设单位及社会各界的赞誉，多项工程荣获市行业优秀工程奖、省行业优秀工程奖等佳誉。\r\n      冠恒建设一直秉承“客户至上，质量第一”的宗旨，并致力于打造品牌经营的长期战略规划，以质量、信誉树立企业的品牌，以企业文化创造核心竞争力、以精益求精的专业理念，持续完善的管理体系，追求卓越，打造精品，与时俱进，以更高的热情为社会创造和谐、舒适的生活空间。', '未公开', 50, NULL, NULL, NULL, NULL, 'www.gdghzs.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (534, '2025-04-08 15:16:28.007229', '2025-04-08 15:16:28.007229', NULL, '内湛贸易（上海）有限公司', 2, 629, '闵行区山花路518号1幢208室', '梁小姐', 'karen@innerpower.net.cn', NULL, NULL, '内湛贸易(上海)有限公司是一家在上海注册的全外资企业，我们是陶氏代理商，随着历年来的业务不断扩大,我们同时代理海内外大品牌产品。经营产品范围包含硅产品、焊料类、聚氨酯、丙烯酸、环氧树脂、润滑剂、化工产品、电子电器、元器件、机械设备及进出口业务并提供相关的配套服务。公司致力于电子产品的生产应用发展，客户的满意度是我们的服务宗旨。', '13428408018', 50, NULL, NULL, NULL, NULL, '', '310100', '310000', '310112', 0, NULL);
INSERT INTO `company` VALUES (535, '2025-04-08 15:16:28.326211', '2025-04-08 15:16:28.326211', NULL, '仲利国际融资租赁有限公司', 2, 630, '长宁区金钟路631弄1号楼（上海总部）', '常先生', 'letianchang@chailease.com.cn', NULL, NULL, '仲利国际租赁有限公司为国内第一家经商务部批准之外商独资租赁公司；企业团成立四十余年，稳踞台湾地区租赁产业龙头地位，租赁市场占有率43%，并排名服务业前三十强。中租企业团国外经营据点：洛杉矶、旧金山、曼谷、胡志明市、河内、马来西亚、伦敦、俄罗斯、菲律宾；2011年12月13日中租控股顺利在台湾证券交易所挂牌上市，股票代码5871，简称：Ｆ-中租，成为首家回台上市的财务融资公司。我们诚邀您加入，与我们共创亚太地区卓越的财务金融公司！\r\n仲利国际租赁有限公司成立于2005年，总部设立于上海，为台湾租赁业龙头中租控股公司100%投资，并设有子公司仲利国际贸易(上海)有限公司和仲津国际租赁有限公司，其中仲津国际租赁有限公司设立于天津。近年以倍数成长速度，每年以3-5个新网点设立为目标，现有46个营销网点及8个专业金融服务事业部，业务遍布全国。公司自成立以来，在政府相关部门的支持与母公司优秀团队的带领下，充分发挥融资租赁快捷便利的特点，提供设备融资服务，涉及行业包括电子科技、工程机械、纺织印染、金属加工、钢铁制作、精密五金、塑胶化工等。成立十多年来，累计业务投放额约1300亿人民币，服务企业约3万家，为客户提供系统化、全方位、一站式的金融服务，以成为中小企业成长的伙伴。', '未公开', 50, NULL, NULL, NULL, NULL, 'http://www.chailease.com.cn', '310100', '310000', '310105', 0, NULL);
INSERT INTO `company` VALUES (536, '2025-04-08 15:16:28.646925', '2025-04-08 15:16:28.646925', NULL, '东莞证券股份有限公司东莞分公司', 2, 631, '东莞市鸿福东路1号国贸中心5栋8002至8006室', '邓星洁', '601535259@qq.com', NULL, NULL, '东莞证券东莞南城分公司正式升级为东莞分公司，前身莞太路营业部，自1993年6月30日正式开业至今已有26年，是东莞地区成立最早、规模最大的证券营业部，陪伴着广大投资者见证了中国资本市场的近30年的发展。现在，我们拥有东莞最大的专业投顾人团队20人，平均从业年限10年以上，历经多轮牛熊锤炼，经验丰富，专业超群，深受投资者信任和支持。一路走来，东莞证券东莞分公司曾多次被广东证监局评为“投资者教育先进单位”，多次荣获《证券时报》、“券商中国”评选的“最佳区域证券营业部”、“中国明星营业部”等，2019年，我们荣获“中国三十强证券分支机构”称号。在《南方都市报》主办的东莞市第四届、第六届金牌理财师评选中两获“十佳金牌团队”，更是东莞地区唯一获此殊荣的券商团队。', '13790501957', 50, NULL, NULL, NULL, NULL, 'www.DGZQ.COM.CN', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (537, '2025-04-08 15:16:28.999872', '2025-04-08 15:16:28.999872', NULL, '东莞市至拙电器科技有限公司', 2, 632, '黄江北岸南路28号', '高小姐', '未公开', NULL, NULL, '东莞市至拙电器科技有限公司是一家工贸一体的公司，成立于2018年，集研发、生产、销售一体，主营业务是厨房小家电，主要产品是厨师机、煲汤机、压面器、咖啡机等整机及相关零部件。', '18925553903', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (538, '2025-04-08 15:16:29.535937', '2025-04-08 15:16:29.535937', NULL, '东莞宏德化学工业有限公司', 2, 633, '霄边第二工业区', '蔡小姐', 'HT85533620@163.COM', NULL, NULL, '石梅集团总部位于台北，集团旗下有台湾石梅(观音厂)、香港宏瑞（办事处）、东莞宏德（长安厂）、东莞宏石（沙田厂）、昆山石梅（昆山厂）、越南石梅（越南厂）等分公司。公司秉着“以人为本、以客为尊、服务创新、务实精进”的经营理念，已通过ISO9001、SO14001、ISO45001等国际体系认证。\r\n公司主要生产有Acrylic(丙烯酸)系列、UV(紫外线光硬化)系列、PU(聚氨脂)系列，在本行业均处于领先地位，致力成为中国丙烯酸树脂第一大供货商。专业于接着、涂装材料及其它精细化工产品，致力于成为国际性领导厂商, 销售网络遍及世界各地。追求环保,创造客户与企业关系人最大的效益及福祉。连续多年被评为东莞市“员工满意企业”。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (539, '2025-04-08 15:16:29.834145', '2025-04-08 15:16:29.834145', NULL, '东莞金坤新材料股份有限公司', 2, 634, '小河工业区', '梁小姐', '1277127862@qq.com', NULL, NULL, '东莞金坤新材料股份有限公司是一家集研发、生产、销售为一体的稀土磁铁制造及应用方案服务商新三板上市企业，拥有丰富的磁性材料行业研发、制造经验和完整的供应链体系，工厂位于东莞市道滘镇小河工业区，立足珠三角，服务全国和全世界客户。\r\n\r\n作为钕铁硼磁铁应用技术专家，我们拥有先进的磁性能分析仪器和经验丰富的技术工程师，快速帮助客户更好的选择合适的磁性产品和整体应用方案，也可根据客户需求定制各种磁组件产品。我们从客户产品开发阶段就介入的售前服务模式，致力于为客户缩短产品开发周期，降低开发成本，提高产品品质。\r\n\r\n金坤磁铁有限公司成立于2005年10月。经过12年的卓越奋斗，现已成为集原材料、研发、生产质造为一体的领军级磁铁企业。\r\n\r\n公司现有三座工厂：内蒙古包头原材料工厂，专业生产磁铁原材料；安徽江馨微电工厂，专业生产微电机用于手机摄像头；东莞小河工厂是集研发精工为一体的综合生产基地：厂区内规划办公面积约1800余平米（独栋办公室），生产车间约5,600平米，员工宿舍约2,400平方米。 员工总人数约320人。现有切片设备为500余台，年产能15000 万平方厘米（合约250吨）。\r\n\r\n拥有多种异型磁铁加工能力，设备有内圆切割机，打孔机，线切割，单面磨床，双面磨床，立式磨床等多达700余台，以满足各个行业对磁铁的生产要求。 厂内有多种可靠性测试设备如盐雾机，恒温恒湿机，高温测试机，磁特性分析仪，二次元投影仪，跌落测试设备等各种设备以满足产品特性需求。\r\n\r\n金坤磁铁生产的钕铁硼永磁铁广泛应用于、医疗、通讯、电子信息、新能源汽车、风能发电、军事国防等领域。公司已经通过ISO9001，ISO14001，TS16949国际认证体系。\r\n\r\n金坤磁铁与微软、TCL、海信、比亚迪、佛山照明、SKULLCANDY、LITEON、昂硕电声通讯等众多行业企业是战略合作伙伴！\r\n\r\n东莞金坤新材料股份有限公司依托\"世界制造业之都（东莞）\"的产业群优势和技术优势，不断加大技术创新力度，不断改进烧结钕铁硼磁铁生产的工艺与设备，使高端产品质量和性能得到了很大的提高，进一步提高了企业的市场竞争力；我司积累了成熟的高端产品制造和高效服务客户的能力，致力3～5年成为行业高端、异型、精密型钕铁硼磁铁的领军企业。', '15874842248', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (540, '2025-04-08 15:16:30.103834', '2025-04-08 15:16:30.103834', NULL, '东莞捷通达电讯有限公司', 2, 635, '宏北路20号2002室', '叶顺昌', '017525@gdjietong.com', NULL, NULL, '东莞捷通达电讯有限公司 成立于2009年，是香港电讯(HKT)在国内投资的通讯连锁企业，业务集中于品牌手机及配件零售和华为新能源汽车销售，着力于实体手机专卖门店、线上电商平台销售，与各大手机厂商及国代商均保持良好合作关系，是华为的“金种子”客户。', '13725733908', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (541, '2025-04-08 15:16:30.417417', '2025-04-08 15:16:30.417417', NULL, '东莞证券股份有限公司东莞茶山站前路证券营业部', 2, 636, '茶山站前路56号301室', 'luohuilan', '947998431@qq.com', NULL, NULL, '东莞证券股份有限公司成立于1988年6月22日，注册资本15亿元，是东莞市属国有控股重点企业，也是全国首批承销保荐机构之一。目前，东莞证券在全国范围有近3000名员工，旗下分支机构达88家（其中营业网点86家，上海分公司1家，深圳分公司1家），另全资拥有东证锦信投资管理有限公司、东莞市东证宏德投资有限公司，并控股华联期货有限公司。', '13537244311', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (542, '2025-04-08 15:16:30.982551', '2025-04-08 17:58:02.523668', NULL, '广东木头云数字科技有限公司', 2, 637, '南五长城街1号2101室', '邓女士', '407750339@qq.com', '2016-12-01', '互联网', '广东木头云数字科技有限公司（以下简称“木头云”）成立于2016年12月，是一家利用互联网思维与技术专注于服务木材产业链的公司，除了以木材原材料、相关木制品等为主要对象进行在线贸易，还为客户提供木材仓储、加工、市场、行情分析、大数据等服务，将线上与线下结合融为一体，是一个汇集信息流、资金流、商品流等一站式解决方案的综合服务平台。\r\n\r\n历经五年发展，木头云在全国布局事业版图，包括东莞、佛山、深圳、张家港、宁波、青岛、仙游等，以此作为木材、家具仓储基地辐射全国，服务木材行业企业超1000家，运营的木材基地面积达20万平方米。\r\n\r\n木头云平台供应木材类型有：非洲材、东南亚材、北美材、南美材、巴新材、所罗门材、欧洲材、俄罗斯材、国产材等，涵盖板材、原木、红木、木皮、人造板等，木材品种超过100种，如大斑马、小斑马、黄玫瑰等；供应的家具以红木家具为主，含大红酸枝、赞比亚紫檀、刺猬紫檀、大果紫檀等品种。木头云通过专业化运作，为木材企业、家具厂、加工厂降低经营成本，为终端消费者创造与众不同的产业链价值。', '19876799786', 151, '私营', '东莞市', '广东省', '厚街镇', '', '441900', '440000', '441900122', 0, NULL);
INSERT INTO `company` VALUES (543, '2025-04-08 15:16:31.493745', '2025-04-08 15:16:31.493745', NULL, '东莞市安居建设投资有限公司', 2, 638, '莞长路东城段27号6栋101室', '陈小姐', 'hr@0769anju.com', NULL, NULL, '东莞市安居建设投资有限公司（以下简称“东莞安居公司”），为东莞市属国有独资企业——东莞实业投资控股集团有限公司的全资子公司，是东莞首家市属住房租赁企业。东莞安居公司成立于2018年，以“建设高品质人才住房，助力东莞高质量发展“为使命，以人才安居住房为载体，筑巢引凤，服务人才，助推湾区都市、品质东莞的建设和发展，帮助人才更好地融入东莞、爱上东莞、扎根东莞。\r\n\r\n东莞安居公司打造的首个青年人才公寓品牌——莞寓，稳居东莞市长租公寓市场占有率首位。截至目前（2024年11月30日），莞寓布局23个项目，其中自投自营项目17个，代运营项目6个，管理总房源8000余间。莞寓主力产品包括品质蓝领公寓、精品白领公寓，以及复合型租赁社区等。', '未公开', 50, NULL, NULL, NULL, NULL, 'http://www.0769anju.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (544, '2025-04-08 15:16:31.900630', '2025-04-08 15:16:31.901525', NULL, '东莞茵拓进出口有限公司', 2, 639, '白马黄金一路国宁二期4栋107', '粟小姐', 'dongguanintop@163.com', NULL, NULL, '我司于 2015 年正式成立，所销售机械产品经过多家市场积累与铺垫，逐渐建立一套完整的、优质的纸箱包装 机械应用供应体系。同时与国内优质供应商合作，提供各种中高档纸板生产线、印刷机、钉箱机、粘箱机、制胶 机等一整套纸箱生产设备机械，并且可根据广大国外客户的需求，量身打造完整的纸箱生产解决方案。\r\n此外，公司于 2018 年设立印度办事处，拥有高级机械及电气工程师 2 人，并在海外雇用了一批优秀技术服务 人员。自公司成立以来，公司一直秉承客户第一，员工第一的经营理念，在专注印度市场开拓的同时，机械产品 也远销东南亚， 中东，非洲等国家地区，为超过一百家纸箱纸板生产厂家提供一站式解决服务，优质、用心的服 务赢得了众多厂家的信赖和好评，在印度及海外市场逐渐树立起公司良好品牌。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (545, '2025-04-08 15:16:32.271380', '2025-04-08 15:16:32.271380', NULL, '深圳市苏宁易购销售有限公司', 2, 640, '深圳市罗湖区仙湖社区国威路72号莲塘第一工业区102栋国威路70-1号2楼', '韩小姐', '未公开', NULL, NULL, '苏宁创立于1990年，在中国和日本拥有两家上市公司，是中国领先的商业企业，2019年苏宁控股集团以6025亿元营收位列中国民营企业500强第三、中国民营企业服务业100强第二，蝉联互联网零售行业第一。随着全场景布局的加速推进和智慧零售战略的深度融合，苏宁充分发挥线上线下融合发展的优势，持续提升产品服务质量，激发消费市场活力，成为推动国内经济发展、服务提升的积极力量。与此同时，苏宁积极拓展产业经营，形成苏宁易购、苏宁物流、苏宁金融、苏宁科技、苏宁置业、苏宁文创、苏宁体育、苏宁投资八大产业板块协同发展的格局。', '未公开', 50, NULL, NULL, NULL, NULL, 'http://www.suningholdings.com/cms/index.htm', '440300', '440000', '440303', 0, NULL);
INSERT INTO `company` VALUES (546, '2025-04-08 15:16:32.523082', '2025-04-08 15:16:32.523082', NULL, '铠利源（惠州）精密科技有限公司', 2, 641, '惠州市惠城区水口镇洛塘霞岗村上岗岭仔地段厂房', '谭小姐', '未公开', NULL, NULL, '惠州铠利源精密科技有限公司创立于2020年10月，公司总部设立于香港新界葵涌，工厂位于交通便利、风景优美、经济发达的广东惠州市。惠州工厂于2021年3月投入使用，厂房占地面积13800平方米，总资产3000万人民币，目前在职员工300多人。以“技术立企业”、“创新以人为本”的经营理念，以超精密、高精密组装生产为核心，致力于专业从事表壳表带及智能穿戴生产。公司拥有稳定的规模生产能力，设备投入资金约800万人民币。从原材料到生产过程到成品，都经过严格的管控。可生产品种繁多精密产品，如表壳、表带、表扣、镶钻、装饰品。得到了迪奥（法国）1947、昆仑表（瑞士）1955、艾美（瑞士）1961、宝格丽（意大利）1879等国际品牌客户的认可。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441300', '440000', '441302', 0, NULL);
INSERT INTO `company` VALUES (547, '2025-04-08 15:16:33.127889', '2025-04-08 15:16:33.127889', NULL, '东莞市升微机电设备科技有限公司', 2, 642, '大朗水新路221号', '尹丽梅', 'mei222614mei@163.com', NULL, NULL, 'Simplewell是一家拥有研发能力、自主设计及制造各类试验设备的专业性企业.在产品的研发、 设计制造、质量控制及服务协调方面，有高效运作科学的管理模式和经营理念。并通过了TUV:ISO9001:2008认证，VDA6.4:2005质量管理体系认证。拿到了大量的国内发明专利和美国、日本、欧洲专利。并得到了政府的支持和多项奖励。\r\n公司拥有国际先进的激光切割机、数控折弯机，激光焊接机等现代先进工艺技术加工设备。\r\n公司主重对人材的培养与发展，汇集了大批行业优秀的研发设计及制造人才，具有制造大型非标复杂试验设备的成熟经验和安装能力。在机器的智能化控制及软件开发方面也具有很强的能力。.\r\n我们生产的产品方主要应用在大学院校、科研机构、航空航天、军工、电子、电工、玩具、家具、五金、纸品、电池、光电、通信、汽车、农业、等单位。并为他们提供符合GB、GJB、IEC、ISO、MIL、DIN、CE等标准的试验设备', '13377785099', 50, NULL, NULL, NULL, NULL, 'simplewell.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (548, '2025-04-08 15:16:33.416241', '2025-04-08 15:16:33.416241', NULL, '广东弘擎电子材料科技有限公司', 2, 643, '京九路322号', '严女士', 'yjy@hongqingkj.com', NULL, NULL, '弘擎科技属于高分材料行业，国家高新技术企业，上市后备企业，小巨人专精特新企业。是一家全方位解决胶粘材料方案解决方案公司。公司自主研发400多项发明专利和实用新型专利。\r\n     公司总部位于东莞常平镇，拥有独立的花园式自建产业园。占地面积48亩，设立研发中心、制造中心、行政办公写字楼、员工活动中心等多栋独立写字楼、厂房。公司工作环境舒适，比邻常平东轻轨站、东莞东火车站。交通便利。公司管理人性化，免费提供食宿。为新入职同事当月购买社保、公积金，签订劳动合同。丰厚的节假日礼物。培训活动等。\r\n        更多详情，欢迎联系HR小姐姐了解！', '13532480806', 50, NULL, NULL, NULL, NULL, 'www.hongqingkj.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (549, '2025-04-08 15:16:33.842865', '2025-04-08 15:16:33.842865', NULL, '海博创新科技（东莞）有限公司', 2, 644, '星城党群服务中心9楼', '王成', '157895335@qq.com', NULL, NULL, '海博创新科技（东莞）有限公司是专门为海内外国家高层次人才和项目提供专业化服务的机构，旨在为国家特聘专家及海内外高层次人才到大湾区创新创业提供孵化加速、资本对接、市场开拓、技术合作等全链条、个性化的多方位服务，通过市场化的手段帮助高端人才项目的快速发展，以实现培育一批高精尖的产业领军企业目标。\r\n   公司为高层次人才创业提供伙伴式发展服务；将高层次人才的硬科技项目与传统产业相结合，加速现有产业升级转型；以产业链为导向，加速产业聚集，形成高科技产业园区。 \r\n  公司以引进硬科技项目为使命，以创业孵化为核心定位，依托大湾区现有产业基础与发展规划，结合大湾区科技与人才服务需求、产业转型升级契机，致力为大湾区打造赋能产业新体系。\r\n   公司创始人曾任中央领导人才工作小组批准成立的千人计划南方创业服务中心副秘书长，曾帮助广州、东莞等多个城市三年进行国家重大人才申请辅导，帮助广州增城、江西宜春在国家人才工程领域历史性0突破，帮助东莞在国家重大人才工程成果高速增长。以服务高层次人才核心任务，吸引了大量海内外高层次人才来莞考察、带来合作项目；并且帮助多位海归高层次人才创新创业！', '13713059920', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (550, '2025-04-08 15:16:34.178874', '2025-04-08 15:16:34.178874', NULL, '东莞证券股份有限公司东莞石碣证券营业部', 2, 645, '勇口东风中路1号富盈酒店三楼', '梁锦兰', '422354519@qq.com', NULL, NULL, '东莞证券股份有限公司成立于1988年6月22日，注册资本15亿元，是东莞市属国有控股重点企业，也是全国首批承销保荐机构之一。30多年来，东莞证券以经纪、资管、投行三大业务为核心，积极发展证券自营、私募基金、另类投资等业务，已成为全国性综合类证券公司。东莞证券石碣营业部位于石碣镇东风中路1号石碣富盈假日酒店三楼北左侧，交通便利。我们秉持“智慧创造财富，专业成就价值”的核心价值观，以培育市场、服务社会为己任。凭借“行业资历、金牌团队、专业思维、贴心服务”的全新理念，为客户量身打造高端的“金钻服务”。', '13713398543', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (551, '2025-04-08 15:16:34.935968', '2025-04-08 15:16:34.935968', NULL, '浙江宁银消费金融股份有限公司', 2, 646, '长兴路788弄115号', '刘老师', '未公开', NULL, NULL, '浙江宁银消费金融股份有限公司（简称“宁银消金”）是经国家金融监督管理总局批准成立的、为我国境内居民个人提供以消费为目的的贷款的持牌消费金融公司。公司控股股东宁波银行实力雄厚，是国内20家系统重要性银行之一。在消费金融领域，目前获批的持牌公司仅31家，发展空间巨大，是一个具有广阔蓝海的金融市场。\r\n公司汲取了宁波银行多年业务发展和风控管理经验，结合互联网场景搭建消费金融平台，致力于为广大普惠客群，提供专业化金融服务，同时，对区域内优质客户（公务员、事业单位、国企、世界500强企业员工），提供一对一专属金融服务，打造主流品牌形象，力争成为个人客户值得信赖的综合金融服务平台。截至2023年末，公司贷款余额420.85亿元，同比增长485.9%；实现净利润2.02亿元，同比增长676.9%，经营质量稳步提升。展望未来，公司将秉承普惠金融的初心，积极探索消费金融业务模式，依托互联网技术不断推进产品创新和流程优化，不断提升客户体验，满足各类群体的消费需求。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.cfcbnb.com/', '330200', '330000', '330205', 0, NULL);
INSERT INTO `company` VALUES (552, '2025-04-08 15:16:35.326285', '2025-04-08 15:16:35.326285', NULL, '东莞市佳兆业物业管理有限公司', 2, 647, '东莞市南城区胜和路金盈大厦A区208室', '叶浩斌', 'yehaob@kaisagroup.com', NULL, NULL, '佳兆业美好集团有限公司（简称佳兆业美好）成立于1999年，总部位于深圳，2018年12月在香港联交所成功上市，股票代码：2168.HK。截至2019年6月30日，佳兆业美好进驻全国37个城市，总管理项目218个，总物业管理面积达3630万平方米；为全国近24万个物业单位提供服务；下辖20余家子公司，员工6000多人，现有业务涉及物业管理服务、交付前及顾问服务、社区增值服务、智能解决方案服务等领域。\r\n东莞市佳兆业物业管理有限公司是佳兆业美好集团的全资子公司，成立于2007年7月18日，为一级资质，注册资金为1000万。目前在管项目有水岸山城项目、水岸豪门项目、中央豪门项目、帝景湾项目、东江豪门项目、城市绿洲项目、御龙山项目、碧海云天项目、桥头满都花园项目、君荟庭项目、松山湖佳纷天地项目。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (553, '2025-04-08 15:16:35.793999', '2025-04-08 15:16:35.793999', NULL, '东莞证券股份有限公司东莞厚街分公司', 2, 648, '波特曼酒店9楼东莞证券', '张良勇', '523006957@qq.com', NULL, NULL, '东莞证券有限责任公司成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。公司业务范围涵盖了经纪、投资咨询、财务顾问、承销与保荐、证券自营、资产管理、基金代销、期货IB、直接投资、融资融券等领域', '13660605179', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (554, '2025-04-08 15:16:36.130687', '2025-04-08 15:16:36.130687', NULL, '广州顶津饮品有限公司', 2, 649, '广州经济技术开发区东区宏远路16号', '靳科', '未公开', NULL, NULL, '康师傅主要在中国从事生产和销售方便面、饮品等方便食品，全国拥有78家工厂与340家营业部，雇员数量超过60000人。康师傅作为中国家喻户晓的品牌，经过多年的耕耘与积累，深受中国消费者喜爱和支持。\r\n康师傅饮品投资有限公司从1996年开始从事生产和销售饮料，逐渐成为中国消费者家喻户晓的品牌。2022年康师傅即饮茶销量市占率达41.7%，继续稳居市场首位。康师傅旗下果汁产品市场占有率为17.9%，居市场第二位。包装水销量市场占有率为6%。\r\n快速发展的康师傅饮品广东公司业务覆盖深圳、东莞、惠州、河源、潮汕等地区，需要大量优秀人才的加盟，也将为更多的优秀人才提供展示自己的舞台，让我们携手，共创百年康师傅！', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440112', 0, NULL);
INSERT INTO `company` VALUES (555, '2025-04-08 15:16:36.425939', '2025-04-08 15:16:36.425939', NULL, '华泰证券股份有限公司东莞国贸中心证券营业部', 2, 650, '鸿福东路1号国贸中心2栋3303室', '陈欣', 'chenxin023308@htsc.com', NULL, NULL, '华泰证券股份有限公司（“华泰证券”或“公司”）是一家领先的科技驱动型综合证券集团。自1991年成立以来，华泰证券积极把握中国资本市场改革开放的历史机遇，在业内率先以金融科技助力转型，用全业务链服务体系为个人和机构客户提供专业、多元的证券金融服务，综合实力和品牌影响力位居国内证券业第一方阵。\r\n\r\n2010年2月26日，公司A股（601688.SH）在上海证券交易所挂牌上市交易。2015年6月1日，公司H股（6886.HK）在香港联合交易所挂牌上市交易。2019年6月17日，公司全球存托凭证（HTSC.LI）在伦敦证券交易所成功上市交易。自此，公司也成为一家在上海、香港和伦敦三地上市的中国金融机构。\r\n\r\n依托高度协同的业务模式、先进的数字化平台、广泛且紧密的客户资源，公司财富管理业务、机构服务业务、投资管理业务和国际业务全方位发展，全力打造面向未来的差异化核心优势，竞争实力位居行业前列。2014年以来，公司股票基金交易量保持行业第一（据沪深交易所数据）；公司移动财富管理APP“涨乐财富通”月度活跃用户数也长期名列行业APP第一（据易观智库，自2016年至2023年），2023年末累计下载量超过7400万；股权承销、债券承销、并购重组业务位居行业前列。\r\n\r\n公司拥有全资子公司华泰联合证券有限责任公司、华泰证券（上海）资产管理有限公司、华泰国际金融控股有限公司、华泰紫金投资有限责任公司、华泰创新投资有限公司、华泰期货有限公司；控股江苏股权交易中心有限责任公司，参股南方基金管理有限公司、华泰柏瑞基金管理有限公司、江苏银行股份有限公司等。\r\n\r\n秉承“高效、诚信、稳健、创新”的核心价值观，华泰证券全面实施科技赋能下的财富管理和机构服务“双轮驱动”发展战略，致力成为兼具本土优势和全球影响力的一流投资银行。', '13423410277', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (556, '2025-04-08 15:16:36.801059', '2025-04-08 15:16:36.801059', NULL, '深圳市乐有家控股集团有限公司', 2, 651, '深圳市福田区八卦路安吉尔大厦16楼乐有家控股集团', '钟坤霞', 'hrzp@leyoujia.com', NULL, NULL, '深圳市乐有家控股集团有限公司,2007年10月23日成立，经营范围包括一般经营项目是：投资兴办实业（具体项目另行申报）；经济信息咨询；经营进出口业务（法律、行政法规、国务院决定禁止的项目除外，限制的项目须取得许可后方可经营）；房地产经纪（不含限制项目）。', '16620673528', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440304', 0, NULL);
INSERT INTO `company` VALUES (557, '2025-04-08 15:16:37.170178', '2025-04-08 15:16:37.170178', NULL, '玉山银行（中国）有限公司', 2, 652, '前海深港合作区梦海大道5033号卓越前海壹号7栋31F玉山银行', '林宛文', '未公开', NULL, NULL, '玉山银行1992年于台湾正式成立， 2012年设立东莞分行，并于2016年改制为法人银行。玉山银行（中国）是首家于深圳前海自贸区内建立的金融总部，目前在大陆地区已设立5个网点：营业部、深圳分行、东莞分行、长安支行、广州分行。\r\n    玉山银行杰出的金融创新和经营绩效持续获得国际级的肯定：2014至2019年连续六年入选美国DJSI道琼永续指数（新兴市场指数成分股），为台湾金融业唯一；2017年创台湾金融业纪录地拿下《亚洲银行家》（The Asian Banker）“亚太最佳银行”；2010至2019年连续10年荣获财资杂志《The Asset》“亚洲杰出管理奖”最高荣誉—白金奖，并连续3年被评为“台湾最佳银行”；2017年荣获Gartner“最佳信息数据治理奖”，为亚洲唯一获奖企业；2017年获得亚洲金融杂志《Finance Asia》“台湾最佳CSR企业”、“台湾最佳公司治理”等6项大奖。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440305', 0, NULL);
INSERT INTO `company` VALUES (558, '2025-04-08 15:16:37.517471', '2025-04-08 15:16:37.517471', NULL, '中信证券华南股份有限公司', 2, 653, '珠江西路5号广州国际金融中心主塔19层、20层', '叶锦萍', 'jpye@citics.com', NULL, NULL, '中信证券股份有限公司（简称“中信证券”，A股代码“600030”、H股代码“6030”）成立于1995年10月，2003年在上海证券交易所挂牌上市交易，2011年在香港联合交易所挂牌上市交易，是中国第一家A+H股上市的证券公司。\r\n中信证券业务范围涵盖证券、基金、期货、外汇和大宗商品等多个领域，通过全牌照综合金融服务，全方位支持实体经济发展，为国内外企业客户、机构客户、高净值客户、零售客户提供各类金融服务解决方案。目前拥有6家主要独立业务子公司，分支机构遍布全球13个国家，中国境内分支机构和网点400余家，华夏基金、中信期货、金石投资、中信证券资管等主要控股子公司均在各自领域中保持领先地位。\r\n2023年12月末，中信证券总资产14,534亿元，归属母公司净资产2,688亿元。2023年实现营业收入601亿元，归属母公司净利润197亿元，均稳居行业领先地位。', '13412388819', 50, NULL, NULL, NULL, NULL, 'http://www.cs.ecitic.com/newsite/', '440100', '440000', '440106', 0, NULL);
INSERT INTO `company` VALUES (559, '2025-04-08 15:16:37.845531', '2025-04-08 15:16:37.845531', NULL, '东莞证券股份有限公司深圳龙岗腾飞路证券营业部', 2, 654, '腾飞路9号创投大厦4104', '陈杰升', '447258512@qq.com', NULL, NULL, '东莞证券股份有限公司深圳龙岗营业部于2022年6月29日成立并入驻龙岗创投大厦，是基于东莞证券“扎根东莞、迈向全国”的战略部署在深圳地区成立的第四家证券营业部。深圳龙岗营业部秉持“智慧创造财富、专业成就价值”的核心价值观，以“创新以致胜，合规以致远”的经营理念与“真诚、专业、包容、感恩”的企业文化为投资者提供高效且有温度的一站式综合金融服务，并积极履行企业社会责任。', '13712958880', 50, NULL, NULL, NULL, NULL, '', '440300', '440000', '440307', 0, NULL);
INSERT INTO `company` VALUES (560, '2025-04-08 15:16:38.278109', '2025-04-08 15:16:38.278109', NULL, '东莞东利科技有限公司', 2, 655, '超朗新塘球场巷1号', '武女士', '未公开', NULL, NULL, '东莞东利科技有限公司是一家专业研发和生产包括TPE、EVA、PA、PES、TPU、EAA、HDPE胶膜、胶网、胶朴、弹力氨纶胶等热熔粘接材料产品的企业。东莞东利科技有限公司的产品被广泛应用于服装：女士文胸，运动文胸，瑜伽裤，衬衫，POLO衫，男女内裤，防晒帽，帽子，鞋材衬布；汽车内装饰，家具，过滤工业，医疗敷料贴，建材以及其他领域。我们公司拥有强大的研发和生产能力，已获得20项国家专利。此外，还获得OEKO-TEX 等国家检测认证，产品安全，环保。公司秉承“对接、创新、共赢”的理念，专注于“改性热熔胶膜”研发生产销售，可根据客户项目定制化生产，为客户提供从测试选材、研发、生产、后续产品售后及技术上的一条龙服务。', '未公开', 50, NULL, NULL, NULL, NULL, 'http://www.baikaisz.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (561, '2025-04-08 15:16:38.558109', '2025-04-08 15:16:38.558109', NULL, '广东珍岛信息技术有限公司', 2, 656, '安宏基天曜广场A栋16楼', '范玉佳', 'yujia.fan@marketingforce.com', NULL, NULL, '珍岛信息技术（上海）股份有限公司，简称珍岛集团，成立于2009年，致力于打造全球领先的智能营销云平台，也是国内率先推出的Marketingforce（营销力）平台，专注于人工智能、大数据、云计算在数字营销及企业数字化智能化领域的创新与实践，面向全球企业提供营销力软件及服务，现已形成IaaS（云计算）、PaaS（开放中台）、All-in-one AI SaaS智能营销云平台（含营销云、销售云、商业云、企服云、服务云等一站式智能营销云平台），以及数字威客服务平台、云应用市场、数字媒体自助等一站式企业服务生态平台。\r\n\r\n总部位于上海市静安区大数据产业基地，云计算机房设立于无锡，30+分支机构业务覆盖全球。珍岛集团现有员工约4000人，累计申请软件著作权400余项，相关专利40余项。\r\n\r\n已获得国家、市级、科研机构协会等多方认可，收获相关荣誉与资质400余项。其中国家级资质荣誉18项，包括：国家科学技术进步二等奖、工信部推荐中小企业数字化赋能产品服务单位、国家商务部数字商务企业、中国互联网百强企业、国家中小企业公共服务示范平台、现代服务业综合试点单位、中国科协认定的全国示范院士专家工作站、国家高新技术企业（4家）等；上海市市级荣誉资质包括：上海市科技进步一等奖、上海市科技小巨人企业、上海名牌企业、上海软件企业百强、上海市电子商务示范企业、上海软件企业和信息技术服务业百强等。\r\n\r\n同时，在产教融合领域，公司与复旦大学、上海大学、西安交通大学、华东师范大学等知名院校建立了战略伙伴关系，分别开展了智能营销实训实验基地、虚拟仿真项目设计等不同领域的深度产学研合作。\r\n\r\n在科技创新领域，2017年，珍岛企业技术中心经上海五部委联合评定为上海市级企业技术中心，定位商业科技发展趋势、产业互联网创新转型、互联网+及企业数字营销智能化应用领域，打造创新型技术组织，目前已形成立体式数字和数据技术生态体系架构，聚焦AI-SaaS、智慧云计算、大数据、中台引擎等核心领域，在产品技术、技术人才组织、产学研合作、商业模式创新等领域已获得多方认可。', '18802012624', 50, NULL, NULL, NULL, NULL, 'https://www.marketingforce.com/', '440300', '440000', '440309', 0, NULL);
INSERT INTO `company` VALUES (562, '2025-04-08 15:16:38.808380', '2025-04-08 15:16:38.808380', NULL, '东莞市荣兴纸业有限公司', 2, 657, '东莞市沙腰村永兴路5号', '陆文凭', '841063249@qq.com', NULL, NULL, '东莞市荣兴纸业有限公司创建于1998年，坐落于国际制造业名城东莞市——石碣镇，集销售、服务、物流于一体的大型专业纸业公司。拥有优秀的业务团队和完善的物流服务体系，我们秉承“诚信、务实、合作、创新”的经营理念，致力于工业用纸、文化用纸的销售业务，在深圳、佛山、广州、中山、江门、惠州等地均设有办事处，销售网络覆盖珠三角及周边省市。\r\n       公司组织结构清晰，流程科学，制度严谨。公司坚持“以人为本”的管理理念，关爱员工，帮助员工成长并经常组织员工开展丰富多彩的活动。\r\n       我们的合作企业： 均为全球造纸业知名企业。', '17873926021', 50, NULL, NULL, NULL, NULL, 'http://www.dgrongxingpaper.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (563, '2025-04-08 15:16:39.260482', '2025-04-08 15:16:39.260482', NULL, '东莞市正和楚基科技有限公司', 2, 658, '角社新兴业路2号', '宁女士', '未公开', NULL, NULL, '    正和楚基是一家专业从事CNC、车床、3DP、冲压、锻压、注塑、电镀、阳极等表面处理的企业，主要从事精密金属加工（3C部件，半导体零部件），精密连接器、天线、核心部件的生产及组装。\r\n    公司以“庚续百年企业，成果人人共享”，“成为世界最优秀的硬件供应商，为客户创造最大价值”作为公司愿景及使命，以“成就客户、艰苦奋斗、自我批判、开放进取、至诚守信、团队合作、行稳致远”为经营理念，全面提升核心竞争力，牢牢确立了在五金电子配件和机械零部件领域的领先地位和产业格局，用自己的努力与合作伙伴共创辉煌！我司现有员工1500人（东莞/深圳两个厂区），基地面积10万平方，未来规划自建工业园（2025年启动）12万平方，力争再续辉煌篇章！', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (564, '2025-04-08 15:16:39.929733', '2025-04-08 15:16:39.929733', NULL, '东莞证券股份有限公司东莞东城分公司', 2, 659, '新东华大厦1201', '黄静敏', '3662183840@qq.com', NULL, NULL, '暂无', '13713230878', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (565, '2025-04-08 15:16:40.301351', '2025-04-08 15:16:40.301351', NULL, '东莞市惠盈工艺品有限公司', 2, 660, '长虹百荟22栋办公楼', '赖小姐', 'huiyingart@hotmail.com', NULL, NULL, '东莞惠盈工艺品有限公司位于交通发达的珠三角广东省东莞市。是一家致力于宝石、半宝石工艺及艺术品、饰品等以原料开发、设计、生产与销售一体化专业的有限公司。惠盈是拥有专业的技术生产，完整、科学的质量管理体系，支持来图来样订做。我司秉承着诚信为本、实力和产品质量获得行业界的认可，在欧美地区也有着多家合作商家。 惠盈工艺品不断向前发展，全力打造中国最务实的工艺及艺术品、饰品品牌。期待您的加入，来共同实现我们的梦想，来共同见证奇迹，共同创造公司美好的明天!　', '13543713806', 50, NULL, NULL, NULL, NULL, 'https://dgifts.en.alibaba.com/', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (566, '2025-04-08 15:16:40.653176', '2025-04-08 15:16:40.653176', NULL, '东莞市成樑人力资源开发有限公司', 2, 661, '体育路家宝大厦1206', '党春洁', '3176165609@qq.com', NULL, NULL, '东莞市成樑人力资源开发有限公司成立于2023年08月15日，注册地位于广东省东莞市厚街镇康乐南路145号2单元1503室，法定代表人为叶毅忠。经营范围包括一般项目：人力资源服务（不含职业中介活动、劳务派遣服务）；技术服务、技术开发、技术咨询、技术交流、技术转让、技术推广；科技中介服务；自费出国留学中介服务。（除依法须经批准的项目外，凭营业执照依法自主开展经营活动）许可项目：职业中介活动；劳务派遣服务。\r\n东莞市成樑人力资源开发有限公司是广东劳务行业中崛起的一颗新秀，劳务派遣市场以其独特的经营理念和超前务实的业务操作手段进行运作，以高于市场的服务标准适应劳务派遣就业市场，为广大就业人员、用人单位提供新型、便捷的服务。\r\n公司奉行“诚信为本、规范运作、满意第一、服务社群”以“守法经营，求真务实，服务沟通”为宗旨，积极响应政府对再就业工程的号召，高效引领人力资源合理有序流动，安全快捷地对劳动力国有资源进行优化配置，促进劳动就业环境的改善。', '17597811620', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (567, '2025-04-08 15:16:40.871951', '2025-04-08 15:16:40.871951', NULL, '东莞泰利测试设备有限公司', 2, 662, '黄泥塘村幸福路13号', '陈小姐', 'wangguofang@terchy.cn', NULL, NULL, '东莞泰利测试设备有限公司1998年成立于东莞市常平镇黄泥塘管理区，主要设计、开发、生产各类型环境测试设备产品，公司在台湾和中国大陆(东莞、苏州)分别设立研发、生产基地。\r\n公司实行全员培训和技能资格认证制度，并以先进的制造和设备迅速提高产能以满足市场的需求。“尊重个人成就感，不断学习，给你一片天空让你努力创造自己的世界”是公司的用人准则。', '18666862586', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (568, '2025-04-08 15:16:41.052532', '2025-04-08 15:16:41.053224', NULL, '东莞市耀野自动化有限公司', 2, 663, '牛山瑞联振兴工业园', '饶', 'jianhong.rao@sinobonder.com', NULL, NULL, '东莞市耀野自动化有限公司主营高精度高速度自动化设备。核心研发团队理论基础深厚，实践经验丰富，具备雄厚的技术实力，能够自主研发高速高精度平台、音圈电机、高速数据采集系统、视觉定位和识别系统等。目前开发的自动化设备主要应用于光通讯行业，均在同行业处于领先水平。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (569, '2025-04-08 15:16:41.267044', '2025-04-08 15:16:41.267044', NULL, '招商证券股份有限公司东莞厚街体育路证券营业部', 2, 664, '体育路18号2楼', '蔡淑银', 'caisy1@cmschina.com.cn', NULL, NULL, '招商证券是百年招商局旗下金融企业，经过二十多年创业发展，已成为拥有证券市场业务全牌照的一流券商。2009年和2016年，招商证券分别在上交所和联交所主板上市。截止目前，招商证券已成为中证100、上证180、沪深300、新华富时中国A50等多个指数的成分股。', '13580768126', 50, NULL, NULL, NULL, NULL, 'www.newone.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (570, '2025-04-08 15:16:41.764830', '2025-04-08 15:16:41.764830', NULL, '招商证券股份有限公司东莞鸿福路证券营业部', 2, 665, '东莞市南城区第一国际招商银行大厦20楼', '高经理', '815831137@qq.com', NULL, NULL, '招商证券是一家中国领先的上市证券公司，拥有全业务资质，跨越国内外市场，覆盖证券、期货、证券投资基金、直接股权投资等多个领域。目前在国内各大中城市拥有11家分公司，200多家营业网点，并全资拥有招商证券国际有限公司、招商期货有限公司、招商致远资本投资有限公司、招商证券投资有限公司、招商证券资产管理有限公司。招商证券超过10000位员工竭诚为全球企业、政府机构、个人和机构投资者提供全面的证券服务。我们致力于打造中国最佳投资银行，通过卓越的金融服务实现客户的财富增长。\r\n依托强大的招商体系，2001年4月8日招商证券在东莞南城鸿福路成立了第一家营业部。来到东莞，招商证券稳扎稳打，营业部秉承着“百年招商精神”，以“励新图强，敦行致远”为核心价值观、并客户为中心人才为根本，凭借不断创新的金融服务，在市场上树立了稳健、专业、务实、创新的良好形象。经过几年的发展壮大，营业部于2014年分别在分别在虎门、厚街、石龙三个镇区成立了二级营业部，进一步扩大服务客户的范围和广度。', '15919736880', 50, NULL, NULL, NULL, NULL, 'www.newone.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (571, '2025-04-08 15:16:42.103113', '2025-04-08 15:16:42.103113', NULL, '东莞泰盟饰品有限公司', 2, 666, '常平沙湖口村圣旗路2号泰盟化妆品', '李小芳', '未公开', NULL, NULL, '东莞泰盟饰品有限公司/东莞泰盟化妆品有限公司，1994年成立，是一家集产品研发、生产、国际贸易于一体的综合性型企业。是台湾鸿亿服饰企业有限公司在大陆投资的独资企业，位于广东省东莞市东部工业园处在常平、横沥、桥头三镇的交界地带，地理位置优越、交通条件便利，公司经过二十几年的高速发展，原有员工二千多名，现有干部150多名、员工400多名，厂区占地面积20000平方米，使用面积为35000平方米，由单一的塑胶发饰品发展到化妆品、保养品等三大系列产品。 公司通过ISO9001：2015质量体系认证、ISO22716及GMPC化妆品标准认证，产品均能符合欧美、中国及中东国家的出口质量标准，产品包括：唇彩、唇彩膏、腮红、眼影粉、粉饼、口红、唇笔、眼影笔、睫毛膏、指甲油。 未来，公司持续以“品质第一，客户至上。持续改进，追求卓越”的指导思想，深化制度化、标准化的管理模式，公司将进一步加强内部管理，广纳英才。公司将打造成最具人气、最时尚、最具代表力的彩妆品牌！', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (572, '2025-04-08 15:16:42.791230', '2025-04-08 15:16:42.791230', NULL, '东莞市南城学而优为培训中心有限公司', 2, 667, '鸿福西路南城段70号', '翟家乐', '392817931@qq.com', NULL, NULL, '好方法教育简介\r\n好方法教育始创于2018年，总部位于东莞市，是一家专业从事教育培训服务的企业。我们致力于为适龄学生提供全方位、高品质的教育培训服务，帮助他们在各自领域取得更好的成就。\r\n我们的服务涵盖了多个领域，包括语言培训、升学辅导以及兴趣爱好培训等。我们拥有一支专业、经验丰富的教师团队，他们拥有丰富的教学经验和专业知识。我们采用灵活多样的教学方式，包括线上和线下课程、一对一和小班辅导等，以满足不同客户群体的需求。\r\n本公司以“诚信、认真、效率”为核心价值观，始终坚持客户至上的服务理念。我们不断优化课程设置和教学方法，提高教学质量和效果，赢得了广大学员的高度认可和好评。\r\n未来，好方法教育将继续秉承“教育改变命运，学习成就未来”的企业使命，不断拓展服务领域和提高服务质量，为更多的人提供优质的教育培训服务，助力他们实现梦想。', '18188838981', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (573, '2025-04-08 15:16:43.126059', '2025-04-08 15:16:43.126059', NULL, '东莞证券股份有限公司东莞虎门分公司', 2, 668, '连升路63号地标大厦3栋160室', '王冠华', '124919862@QQ.com', NULL, NULL, '东莞证券有限责任公司成立于1988年6月，注册资本15亿元，是国有控股的全国性综合类证券公司，也是全国首批承销保荐机构之一。业务范围涵盖了经纪、投资咨询、承销与保荐、证券自营、资产管理、基金代销、融资融券等', '13729930001', 50, NULL, NULL, NULL, NULL, 'www.dgzq.com.cn', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (574, '2025-04-08 15:16:43.549789', '2025-04-08 15:16:43.549789', NULL, '东莞市鑫瑞内衣有限公司', 2, 669, '永庆村富华路40号', '李汶鸿', 'Aoofaray@gmail.com', NULL, NULL, '东莞市鑫瑞内衣成立于2003年，风里雨里我们现在总人数100+，占地面积1万平方米。我们主要面向欧美市场，以及东南亚市场。现在我们在高速发展的过程中将业务划分为国内业务部过国际部，国内的一线货架电商：淘宝，天猫，拼多多，以及直播带货电商。国际部：Alibaba，amazon，SHEIN ，TEMU，aliexpress, OZO , Shopee, Ebay, Cdiscount ，独立站。我们需要扩招我们的各个事业部期待你的加入', '18710424052', 50, NULL, NULL, NULL, NULL, 'http://www.xinruibra.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (575, '2025-04-08 15:16:43.845426', '2025-04-08 15:16:43.845426', NULL, '东莞宝建高分子材料有限公司', 2, 670, '裕元工业区裕元二路（宝建）', '陶先生', 'taowuchun@twemc.com.tw', NULL, NULL, '东莞宝建高分子材料有限公司，创建于1998年（前身为“东莞宝建鞋材有限公司”）。公司位于东莞市黄江镇裕元工业区内，占地面积6万多平方米，建筑总面积4万余平方米，年产能达4万余吨，是一家专业从事PU鞋材应用之聚氨酯弹性体产品研发、生产及推广的企业。经过10余年的不断拼搏，已拥有注册资本1600万美元。\r\n本公司在以核心技服为基础，不断研究创新，逐渐延伸PU相关产品，增设了PU树脂、热可塑性聚氨酯胶粒及聚酯多元醇等产品生产，以持续不断的提供和满足鞋材、合成皮、真皮、纺织、接着、涂料、油墨等需求。秉持“两个中心：以员工为中心，以客户为中心；三个价值观：崇尚品德、协同合作、积极创新”---宝建中心思想的经营理念，凭借专业的技术力量、一流的生产设备，良好的信誉和务实的管理团队，陆续获得ISO9001国际质量管理系统认证、安全生产许可证照、ISO14001环境管理体系认证、IATF16949汽车行业质量管理体系认证等，同时亦获得多家国际品牌客户信任及好评，为其认证之生产工厂，产品已销售国际市场多年。\r\n本公司将自始至终将本着“创新服务、永续经营”的宗旨，巩固和加强与现有合作伙伴的友好关系，发展新的海内外合作伙伴，同大家一道共同开创双赢的合作空间，互惠互利、共同成长。', '未公开', 50, NULL, NULL, NULL, NULL, 'https://www.pouchien.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (576, '2025-04-08 15:16:44.109814', '2025-04-08 15:16:44.109814', NULL, '东莞市琅菱机械有限公司', 2, NULL, '芦溪二路40号3栋101室', '陈小姐', '540959142@qq.com', NULL, NULL, '东莞市琅菱机械有限公司（以下简称“琅菱公司”），成立于2008年10月21日，位于东莞市寮步镇西溪围仔红棉南路8号，法定代表人宋克甫，主要从事纳米砂磨机、卧式砂磨机等专用机械设备的研发、设计、生产和销售。按照国务院《中国制造2025》规划，未来我国将逐步从制造大国走向制造强国，琅菱公司所属行业符合国家宏观调控政策及产业规划，且未来具有无限发展潜力。', '13650448278', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (577, '2025-04-08 15:16:44.382045', '2025-04-08 15:16:44.382045', NULL, '东莞深度互联网科技有限公司', 2, 671, '科技四路16号2栋718室', '莫彬', '未公开', NULL, NULL, '东莞深度互联网科技有限公司是一家2022年成立，总部位于松山湖科技园区内，是以计算机图形/图像技术为基础，虚拟现实和增强现实为应用方向的科技型创新企业。我们主要帮助客户对产品外观或场景进行数字化采集，并对采集数据在互联网和计算机内建立物理级别高仿真的虚拟世界，以此来为客户决策提供依据。我们自主研发光线追踪渲染引擎和实时网页渲染系统，有一整套基于3D的互联网产品定制解决方案。', '未公开', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (578, '2025-04-08 15:16:44.784987', '2025-04-08 15:16:44.784987', NULL, '广州百事可乐饮料有限公司', 2, 672, '敦和路57号', '许桂滨', 'xuguibin@masterkong.com.cn', NULL, NULL, '百事可乐是享誉全球的快消品企业，世界500强品牌，经营百事可乐、7喜、美年达、果缤纷、佳得乐、纯水乐、都乐、激浪等明星产品。\r\n公司于1981年在深圳设立了第一家灌装厂，在2012年与康师傅控股完成战略联盟。此战略联盟创造了中国领先的拥有约100家灌装厂的饮料生产网络，销售渠道遍及全国各地。', '未公开', 50, NULL, NULL, NULL, NULL, '', '440100', '440000', '440105', 0, NULL);
INSERT INTO `company` VALUES (579, '2025-04-08 15:16:45.234303', '2025-04-08 15:16:45.234303', NULL, '东莞市新佰人机器人科技有限责任公司', 2, 673, '乌沙社区乌沙兴发南路西五街40号1号楼201室', '李小姐', 'liyuting@nndrobot.com', NULL, NULL, '东莞市新佰人机器人科技有限公司是一家专业机器人研发的高新科技企业，拥有百余高精尖人才组成的研发团队，拥有20多项发明专利。公司的机器人广泛用于【五金机加工】【注塑成型】【电子产品制造】行业，包括：滚齿机、数控车床、CNC加工、冲压、注塑去水口、削毛刺、覆膜、锁螺丝、镭雕、检测等工位。\r\n新佰人机器人基于数字孪生及人工智能技术，建立了工业场景下的通用机器人产品。是国内唯一拥有机器人\"派遣工商业模式”发明专利的企业。\r\n新佰人机器人派遣工，旨在惠普中小企业0投入实现自动化产业升级，用实际行动推动制造工业4.0进程。', '15766749313', 50, NULL, NULL, NULL, NULL, '', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (580, '2025-04-08 15:16:45.831061', '2025-04-08 15:16:45.831061', NULL, '东莞市星火教育科技有限公司', 2, 674, '东城大道128号星火教育', '洪伟琦', 'hongweiqi@xiao100.com', NULL, NULL, '星火教育成立于2003年，经过19年的发展，目前已成长为中国领先的中小学教育辅导机构，多年深耕个性化教育、学习能力的开发和培养、家庭教育和前沿教育技术，已帮助越来越多的学生取得成功。\r\n目前星火教育已在全国16个省，34个城市，开设了超260个校区，员工人数超过8000人，并获得“全国十佳课外辅导机构”、“中国最具综合实力教育集团”、“中国领军品牌课外教育机构”、“最具品牌价值教育机构”等荣誉。', '13433621596', 50, NULL, NULL, NULL, NULL, 'www.xiao100.com', '441900', '440000', NULL, 0, NULL);
INSERT INTO `company` VALUES (581, '2025-04-08 15:16:46.262895', '2025-06-24 16:45:08.275686', NULL, '内蒙古伊利实业集团股份有限公司液态奶事业部', 2, 757, '土默特左金山开发区金山大道1号', '谢彩莲', 'xiecai2005@126.com', NULL, '互联网', '伊利集团位居全球乳业五强，连续九年蝉联亚洲乳业第一，也是中国规模最大、产品品类最全的乳制品企业。最优的产品品质、领先的综合服务能力和全面的可持续发展能力，让伊利一直深受全球顶级盛会、赛事以及各级政府和社会各界的信赖与认可。从2008年北京奥运会到2019武汉军运会、2022年北京冬奥会，从2010年上海世博会到2016年杭州G20峰会，伊利作为唯一一家提供服务的乳制品企业频频亮相。同时伊利也是博鳌亚洲论坛、世界互联网大会等顶级峰会的合作伙伴。\r\n液态奶事业部是伊利集团下设规模最大的产品事业部，旗下拥有金典、安慕希、舒化、QQ星、味可滋、谷粒多、优酸乳等享誉海内外知名品牌，遍布全国30余家生产基地，为消费者提供优质乳制品。液态奶事业部产销量持续领跑乳品行业，开创了中国全新的“液态奶时代”。', '13509813855', 50, '私营', '呼和浩特市', '内蒙古自治区', '土默特左旗', '', '150100', '150000', '150121', 0, 788);
