INSERT INTO `post` VALUES (1127, '2025-04-08 15:20:11.097986', '2025-06-20 16:14:07.484346', NULL, '销售支持专员', 'Associate Sales Process Specialist 销售流程专员 （隶属于销售部门）\r\n\r\n作为一家专业的应用安全科学公司，UL Solutions (NYSE：ULS) 助力遍布 110 多个国家/地区的客户应对安全、安防和可持续性挑战，并将之转变为机遇。UL Solutions 提供测试、检验、认证(TIC)，以及软件产品和咨询服务，以支持客户的产品创新和业务增长。UL 标志传递信任，也反映了我们对推进安全使命的坚定承诺。我们助力客户创新、推出新产品和服务、适应全球市场和复杂的供应链，并以可持续和负责任的方式走向未来。我们的科学助力您提升优势。\r\n \r\nUL Solutions进入中国四十多年来，目前我们在中国设有12个分支机构以及位于苏州、广州、东莞、上海、深圳、常州和中山共8个大型实验室，服务于超过22,000家客户。\r\n\r\nULSolutions在中国更获得社会公众认可奖项，亚太区The BEST雇主，人力资源管理杰出奖，中国人才势能大奖 – 中国移动招聘势能奖，大苏州The BEST雇主 – The BEST办公环境雇主等等。\r\n\r\nWhat you’ll learn & achieve:  \r\n主要负责南中国区家电、制冷暖通及零部件业务的销售支持工作\r\n1. 通过电话或电子邮件咨询与客户互动，以解决咨询和销售流程相关问题；协调售前和售后行动，确保客户符合TIC认证需求和产品或服务采用时间表\r\n2. 在既定程序内自主工作，使用标准化方法开发和分享报价定价工具;\r\n3.客户跟进并协助将报价转化为订单。使用ERP将报价处理为订单                           \r\n4. 建立内部UL问题解决网络，并主动让内部人员参与预测问题，改进交付，并制定改善U客户的解决方案经验；\r\n5. 根据账户所有者的要求，跟踪账户历史记录并从内部来源提供数据，以及销售代表们可以更深入地了解客户和客户机会；\r\n\r\nWhat makes you a great fit:  \r\n1.本科学历，理工科背景可以优先；\r\n2. CET-4及以上水平，英文读写能力佳；精通MS Office（Word、PowerPoint、Excel、Outlook）和CRM软件\r\n3.开朗乐观，具有良好的沟通能力和团队合作精神，学习能力较强。\r\n4.未来有机会转为专业销售\r\n\r\n加入UL Solutions，您将获得：\r\n1.五天八小时工作制，享受国家规定的加班补贴；\r\n2.具有竞争力的薪酬福利体系：\r\n· 年底双薪，年度绩效奖金，年度调薪等；\r\n· 按国家规定缴纳五险一金，公司补充商业保险、年度体检、心理健康咨询、节假日福利、法定年假+公司补充年假及12天全薪病假、员工旅游或公司团建、部分城市提供员工班车等\r\n3.超长假期：法定年假+公司提供的补充带薪年假及12天全薪病假；\r\n4.团队氛围：扁平化的组织，人性化的管理，员工之间互助合作；\r\n5.成长平台：业内技术大咖，一对一导师，丰富的线上线下培训课程，国际化的工作环境，多元与包容的文化氛围。', '广东省', 5000, 7000, 1, '全职', NULL, 1, 390, 6, NULL, NULL, '广州市', '广东省', '黄埔区', 245, '440100', '440000', '440112', '送钱', 1, '酒店经理', 0);
INSERT INTO `post` VALUES (1128, '2025-04-08 15:20:11.930600', '2025-06-09 14:51:45.845804', NULL, '综合类：海外政府关系，人力，财务，法务，审计', '综合类：公共关系/人力资源/工商管理/财务/会计/税务/法务/审计/金融等相关专业\r\n政府关系维护：建立并维护与目标国家及地区政府部门、监管机构的良好关系，确保公司运营符合当地政策和法律法规。\r\n政策分析与解读：跟踪和分析国际市场相关政策、法规和监管环境的变化，向公司高层提供政策建议，确保业务合规。\r\n危机管理与公关：参与处理国际市场中的政府相关危机事件，协助制定应对策略并参与公关活动。\r\n政策倡导：通过参与行业协会和相关国际组织的活动，推动行业政策的有利发展，确保公司的国际业务具有竞争优势。\r\n跨部门沟通与协调：与公司内部的法务、市场、运营等部门保持密切合作，确保各部门在国际运营中的一致性。\r\n项目支持：支持公司全球扩展项目，协助进行政府项目投标、审核及合作谈判。\r\n合规与报告：确保各国际市场的运营合规性，协助准备和提交相关政府报告和文件。', '广东省', 10000, 16000, 20, '全职', NULL, 1, 391, 6, NULL, NULL, '深圳市', '广东省', '福田区', 17, '440300', '440000', '440304', '包吃住', 4, NULL, 0);
INSERT INTO `post` VALUES (1129, '2025-04-08 15:20:12.241580', '2025-06-09 14:52:09.835824', NULL, '产研类：产品经理，工业设计，电子技术，材料开发', '产研类：工业设计/物理学/化学/材料/结构/机械/电子/计算机/食品科学等理工科类专\r\n1. 机会识别：针对用户痛点，提出产品优化的方向；\r\n2. 产品规划：基于市场、竞争、用户的需求，产出具有竞争力的弹产品定义；\r\n3. 产品打磨：在上级/导师的帮助下，可以完整的实现目标要求的产品定义；\r\n4. 产品成果：经过带教，可以独立完成产品需求收集、产品定义、产品开发其中一项；\r\n5. 技术理解：理解技术常识，并应用于项目的执行与落地', '不直达哦', 10000, 16000, 20, '全职', NULL, 1, 391, 6, NULL, NULL, '深圳市', '广东省', '福田区', 46, '440300', '440000', '440304', '', 4, NULL, 0);
INSERT INTO `post` VALUES (1130, '2025-04-08 15:20:12.740867', '2025-04-08 15:20:12.740867', NULL, '营销类：海外MKT，海外销售、渠道销售', '营销类：市场营销/国际留易/经济学/统计学等营销类、商管类专业\r\n英语/俄语/西班牙语/德语/阿拉伯语等语言类专业\r\n1、负责销售中心订单履约管理及销售支持团队管理，做好销售区域后台支持工作；\r\n2、订单履约管理：完善订单履约相关管理办法，流程维护及优化，系统需求对接及落地，相关专项项目管理，负责订单到发货流程问题卡点闭环解决，并定期审视以上管理；\r\n3、销售中心PSI管理：定期关注和分析，协同供应链跟进交付计划和进度，评估库存和发货风险及提前预警，协同大区提高库存周转率，降低滞销库存；\r\n4、负责销售支持组织规划，绩效管理，为团队提供问题解决方案及决策，给予资源协同；\r\n5、日常组织运作管理，异常问题处理及宣导的跨部门对接口；', '', 10000, 16000, 20, '全职', NULL, 1, 391, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1131, '2025-04-08 15:20:13.020176', '2025-04-08 15:20:13.020176', NULL, '供应链类：采购，质量、计划订单，智能制造，仓储运营', '供应链类：供应链管理/物流管理/工程管理/机械/电子/可靠性等理工科类专业', '', 10000, 16000, 20, '全职', NULL, 1, 391, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1132, '2025-04-08 15:20:13.588958', '2025-04-08 15:20:13.588958', NULL, '储备渠道经理', '岗位职责：\r\n1、通过自主渠道或公司提供渠道开发客户，给予充分的自由发展空间；\r\n2、了解客户需求，给客户做资产配置建议，推荐公司的理财产品，包括公募和私募基金、定制产品等等（重点）；\r\n3、维护服务客户，实现老客户转介绍，引进新客户。\r\n\r\n任职资格：\r\n1、通过证券从业资格考试者优先（公司可提供考前培训及预约考试）\r\n2、本科及以上学历\r\n3、有强烈的成功期望，立志长期致力于金融证券行业\r\n4、能吃苦，能坚持并承受一定的工作压力\r\n\r\n酬金待遇：\r\n底薪＋绩效津贴＋社保补贴＋股票／期货／融资融券提成＋运营奖励＋基金／理财产品销售奖励＋月度／季度／年度竞赛奖励＋年终奖＋过节费等等', '', 5000, 10000, 10, '全职', NULL, 1, 392, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1133, '2025-04-08 15:20:14.183576', '2025-04-08 15:20:14.183576', NULL, '实习生', '1.随时了解客户及市场状态，进行市场信息收集和市场调研，及时掌握客户需求；\r\n2.根据上级领导的要求完成工作任务，包括不仅限于拓展新客户、维护老客户以及销售产品的跟进等。', '', 3000, 5000, 20, '全职', NULL, 1, 393, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1134, '2025-04-08 15:20:15.301594', '2025-04-08 15:20:15.301594', NULL, '律师助理', '岗位职责  \r\n1. 协助律师完成法律文书起草、审核及修订，包括合同、诉状、法律意见书等；  \r\n2. 参与案件材料整理、法律检索及案例研究，提供基础法律分析支持；  \r\n3. 跟进案件流程，协助完成立案、庭审准备及客户沟通协调工作；  \r\n4. 处理律所行政事务，包括文件归档、会议记录及日常事务性工作。  \r\n\r\n---\r\n\r\n任职要求  \r\n1. 法学专业本科及以上学历，基础知识扎实，熟悉民商法、诉讼法等领域优先；    \r\n2. 具备良好的文字表达能力、逻辑分析能力及学习能力；  \r\n3. 责任心强，工作细致，能适应团队协作与适度工作压力。  \r\n\r\n---\r\n\r\n福利待遇  \r\n- 薪资结构：固定月薪4000元+年终双薪+案件绩效奖金；  \r\n- 社会保障：五险一金全额缴纳；  \r\n- 职业发展：系统化法律实务培训、资深律师带教、晋升通道透明；  \r\n- 其他福利：带薪年假、节日福利、团建活动、弹性工作时间。  \r\n说明：  \r\n- 通过司法考试者入职后可申请实习律师资格，律所提供挂证支持及实务指导。  \r\n- 应届毕业生或有律所实习经验者优先考虑，优秀者可面议薪资。', '', 4500, 5500, 2, '全职', NULL, 1, 394, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1135, '2025-04-08 15:20:16.221366', '2025-04-08 15:20:16.221366', NULL, '储备干部', '轮岗实践:在销售、市场、运营、客服等岗位轮岗，掌握业务流程和技能。\r\n销售攻坚:参与销售，吃透产品，完成个人目标，推动店铺业绩增长市场调研:收集市场和竞品信息，分析客户需求，为策略制定提供依据\r\n团队协同:与各部门密切合作，参与会议，分享经验，助力团队进步。流程革新:找出流程问题，提出优化方案，探索新方法提升效率。\r\n客户服务:处理客户咨询、投诉，反馈问题，推动产品和服务改进。', '', 7000, 8000, 3, '全职', NULL, 1, 395, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1136, '2025-04-08 15:20:16.680533', '2025-04-08 15:20:16.680533', NULL, '门店收银', '岗位职责：\r\n1、熟悉各项开单销售流程，实时打单，日报表当天发给片区财务\r\n2、收款银行对应账户、营业款、账目准确性\r\n3、门店点数跟进，当天以拍照形式发给片区财务，固定资产管理（下架样机及时退仓，多余样机收回盒子归纳）\r\n4、门店每月政策，商品库存盘点准确性，赠品管理\r\n5、财务制度及时性，月结表，每日报表及时上交，费用审核\r\n6、移动业务专业知识精通（如、资费标准，业务要求办理流程）\r\n7、门店 服务配合度、卫生、仪容仪表\r\n8、熟悉财务制度，按照财务制度做好每项制度监管，每月向收银主管，以月度汇总报表反馈一次', '', 4500, 5500, 1, '全职', NULL, 1, 395, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1137, '2025-04-08 15:20:17.436630', '2025-04-08 15:20:17.436630', NULL, '体验顾问', '岗位职责：\r\n1、熟悉产品价格及性能、接待客户咨询、完成门店下达的销售目标；\r\n2、负责做好货品销售记录、盘点、账目核对等工作，按规定完成各项销售统计工作\r\n3、完成商品的来货验收、上架陈列摆放、补货、退货、防损等日常营业工作\r\n4、做好所负责区域的卫生清洁工作\r\n5、完成店长安排的其他工作', '', 5000, 9000, 5, '全职', NULL, 1, 395, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1138, '2025-04-08 15:20:17.787531', '2025-04-08 15:20:17.787531', NULL, '全屋智能业务员', '岗位职责\r\n1、负责合作渠道拓展，拓展不同来源的消费者，包括地产物业、装修公司、设计师资源、建材异业合作等渠道；\r\n2、负责渠道客情维护，定期维护好合作对象的良好关系；\r\n3、负责客户的服务对接，包括客户联络、来展厅体验邀约、确认客户需求、邀请方案洽谈、协同设计师和销售经理达成签单目标；\r\n4、负责上级领导下达的各项任务；', '', 6000, 8000, 3, '全职', NULL, 1, 395, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1139, '2025-04-08 15:20:18.501507', '2025-04-08 15:20:18.501507', NULL, '销售专员', '职位职责：\r\n1、学习并掌握产品知识 。\r\n2、拜访用户，寻找并发现潜在用户 。\r\n3、开拓市场，收集并反馈市场信息。\r\n4、完成销售任务，达到公司预期的销售目标。\r\n\r\n 招聘条件：\r\n1、具有抗压能力，适应外出拜访客户。\r\n2、具备敬业精神、团队合作精神、吃苦耐劳、学习能力强。\r\n3、具有市场的敏感性和洞察力，较强的沟通、供应商开发能力；', '', 5000, 8000, 6, '全职', NULL, 1, 396, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1140, '2025-04-08 15:20:19.718731', '2025-04-08 15:20:19.718731', NULL, '授薪律师', '1、国内外知名院校法学专业本科以上学历，通过国家法律执业资格考试优先； 2、有律师事务所、法院检察院等实习经验优先， 3、熟练使用办公软件，熟悉并擅长使用法律及案例检索工具； 4、学习能力强，具有业务研究和高效输出能力； 5、工作认真、责任性强、沟通协调能力强。', '', 5000, 15000, 10, '全职', NULL, 1, 397, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1141, '2025-04-08 15:20:20.694641', '2025-04-08 15:20:20.694641', NULL, '高中数学老师', '岗位职责：\r\n1、熟悉高考题型和考点，具有夯实的专业基础；\r\n2、在教学上用心、细心、有责任心，有一定的亲和力，能更好地为学生答疑解惑；\r\n3、与学生、家长良好沟通，快速把握其学习状况，因材施教，寓教于乐，帮助学生更好的快乐学习。', '', 8000, 15000, 2, '全职', NULL, 1, 398, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1142, '2025-04-08 15:20:20.961515', '2025-04-08 15:20:20.961515', NULL, '高中物理教师', '岗位职责：\r\n1、熟悉高考题型和考点，具有夯实的专业基础；\r\n2、在教学上用心、细心、有责任心，有一定的亲和力，能更好地为学生答疑解惑；\r\n3、与学生、家长良好沟通，快速把握其学习状况，因材施教，寓教于乐，帮助学生更好的快乐学习。', '', 8000, 15000, 2, '全职', NULL, 1, 398, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1143, '2025-04-08 15:20:21.317063', '2025-04-08 15:20:21.317063', NULL, '初中数学教师', '岗位职责：\r\n1、熟悉中考题型和考点，具有夯实的专业基础；\r\n2、在教学上用心、细心、有责任心，有一定的亲和力，能更好地为学生答疑解惑；\r\n3、与学生、家长良好沟通，快速把握其学习状况，因材施教，寓教于乐，帮助学生更好的快乐学习。', '', 5000, 12000, 2, '全职', NULL, 1, 398, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1144, '2025-04-08 15:20:22.036170', '2025-04-08 15:20:22.036170', NULL, '初中物理教师', '岗位职责：\r\n1、熟悉中考题型和考点，具有夯实的专业基础；\r\n2、在教学上用心、细心、有责任心，有一定的亲和力，能更好地为学生答疑解惑；\r\n3、与学生、家长良好沟通，快速把握其学习状况，因材施教，寓教于乐，帮助学生更好的快乐学习。', '', 5000, 12000, 2, '全职', NULL, 1, 398, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1145, '2025-04-08 15:20:22.935843', '2025-04-08 15:20:22.935843', NULL, '阿里客户经理', '【岗位职责】：\r\n1、通过公司公海的资源进行电话、上门、陌拜和邀请参加会议等方式，联系有意向的外贸企业，邀请其入驻到阿里巴巴国际站并提供配套服务；\r\n2、分析行业市场数据，为客户提供整套跨境贸易电商解决方案；\r\n3、针对客户需求，组织客户进行培训和交流，成就客户外贸事业；\r\n\r\n【任职要求】：\r\n1、大专以上学历，有销售经验优先考虑；\r\n2、沟通能力强，有意向从事销售行业的应届毕业生；\r\n3、热爱销售，要性十足，善于沟通，目标感强；\r\n4、性格乐观开朗，极度渴望成功，愿付非凡代价；\r\n\r\n【职位优势】：\r\n1.接触的客户群为社会精英阶层﹣-﹣企业老板！\r\n2.接受的是世界上先进的互联网理念！\r\n3.无限的成长空间及学习机会！\r\n4.享受高薪﹣-﹣早日实现购车购房梦想！\r\n\r\n【薪酬待遇】\r\n1、成长迅猛﹣﹣所有岗位以竞聘制，每三个月会有一次转正晋升的机会，加薪很简单；\r\n2、文化开放﹣﹣鼓励内部创业，由公司提供项目、资金、场地、人员；\r\n3、白领办公﹣﹣提供私人办公设备，每人独立办公卡座，白领化办公环境；\r\n4、待遇优厚﹣﹣无责任底薪＋千元绩效＋高额业绩提成＋月度季度奖金＋年终奖＋季度豪华旅游＋每周福利\r\n5、奖励丰厚﹣﹣每周奖金福利，每周发放，每月奖金＊*＊不封顶；\r\n6.．薪资架构：平均月薪过万，只要你努力，年薪30万不是梦。\r\n\r\n【工作时间】\r\n8:30-12:00 14:00-18:00双休7.5H！国家法定节假日统统放假\r\n\r\n【你能得到什么】：\r\n1. 公平：同等的平台、同等的环境、同等的机会，不一样的是你自己的努力；\r\n2. 公正：我们会用心去爱每一名同事，因为我们都是年轻人，有的都是共同的语言；\r\n3. 公开：晋升表彰公开透明，业绩，人品，二者缺一不可；', '', 5000, 10000, 5, '全职', NULL, 1, 399, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1146, '2025-04-08 15:20:24.177055', '2025-04-08 15:20:24.177055', NULL, '律师助理', '1、通过法律职业资格考试优先，热爱并有志于长期投身律师职业;\r\n2、具备较强的法学理论知识，对待工作认真负责，细致踏实，逻辑思维能力强具备优秀的学习能力与团队协作能力，抗压能力强;\r\n3、具有良好的沟通能力、及较强法律文书写作能力(提供写作过的文章、法律文书、公众号推文或研究报告等优先):\r\n4、具有法院或者知名律所在校实习经验者优先:', '', 5000, 5500, 2, '全职', NULL, 1, 400, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1147, '2025-04-08 15:20:24.854531', '2025-04-08 15:20:24.854531', NULL, '实习生', '1.法学在校生、应届毕业生;\r\n2.具备良好的法律检索能力及文书写作能力;\r\n3.责任心强，积极主动，勤于思考、总结与分享。', '', 2000, 3000, 2, '全职', NULL, 1, 400, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1148, '2025-04-08 15:20:25.809986', '2025-04-08 15:20:25.809986', NULL, '管培生（理赔方向）', '岗位职责：\r\n1、负责理赔运营相关工作，处理车险、非车险、人伤等相关理赔案件；\r\n2、负责理赔案件的现场查勘、定损和单证收集工作；\r\n3、指引客户后续索赔流程，妥善解答和受理客户咨询与投诉。\r\n任职资格：\r\n1、本科及以上学历应届毕业生:\r\n2、汽车、工程、机械、医学、法律等相关专业优先;\r\n3、具备C1或以上驾照，能熟练使用办公自动化设备及常用办公软件;\r\n4、具有一定的团队合作精神，工作责任心强，具有良好的语言表达能力和较强的沟通协调能力。', '', 6000, 10000, 15, '全职', NULL, 1, 401, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1149, '2025-04-08 15:20:26.121264', '2025-04-08 15:20:26.121264', NULL, '管培生（营销方向）', '岗位职责：\r\n1、依托公司资源对公司产品进行宣传、介绍、销售；\r\n2、市场信息、客户信息建议的收集、反馈；\r\n3、产品方案的宣导、推动、跟踪、兑现；\r\n4、销售业绩的进度管理、状况分析；业务推进跟踪，业务统计与报表编制，业务达成率分析、反馈。\r\n任职资格:\r\n1、本科及以上学历应届毕业生;\r\n2、专业不限;\r\n3、具有一定的团队合作精神，具有良好的语言表达能力和较强的沟通协调能力。', '', 6000, 10000, 15, '全职', NULL, 1, 401, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1150, '2025-04-08 15:20:26.841314', '2025-04-08 15:20:26.841314', NULL, '外贸专员', '任职要求：\r\n1）、男女不限，大专及以上学历，国际贸易、商务英语，通讯工程等相关专业毕业，英语CET四级或以上，能与国外客户邮件沟通及往来。\r\n2）、有1-3年或以上外贸相关工作经验，能独立开发客户能力。可接受优秀应届毕业生。\r\n3）、能吃苦耐劳，诚信踏实，精诚团结，好学上进，责任心强，具备良好的综合素质，较强的学习能力和执行能力；', '', 4000, 6000, 2, '全职', NULL, 1, 402, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1151, '2025-04-08 15:20:27.280935', '2025-04-08 15:20:27.280935', NULL, '结构工程师', '职位要求：\r\n1、机械电子工程、机械设计及自动化等相关专业，大专及以上学历，应届毕业生；\r\n2、熟悉三维设计软件ProE，SolidWorks、UG中的至少一种，精通2d标注标准及公差分析；\r\n3、精通塑胶，钣金的结构设计，熟悉表面处理工艺；\r\n4、精通机加工工艺，有数控编程经验者佳；\r\n5、熟悉塑胶模具，铝挤出模具，钣金加工等；\r\n6、具有产品设计经验，有通信射频产品设计经验者佳。具备整机机构独立设计能力。', '', 4500, 7000, 2, '全职', NULL, 1, 402, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1152, '2025-04-08 15:20:27.970242', '2025-04-08 15:20:27.970242', NULL, '设备/设计储干', '任职要求：\r\n1.能用普通话很好的交流沟通。 \r\n2.学习模具,或机电一体化专业。                                                            \r\n3.有从事过五金冲压生产，模具加工等相关工作经验者，优先考虑。                                        \r\n4.会机械制图，PPT,懂得机械原理，机械模具专业。                                                           \r\n5.服从管理，能吃苦耐劳，心态好，主动好学，并有责任心。\r\n6.有很强的执行力，能够很快的适应工作环境，融入团队。\r\n\r\n岗位职责：\r\n1.学习冲压生产作业流程及模具维修基础知识技能；学习IC产品测量基础知识，自己独立会测量。                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               2.新产品开发相关工作及APQP流程资料建立，在产产品及模具工艺改善。                                                             3.新项目主导及跟踪，总结报告并输出参数，标准，文件。                                                                                                                                                                  4.制定工艺标准，系统BOM资料；对作业员进行操作技能的培训和指导。                                        \r\n5.服从安排管理，有良好的的执行力；完成领导交代的任务。                                                                                                                                                                                                                                                                                                                6.完成领导交代的任务。                                                                                                                                                                                7.试用期3个月，学习生产实践。考核合格后，转为正式岗位。定岗位范围:冲压工技术员-初/中/高级（晋升方向工程师，工程主管）。', '', 6500, 8000, 10, '全职', NULL, 1, 403, 6, NULL, NULL, NULL, NULL, NULL, 0, '440700', '440000', '440704', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1153, '2025-04-08 15:20:28.199080', '2025-04-08 15:20:28.199080', NULL, '人事储干', '任职要求：\r\n1、具备较强亲和力、沟通能力，热爱招聘工作；\r\n2、有较强的抗压能力和执行力，工作积极主动、有责任心；\r\n3、能接受单休工作制。\r\n\r\n岗位职责：\r\n1、负责公司一线员工、职员类、技术类岗位的招聘、甄选、面试、录用工作；\r\n2、能够及时有效的跟用人部门沟通、反馈招聘进度；\r\n3、协助开展校招工作。\r\n4、工作地区：江门', '', 6300, 7500, 2, '全职', NULL, 1, 403, 6, NULL, NULL, NULL, NULL, NULL, 0, '440700', '440000', '440704', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1154, '2025-04-08 15:20:28.337542', '2025-04-08 15:20:28.337542', NULL, '制程储干', '任职要求：\r\n1、化工、化学类专业；\r\n2、具备较强的耐心之上的进取心；\r\n3、责任心强，有执行力。\r\n\r\n岗位职责：\r\n1、负责补水、加药，领取辅料化剂；\r\n2、协助跟进产线，解决制程问题，维护产线制程稳定；\r\n3、协助产品异常问题解决；\r\n4、协助新产品打样跟进。\r\n5、工作地区：江门', '', 7000, 9000, 20, '全职', NULL, 1, 403, 6, NULL, NULL, NULL, NULL, NULL, 0, '440700', '440000', '440704', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1155, '2025-04-08 15:20:28.614000', '2025-04-08 15:20:28.614000', NULL, '化验分析储干', '任职要求：\r\n1.无机化学、有机化学、分析化学、仪器分析理论基础扎实；\r\n2.懂滴定分析、UV、ICP、滴重计操作；\r\n3.Word、PPT、Excel使用熟练。\r\n\r\n岗位职责：\r\n1.化验室日常取样、分析工作；\r\n2.标准文件编写；\r\n3.参与体系审核。\r\n4.工作地区：江门', '', 6500, 8000, 6, '全职', NULL, 1, 403, 6, NULL, NULL, NULL, NULL, NULL, 0, '440700', '440000', '440704', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1156, '2025-04-08 15:20:28.841868', '2025-04-08 15:20:28.841868', NULL, '业务跟单储干', '任职要求:\r\n1.本科及以上学历，英语专业，英语听说读写能力较强；\r\n2.熟悉跟单流程；\r\n3.具备较强的抗压能力、持续学习能力；\r\n4.性格开朗，善于表达，沟通协作能力强。\r\n\r\n岗位职责：\r\n1.负责跟进客户项目；\r\n2.负责跟进客户报价、出货、对账、ERP系统操作等跟单工作。', '', 6300, 7500, 6, '全职', NULL, 1, 403, 6, NULL, NULL, NULL, NULL, NULL, 0, '440700', '440000', '440704', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1157, '2025-04-08 15:20:28.988744', '2025-04-08 15:20:28.988744', NULL, '财务储干', '任职要求:\r\n1、本科及以上学历;\r\n2、熟练使用ERP软件、灵活应用EXCEL必备的\r\n常用函数;\r\n3、积极进取，具备良好团队合作精神;\r\n4、具备良好的学习持续能力。\r\n\r\n岗位职责:\r\n1、负责日常系统凭证的录入和付款制单\r\n2、学习事业部经营报表制作及小单位成本的跟进\r\n3、合同管理登记\r\n4、资产管理登记\r\n5、完成领导交待的其他事项。', '', 6300, 7500, 2, '全职', NULL, 1, 403, 6, NULL, NULL, NULL, NULL, NULL, 0, '440700', '440000', '440704', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1158, '2025-04-08 15:20:29.675970', '2025-04-08 15:20:29.676996', NULL, '小学数学教师', '1、国内外知名高校应届毕业生，本科及以上学历，具有研究生学历者优先考虑；\r\n2、教师类岗位需具备所申岗位的教师资格证；\r\n3、 普通话标准，仪表仪态端庄，有亲和力；\r\n4、 具有较强的学习能力、沟通表达能力，工作积极主动，抗压能力强。', '', 12000, 14000, 2, '全职', NULL, 1, 404, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1159, '2025-04-08 15:20:29.894900', '2025-04-08 15:20:29.894900', NULL, '小学语文教师', '1、国内外知名高校应届毕业生，本科及以上学历，具有研究生学历者优先考虑；\r\n2、教师类岗位需具备所申岗位的教师资格证；\r\n3、普通话标准，仪表仪态端庄，有亲和力；\r\n4、具有较强的学习能力、沟通表达能力，工作积极主动，抗压能力强。', '', 12000, 14000, 3, '全职', NULL, 1, 404, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1160, '2025-04-08 15:20:30.165073', '2025-04-08 15:20:30.165073', NULL, '小学实习科学教师', '一、应聘条件\r\n1、大学在读生或应届毕业生，本科或以上学历，专业对口，具有对应学科教师资格者优先考虑；\r\n2、普通话标准，仪表仪态端庄，有亲和力；\r\n3、身体健康，抗压能力强，热爱学习，具有奉献精神和团队协作意识。\r\n\r\n二、实习待遇\r\n1、实习津贴1000-2000元/月；\r\n2、提供工作日一日三餐，提供教师公寓；\r\n3、实习时间为2025年春季学期，秋季学期有机会转为正式教师。', '', 1000, 2000, 3, '全职', NULL, 1, 404, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1161, '2025-04-08 15:20:30.833854', '2025-04-08 15:20:30.833854', NULL, '电子技术员', '1、协助PE工程师跟进新产品的开发试产及上线指导等工作；\r\n2、对生产提供工艺技术指导，并对生产工艺持续改善；\r\n3、能够针对生产异常进行初步分析与验证，对工艺人为不良进行识别与控制；\r\n4、负责产线的功能坏机分析维修工作。', '', 6000, 8000, 5, '全职', NULL, 1, 405, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1162, '2025-04-08 15:20:31.466419', '2025-04-08 15:20:31.466419', NULL, '生产组长', '岗位职责：\r\n1、组织班组资源，保质保量完成计划工单任务；\r\n2、处理制程异常，不良品分析修复，降低作业不良品，提高产品直通率；\r\n3、员工培训与指导，提高综合素质和工作能力，使其技能能达到生产要求；\r\n4、严格执行有关规定及指导文件，准确填写生产相关报表，及时反馈生产情况；\r\n5、监控和盘查生产物料动向，防止物料流失，控制生产损耗，有效降低生产成本；\r\n6、负责班组安全意识宣导，反馈安全隐患，确保生产安全；\r\n7、管理拉线上的设备仪器，确保设备安全；\r\n8、员工关系管理，促进提升团队意识。', '', 6000, 8000, 10, '全职', NULL, 1, 405, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1163, '2025-04-08 15:20:32.296805', '2025-04-08 15:20:32.296805', NULL, '项目助理', '工作职责：\r\n1、负责项目进度的跟踪与监控，定期收集各环节的进展信息，制作直观清晰的进度报表，及时向项目经理反馈项目执行中的问题与风险，保障项目按计划推进；\r\n2、协调项目团队内部的沟通工作，组织安排各类项目会议，提前准备会议资料、通知参会人员，会议期间准确记录讨论要点及待办事项，并在会后跟进落实情况，促进团队协作顺畅；\r\n3、辅助项目经理进行资源调配与管理，包括人力、物力及预算等方面，了解资源使用状况，协助制定合理的资源分配计划，避免资源浪费或短缺，确保项目资源的高效利用；\r\n4、对接外部合作伙伴与客户，及时传递项目相关信息，解答一般性咨询问题，维护良好的合作关系，助力项目顺利开展。\r\n岗位要求：\r\n1、本科及以上学历，项目管理、工商管理、工程管理、人力资源管理、信息技术等相关专业优先；\r\n2、熟悉所在行业（如IT、工程、制造、咨询等）的项目运作模式，具备相关行业知识者优先；\r\n3、具备优秀的沟通能力，能够高效协调团队内部及外部合作伙伴的工作；\r\n4、能够组织并主持项目会议，准确记录会议要点并跟进落实；\r\n5、对工作认真负责，能够主动发现问题并推动解决。', '', 6000, 8000, 5, '全职', NULL, 1, 405, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1164, '2025-04-08 15:20:32.868476', '2025-04-08 15:20:32.868476', NULL, '物业管理实习生', '接受25届实习生（提供转正机会）\r\n\r\n工作职责：\r\n1、负责建立并管理客户档案，做好资料收集、归档、管理工作；定期走访、回访租户；\r\n2、负责区域内的通告、文件的发送；\r\n3、受理业主保修、投诉、建议及意见等，跟进协调各部门处理；\r\n4、做好分管区域内物管费及其他费用收缴工作；\r\n5、巡视公共区域，做好管理区域内物业管理服务的相关事项；\r\n6、负责监督、检查各项工程维修保养、清洁绿化状况、环境保护状况、公共设施设备的日常管理状况，办理装修进场手续并予以登记、统计、核对和报告。\r\n\r\n任职资格：\r\n1、身高160cm以上，形象大方端庄，具有良好客户服务意识；\r\n2、懂得与不同人打交道，沟通能力强；\r\n接受25、26届在校生过来实习，拿到毕业证提供转正机会。\r\n工作地点：东莞南城、东莞松山湖、东莞企石镇、东莞清溪\r\n\r\n薪酬福利：\r\n加班享有加班费；\r\n防暑降温费750元/年；\r\n正式员工节日补助2200元/年；\r\n享有技能/职称津贴、生日礼金等；\r\n购买五险一金，同时购买商业保险；\r\n有薪假期（年假、年资假、病假、婚假、产假、陪产假、哺乳假、丧假等）；\r\n提供住宿，提供餐补，提供免费工服，年度免费体检以及体质检测。', '', 2200, 2900, 5, '全职', NULL, 1, 406, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1165, '2025-04-08 15:20:33.662063', '2025-04-08 15:20:33.662063', NULL, '华润物业工程管理岗', '岗位职责：\r\n1. 负责工程部门工作开展，作为工程管理人员进行培养；\r\n2. 参与一线岗位顶岗实操或跟岗学习，熟练掌握各基础岗位工作流程；\r\n3. 参与项目各项机电设备、智能设备进行管理，包括巡检、维保、安装、维修等；\r\n4. 负责或参与项目施工、安装等专业图纸修改与审核。\r\n\r\n岗位要求：\r\n1. 学历及专业：本科及以上学历，给排水、土木工程、工程管理、电气、智能楼宇、消防等相关专业优先；\r\n2. 知识与技能：在工程管理各版块具有良好的知识储备，熟悉工程管理工作标准与流程，持相关专业证书优先；具有较强分析与解决问题的能力；\r\n3.  性格与特长：吃苦耐劳，具有专业知识的研究精神，有上进心；抗压能力强，工作细致严谨，具有高度的工作热情、敬业精神；服从背包文化，接受出差/外派;\r\n4.  办公技能：熟练掌握CAD、WORD、EXCEL、POWERPOINT等软件。\r\n5.需要证件：低压电工操作证\r\n工作地点：\r\n东莞、惠州惠阳区', '', 2200, 2900, 5, '全职', NULL, 1, 406, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1166, '2025-04-08 15:20:33.868115', '2025-04-08 15:20:33.868115', NULL, '物业环境管理实习生', '工作内容：\r\n1、负责住宅小区的保洁管理及绿化养护计划，并监督实施；\r\n2、负责按照合同约定监督外委单位（绿化、保洁、消杀、垃圾清运）的履约情况，并做好日常保洁费用结算工作；\r\n3、负责按规定对管理区域的环境进行巡查，发现问题及时处理；\r\n4、负责绿化保洁人员的培训、日常工作安排及管理等工作；\r\n5、负责处理环境绿化方面的投诉,拜访业户以听取意见并及时改进。\r\n6、负责每月检查工具、材料的消耗及库存情况，若发现短缺，应及时提出购买申请。\r\n\r\n任职要求：\r\n1、本科及以上学历，园艺/l绿化/环境类专业优先考虑；\r\n2、熟练操作OFFICE等办公软件，掌握保洁、绿化等专业知识；\r\n3、责任心强，善于沟通，具有协调解决问题的能力和抗压力。\r\n可接受25、26届实习生，拿到毕业证提供转正机会。\r\n\r\n晋升路线：环境专员-部门领班-部门主管-项目主管-项目副经理-项目经理（一年2次内部竞聘机会）', '', 2200, 2900, 3, '全职', NULL, 1, 406, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1167, '2025-04-08 15:20:34.828505', '2025-04-08 15:20:34.828505', NULL, '财务管培生', '工作职责：\r\n- 协助财务经理进行日常的财务管理工作，例如记录日记账、准确分类日记账、录入数据等。\r\n- 负责生成财务报表，包括资产负债表、利润表和现金流量表等。\r\n- 协助财务经理进行预算编制和监控，以及费用报销的审核。\r\n- 参与公司的财务项目，例如资产负债表的调整和财务审计等。\r\n- 根据财务经理的要求，进行数据分析，并提供相关报告和建议。\r\n\r\n任职要求：\r\n- 大学本科及以上学历，财务、会计、经济学等相关专业。\r\n- 具备良好的财务分析和报告撰写能力。\r\n- 熟练掌握财务软件，例如金蝶、用友等。\r\n- 具备较强的沟通能力和团队合作意识，能够与不同部门和人员保持良好的沟通和合作。\r\n- 对财务管理有强烈的兴趣，有志于在财务管理领域发展。', '', 4500, 6000, 1, '全职', NULL, 1, 407, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1168, '2025-04-08 15:20:35.276148', '2025-04-08 15:20:35.276148', NULL, '销售管培生', '工作职责：\r\n1.建立、维护、扩大终端销售网点，维护和开发新客户，拜访目标客户，与客户建立并发展长期、稳定、融洽的合作关系；\r\n2.巡查商场产品陈列，做好新品上市/节假日/特价活动等节点的促销推广及管理；\r\n3.掌握产品资料、市场动态及竞争产品信息，\r\n4.负责管辖区域市场各级客户的服务、客情维护。\r\n\r\n任职要求：\r\n1.市场营销专业优先；\r\n2.具备较强的沟通协调力、团队管理能力、计划执行力，抗压能力强\r\n\r\n负责区域在广州/深圳/东莞/粤东等地区', '', 4500, 6500, 5, '全职', NULL, 1, 407, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1169, '2025-04-08 15:20:35.505227', '2025-04-08 15:20:35.505737', NULL, '市场部管培生', '工作职责：\r\n1.负责部门文档的建设与管理，为市场部的同事提供行政上的服务和支持；\r\n2.协助市场经理或品牌经理策划与设计市场方案，协助进行市场调研的工作；派发新品的试用小样，收集使用反馈表；\r\n3.收集竞品信息，并提交分析报告，为部门业务人员、领导决策提供参考；利用SAP系统建立条码的BOM，维护SAP系统数据；\r\n4.负责本部门与其他部门的协调工作，如通知、通告以及其他文件的传达。\r\n\r\n任职要求：\r\n1.市场营销、英语等相关专业；\r\n2.熟练使用办公软件，良好的英语听说读写能力；\r\n3.具备较强的沟通能力和团队协作能力，积极主动，开朗乐观。', '', 4500, 6500, 2, '全职', NULL, 1, 407, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440118', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1170, '2025-04-08 15:20:35.926753', '2025-04-08 15:20:35.926753', NULL, '市场部管培生', '工作职责：\r\n1.负责部门文档的建设与管理，为市场部的同事提供行政上的服务和支持；\r\n2.协助市场经理或品牌经理策划与设计市场方案，协助进行市场调研的工作；派发新品的试用小样，收集使用反馈表；\r\n3.收集竞品信息，并提交分析报告，为部门业务人员、领导决策提供参考；利用SAP系统建立条码的BOM，维护SAP系统数据；\r\n4.负责本部门与其他部门的协调工作，如通知、通告以及其他文件的传达。\r\n\r\n任职要求：\r\n1.市场营销、英语等相关专业；\r\n2.熟练使用办公软件，良好的英语听说读写能力；\r\n3.具备较强的沟通能力和团队协作能力，积极主动，开朗乐观。', '', 4500, 6500, 2, '全职', NULL, 1, 407, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1171, '2025-04-08 15:20:36.883139', '2025-04-08 15:20:36.883139', NULL, '财务管培生', '工作内容：\r\n先安排在生产、资材、工程、采购、销售等各部门轮流实习，熟悉工艺流程、BOM图纸、系统单据交易、供应商核价、客户报价、费用损益核算等模块，后在出纳、应付、应收、工资核算、成本损益核算等各岗位轮流实习，待熟练相关财报运作后，可安排轮岗实操，复核项目部提交财报。\r\n\r\n岗位要求：\r\n1、本科及以上学历，财务相关专业；\r\n2、具有一定的会计理论专业知识，具有初级及以上会计职称；\r\n3、熟练使用各种财务工具和办公软件；\r\n4、有较强的责任心、良好的职业操守、对数字敏感、工作认真细心；\r\n5、作为管培生，需接受安排异地工作调动。', '', 5000, 5000, 6, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1172, '2025-04-08 15:20:37.262584', '2025-04-08 15:20:37.262584', NULL, '文秘管培生', '工作内容：\r\n1、负责部门资料（财务类）的初步审核、资料的收集、处理、分发等工作；\r\n2、负责部门领导的工作指示、会议精神的传达；\r\n3、负责部门文员工作；\r\n4、二年后转财务岗或其它有意向的管理岗位。\r\n\r\n工作要求：\r\n全日制本科财务专业学历，具备初级会计证、会讲粤语者优先', '', 5000, 5000, 6, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1173, '2025-04-08 15:20:37.483141', '2025-04-08 15:20:37.483141', NULL, '生产管理管培生', '岗位职责：\r\n1、在上级领导下，努力完成车间各项生产任务与目标值；\r\n2、全面落实物控下达的各项生产任务，确保交期完成；\r\n3、全面负责主管部门日常事务，主管本部门人员考勤，绩效考评；\r\n4、全面负责主管车间生产进度，做好上下工序协调配合工作，以保证均衡生产；\r\n5、努力提高机器和人员利用率，全面降低制造成本；\r\n6、负责本部门人员培训，督导部门人员按相关作业指导书作业；\r\n7、负责本部门“7S”活动的推行工作，根据设备“三级保养”制度督导机长，机组人员做好设备保养，并加强检查；\r\n8、全面控制本部门的产品品质，加强生产过程中品质控制；\r\n9、对本部门员工工资监督审查并提报生产部长；\r\n10、负责本部门技术改善与工艺改良，提高技术生产能力与制造能力；\r\n11、负责主持本部门的各级例行会议，并参加公司召开的各项相关会议\r\n12、负责本部门程序文件的制定,对本部门程序化、标准化作业推行的全过程负责；\r\n13、其它由上级安排的工作。\r\n\r\n任职资格：\r\n1、本科及以上学历；\r\n2、有意向在生产车间管理岗位深耕；\r\n3、有较强的组织、领导能力及统筹协调能力；\r\n4、认真负责的工作态度及强烈的责任感。', '', 5000, 5500, 10, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1174, '2025-04-08 15:20:37.684499', '2025-04-08 15:20:37.684499', NULL, '人资行政管培生', '1、部门会议记录的整理；\r\n2、每月考勤、异动、与工资结算相关资料的制作；\r\n3、每月各部门绩效考核汇总；\r\n4、负责所属项目具体招聘工作，办理员工入职、异动、离职的相关手续；\r\n5、人事档案的管理；\r\n6、负责社会保险账户，办理社会保险相关事宜(例：增减保险、生育津贴、工伤津贴的申请)；\r\n7、《劳动合同》的签订工作等。', '', 5000, 5000, 10, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1175, '2025-04-08 15:20:38.057577', '2025-04-08 15:20:38.057577', NULL, '采购管培生', '1、包装材料开发议价；\r\n2、采购订单分配维护； \r\n3、应付货款对账；\r\n4、交付异常沟通。', '', 5000, 5500, 6, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1176, '2025-04-08 15:20:38.296383', '2025-04-08 15:20:38.296383', NULL, '业务管培生', '1、跟进客户相关工作，包括客户图纸处理、打样、送样、交期、品质异常等。\r\n2、本公司是实体产品销售，面对的对象是知名的大企业。前期主要负责业务跟单，包括产品的交货、物流这块的跟进，熟悉公司的产品属性和公司各部门的运作模式，做到对公司的产品和结构模式熟记于心；\r\n3、后期负责对新客户的开发、谈判以及业务合作这块，部门间制定各自的销售计划，完成既定目标。', '', 5000, 6000, 10, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1177, '2025-04-08 15:20:38.631866', '2025-04-08 15:20:38.631866', NULL, '包装工程管培生', '1、制样前期的结构材料工艺的可行性评审及优化；\r\n2、制样图纸的处理；\r\n3、制样、BOM的制作进度跟踪与检验；\r\n4、完成上级临时安排的工作。', '', 5000, 5500, 10, '全职', NULL, 1, 408, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1178, '2025-04-08 15:20:39.237381', '2025-04-08 15:20:39.237381', NULL, '项目投标员', '1、负责招投标信息的收集，投标文件的制作及标书中涉及到的相应工作；\r\n2、负责招投标信息的收集与整理，负责投标文件的制作、审核、装订、投递等工作；\r\n3、负责招采单位的考察接待，负责与项目负责人、公司相关部门积极协调招标文件制作过程中的问题，确保投标文件按时投递；', '', 4000, 5000, 3, '全职', NULL, 1, 409, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1179, '2025-04-08 15:20:39.709728', '2025-04-08 15:20:39.709728', NULL, '策划宣传', '1、公司各类活动策划、组织。公司内刊的策划、组稿、撰稿及编排。\r\n2、公司网站的更新维护，新媒体的撰写编排推送及宣传短视频的制作等。\r\n3、活动及新闻类相关图片、影像的拍摄、剪辑和存档。\r\n4、协助美编刻绘处理横幅及公司各种宣传文字。\r\n5、完成上级安排的临时工作。', '', 4000, 5000, 5, '全职', NULL, 1, 409, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1180, '2025-04-08 15:20:39.914190', '2025-04-08 15:20:39.914190', NULL, '财务会计', '1、申请票据，购买发票，准备和报送会计报表，协助办理税务报表的申报；\r\n2、现金及银行收付处理，制作记帐凭证，银行对帐，单据审核，开具与保管发票； \r\n3、协助财会文件的准备、归档和保管，固定资产和低值易耗品的登记和管理； \r\n4、负责与银行、税务等部门的对外联络； \r\n5、协助主管完成其他日常事务性工作。', '', 4000, 5000, 5, '全职', NULL, 1, 409, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1181, '2025-04-08 15:20:40.243342', '2025-04-08 15:20:40.243342', NULL, '项目管理员', '1、协助业务经理开发新项目、跟进旧项目的协调、沟通工作;\r\n2、已进行的项目跟进，与工地负责人沟通、到现场了解情况，协调、解决项目出现的任何问题。\r\n3、了解施工进度、申请进度款并及时向公司反馈情况。', '', 4000, 5000, 5, '全职', NULL, 1, 409, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1182, '2025-04-08 15:20:40.781189', '2025-04-08 15:20:40.781189', NULL, '资料技术员', '1、塔吊、施工升降机等建筑起重机械的安拆方案，附着方案编制，基础、附墙的受力计算以及其他各项受力计算；\r\n2、塔吊、施工升降机的安装、拆卸、维保等资料编制；\r\n3、与施工总承包单位对接沟通各项技术方案资料；\r\n4、会CAD制图和工程力学计算，有同类型工作经验或机电类职称优先考虑。', '', 4000, 5000, 5, '全职', NULL, 1, 409, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1183, '2025-04-08 15:20:41.073249', '2025-04-08 15:20:41.073249', NULL, '行政助理', '1、负责公司部分接待工作，协助行政副总处理日常事务；\r\n2、负责公司资产的统计管理，以及保险的落实情况；\r\n3、协调公司各部门之间的工作，做好工作安排；\r\n4、熟悉各部门工作，做好应对各种突发状况的准备；\r\n5、协助部门领导处理其他相关事务，完成领导交代的临时任务。', '', 4000, 5000, 5, '全职', NULL, 1, 409, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1184, '2025-04-08 15:20:42.044865', '2025-04-08 15:20:42.045378', NULL, '新媒体运营实习生', '岗位职责：\r\n1、负责小鹏汽车区域&门店新媒体平台运营、脚本策划、拍摄剪辑（抖音、小红书、视频号等）\r\n2、负责小鹏汽车区域品牌传播及规范维护：活动KV设计、品牌活动宣传视频剪辑等\r\n3、根据区域市场规划，协助推进区域营销活动落地执行，包括但不限于：门店开业、试乘试驾、外展车展、品牌异业、线上口碑曝光等活动\r\n\r\n任职要求：\r\n1、有抖音、小红书运营、直播经验优先;\r\n2、普通话标准，肢体语言丰富，有一定审美能力;性格外向活泼，形象好气质佳，大胆自信，镜头感强\r\n3、踏实认真，以结果为导向；思维敏捷，具有较强的语言表达能力和现场把控应变能力；\r\n4、能接受灵活工作时间，根据活动与直播需求调整出勤时间\r\n5、大专及以上学历，有驾照能独立开车上路可加分', '', 4000, 4500, 1, '全职', NULL, 1, 410, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1185, '2025-04-08 15:20:42.573313', '2025-04-08 15:20:42.573313', NULL, '市场实习生', '【仅招聘26届毕业生】\r\n岗位职责：\r\n1、区域性活动支持，如试驾会、媒体活动、新品上市等；与各门店沟通协调，统筹区域内门店活动；\r\n2、部门日常物资管理：如试驾车辆、市场活动物资等\r\n3、协调各区域活动项目管理，包括项目立项、执行与核销工作\r\n4、利用数据分析市场活动表现，复盘并优化区域市场业务效能\r\n岗位要求： \r\n1.至少实习6个月以上，每周不少于4天\r\n2.有驾照、会开车、吃苦耐劳\r\n3.有责任心、细心、负责，学习能力强，对于市场、营销比较感兴趣的同学\r\n4.会ps会剪辑、 能直播会拍视频，熟练使用日常办公软(Word/Excel/PPT)', '', 2500, 3000, 1, '全职', NULL, 1, 410, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1186, '2025-04-08 15:20:43.262964', '2025-04-08 15:20:43.262964', NULL, '运营助理', '对电商行业发展有清晰的认知及认可。良好的沟通能力，学习能力较强，可作为储备干部培养。此岗位后续可往运营或客服管理方向发展。', '', 5000, 7000, 3, '全职', NULL, 1, 411, 6, NULL, NULL, NULL, NULL, NULL, 5, '440300', '440000', '440309', NULL, 4, NULL, 0);
