INSERT INTO `post` VALUES (1190, '2025-04-08 15:20:44.088353', '2025-04-08 15:20:44.088353', NULL, '外贸业务员', '1、	英语四级以上，具备普通口语交流能力。\r\n2、	具备较强的学习能力，一定的营销技巧和较强的沟通能力。', '', 5000, 8000, 3, '全职', NULL, 1, 411, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1191, '2025-04-08 15:20:44.302969', '2025-04-08 15:20:44.302969', NULL, '销售工程师', '1、有团队合作意识和较强的执行能力，具有一定的应变能力和工作承受能力。\r\n2、热爱销售事业，勇于接受挑战，为人坦诚自信，有良好的沟通及表达能力。', '', 5000, 8000, 8, '全职', NULL, 1, 411, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1192, '2025-04-08 15:20:44.527201', '2025-04-08 15:20:44.527201', NULL, '嵌入式 Linux 软件开发工程师', '1、有科协、电子协会及电子大赛等经验及嵌入式软件开发实习经验优先录用；\r\n2、编程语言：C/C++，熟悉 linux 常用命令，熟悉相关网络通讯协议。', '', 8000, 15000, 5, '全职', NULL, 1, 411, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1193, '2025-04-08 15:20:45.132676', '2025-04-08 15:20:45.132676', NULL, '外贸业务员', '岗位职责：\r\n1. 熟悉了解公司产品，并能准确及时报价\r\n2. 依照部门分配的销售目标，制定销售计划，并完成销售目标\r\n3. 负责联系客户，编制报价，参与商务谈判，签订合同等\r\n4. 开发新市场，发展新客户，拓展产品销售范围\r\n5. 负责维护客户关系，建立长期合作关系\r\n6. 负责销售产品市场信息的搜集以及竞争对手的分析\r\n岗位要求：\r\n1. 本科及以上学历，英语类、国际贸易类、 商英类、语言类等相关专业或海外留学毕业生 \r\n 2. 具备流利的英语口语水平，能自由与客户全英文交流，有志于从事国际贸易行业', '', 5000, 8000, 10, '全职', NULL, 1, 412, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1194, '2025-04-08 15:20:45.782178', '2025-04-08 15:20:45.782178', NULL, '助理工程师', '岗位职责：\r\n1. 协助参与LED灯具的结构设计，完成新产品的开发设计、工程图纸、成本核算、资料输出等设计开发工作\r\n 2. 负责技术改进与技术文件资料管理和输出，如BOM，规格书等技术支持工作\r\n 3. 负责对项目进度跟进，确保进度计划有序朝着预定的时间内完成项目的设计工作\r\n 4. 负责对样品需求的跟进和制作\r\n 5. 协助并对接营销中心，为客户提供售前、售中、售后等支持其他上级安排的工作\r\n岗位要求：\r\n1. 熟练使用CAD、Pro-E等软件\r\n2. 大专及以上学历，机械、模具等相关专业', '', 5000, 8000, 6, '全职', NULL, 1, 412, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1195, '2025-04-08 15:20:46.598997', '2025-04-08 15:20:46.598997', NULL, '线下营销岗（销售、活动策划方向）', '1、热爱美妆行业，拥有实干精神，有大局观，对于工作内容和挑战持开放性心态，抗压能力强；\r\n2、逻辑性强，具有良好的营销思维、产品思维、沟通能力及组织协调能力；\r\n3、驻地广州，能接受出差（策划岗出差较少）。', '', 6000, 8000, 10, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1196, '2025-04-08 15:20:47.237248', '2025-04-08 15:20:47.237248', NULL, '产品岗（产品策划、包材开发、文案方向）', '1、熟悉国内化妆品类流行趋势、美妆护肤知识、产品开发流程；\r\n2、具备一定的审美能力、优秀的沟通协调能力，对消费者有敏锐洞察，热爱数据分析；\r\n3、具有天马行空的创意思维、有市场sense、极致关注消费者需求和体验。', '', 6000, 8000, 5, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1197, '2025-04-08 15:20:47.642641', '2025-04-08 15:20:47.642641', NULL, '品牌岗（营销策划、媒介、公关、内容方向）', '1、市场营销、广告等专业，有一定文案能力和创意思维、能紧追网络热点；           2、热爱美妆护肤行业，对互联网电商充满兴趣及有相关工作经验者优先；\r\n3、心态开放、抗压性强，良好的沟通与理解能力。', '', 6000, 8000, 10, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1198, '2025-04-08 15:20:47.791385', '2025-04-08 15:20:47.791385', NULL, '电商岗（运营、投流、直播、策划等方向）', '1、专业不限、熟练运用相关数据分析工具、相关办公软件，了解国内主流电商平台的运营推广逻辑；\r\n2、具有较强的数据分析和整合能力，主动性较强；\r\n3、有一定的创新能力，良好的沟通能力。', '', 6000, 8000, 15, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1199, '2025-04-08 15:20:47.929647', '2025-04-08 15:20:47.929647', NULL, '设计岗（电商、品牌、摄影等方向）', '1、视觉传达、工艺美术、艺术设计、产品设计、动画设计、产品设计、摄影等相关专业优先考虑；\r\n2、热爱美妆护肤、时尚行业，关注社会趋势的变化；\r\n3、审美在线，动手能力强，对互联网电商充满兴趣及有相关工作经验者优先。', '', 8000, 10000, 8, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1200, '2025-04-08 15:20:48.304356', '2025-04-08 15:20:48.304356', NULL, '职能岗（HR、财务、法务、法规、IT）', '人力资源管理、财务管理、法学、生物医药类、计算机等相关专业，性格开朗，专业知识扎实。', '', 6000, 8000, 10, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1201, '2025-04-08 15:20:48.548009', '2025-04-08 15:20:48.548009', NULL, '工厂储干（生产、工程、仓储、采购、计划方向）', '化学化工类、供应链管理、物流管理专业、机械、电气自动化、工程等专业，掌握MS Office办公软件，能吃苦，踏实肯干。', '', 6000, 8000, 15, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1202, '2025-04-08 15:20:48.844191', '2025-04-08 15:20:48.844191', NULL, '质检', '药品检验、化学化工相关专业，具备良好的沟通能力、数据分析能力、问题解决能力和团队合作精神。', '', 6000, 8000, 5, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1203, '2025-04-08 15:20:49.092564', '2025-04-08 15:20:49.092564', NULL, '化妆品研发', '化妆品、化学、化工、生物、医学、药学、食品、材料等相关专业，有检测分析、功效检测、实验仪器的维护、稳定性相容性测试等经验。', '', 8000, 12000, 5, '全职', NULL, 1, 413, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440114', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1204, '2025-04-08 15:20:50.368315', '2025-04-08 15:20:50.368315', NULL, '市场管培生', '企知道一家基于大数据、云计算、人工智能技术，向企业提供科创服务（知识产权、产业政策申报、产学研对接、科创金融等）、SaaS平台服务、科创大数据服务的专业服务机构，知识产权行业龙头企业，致力于提升全天下企业核心竞争力。企知道总部位于深圳，全国设有60多家分子公司，覆盖30多个主要经济城市，累计合作客户20万家，员工超5000人。\r\n【工作内容】\r\n1.作为集团的大客户销售，负责东莞区域B端大客户群体的开发、维护；\r\n2.深入挖掘客户需求，为客户制定知识产权、产业政策、互联网大数据平台等企业全生命周期一体化解决方案；\r\n3.与意向客户进行线上或线下的商务谈判，解决客户疑虑，达成签单合作；\r\n4.完成个人业绩目标，并与团队成员配合，实现团队业绩目标；\r\n【任职要求】\r\n1、统招本科及以上学历，理工科优先；\r\n2、IT行业、软件行业销售经验优先；\r\n3、逻辑思维强，善于总结并具备问题解决的能力；\r\n4、看好知识产权行业的发展前景，有志于在本行业长期发展；\r\n【其他亮点】\r\n1.通过这份工作，可以了解到不同行业的知识，拓宽自己的知识面\r\n2.对接大企业老板，一线接触学习成功企业老板，综合能力的锻炼与提升以及优质客户资源的累计\r\n3.可以学习到聪0-1建立成熟稳定的销售体系的所有知识，相信这份收获能让你今后的职业生涯更加游刃有余', '', 9000, 12000, 3, '全职', NULL, 1, 414, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1205, '2025-04-08 15:20:50.645700', '2025-04-08 15:20:50.646731', NULL, '政府项目申报工程师', '【岗位职责】\r\n1. 负责国家、省及市、各区（主要）项目申报、资质认证、政策扶持、产业推进政策文件的收集、整理，形成政策体系；\r\n2. 协助商务与客户对接，依据客户实际情况进行匹配政策，挖掘可申报项目，推动完成签约后进行申报；\r\n3. 辅导企业前期材料的准备，如可行性研究报告、研发立项报告等，资料完成后进行递交；\r\n4. 主动跟踪申报项目的状态和进度，及时反馈项目信息给部门负责人和客户对接人；\r\n5. 对各类项目申报资料的整理、留档，做好技术资料交接、保管工作。\r\n包括但不限于重点小巨人、绿色工厂、重大科技专项、国家高新技术企业、专精特新、小巨人等项目\r\n【任职要求】\r\n1. 统招本科及以上学历，理工科专业；\r\n2. 具有较强的归纳总结、文案撰写、组织统筹、沟通协调、逻辑分析、决策表达能力；\r\n3. 熟悉项目申报流程及具有较好的技术理解能力。', '', 7000, 9000, 3, '全职', NULL, 1, 414, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1206, '2025-04-08 15:20:51.369227', '2025-04-08 15:20:51.369227', NULL, '专利管培生（机械/电学）', '工作职责：\r\n1、完成专利挖掘、检索、分析、对比、撰写、申请、答辩等工作；\r\n2、负责或参与专利复审、无效、行政诉讼等相关工作，优质客户的维护，包括客户答疑、技术交底等；\r\n3、负责或参与内部专利业务规范/指引，典型案例的梳理、编制及更新等工作；\r\n任职要求：\r\n1.理工科本科及以上学历；\r\n2.机械、电学相关专业优先；\r\n3.学习能力强，适应性好，拥有良好的沟通能力；\r\n4.不怕吃苦，责任心强、品行端正、工作认真仔细，有良好的团队合作精神。\r\n知识产权龙头企业，全国有超过六十多家分公司，整个集团超5000名工程师，致力于提升全天下企业的核心竞争力', '', 6000, 8000, 4, '全职', NULL, 1, 414, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1207, '2025-04-08 15:20:52.533113', '2025-04-08 15:20:52.533113', NULL, '助理工程师', '岗位要求：\r\n1.2025应届毕业生，学生干部、党员优先，10人；\r\n2.电子通信专业，通信工程专业；\r\n3.服从公司安排，工作认真负责；\r\n4.适应性强，具备较好的沟通协调能力。\r\n公司福利待遇：\r\n1.公司实行大小周工作制，入职缴纳五险一金；\r\n2.包食宿，一日三餐；\r\n3.法定节假日，节日礼品；\r\n4.生日会、团建、尾牙等丰富多彩的员工活动；\r\n5.定期组织内部培训，完善的晋升体制。', '', 5000, 6000, 10, '全职', NULL, 1, 415, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1208, '2025-04-08 15:20:53.091378', '2025-04-08 15:20:53.091378', NULL, '电气工程师助理', '岗位要求：\r\n1.2025应届毕业生，学生干部、党员优先，10人；\r\n2.机械设计、机电一体化、模具设计专业；\r\n3.服从公司安排，工作认真负责；\r\n4.适应性强，具备较好的沟通协调能力。\r\n公司福利待遇：\r\n1.公司实行大小周工作制，入职缴纳五险一金；\r\n2.包食宿，一日三餐；\r\n3.法定节假日，节日礼品；\r\n4.生日会、团建、尾牙等丰富多彩的员工活动；\r\n5.定期组织内部培训，完善的晋升体制。', '', 5000, 6000, 10, '全职', NULL, 1, 415, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1209, '2025-04-08 15:20:53.342211', '2025-04-08 15:20:53.342211', NULL, '外贸跟单', '岗位要求：\r\n1、负责公司产品的销售及推广。\r\n2、根据公司营销计划完成部门销售指标，开拓新市场，发展新客户，增加产品销售范围。\r\n3、负责收集市场信息及竞争对手的分析与了解。\r\n4、对外贸客户报价、合同拟定、洽谈、订单跟踪、相关单证制作。 \r\n5、服从上级的指令，按时有效的完成上级交付的任务。\r\n6、商务英语和国际贸易专业优先，英语四级，听说写流利，能够阅读英文邮件，能与客户网上交流，用英语与客户电话沟通。\r\n7、性格开朗，具有良好的商务谈判能力及沟通能力、团队合作精神，责任心强，抗性强。\r\n\r\n公司福利待遇：\r\n1.公司实行大小周工作制，入职缴纳五险一金；\r\n2.包食宿，一日三餐；\r\n3.法定节假日，节日礼品；\r\n4.生日会、团建、尾牙等丰富多彩的员工活动；\r\n5.定期组织内部培训，完善的晋升体制。', '', 5000, 6000, 10, '全职', NULL, 1, 415, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1210, '2025-04-08 15:20:53.926405', '2025-04-08 15:20:53.926405', NULL, '财富经理', '1、 及时获悉金融市场的信息，对证券投资策略、资产配置方案进行研究。向客户提供产品咨询和投资咨询服务；\r\n2、 依托财富顾问部指导，为客户提供各类投资咨询服务，维护高净值客户；\r\n3、配合营销团队积极拓展新增客户，进行产品销售及创新业务开发等工作；\r\n4、 负责客户的日常管理，并与其建立良好的合作关系。\r\n\r\n任职要求：\r\n1、 本科及以上学历，经济、金融、管理等相关专业；\r\n2、 热爱金融事业，具有一定的金融、投资相关理论知识；\r\n3、 具有一定客户资源，银行、证券、期货、保险工作经验者优先；\r\n4、 具备证券从业资格。', '', 7000, 12000, 5, '全职', NULL, 1, 416, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1211, '2025-04-08 15:20:54.792388', '2025-04-08 15:20:54.792388', NULL, '法律咨询顾问-管培生（不限专业）', '【工作内容】\r\n1.对有需求的客户，通过电话回访，了解基本案情，初步判断法律服务需求；\r\n2.邀约有意向的客户上门与律师面谈，协助律师做好客户上门接待与上门后回访工作；\r\n3.做好客户维护，协助律师团队为客户提供优质法律服务。\r\n\r\n\r\n【岗位要求】\r\n1.对销售岗位有兴趣，有服务行业咨询经验或者销售经验者优先；\r\n2.具备优秀的沟通能力和服务精神，愿意为老百姓提供服务；\r\n3.愿意付出时间精力换取个人职业发展的更高成就及更高收入；\r\n4.工作内容有一定强度，需要具备抗压能力；\r\n5.律所为一体化管理，能接受售前流程的要求，愿意融入。\r\n\r\n【壹号律所优势】\r\n1.律所薪酬制度成熟，具备行业竞争力。多劳多得，提成上不封顶，目前咨询顾问的薪资待遇底薪+补贴+提成+奖金，平均每月薪资在5K-20K的范围；一般的伙伴薪资都在7K左右，优秀的前30%在15K-20k.\r\n2.律所提供充足的线上客户资源，无需进行陌生拜访，无需进行上门拜访；\r\n3.律所提供核心技能培训和带教复盘机制，帮助咨询顾问快速掌握法律+销售的工作方法论。\r\n4.律所提供清晰的晋升渠道。帮助咨询顾问实现“咨询顾问-小组负责人-大区负责人”的跨越式晋升发展。目前律所在四年内已内部培养了3位以上大区负责人，20位以上的小组负责人。\r\n5.律所发展速度快。律所成立于2015年，于2021年开启全国化战略，目前已开办广州、深圳、东莞、佛山、武汉、番禺所，希望体系内表现优异的咨询顾问经过一段时间的积累，竞聘各大区负责人的岗位；\r\n6.律所拥有自主研发的数字化系统。律所从2018年开始持续投入“壹律cloud”法律数字化系统的研发，能为咨询顾问在法律检索、客户管理、团队协同、数据统计、技能复盘等环节提供全方位数字技术支持。\r\n7.律所坚持客户第一原则，围绕客户需求，按照现代化的组织架构，设立了市场部、品宣部、售后部等部门，帮助律师更高效的完成法律服务。', '', 5000, 20000, 5, '全职', NULL, 1, 417, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440104', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1212, '2025-04-08 15:20:55.232692', '2025-04-08 15:20:55.232692', NULL, '广东富凯尔化工新材料有限公司', '1.大专及以上学历，化工工程、高分子、化学分析、化学应用等相关专业毕业，可接受应届生；\r\n2.协助生产对生产流程、生产工艺、检测标准产品技术的控制；\r\n3.产品生产过程异常处理及建立纠正预防措施并跟进；\r\n4.愿意从事生产一线化工技术管控工作；\r\n5.工作细致，有责任心，有良好的沟通协调能力和团队协助能力；\r\n6.完成领导交办的其他临时工作。', '', 4500, 8000, 5, '全职', NULL, 1, 418, 6, NULL, NULL, NULL, NULL, NULL, 0, '441800', '440000', '441881', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1213, '2025-04-08 15:20:55.956890', '2025-04-08 15:20:55.956890', NULL, '产品经理', '岗位职责:\r\n1、负责公司相关产品功能设计，能独立完成从需求调研到产品方案设计；\r\n2、 负责产品总体规划，确定产品功能、流程、用户体验及后台解决方案，绘制产品原型图，编写相关需求文档。\r\n3、 协调技术团队及项目管理，与UI、开发、测试、运营等部门紧密合作，以确保产品准时、高质发版。\r\n4、 负责产品发布后的改进、BUG跟踪、收集改进意见、提出改进方案。\r\n\r\n岗位要求:\r\n1、 熟悉产品实现过程，包括市场分析、需求分析、产品功能设计、业务流程设计、界面设计、用户研究和可用性测试等。\r\n2、对网站、系统易用性设计和用户体验有良好的直觉，注重细节；\r\n3、具有较强的策划能力，对产品和运营敏感，思维清晰有条理；\r\n4、热爱产品，对数据敏感，善于发现问题，解决问题；\r\n5、具有较强的产品文档书写能力和团队沟通协调能力。', '', 4500, 8000, 1, '全职', NULL, 1, 419, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1214, '2025-04-08 15:20:56.187056', '2025-04-08 15:20:56.187056', NULL, '视觉算法工程师', '1.本科及以上学历，计算机、电子信息、自动化、数学等相关专业；3年以上相关工作经验；\r\n2.熟练掌握C/C++/Python等编程语言之一；\r\n3.熟悉图像处理算法原理，熟练MIL / halcon / VisionPro / OpenCV 中任何一种算法工具的应用及二次开发；\r\n4.如熟悉tensorflow/pytorch/caffe/Yolo等框架中的一种或多种，熟悉分类、检测等领域的模型设计，熟悉训练、调参、优化的流程和常用方法更佳。\r\n\r\n岗位职责：\r\n1.负责运动体感领域的视觉产品技术开发。\r\n2.针对实际应用场景，开发定制型视觉算法模块或优化已有的平台算法模块，满足项目要求的性能指标。\r\n3.优化与改进图像处理算法', '', 4000, 8000, 1, '全职', NULL, 1, 419, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1215, '2025-04-08 15:20:56.411366', '2025-04-08 15:20:56.411366', NULL, 'APP Flutter工程师', '1、使用Flutter进行移动应用研发；能够独立完成iOS应用的开发工作；\r\n2、热爱前端，精通flutter等前端开发技术，熟悉常用前端框架；\r\n3、和前端、后端工程师一起研讨技术实现方案，进行应用及系统整合；\r\n4、熟悉Flutter相关API及第三方框架。\r\n\r\n任职要求：\r\n1、有Flutter实际项目经验者优先；\r\n2、有小游戏开发相关经验；\r\n3、熟悉硬件连接经验；\r\n4、熟悉iOS原生开发者优先；', '', 4500, 8000, 1, '全职', NULL, 1, 419, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1216, '2025-04-08 15:20:56.608339', '2025-04-08 15:20:56.608339', NULL, '嵌入式软件开发', '岗位职责：\r\n1、负责情趣用品嵌入式开发及现有产品的持续迭代工作；\r\n2、负责实现物联网产品与 App 的连接通讯，相关协议制定；\r\n3、负责系统的技术架构设计、核心模块的代码编写、功能测试；\r\n4、负责撰写软件需求、系统设计方案及项目开发过程相关文档。\r\n5、负责芯片选项、方案设计、电路设计。\r\n任职要求:\r\n1、本科及以上学历，电子、通信、计算机、自动控制等相关专业；\r\n2、具有2年以上物联网项目开发经验，有通信网络协议、物联网相关项目设计经验优先；\r\n3、熟练掌握C/C++语言编程，熟练使用keil、IAR、git版本管理工具等;\r\n4、能看懂电路原理图，熟悉常用通信协议及硬件接口，如UART、I2C、CAN、I2S、SDIO、SPI、以太网等;\r\n5、掌握至少一种操作系统 ;\r\n6、熟悉无线传感网络、工业以太网、现场总线等通讯技术，了解Lora、蓝牙、RFID、ZigBee、Wi-Fi、4G等技术以及主流传感器应用方案;\r\n7、熟悉IOT及云相关通信协议(MQTT、CoAP、https、protobuf、modbus、Json等);', '', 5000, 8000, 1, '全职', NULL, 1, 419, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1217, '2025-04-08 15:20:57.262846', '2025-04-08 15:20:57.262846', NULL, '综合管理管培生', '综合管理管培生：致力于培养物业项目管理、社区经营、投资拓展、城服运营、招标采购、人事行政等业务及职能部门的管理人才；\r\n专业要求：不限专业。\r\n薪资福利：综合收入5.5-10K/月，五险一金，提供员工宿舍、餐厅/餐补\r\n工作地点：全国（愿意服从地域调配）\r\n培养路径：定制专属培养计划，提供广阔的发展平台和晋升通道，帮助大学生在2年内快速成长为初级管理人才及技术人才，2-3年成为业务骨干，4-5年内成长为中高级管理人才及高阶专业人才。', '', 5500, 10000, 5, '全职', NULL, 1, 420, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1218, '2025-04-08 15:20:57.902069', '2025-04-08 15:20:57.902069', NULL, '理财顾问', '岗位职责：\r\n1、负责所辖区域的新客户开拓，客户信息的搜集；\r\n2、定期拜访客户，销售公司产品；\r\n3、与客户进行沟通，及时掌握客户需要，了解客户状态；\r\n4、定期对客户档案进行分析、整理，提供销售分析数据；\r\n5、接受客户投诉，妥善解决问题；\r\n任职要求：\r\n1、本科及以上学历，具有证券从业资格证； 具有基金从业资格证、投资顾问资格证优先！\r\n2、性格外向，具有较强的沟通能力和语言表达能力，较强的公关能力、应变能力和谈判能力；\r\n3、具备良好的客户服务意识，良好的品牌及营销策划能力；\r\n4、工作认真勤奋，刻苦努力。', '', 4500, 7000, 20, '全职', NULL, 1, 421, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1219, '2025-04-08 15:20:58.771648', '2025-06-10 10:34:11.455840', NULL, 'Java管培生', '工作内容：\r\n1.参与企业Java项目开发，完成模块编码、单元测试和Bug修复；\r\n2.使用主流框架实现业务逻辑，编写接口文档；\r\n3.维护现有系统，优化代码性能；\r\n4.熟悉开发工具链：Git代码管理、Maven/Gradle构建工具、Jenkins自动化部署。\r\n5.与内部团队协作，理解需求并转化为技术实现。\r\n\r\n岗位要求：\r\n1.统招本科及以上学历，计算机科学、软件工程等相关专业优先；\r\n2.扎实的Java基础：熟悉多线程、JVM调优、Spring、ORM、Dubbo、Zookeeper、Nacos、MySQL、NoSQL（MongoDB/Elasticsearch）等；\r\n3.有完整项目经历，熟悉Git、Maven、Jenkins等开发工具链；\r\n4.快速掌握新技术（如AI工程化、低代码平台），适应高强度学习节奏；\r\n5.具备跨团队沟通能力，能清晰表达技术方案。', '深南中路汉国中心18楼', 5000, 7000, 2, '全职', NULL, 1, 428, 6, NULL, NULL, '东莞市', '广东省', '东城街道', 47, '441900', '440000', '441900003', '', 4, 'Java', 0);
INSERT INTO `post` VALUES (1220, '2025-04-08 15:20:59.164031', '2025-04-08 15:20:59.164031', NULL, '财务管培生', '【工作内容】：\r\n1.学习企业财务制度、ERP系统操作、财务报告编制流程及合规要求；\r\n2..协助日常账务处理、财务报表编制；\r\n3.支持业务部门财务需求；\r\n4.专项项目参与。\r\n\r\n【任职要求】：\r\n1.本科及以上学历，财务、会计、金融、经济等相关专业；\r\n2.扎实的财务基础知识，熟悉会计准则及税法政策；\r\n3.熟练使用Excel、PPT，掌握Power BI/SQL/Python等工具加分；\r\n4.逻辑清晰，对数据敏感，具备商业洞察力；\r\n5.快速学习能力，适应跨部门协作工作；', '', 5000, 7000, 2, '全职', NULL, 1, 422, 6, NULL, NULL, NULL, NULL, NULL, 0, '421100', '420000', '421102', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1221, '2025-04-08 15:20:59.412328', '2025-04-08 15:20:59.412328', NULL, '津星管培生', '【工作内容】\r\n轮岗部门：市场部、销售部、品牌部\r\n- 参与公司各项业务流程，了解并熟悉不同部门的工作模式与运营方式；\r\n- 在导师指导下完成指定项目或任务，积累实际工作经验；\r\n- 对行业趋势、市场动态进行调研分析，为公司发展提供建议；\r\n- 完成领导交办的其他相关工作，提升综合管理能力；\r\n- 通过轮岗学习，确定自身职业发展方向，成为未来公司管理层的储备人才。\r\n\r\n【任职要求】\r\n- 本科及以上学历，专业不限；\r\n- 思维敏捷，具备良好的沟通协调能力和团队合作精神；\r\n- 学习能力强，能快速适应新环境和新任务；\r\n- 具备一定的抗压能力，能够接受挑战并积极解', '', 5000, 7000, 15, '全职', NULL, 1, 422, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1222, '2025-04-08 15:21:00.257159', '2025-04-08 15:21:00.257159', NULL, '实习工程师/专利工程师', '岗位职责：\r\n1、负责专利申请文件的撰写、绘图，答复审查意见以及专利文献检索分析工作；\r\n2、与客户进行技术沟通，为客户提供专业咨询对相关行业领域的企业做顾问工作，并进行工作分析与研究；\r\n3、通过检索判断专利申请文件的新颖性与创造性；\r\n4、负责参与公司知识产权相关的对外谈判活动。\r\n\r\n任职要求：\r\n1、全日制本科及以上学历，机械、自动化、电子、计算机、光电技术等理工科专业；对知识产权有认知或具专利代理人执业证优先；\r\n2、1-3年工作经验，对专利工作有浓厚的兴趣；熟悉知识产权法及专利申请的相关流程；认可知识产权行业，并以此为长期职业发展方向；\r\n3、良好的沟通表达能力，出色的分析与研究能力；\r\n4、具独立工作能力，能够承受较高的工作压力.\r\n5、有责任心、诚信、工作细致、认真、严谨，具有团队精神；\r\n\r\n薪资构成：岗位底薪+提成+餐补+激励奖金+年终奖\r\n专业培训，鼓励岗位技能提升，岗位技能考级奖金', '', 5000, 10000, 2, '全职', NULL, 1, 423, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1223, '2025-04-08 15:21:00.438088', '2025-04-08 15:21:00.438088', NULL, '知识产权顾问', '岗位职责：\r\n1、客户售前推广：向客户推广公司服务产品及服务模式（如知识产权申请、国家补助政策项目、工商财税等）\r\n2、客户商务谈判：通过电话沟通、拜访客户，进行商务谈判，促成合作;\r\n3、客户售后服务：跟进客户服务进展，定期反馈，保障服务正常推进；\r\n4、客户款项回收：负责对名下客户进行收款，确保应收款项及时到账；\r\n5、客户关系维护：及时推送客户适配的服务产品，定期回访了解客户发展现状及需求，保持稳定的长期合作关系；\r\n任职要求：\r\n1、专科以上学历，可接受没有相关工作经验，有1年以上业务拓展工作经验或对知识产权行业有一定了解的优先；\r\n2、具备较强的责任心和沟通执行力，良好的客户服务意识及团队协作意识；\r\n3、有较强的沟通表达能力及服务意识；抗压能力强，敢于突破自我。\r\n\r\n（工作地点：东莞、惠州、佛山皆可选择）\r\n\r\n工作时间:周一到周五08:20-12:00；13:30-18:00；周六08:20-12:00；周六下午和周日正常休息；每月有两周双休；国家节假日正常放假。\r\n\r\n公司地址：东莞市南城街道宏图路86号南信产业国际D栋701室。', '', 6000, 10000, 3, '全职', NULL, 1, 423, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1224, '2025-04-08 15:21:01.153319', '2025-04-08 15:21:01.153319', NULL, '创新专员', '-根据公司提供的客户资源进行数据整理分析，为客户确定财富管理目标、量身定制财富管理方案、为客户配置合适的保险产品\r\n\r\n-根据销售业务过程的要求，熟练达成客户分类别，电话预约，跟进需求，推荐适合的保险产品和异议处理，合同成交等全部业务\r\n\r\n-达成公司考核指标，完成公司安排的其他工作\r\n\r\n\r\n职位要求：\r\n- 良好的沟通能力和团队合作精神，具有责任心；\r\n- 熟练掌握常用办公软件，具备基本的网络知识；\r\n-  金融相关专业优先；\r\n- 具备良好的语言能力和思维能力，善于倾听客户需求。', '', 6000, 12000, 3, '全职', NULL, 1, 424, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1225, '2025-04-08 15:21:01.385945', '2025-04-08 15:21:01.385945', NULL, '证保渠道经理', '1. 协助证券网点帮助客户确定财富管理目标、量身定制财富管理方案、为客户配置合适的保险产品;\r\n2.及时对证券网点的保险需求提供培训，\r\n3. 及时对客户的保险咨询进行解答并提供相应的建议及服务;\r\n4、达成公司考核指标，完成公司安排的其他工作。\r\n任职要求\r\n1本科以上学历，具备投资顾问资格优先：\r\n2. 具有扎实的经济、金融、投资等领域的相关知识，同业工作经验优先;\r\n3.有较强的沟通能力和客户服务能力;\r\n4. 具有较强的团队合作精神，能承受一定的工作压力', '', 7000, 12000, 3, '全职', NULL, 1, 424, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1226, '2025-04-08 15:21:01.764462', '2025-04-08 15:21:01.764462', NULL, '客服专员', '负责公司产品的售前售后服务，处理客户关于产品咨询、使用过程中遇到的问题，提供优质的销售服务，维护公司形象和信誉。\r\n主要职责：\r\n- 负责公司产品的推广和销售\r\n- 接收和处理客户关于产品咨询、使用过程中遇到的问题，提供优质的服务；\r\n- 维护公司形象和信誉，及时反馈并处理客户问题；\r\n- 遵守公司的各项制度，执行公司的规定和要求；\r\n- 配合公司的销售活动，做好产品销售和推广。\r\n职位要求：\r\n- 良好的沟通能力和团队合作精神，具有责任心；\r\n- 熟练掌握常用办公软件，具备基本的网络知识；\r\n- 具备一定的售后服务经验，熟悉产品的使用方法和维护方法；\r\n- 具备良好的语言能力和思维能力，善于倾听客户需求。', '', 5000, 7000, 5, '全职', NULL, 1, 424, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1227, '2025-04-08 15:21:02.529177', '2025-04-08 15:21:02.529177', NULL, '麦当劳餐厅值班主管-就近安排上班', '岗位描述：全职、学生      学习值班领导力课程并完成鉴定，聚焦值班管理，支持餐厅业务目标达成。\r\n工作职责：\r\n学习并能独立进行值班管理，通过管理人员、设备、物料，平稳一致地提供杰出的QSC，聚焦值班管理，通过值班管理确保顾客用餐体验，支持餐厅业务目标达成。\r\n\r\n岗位要求：\r\n1.年满18周岁以上；\r\n2.大专及以上学历；\r\n3.有志于餐饮服务业，具备良好的顾客服务意识；\r\n4.能适应早晚轮班工作及快节奏的工作方式；\r\n4.善于沟通，充满热情，学习能力强，适应变革；\r\n5.无需工作经验，专业不限;\r\n6.应届大学生或就业见习人员亦可。', '', 3000, 4000, 15, '全职', NULL, 1, 425, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1228, '2025-04-08 15:21:02.841061', '2025-04-08 15:21:02.841061', NULL, '麦当劳菁英管培生-就近安排工作地点', '菁英管培生项目介绍：\r\n\r\n麦当劳中国目标2028年突破1万家餐厅，持续提升数字化能力，菁英管培生计划作为培养麦当劳未来中坚管理人才的重要途径之一正式启动。您将以菁英管培生身份入职餐厅，开启2个月的基础运营实践训练，作为公司运营管理后备役，夯实基础技能，之后根据成长情况，从值班主管步步晋升。\r\n通过18个月甚至更短的重点培养，让刚刚毕业的你，可以通过扎实的系统运作，掌握数字化系统分析技能，从对于餐厅营运知之甚少的“小白”成长为可以制定业务决策带领团队实施，执掌千万营业额，甚至多家餐厅的主理人，在职场先人一步！\r\n\r\n一、18个月快速发展路径，配备完善、多样的培训发展体系\r\n员工&精英员工—— 值班主管—— 顾客体验经理——系统专家——餐厅总经理\r\n\r\n领导力学习：根据个人特点，灵活自主完成课件学习及课程培训，提升核心竞争力\r\n\r\n二、大咖带教\r\n餐厅总经理作为“并肩教练”给予教练回馈；\r\n营运经理作为“专属导师”提供专业职业指导；\r\n与麦当劳高管面对面沟通、分享、学习的机会\r\n\r\n三、完善的薪酬福利体系\r\n毕业前：\r\n1、菁英管培生专属里程碑奖金\r\n2、意外保险\r\n3、免费餐饮\r\n毕业全职入职后（包含上述）：\r\n4、五险一金\r\n5、公司福利年假，周年服务奖\r\n6、年度体检、百万医疗险、补充医疗保险等\r\n\r\n四、任职要求\r\n1、本科及以上学历，欢迎2023/2024届应届生\r\n2、具有责任心与好奇心，善于与人沟通及团队合作，愿意不断学习、接受挑战和领导他人，有强烈的发展意愿\r\n3、喜欢快节奏的工作并能适应轮班\r\n4、乐于从事连锁餐饮零售业，热爱顾客服务工作\r\n5、无需工作经验，专业不限，若有相关的零售餐饮行业工作经历更佳', '', 4000, 7000, 5, '全职', NULL, 1, 425, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1229, '2025-04-08 15:21:03.234594', '2025-04-08 15:21:03.234594', NULL, '麦当劳学生兼职、实习', '餐厅员工\r\n职位描述：无论你是在寻找一份可以灵活安排时间的工作，还是一份可以快速成长不断发展的长期职业，麦当劳餐厅员工都是一个很不错的开始。我们的餐厅24小时营业，你一定能在这里找到一份属于你的位置。 我们投入了很多资源，以确保我们所有层级的雇员都获得培训，同时得到发展自己潜力的机会。 无论是在收银台前微笑服务顾客，还是在厨房中精心准备食品，或是在汽车餐厅中提供便利服务，加入麦当劳，来自不同背景的雇员们都收获了学习、发展和欢乐。\r\n\r\n工作职责：在不同的工作站岗位上服务顾客，协助餐厅达到最佳的质量、服务、清洁及物超所值。\r\n\r\n岗位要求：\r\n1、学生兼职：在校学生，年满18周岁以上；\r\n2、实习管理员：实习期6个月或以上，有意向长期发展；\r\n3、全职人员：年龄18-50岁，有志于服务行业；\r\n4、具有良好的顾客服务意识\r\n5、能适应早晚轮班工作及快节奏的工作方式\r\n6、具备良好的沟通技巧、团队合作意识\r\n7、具有较强的工作责任心', '', 2000, 4000, 15, '全职', NULL, 1, 425, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1230, '2025-04-08 15:21:03.992071', '2025-04-08 15:21:03.992071', NULL, '研发打板员', '岗位职责:\r\n1.协助工程师制作样板\r\n2.负责产品送样\r\n3.协助工程师出产品的成分等资料\r\n4.维护实验的日常卫生\r\n岗位要求:\r\n1.本科及以上学历，精细化工、生物医学、应用化学等专业优先\r\n2.有日化行业实习或工作经验最佳\r\n3.有积极上进心，吃苦耐劳', '', 5000, 7000, 3, '全职', NULL, 1, 426, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440115', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1231, '2025-04-08 15:21:04.230516', '2025-04-08 15:21:04.230516', NULL, '研发测试员', '岗位职责\r\n1.根据作业指导书负责生产标记工作，并按要求输出相应的记录，且保证记录的完整性、正确性；\r\n2.根据测试方案进行性能测试，数据整理汇报，按要求输出相应的记录，且保证记录的完整性、正确性；\r\n3.负责校准品、质控品调配测试工作，数据整理汇报，并按要求输出相应的记录，且保证记录的完整性、正确性。\r\n\r\n岗位职责：\r\n1、本科及以上学历，化妆品研发、生物化学等相关专业；\r\n2、熟悉实验室工作，了解日化行业；优秀应届生亦可接受\r\n3、操作能力强，善于分析解决问题；善于沟通，能有效衔接部门之间、各岗位之间的工作；', '', 5000, 7000, 3, '全职', NULL, 1, 426, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440115', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1232, '2025-04-08 15:21:04.891097', '2025-04-08 15:21:04.891614', NULL, '初中教师及课程顾问', '1.负责初中英语小班课线下教学相关工作，包括备课、授课和布置作业等；\r\n2.负责提供高质量的教学服务；\r\n3.负责电话、微信与家长沟通，反馈，交流；\r\n4.积极参与公司和部门组织的各类培训、教研、会议等；\r\n5.维护学生档案，协助校区做好招生宣传、续费报名和转介绍工作。', '', 5000, 12000, 10, '全职', NULL, 1, 427, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1233, '2025-04-08 15:21:05.750492', '2025-04-08 15:21:05.750492', NULL, '储备渠道经理', '一、储备渠道经理（4名）\r\n7k~25k/深圳/本科及以上\r\n需求专业：\r\n金融类\r\n岗位职责:\r\n1、日常的行情分析，及时了解金融市场的信息，收集客户建议，向客户传递公司产品与服务信息。 \r\n2、客户开发和客户关系维护、客户证券投资指导及金融产品推介。\r\n3、为客户推荐公司的理财产品等。\r\n4、开发银行与非银行渠道，负责或参与组织各类市场营销活动，实现批量新客引流。\r\n\r\n岗位要求:\r\n1、全日制本科及以上学历，经济类专业优先； \r\n2、具有证券从业资格或证券从业考试成绩合格证明；\r\n3、吃苦耐劳，具有责任心，能承受一定的工作压力；\r\n\r\n薪酬待遇：\r\n底薪（4000—20000）+岗位津贴+渠道开发奖+股票/期货/融资融券提成+开户奖+有效户奖+基金销售奖+月度/季度/年度竞赛奖+过节费+年终奖金等等\r\n\r\n福利：\r\n1、过节费；\r\n2、岗前培训；\r\n3、弹性工作；\r\n4、多样化的员工活动；\r\n\r\n二、职业发展:\r\n1、管培生-理财顾问-财富顾问\r\n2、管培生-渠道经理-区域经理-市场拓展部管理岗\r\n3、初级讲师-中级讲师-高级讲师-资深讲师\r\n日常专题培训、上市公司交流、基金公司交流、完善的培育机制及“管理与专业”双通道发展。\r\n\r\n三、投递说明：\r\n联系方式：刘经理  0755-83781174\r\n简历投递邮箱：liuyiting@cmschina.com.cn（邮件主题请命名为：学校+姓名）\r\n联系地址：深圳市福田区深南中路汉国中心18楼招商证券\r\n官方网址：www.newone.com.cn', '', 5000, 20000, 5, '全职', NULL, 1, 428, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1234, '2025-04-08 15:21:06.612989', '2025-04-08 15:21:06.612989', NULL, '管理培训生（销售管理方向）', '【任职资格】：\r\n1、统招本科学历及以上学历，不限专业，不限性别（接受24、25届；25届需长期全职实习）\r\n2、具备领导潜质，有学生会或社团管理资历更佳；\r\n3、积极主动，具有创新精神，勇于接受挑战；\r\n4、优秀的沟通表达能力，团队协作能力、适应能力和抗压能力；\r\n5、具有强烈的责任心、为人谦虚，善于学习；\r\n6、有销售、零售店工作经验优先。', '', 5500, 1000, 2, '全职', NULL, 1, 429, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1235, '2025-04-08 15:21:06.875112', '2025-04-08 15:21:06.875112', NULL, '珠宝销售顾问/导购', '【任职资格】\r\n1、喜欢珠宝门店销售导购工作，能接受大型节假日排班排休工作（例如：春节、国庆节、情人节等），优先考虑珠宝同行；\r\n2、待人热情，开朗活泼，具有良好的亲和力；\r\n3、沟通表达能力优秀，善于与人打交道，会聊天，情商高；', '', 4000, 8000, 3, '全职', NULL, 1, 429, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1236, '2025-04-08 15:21:07.094805', '2025-04-08 15:21:07.094805', NULL, '管理培训生（销售管理方向）', '【任职资格】：\r\n1、统招本科学历及以上学历，不限专业，不限性别（接受22、23届；24届需长期全职实习）\r\n2、具备领导潜质，有学生会或社团管理资历更佳；\r\n3、积极主动，具有创新精神，勇于接受挑战；\r\n4、优秀的沟通表达能力，团队协作能力、适应能力和抗压能力；\r\n5、具有强烈的责任心、为人谦虚，善于学习；\r\n6、有销售、零售店工作经验优先。', '', 5500, 10000, 3, '全职', NULL, 1, 429, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1237, '2025-04-08 15:21:07.317561', '2025-04-08 15:21:07.317561', NULL, '管理培训生', '1、统招本科学历及以上学历，不限专业，不限性别（接受24、25届；25届需长期全职实习）\r\n2、具备领导潜质，有学生会或社团管理资历更佳；\r\n3、积极主动，具有创新精神，勇于接受挑战；\r\n4、优秀的沟通表达能力，团队协作能力、适应能力和抗压能力；\r\n5、具有强烈的责任心、为人谦虚，善于学习；\r\n6、有销售、零售店工作经验优先。', '', 5000, 10000, 4, '全职', NULL, 1, 429, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1238, '2025-04-08 15:21:07.891823', '2025-04-08 15:21:07.891823', NULL, '技术工艺工程师', '岗位职责：\r\n1、负责评估新产品或新项目的可行性；\r\n2、负责样品开发与试制跟进，包括测试及相关实验跟进，数据记录与报告输出；\r\n3、负责传感器产品工艺策划、验证、实施、优化，工艺异常的分析处理，持续改进工艺能力，提高生产效率；\r\n4、负责各阶段工艺文件（包括WI / FMEA /控制计划/工艺流程/ SOP）的编制与签审；\r\n5、负责生产用工装夹具的设计、验收、调试及维护保养；\r\n6、负责设备仪器验收、调试及预防性维护；\r\n7、领导交办的其它事项。\r\n\r\n任职资格：\r\n1、学历：本科或以上相关自动化、工程、电子专业教育背景；\r\n2、知识：传感器和自动化设备的性能参数、工作原理和应用场景；了解相关法律法规，特别是销售合同和商业合作相关；传感器产品/行业优先；\r\n3、工作经验：有传感器（硅阻式压力，温度，电流，磁电，转速，MEMS等）相关经验优；有外资企业工作背景者优先考虑；\r\n4、技能：英语 - CET 4，良好口语，阅读和写作能力；\r\n办公软件 - 能够熟练操作常用办公软件，如Word，Excel和PPT等，有CRM使用经验优先考虑；能熟练使用CAD，Pro/E，solidworks等二维、三维设计软件；\r\n其他 - 能够读懂和解析技术图纸和规格书；\r\n5、个性特征：正直诚信，责任感，乐意学习，适应变化，合作导向；\r\n6、资格证书（如适用）：项目管理。\r\n\r\n有意加入GUCE固测大家庭，欢迎投中/英文简历。\r\n成功筛选出的简历，HR将会电话进行首轮的电话面试。', '', 6000, 12000, 2, '全职', NULL, 1, 430, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1239, '2025-04-08 15:21:08.285895', '2025-04-08 15:21:08.285895', NULL, '传感器销售城市经理', '岗位职责:\r\n*工作地点可选东莞Office/深圳、广州、惠州、佛山HomeOffice\r\n1、了解并接受公司文化，管理规定，以及与销售相关的规章，保持对行业动态和市场变化的敏感度，收集并分析竞品信息；\r\n2、参与制定销售策略，利用市场研究和销售预测，为产品研发和市场策略提供参考；\r\n3、开拓终端客户，能够精准定位并深度挖掘潜力客户，实施“高举高打”的营销策略，通过高层营销方式，提供卓越服务构建并深化与客户的长期合作关系；\r\n4、完成年度销售目标，包括销售额和利润，定期进行销售业绩的评估和反馈；\r\n5、深入理解和掌握客户的需求，能够为客户提供独到的见解，从而提供合适的产品或解决方案，并进行商业谈判以达成销售合同；\r\n6、与客户建立并维护良好的长期关系，及时解决客户问题，提供优质服务，不断提升客户满意度；\r\n7、与内部团队，如产品团队、技术支持团队和客户服务团队等进行有效沟通，以确保销售过程的顺利进行；\r\n8、负责CRM系统的操作和数据录入，遵照公司规定定期进行系统维护和检查，确保客户信息与数据的准确性和完整性；\r\n9、参与或组织各种销售推广活动，如行业展览、研讨会等，提升公司品牌知名度；\r\n10、定期进行销售培训，提升销售技巧和产品知识；\r\n11、负责上级及公司分配的其他与工作相关的任务，能够在压力下完成工作目标。\r\n任职要求:\r\n1、学历：本科或以上相关自动化、工程、电子专业教育背景；\r\n2、知识：传感器和自动化设备的性能参数、工作原理和应用场景；了解相关法律法规，特别是销售合同和商业合作相关；传感器产品/行业优先；\r\n3、工作经验：不限\r\n4、技能：英语 - CET 4，良好口语，阅读和写作能力，国内业务不做强制要求；\r\n办公软件 - 能够熟练操作常用办公软件，如Word，Excel和PPT等，有CRM使用经验优先考虑；\r\n其他 - 能够读懂和解析技术图纸和规格书；\r\n5、个性特征：正直诚信，责任感，乐意学习，适应变化，合作导向；\r\n6、资格证书（如适用）：销售谈判，客户沟通技巧，项目管理。\r\n\r\n有意加入GUCE固测大家庭，欢迎投中/英文简历）。\r\n成功筛选出的简历，HR将会电话进行首轮的电话面试。', '', 10000, 15000, 5, '全职', NULL, 1, 430, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440104', NULL, 4, NULL, 0);
