INSERT INTO `post` VALUES (1242, '2025-04-08 15:21:09.928135', '2025-04-08 15:21:09.928135', NULL, '储备干部', '1、在校时期学习勤苦，学习能力强，成绩优异，\r\n2、有制造行业有关的实践经历或工作经历。\r\n3、吃苦耐劳、责任心强。\r\n4、喜爱挑战，富裕创新精神，\r\n5、认同本公司的公司文化，并有从基层做起的信心，\r\n6、有有关管理、销售工作经验，\r\n7、切合我公司岗位需求的专业人材\r\n8.英语熟练优先', '', 5000, 6000, 10, '全职', NULL, 1, 431, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1243, '2025-04-08 15:21:10.502305', '2025-04-08 15:21:10.502305', NULL, '技术员', '1、制程设备换线调试，如（超声机，测试设备，分板机，MES系统工单切换）\r\n2、工程不良分析及风险评估；\r\n专业知识要求\r\n1、会使用PADS-9.5或者pore3.0-5.0;\r\n2、PFMEA制作，SOP编写；', '', 5000, 6000, 2, '全职', NULL, 1, 431, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1244, '2025-04-08 15:21:11.340972', '2025-04-08 15:21:11.340972', NULL, '抖音运营/场控', '岗位职责：\r\n1、负责公司新媒体平台（如抖音、小红书等）的日常运营管理，包括内容策划、撰写、编辑、发布和推广；\r\n2、熟悉IP/店铺的运营策划和管理，掌握各平台规则和各种活动规则；\r\n3、负责直播活动的整体运营和监控，确保直播流程的顺畅和高效；\r\n4、分析直播数据，优化直播策略和运营效果；\r\n5、增加粉丝数和浏览量，积极与粉丝进行互动，回复评论、私信等社交互动，了解用户需求和反馈，提高用户满意度。\r\n6、完成上级交办的其他工作。\r\n\r\n\r\n任职要求：\r\n1、具有抖音、小红书内容运营经验，熟悉各平台运营策略；\r\n2、热爱新媒体行业，具有一定策划、组织文案、组织协调能力，目标感清晰，自驱力强，抗压能力强；\r\n3、思维活跃，表达能力强，有团队精神，应变能力强，能够现场应对突发情况；\r\n4、具有较强的判断规划能力和数据分析能力。', '', 4500, 8000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1245, '2025-04-08 15:21:11.566828', '2025-04-08 15:21:11.566828', NULL, '媒介专员', '岗位职责：\r\n1、负责电商平台（如抖音、快手、小红书等）工作媒介资源的开拓与维护，与达人、机构等建立良好合作关系；\r\n2、根据客户需求，制定精准的工作媒介投放方案，并跟进执行，确保效果达成；\r\n3、分析工作媒介数据，优化投放策略，提升ROI；\r\n4、关注行业动态，挖掘潜在合作机会，拓展业务渠道。\r\n5、每月完成公司下发的指标业务，对产出效果负责。\r\n职位要求：\r\n1、1年以上电商或互联网行业工作经验，有工作媒介资源者优先；\r\n2、具备良好的沟通能力和谈判技巧，能够独立完成商务洽谈；\r\n3、责任心强，抗压能力强，具备团队合作精神；\r\n4、对数据敏感，具备一定的数据分析能力。', '', 4500, 8000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1246, '2025-04-08 15:21:11.883419', '2025-04-08 15:21:11.883419', NULL, '电商视觉设计师', '工作内容\r\n1、根据电商活动的主题和内容，设计相应的平面视觉表现；\r\n2、把控品牌推广过程中的视觉表现，确保符合公司要求的品质形象；\r\n3、管理推广设计和物料供方资源。\r\n4、产品包装及详情页设计；\r\n\r\n\r\n任职要求\r\n1、具备踏实严谨的工作态度和强烈的责任心；\r\n2、具备团队协作精神和敬业态度；\r\n3、能够充分理解上级的指示，并具备创造力。', '', 4500, 8000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1247, '2025-04-08 15:21:12.256463', '2025-04-08 15:21:12.256463', NULL, '短视频编导', '岗位职责：\r\n1、根据公司定位，负责短视频内容的策划与创意构思，制定拍摄方案和脚本。\r\n2、熟悉短视频制作流程，组织和协调拍摄团队，包括摄影师、演员、情景设计等，确保拍摄工作的顺利进行；\r\n3、跟进后期的制作、剪辑调色和音乐特效等，保证成片质量；\r\n4、对短视频的播放数据进行分析，不断总结经验，优化后续内容创作；\r\n5、完成上级领导分配的其他工作；\r\n\r\n职位要求：\r\n1、喜欢美食文化，或对美食文化感兴趣的优先考虑；\r\n2、能够独立撰写脚本，擅长创意，策划，具有丰富的想象力和创新能力，文字功底好；\r\n3、熟悉短视频平台玩法，能抓住热点，对内容敏感，网感好，能准确把握粉丝群体心理需求，根据需求制作出爆款短视频内容；\r\n4、善于沟通，具有团队意识，执行能力强，能够推动及把控视频工作的进度。', '', 4500, 8000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1248, '2025-04-08 15:21:12.506458', '2025-04-08 15:21:12.506458', NULL, '采购', '工作职责：\r\n1、根据公司需求和经预算部门确定的采购预算，制定采购计划，包括采购物品、数量、价格、采购策略。\r\n2、寻找、筛选、管理供应商，建立供应商关系，保证供应商质量、交货期、价格等符合公司需求。\r\n3、执行采购计划，并监督采购过程中所有环节，包括与供应商的沟通、价格协商、合同签订、发货、接收等工作。\r\n4、整理、分析采购数据，包括采购量、采购成本、采购效率、供应商质量等数据，以便制定和完善采购策略。\r\n5、完成上级领导分配的其他工作。\r\n\r\n任职要求：\r\n1、具有良好的沟通能力，能有效的处理问题；\r\n2、具有数据分析能力，能完美执行采购任务；\r\n3、具备优秀的团队合作能力，完成跨部门沟通。', '', 4500, 8000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1249, '2025-04-08 15:21:13.125730', '2025-04-08 15:21:13.125730', NULL, '客服专员', '岗位职责：\r\n1、负责公司电商平台的日常售前售后咨询服务；\r\n2、打字速度快，反应灵敏，能同时和多人聊天，对客户有耐心；\r\n3、积极高效处理交易过程中的物流、产品漏发等相关问题；\r\n4、负责及时跟踪货品发货动向，及时与用户沟通；\r\n5、完成上级领导分配的其他工作。\r\n\r\n任职要求：\r\n1、有较强的学习能力和良好的表达能力；\r\n2、熟练使用EXCEL、word、PPT等办公软件；\r\n3、具备较强的沟通协调能力和客户服务意识，优秀的沟通谈判和危机处理能力；\r\n4、具备优秀的问题分析与解决能力、较强的应变能力和善后处理能力，能独立处理售前、售后、投诉等业务。', '', 4500, 8000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1250, '2025-04-08 15:21:13.331766', '2025-04-08 15:21:13.331766', NULL, '主播', '岗位职责\r\n1、负责公司账号直播，直播思路清晰，能快速反应解答粉丝疑问，引导粉丝互动制造氛围；\r\n2、根据活动/产品/品牌规划直播排期，撰写直播内容，把控直播节奏，面对突发状况具有及时处理能力及良好的心态；\r\n3、有自己的直播想法，能和运营一起分析直播数据，并进行优化，复盘直播效果，不断提升直播品质，提高直播转化；\r\n4、思维逻辑清晰，能熟练电脑操作，懂得直播规则，熟悉平台玩法；\r\n5、完成上级交办的其他工作。\r\n\r\n\r\n任职要求：\r\n1、有1年以上的直播经验，具有抖音直播、主持人相关行业经验，普通话水平优秀；\r\n2、形象气质佳，热情开朗，镜头感强，上镜效果好，面对镜头不怯场，语言表达能力强，擅长直播间气氛活跃；\r\n3、熟悉抖音/电商等平台直播规则，有一定的学习精神，主观能动性强，能够迅速抓取互联网流行文化；\r\n4、喜欢看直播，认可新媒体直播行业。\r\n\r\n福利待遇：\r\n1、工作时间：10:00-19:00，周末休息（大小周制），节假日按规定\r\n2、薪资范围：5-10k/月\r\n3、社保类型：五险\r\n4、其他福利：带薪年假，各种节日福利，办公环境好，团队氛围融洽，有不定时下午茶福利及公司聚餐。', '', 4000, 9000, 5, '全职', NULL, 1, 432, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1251, '2025-04-08 15:21:13.625044', '2025-04-08 15:21:13.625044', NULL, '带货主播', '岗位职责\r\n1、负责公司账号直播，直播思路清晰，能快速反应解答粉丝疑问，引导粉丝互动制造氛围；\r\n2、根据活动/产品/品牌规划直播排期，撰写直播内容，把控直播节奏，面对突发状况具有及时处理能力及良好的心态；\r\n3、有自己的直播想法，能和运营一起分析直播数据，并进行优化，复盘直播效果，不断提升直播品质，提高直播转化；\r\n4、思维逻辑清晰，能熟练电脑操作，懂得直播规则，熟悉平台玩法；\r\n5、完成上级交办的其他工作。\r\n\r\n\r\n任职要求：\r\n1、有1年以上的直播经验，具有抖音直播、主持人相关行业经验，普通话水平优秀；\r\n2、形象气质佳，热情开朗，镜头感强，上镜效果好，面对镜头不怯场，语言表达能力强，擅长直播间气氛活跃；\r\n3、熟悉抖音/电商等平台直播规则，有一定的学习精神，主观能动性强，能够迅速抓取互联网流行文化；\r\n4、喜欢看直播，认可新媒体直播行业。\r\n\r\n福利待遇：\r\n1、工作时间：10:00-19:00，周末休息（大小周制），节假日按规定\r\n2、薪资范围：6-8k/月\r\n3、社保类型：五险\r\n4、其他福利：带薪年假，各种节日福利，办公环境好，团队氛围融洽，有不定时下午茶福利及公司聚餐。', '', 4000, 8000, 2, '全职', NULL, 1, 432, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1252, '2025-04-08 15:21:13.928709', '2025-04-08 15:21:13.928709', NULL, '拍摄剪辑', '岗位职责：\r\n1、负责短视频的项目拍摄、剪辑、后期等工作；\r\n2、根据出镜演员人设定位，进行剧情设计，并把控拍摄节奏，保证视频整体效果；\r\n3、具备多样化的剪辑手法和视觉效果设计能力，包括网感创意，转场方式，字幕设计，营销方式；\r\n4、熟悉各类运镜手法，懂得运用镜头语言、剪辑手法表达氛围和视频效果；\r\n5、有良好的审美和对视频镜头有美感追求，对色彩、灯光、构图、镜头语言有较清晰的认知；\r\n6、完成上级交办的其他工作。\r\n\r\n任职要求：\r\n1、有食品拍摄，剪辑工作经验优先考虑；\r\n2、创意思维好，能配合好策划、脚本做好相对应的视频；\r\n3、熟练使用短视频拍摄设备，熟练操作短视频剪辑软件；\r\n4、擅长沟通，有团队意识，能承受较高的工作强度，热爱短视频制作；\r\n5、请带上作品面试。\r\n\r\n\r\n福利待遇：\r\n1、工作时间：10:00-19:00，周末休息（大小周制），节假日按规定\r\n2、薪资范围：4-6k/月\r\n3、社保类型：五险\r\n4、其他福利：带薪年假，各种节日福利，办公环境好，团队氛围融洽，有不定时下午茶福利及公司聚餐。', '', 4000, 6000, 5, '全职', NULL, 1, 432, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1253, '2025-04-08 15:21:14.559601', '2025-04-08 15:21:14.559601', NULL, '电子电气可靠性测试工程师', '工作内容:\r\n1.核对测试申请表、流转单和实际样品的情况，确保样品数量及条件满足测试要求,并根据条件制定相应的原始记录表 ；\r\n2.独立完成测试环境搭建，对自己测试的样品进行管理（测试前、测试中、测试后退样/留样）；\r\n3.如实记录或保存设备输出的测试结果（结果、图片、曲线）；\r\n4.仪器的日常维护（设备输出结果、温湿度监控、除尘）；\r\n5.负责的区域进行整理、整顿、清扫、清洁；\r\n6.配合领导或组长完成临时工作安排。\r\n\r\n任职资格:\r\n本科及以上学历，电子电气/自动化/材料/新能源汽车等相关专业。', '', 6000, 8000, 5, '全职', NULL, 1, 433, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1254, '2025-04-08 15:21:14.795423', '2025-04-08 15:21:14.795423', NULL, '材料可靠性测试工程师', '工作内容:\r\n1.核对测试申请表、流转单和实际样品的情况，确保样品数量及条件满足测试要求,并根据条件制定相应的原始记录表 ；\r\n2.独立完成测试环境搭建，对自己测试的样品进行管理（测试前、测试中、测试后退样/留样）；\r\n3.如实记录或保存设备输出的测试结果（结果、图片、曲线）；\r\n4.仪器的日常维护（设备输出结果、温湿度监控、除尘）；\r\n5.负责的区域进行整理、整顿、清扫、清洁；\r\n6.配合领导或组长完成临时工作安排。\r\n\r\n任职资格:\r\n本科及以上学历，材料相关专业。', '', 6000, 9000, 5, '全职', NULL, 1, 433, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1255, '2025-04-08 15:21:15.016505', '2025-04-08 15:21:15.016505', NULL, '理化VOC检测工程师', '招聘要求：\r\n1、化学、材料等相关专业；\r\n2、在校期间学习成绩优异，实操动手能力强；\r\n3、熟悉实验仪器使用与保养。\r\n\r\n工作内容：\r\n1、负责核对 电子电器ROHS,SVHC等 原始记录的准确性、完整性；\r\n2、负责电子电器ROHS,SVHC等报告中客户信息和数据的准确性，完成报告制作；\r\n3、根据不同的检测项目标准，编制修改和完善检测报告模板。', '', 9000, 15000, 2, '全职', NULL, 1, 433, 7, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1256, '2025-04-08 15:21:15.608714', '2025-04-08 15:21:15.608714', NULL, '化学检测工程师', '工作内容：\r\n1、负责跟进开发有机测试新的检测方法，起草SOP，方法验证，不确定度等文件；\r\n2、负责测试报告数据审核，确保测试过程符合实验室质量控制要求；\r\n3、负责跟进CNAS,CMA,客户等审核准备工作；\r\n4、负责有机组设备维护工作；\r\n5、负责对不符合项调查和整改；\r\n\r\n工作要求\r\n硕士学历，化学相关专业。', '', 9000, 15000, 2, '全职', NULL, 1, 433, 7, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1257, '2025-04-08 15:21:15.828055', '2025-04-08 15:21:15.828055', NULL, '理化测试工程师', '招聘要求：\r\n1、本科学历，化学、材料等相关专业；\r\n2、在校期间学习成绩优异，实操动手能力强；\r\n3、熟悉实验仪器使用与保养。\r\n\r\n工作内容：\r\n1、负责化学/材料实验操作和原始数据分析；\r\n2、负责实验室设备的日常校准与维护；\r\n3、根据SOP进行产品测试，填写并整理测试数据；\r\n4、协助开发新的测试方法', '', 6000, 9000, 2, '全职', NULL, 1, 433, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1258, '2025-04-08 15:21:16.484987', '2025-04-08 15:21:16.484987', NULL, '管培生（电子商务方向）', '岗位职责：   \r\n1、协助电子商务代理运营公司，负责电子商务的客服工作以及与公司的协调工作；\r\n2、电子商务方面的订单退货跟进及问题件的跟进；\r\n3、电子商务的定期对账；\r\n4、电子商务的退货数据统计及分析；\r\n5、网点销售费用的申请；\r\n6、电商订单跟踪处理；\r\n7、电商促销订单排产及加个审批申请；\r\n8、特殊渠道销售的协助；\r\n9、作为公司未来管理层的后备军，入职后在公司各业务部门轮岗6-8个月，根据各业务部门计划安排，了解、熟悉、掌握公司各岗位不同业务运作流程、规章制度及技能要求；\r\n10、各部门轮岗学习和考核通过后，因个人能力定岗，担当业务部门骨干或管理人员，独立开展各项工作。\r\n岗位要求：\r\n1、本科及以上学历，电子商务类专业；\r\n2、能吃苦耐劳，具备较好的协调能力和沟通表达能力；', '', 5000, 7000, 2, '全职', NULL, 1, 434, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1259, '2025-04-08 15:21:16.973537', '2025-04-08 15:21:16.973537', NULL, '平面设计', '岗位职责：   \r\n1、根据公司现有软装体系制作软装方案；\r\n2、负责软装产品进场与相关过程跟进；\r\n3、负责软装设计方案图册制作、效果图设计等工作；\r\n4、协助公司完善软装产品体系。\r\n岗位要求：\r\n1、本科及以上学历，美术院校或设计相关专业；\r\n2、熟练PS、CAD、office、酷家乐/三维家等相关办公软件；\r\n3、善用设计语言跟客户沟通与解决相关问题；\r\n4、要求能完成设计方案和清单，并推动方案执行落地、有效配合团队完成相关工作；\r\n5、富有工作热情、对职业热爱、独立审美、创作欲望和责任感；', '', 6000, 8000, 2, '全职', NULL, 1, 434, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1260, '2025-04-08 15:21:17.120369', '2025-04-08 15:21:17.120369', NULL, '管培生（财务方向）', '岗位职责：\r\n\r\n1.进行生产制造成本核算。\r\n\r\n2.编制成本费用、经济效益、全年总预算。\r\n\r\n3.根据新产品及来样加工的开发及材料成本，编制新产品及来样加工成本预算。\r\n\r\n4.编制会计总表。根据原始凭证编制会计凭证。\r\n\r\n5.根据公司财务制度，审核原始凭证资料，填写OA单据，编制财务凭证。\r\n\r\n6.完成部门经理交办的其他工作。\r\n\r\n7、作为公司未来管理层的后备军，入职后在公司各业务部门轮岗6-8个月，根据各业务部门计划安排，了解、熟悉、掌握公司各岗位不同业务运作流程、规章制度及技能要求；\r\n\r\n8、各部门轮岗学习和考核通过后，因个人能力定岗，担当业务部门骨干或管理人员，独立开展各项工作。\r\n\r\n\r\n\r\n岗位要求：\r\n\r\n1、本科学历以上，有丰富的岗位工作经验的。\r\n\r\n2、熟悉 会计制度、会计法规、税务知识。\r\n\r\n福利待遇：\r\n\r\n1、设有饭堂及员工宿舍，提供免费大巴接送员工上下班（旗峰公园，文化广场）\r\n\r\n2、双休，五天八小时工作制，员工可享受年休、产、婚、丧等假期及13天春节假期。\r\n\r\n3、签订劳动合同，购买五险一金。\r\n\r\n4、公司作为“东莞市实施重点企业规模与效益倍增计划试点企业”，根据《2018东莞市新时代创新人才引进培养实施方案》规定，入职我司可申请莞市新时代创新人才补贴，补贴标准为：\r\n\r\n（1）本科或初级职称：20000元/人\r\n\r\n（2）硕士或中级职称，或上年度在莞纳税额超过3万（含）的人才：6万元/人。\r\n\r\n（3）博士或高级职称：20-30万元/人。\r\n\r\n\r\n简历投递说明：\r\n\r\n接收邮箱：lxj@yulangroup.cn  \r\n\r\n投递格式为：「姓名+学校+专业+应聘岗位」\r\n\r\n联系电话：黎/王小姐 0769-22677203', '', 5000, 7000, 2, '全职', NULL, 1, 434, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1261, '2025-04-08 15:21:17.408798', '2025-04-08 15:21:17.408798', NULL, '国际贸易专员', '岗位职责\r\n\r\n1. 负责公司国际贸易客户的维护和开发，建立良好的合作关系\r\n\r\n2. 熟悉公司国际贸易产品的市场推广和销售\r\n\r\n3. 负责收集、整理和分析市场信息，根据市场需求及时向公司反馈，为业务发展策略提供建议\r\n\r\n4. 具备良好的英语听说读写能力，能够阅读和撰写相关文件，如合同、报价单等\r\n\r\n工作地点：东莞，根据业务需要出差香港\r\n\r\n任职资格：\r\n\r\n1.本科以上学历，英语、商务英语相关专业，1-2年工作经验优先，优秀应届生亦可\r\n\r\n2.具有较强的沟通和协调应变能力，善于与人沟通；\r\n\r\n3.谦虚谨慎、踏实认真；工作主动积极、细致、工作责任心强；\r\n\r\n简历投递说明：\r\n\r\n接收邮箱：lxj@yulangroup.cn  \r\n\r\n投递格式为：「姓名+学校+专业+应聘岗位」\r\n\r\n联系电话：黎/王小姐 0769-22677203', '', 6000, 8000, 2, '全职', NULL, 1, 434, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1262, '2025-04-08 15:21:17.666491', '2025-04-08 15:21:17.666491', NULL, '设计员', '岗位职责：\r\n\r\n1、负责墙纸墙布新版本设计与开发，并跟进产品生产过程。\r\n2、负责客户产品定制设计服务。\r\n\r\n岗位要求：\r\n1、装潢设计/艺术设计及相关专业，熟练使用相关设计软件\r\n2、有较好的审美能力，懂得色彩搭配为佳，有创新能力\r\n3、工作积极主动，态度端正\r\n\r\n4、有软装经验或相关作品集的优先考虑\r\n\r\n福利待遇：\r\n\r\n周末双休，8小时制，提供食宿，五险一金，节日福利，绩效奖季度奖年终奖等\r\n\r\n公司地址：东莞市东城区莞龙路段狮龙路口莞城科技园内\r\n\r\n欢迎各美术院校优秀应届毕业生投递简历应聘', '', 6000, 8000, 2, '全职', NULL, 1, 434, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1263, '2025-04-08 15:21:17.958875', '2025-04-08 15:21:17.958875', NULL, '管培生（人力方向）', '岗位职责：\r\n\r\n1、负责专项培训的策划、组织及实施，跟踪和评估培训效果，并持续改善；\r\n\r\n2、协助建立并优化培训管理体系，对培训需求分析、课件开发、效果评估等有系统掌握；\r\n\r\n3、 整合培训资源，协助建立内外部师资库、教材库、试题库和案例库等；\r\n\r\n4、协助培训管理相关的信息化建设（网站、微信等），负责培训档案的整理及管理；\r\n\r\n5、作为公司未来管理层的后备军，入职后在公司各业务部门轮岗6-8个月，根据各业务部门计划安排，了解、熟悉、掌握公司各岗位不同业务运作流程、规章制度及技能要求；\r\n\r\n6、各部门轮岗学习和考核通过后，因个人能力定岗，担当业务部门骨干或管理人员，独立开展各项工作。\r\n\r\n\r\n\r\n岗位要求：\r\n\r\n1、工商管理，行政管理以及人力资源管理等专业优先考虑。\r\n\r\n2、熟练运用Word、excel、PPT等办公软件，沟通及书面表达能力强。\r\n\r\n3、认真负责，工作积极主动且细心，具备较好的沟通表达能力。\r\n\r\n\r\n\r\n福利待遇：\r\n\r\n1、设有饭堂及员工宿舍，提供免费大巴接送员工上下班（旗峰公园，文化广场）\r\n\r\n2、双休，五天八小时工作制，员工可享受年休、产、婚、丧等假期及13天春节假期。\r\n\r\n3、签订劳动合同，购买五险一金。\r\n\r\n4、公司作为“东莞市实施重点企业规模与效益倍增计划试点企业”，根据《2018东莞市新时代创新人才引进培养实施方案》规定，入职我司可申请莞市新时代创新人才补贴，补贴标准为：\r\n\r\n（1）本科或初级职称：20000元/人\r\n\r\n（2）硕士或中级职称，或上年度在莞纳税额超过3万（含）的人才：6万元/人。\r\n\r\n（3）博士或高级职称：20-30万元/人。\r\n\r\n\r\n\r\n简历投递说明：\r\n\r\n接收邮箱：lxj@yulangroup.cn  \r\n\r\n投递格式为：「姓名+学校+专业+应聘岗位」\r\n\r\n联系电话：黎/王小姐 0769-22677203', '', 5000, 7000, 2, '全职', NULL, 1, 434, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1264, '2025-04-08 15:21:18.224985', '2025-04-08 15:21:18.224985', NULL, '业务经理', '岗位职责：\r\n\r\n1、根据销售目标，落实销售计划，实现年度销售任务；\r\n\r\n2、负责工程项目的开发、管理等。\r\n\r\n3、负责经销商的维护及开发管理\r\n\r\n4、收集市场信息\r\n\r\n\r\n\r\n岗位要求：\r\n\r\n1、销售经验优先考虑；优秀应届毕业生也可考虑。\r\n\r\n2、能适应出差（出差费用按公司规定报销）；\r\n\r\n3、需长期出差，出差地点根据公司安排，不限区域。\r\n\r\n\r\n\r\n\r\n\r\n福利待遇：\r\n\r\n1、福利待遇优厚，入职即配办公手机（含月度话费）。\r\n\r\n2、8000元保底工资\r\n\r\n3、年度任务完成有丰厚的业绩提成。\r\n\r\n4、签订劳动合同，购买五险一金。\r\n\r\n\r\n\r\n月综合收入：8000元-20000元（薪资与销售业绩挂钩，上不封顶）。\r\n\r\n工作地点：广州营、深圳、安徽、河南、山东、江西、云南、贵州、北京、西安、华中华南等区域及周边城市\r\n\r\n\r\n职位福利：五险一金、绩效奖金、带薪年假、节日福利、免费班车、免费停车、周末双休、提供食宿', '', 8000, 20000, 5, '全职', NULL, 1, 434, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1265, '2025-04-08 15:21:18.845640', '2025-04-08 15:21:18.845640', NULL, '销售工程师', '1、	了解ERP理论或财务知识\r\n2、	性格外向，做事积极主动。\r\n3、	有良好的销售意识和技巧，有敏锐的市场观察力\r\n4、	沟通能力强\r\n5、	目标意识强，有 一定的抗压能力', '', 4500, 5000, 5, '全职', NULL, 1, 435, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1266, '2025-04-08 15:21:19.093368', '2025-04-08 15:21:19.093368', NULL, '技术工程师', '1、计算机、财务或者信息管理等相关专业\r\n2、熟悉主流数据库（SQL、ORACLE）对数据结构有了解。\r\n3、学习能力强，有较强的客户服务意识，\r\n4、有较强的沟通表达能力和团队协助精神。', '', 4500, 6000, 5, '全职', NULL, 1, 435, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1267, '2025-04-08 15:21:19.771188', '2025-04-08 15:21:19.771188', NULL, '抖音直播运营', '职位亮点：\r\n1.引领潮流，打造最具影响力的直播！\r\n2.与年轻活力、才华横溢的团队成员共事，共创辉煌！\r\n3.丰厚待遇，等你来挑战！\r\n岗位职责：\r\n1.负责抖音男团的日常运营工作，包括内容策划、拍摄执行及后期发布。\r\n2.分析用户喜好，制定针对性的运营策略，提升男团知名度与粉丝粘性。\r\n3.协调团队成员，确保直播内容的高质量与持续性。\r\n4.监控数据表现，及时调整运营策略，实现流量与收益的双增长。\r\n任职要求：\r\n1.熟悉抖音平台规则及运营技巧，有成功运营案例者优先。\r\n2.具备良好的团队合作精神与沟通能力，能够激发团队潜能。\r\n3.对流行趋势敏感，有创意策划能力，善于捕捉热点话题。\r\n4.工作积极主动，能够承受工作压力，追求卓越。\r\n 薪资待遇：\r\n薪资面议，能力越强，待遇越优！\r\n提成+奖金，业绩越好，收入越高！', '', 4500, 8500, 5, '全职', NULL, 1, 436, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1268, '2025-04-08 15:21:20.030420', '2025-04-08 15:21:20.030420', NULL, '舞蹈老师', '公司简介：\r\n我们是一家位于东莞的充满活力与创新精神的传媒机构，专注于培养并推广优秀的练习生。在这里，才华与激情碰撞，梦想与现实交融。现因业务扩展需要，诚邀热爱舞蹈、富有创意与耐心的您加入我们的团队，共同打造精彩纷呈的直播世界。\r\n岗位职责：\r\n设计并教授男女主播爵士舞、编舞、solo及抖音热门短舞等舞蹈课程。\r\n定期更新舞蹈内容，紧跟潮流趋势，为学员提供新颖、时尚的舞蹈体验。\r\n参与新主播面试流程，指导面试者进行舞蹈展示，评估其舞蹈潜力。\r\n协助提升主播的舞蹈表现力与舞台魅力，促进个人及团队整体舞蹈水平的提升。\r\n与团队成员紧密合作，共同策划并执行相关舞蹈活动及直播内容。\r\n任职要求：\r\n拥有扎实的舞蹈基础，熟悉爵士舞、编舞等舞种，具备良好的舞蹈教学能力。\r\n热爱舞蹈教育事业，有耐心、责任心和良好的团队合作精神。\r\n能够快速学习并掌握新舞蹈，具备创新能力和良好的编舞能力。\r\n熟悉抖音等社交媒体平台，了解并关注舞蹈类热门内容。\r\n有相关工作经验者优先，但优秀的新人亦可考虑。\r\n工作时间：\r\n每天下午1点至晚上10点，周日单休。\r\n薪酬福利：\r\n实习期薪资：5000元/月，表现优异者可提前转正。\r\n转正后薪资：根据工作表现及机构发展情况有晋升机会及薪资调整。\r\n提供良好的工作环境与个人成长平台。\r\n公司提供五险一金', '', 5000, 8000, 2, '全职', NULL, 1, 436, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1269, '2025-04-08 15:21:20.316848', '2025-04-08 15:21:20.316848', NULL, '艺人经纪人', '要求：\r\n很负责的告诉求职者，加入公司会让你学到很全面的知识，前提是请你做好心理准备加入一个很有热血有战斗力的团队\r\n待遇：\r\n1.实习期3400无责底薪+人头费+提成\r\n2.转正4500无责底薪+人头费+提成\r\n3.公司全是90，00后群体，氛围好，不定时下午茶，团建，旅游等等。\r\n职责要求：\r\n1：性格开朗，善于沟通，性格好相处\r\n2：能够与女生有比较好的沟通\r\n3：吃苦耐劳较强\r\n4：执行能力强\r\n5：有传媒行业经纪人/星探/人事招聘/销售/工作经验者\r\n优先考虑。\r\n工作内容；\r\n1定期完成招聘量化的工作要求，并能独立处理和解決\r\n所负责的任务;\r\n2、执行招聘计划,发布招聘信息、简历筛选、面试邀约、面试安排及结果跟进;', '', 4500, 6000, 5, '全职', NULL, 1, 436, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1270, '2025-04-08 15:21:20.588254', '2025-04-08 15:21:20.588254', NULL, '抖音直播艺人', '东莞抖音高颜值直播团队招聘,高底薪,高提成。\r\n公司抖音旗下女团:MXR-滨海湾，MXR-猫星团，MXR-月亮湾，MXR-Super男孩\r\n时间自由,不画大饼,不内卷薪资透明,薪资远超大部分同行业\r\n1.不会跳舞?我们有专业舞蹈老师带薪学习! \r\n2.不会化妆?我们有专业妆造师化妆搭配服装! \r\n3.不会拍视频?我们有专业摄影师拍摄!\r\n4.重要的是接受小白！接受小白！接受小白！\r\n岗位要求:身高155以上 有无舞蹈经验均可\r\n热爱跳舞表演,面对镜头不怯场。工作内容:\r\n1.前期以练舞为主,练舞期为7天,有专业的舞蹈老师教学(带薪学舞!)\r\n2.培训结束后就是跟团队成员一起跳舞!每天六个小时左右\r\n薪资待遇:保底10000起,综合到手薪资3-20w', '', 6000, 10000, 20, '全职', NULL, 1, 436, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1271, '2025-04-08 15:21:21.399864', '2025-04-08 15:21:21.399864', NULL, '封装助理工程师', '封装助理工程师\r\n1、在线异常的跟踪处理。\r\n2、工程批、小批订单的进度跟踪汇总。\r\n3、工艺文件的回签、审核、确认。\r\n4、所有涉及审核文件、回签文件、风险函、摸底数据和工程FT数据的汇总整理。\r\n5、对封装厂晶圆来料异常的回复反馈汇总。\r\n6、各部门需要在封装厂做可靠性需求的安排、跟进与结果确认。\r\n7、每月对工程进度进行汇总报告，主要涉及产品品质异常和工程批完成数量和在制数量等。\r\n8、FT和CP数据的分析确认。\r\n9、上级安排的其它任务。\r\n10、电子类相关专业优先。', '松江区', 6000, 9000, 3, '全职', NULL, 1, 437, 6, NULL, NULL, NULL, NULL, NULL, 0, '310100', '310000', '310117', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1272, '2025-04-08 15:21:21.626731', '2025-04-08 15:21:21.626731', NULL, '销售工程师', '销售工程师岗位职责：\r\n1、负责开拓市场发展目标新客户。\r\n2. 制定销售计划，完成销售目标\r\n3、定期拜访客户，维护客户关系，提交访客报告。\r\n4、配合代理商对公司产品进行推广\r\n5、自主或协助客户进行元器件选型及替换。\r\n5、需要了解新客户的详细信息。\r\n6、对代理商业务人员进行产品辅导及培训。\r\n7、完成领导安排的其它销售工作。\r\n\r\n任职要求:\r\n1、本科学历。\r\n2、有良好的学习能力和团队合作精神，有较强的沟通能力，热爱销售，敢闯敢干。', '', 6000, 12000, 3, '全职', NULL, 1, 437, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1273, '2025-04-08 15:21:21.778823', '2025-04-08 15:21:21.778823', NULL, 'FAE工程师', '1、主要负责技术支持工作（MOS、ESD/TVS、二三极管、电源管理IC类产品）；\r\n2、处理产品的前期技术推广产品选型、中期测试验证和项目调试、后期量产支持及客诉处理；\r\n3、面向公司销售、代理商提供产品的技术支持和培训；\r\n4、收集跟进客户端已量产的产品问题点，并反馈研发部门分析、改善；\r\n5、评估新技术和新产品，为公司战略决策提供技术支持；\r\n6、根据工作内容编写市场应用报告、市场新平台和新产品机会分析报告\r\n7、根据客户应用建立客户技术支持档案；\r\n8、处理客户项目的静电和浪涌整改事件，并给出测试和改善性报告。\r\n\r\n任职资格：\r\n1、本科及以上学历，电子工程、自动化等相关专业；\r\n2、熟悉复杂电路逻辑原理，有大功率电源、电机硬件研发经验者优先。\r\n3、拥有较强的硬件基础，熟悉原理图硬件设计及layout。\r\n4、有相关行业原厂FAE/AE工作经验者优先；\r\n5、性格积极乐观，拥有团队合作意识，有较强的责任感和抗压能力。\r\n6、具备较强的学习能力和问题解决能力，能够适应快速变化的工作环境。\r\n7、具备良好的客户服务意识，能够站在客户角度思考问题。', '', 6000, 10000, 5, '全职', NULL, 1, 437, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1274, '2025-04-08 15:21:22.566574', '2025-04-08 15:21:22.566574', NULL, '运力运营岗', '【物流运营方向】\r\n1.围绕全国业务履约体验、成本及安全等核心数据，进行指标体系搭建及运营；\r\n2.基于数据分析结果进行物流业务策略制定，并推动落地；\r\n3.不断优化与完善业务运营流程，提升履约效率及标准化程度；\r\n4.建设物流合作商运营管理体系并设计标准化方案，提高商结构及业务健康度。', '海淀区', 10000, 15000, 150, '全职', NULL, 1, 438, 6, NULL, NULL, NULL, NULL, NULL, 1, '110100', '110000', '110108', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1275, '2025-04-08 15:21:23.200608', '2025-04-08 15:21:23.200608', NULL, '新媒体运营岗', '共同打造泛娱乐化的金融专业新媒体账号，通过短视频、直播的方式进行平民化的投资者教育、吸引全国范围的证券投资者，并高效服务存量的投资者客户，共同做大做强居民财富管理、投资银行业务等综合投融资服务，同时传递党的声音、普及中华传统文化，持续创造经济价值、履行社会责任。\r\n1．负责或协助负责营业部新媒体工作室的日常运营，包括推送、笔记、短视频/直播策划及制作发布等。\r\n2.通过新媒体渠道拓展市场，提高品牌曝光量和用户粘性。\r\n3.完成公司下发的各项考核指标和服务指标。\r\n4.具体职责将根据个人特长进行调整，力求发挥长处、互为补充，打造金融行业卓越的新媒体工作室。\r\n\r\n	任职要求\r\n1.本科及以上学历。\r\n2.通过证券从业资格考试（可以协助报名参加专场考试）。\r\n3.有新媒体运营经验者优先。\r\n4.具备高度的责任心、较强的学习能力、适应能力以及良好的团队合作精神。\r\n5.中共党员优先。', '', 4500, 10000, 2, '全职', NULL, 1, 439, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1276, '2025-04-08 15:21:23.856516', '2025-04-08 15:21:23.856516', NULL, '财富管理岗', '1.开发高净值客户及机构客户，收集客户财务信息与需求，建立长期合作关系，定期回访客户，跟踪资产变动情况，调整理财方案以匹配客户目标。\r\n2.分析客户资产规模、风险偏好及财务目标，制定个性化理财方案。\r\n3.销售公司标准化金融产品（如信托、基金、理财等），提供专业投资建议。 \r\n4.评估客户风险承受能力，制定风险管理策略并监控投资组合风险。\r\n5.协同产品团队推动创新，优化产品线以满足客户需求。\r\n\r\n	任职要求\r\n1.本科及以上学历。\r\n2.通过证券从业资格考试（可以协助报名参加专场考试）。\r\n3.有新媒体运营经验者优先。\r\n4.具备高度的责任心、较强的学习能力、适应能力以及良好的团队合作精神。\r\n5.中共党员优先。', '', 4500, 15000, 3, '全职', NULL, 1, 439, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1277, '2025-04-08 15:21:24.470631', '2025-04-08 15:21:24.470631', NULL, '专利代理人', '一、主要工作\r\n1.撰写专利申请文件，答复审查意见；\r\n2.检索并判断申请方案的新颖性与创造性、完善相关文件；\r\n3.为客户提供专业技术咨询意见，支持销售工作；\r\n4.平时为市场部同事提供一般性技术培训。\r\n\r\n二、任职资格 \r\n1.一本以上学历； \r\n2 .机械设计制造及其自动化专业、工业工程专业、过程装备与控制工程专业、车辆工程专业、机械工程及自动化专业、机电一体化、机械设计，工程机械、液压机械、车辆工程、家电技术等相关专业；\r\n3 .具备良好的文字表达能力和逻辑分析能力；\r\n4 .工作态度严谨、认真、负责。\r\n\r\n三、工作时间及福利待遇\r\n1.五天8小时工作制，不需加班；\r\n2.入职即签订劳动合同、购买六险一金；\r\n3.节假日福利、日常下午茶、外出旅游等等。', '', 6000, 12000, 2, '全职', NULL, 1, 440, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1278, '2025-04-08 15:21:24.758880', '2025-04-08 15:21:24.758880', NULL, '知识产权顾问', '一、岗位职责\r\n1.为客户提供专利、商标、版权及法务方面的综合服务；\r\n2.根据部门及团队的业务规划，制定个人业务计划并积极实现；\r\n3.主动通过各种渠道搜集客户信息，建立客户档案，积累客户资源；\r\n4.通过电话沟通、拜访面谈、推广活动等途径，推广公司知识产权产品，树立公司专业形象；\r\n5.接受客户的知识产权咨询，提供专业意见，维护客户关系，达成长期合作目的。\r\n\r\n二、任职要求\r\n1.本科及以上学历，具备知识产权相关业务经验尤佳；\r\n2.有良好的沟通交流能力，独立工作能力及团队合作精神；\r\n3. 有较强的学习能力及持续自我提升的意愿。\r\n\r\n三、工作时间及福利待遇\r\n1.五天8小时工作制，不需加班；\r\n2.入职即签订劳动合同、购买六险一金；\r\n3.节假日福利、日常下午茶、外出旅游等等。', '', 5000, 10000, 5, '全职', NULL, 1, 440, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1279, '2025-04-08 15:21:25.522908', '2025-04-08 15:21:25.522908', NULL, '店长助理', '职责：\r\n1、形象良好，沟通能力强，负责公司前台接待工作。\r\n2、负责公司电话接转、收发传真、文档复印等工作。\r\n3、负责各类办公文档、商务文档、合同协议的录入、排版、打印。\r\n4、日常文书、资料整理及其他一般行政事务。\r\n要求：\r\n1、熟练使用Word、 Excel等办公软件;\r\n2、具有良好的沟通能力、协调能力，及较强的保密意识;\r\n3、具有良好的适应能力。', '', 3000, 4000, 5, '全职', NULL, 1, 441, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1280, '2025-04-08 15:21:25.846346', '2025-04-08 15:21:25.846860', NULL, '会计助理', '岗位职责：\r\n\r\n1. 根据公司经营范围归类整理原始凭证、录入凭证、处理账务、编制财务报表\r\n\r\n2. 按公司和财务相关部门的要求准确填写纳税申报表、税票、年审表及其他报表；\r\n\r\n3.协助主管处理其他财务方面的事项\r\n岗位要求：\r\n\r\n1、会计相关专业，本科学历；\r\n\r\n2、认真细致，爱岗敬业，吃苦耐劳，有良好的职业操守；\r\n\r\n4、思维敏捷，接受能力强，能独立思考，善于总结工作经验；\r\n\r\n5、具有良好的沟通能力；\r\n\r\n6、有会计从业资格证书，具备会计初级资格证者优先考虑', '', 3500, 4500, 10, '全职', NULL, 1, 441, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1281, '2025-04-08 15:21:25.987919', '2025-04-08 15:21:25.987919', NULL, '招聘专员', '1、协助上级开展招聘工作。\r\n\r\n2、通过多种渠道积极物色合适的人才，及时满足各个部门的用人需求。\r\n\r\n3、负责招聘过程的简历筛选、预约、面试安排及跟踪落实面试人员的情况等。\r\n\r\n4、 协助上级开展好校招的对接工作。\r\n双休，有招聘兼职经验最优', '', 3000, 5000, 5, '全职', NULL, 1, 441, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1282, '2025-04-08 15:21:26.283291', '2025-04-08 15:21:26.283291', NULL, '销售代表', '岗位职责：\r\n\r\n1、熟悉周边的商圈，包括写字楼，商场，超市，学校，交通等；\r\n\r\n2、通过电话，网络平台等渠道与客户进行沟通；\r\n\r\n3、积累客户源与房源；\r\n\r\n4、接待上门客户，详细了解客户的需求，做好信息的合理匹配；\r\n\r\n5、根据客户需求意向，带客户看房并促成成交；\r\n\r\n6、完成领导安排的其他工作。\r\n\r\n\r\n\r\n任职资格：\r\n\r\n1、有房地产销售工作经验，也可接受应届生，有房地产、金融或市场营销专业优先；\r\n\r\n2、品行端正，积极进取，擅长与人沟通，有较强的学习能力及协调能力；\r\n\r\n3、定位清晰、热爱销售行业，敢于挑战自己；\r\n\r\n4、诚实勤奋，有团队合作精神，具备较强的抗压能力。', '', 4000, 5500, 20, '全职', NULL, 1, 441, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1283, '2025-04-08 15:21:26.488649', '2025-04-08 15:21:26.488649', NULL, '短视频编导', '1.根据短视频定位要求，挖掘选题，前期内容策划，把握节目风格，撰写脚本。\r\n2.组织拍摄与录制，负责现场的调度与控制；\r\n3.跟进后期制作，督促及配合后期制作，保证短视频出片质量。', '', 3500, 4500, 2, '全职', NULL, 1, 441, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1284, '2025-04-08 15:21:27.131470', '2025-04-08 15:21:27.131470', NULL, '体验顾问', '专业能力:普通话流利，具备较强的亲和力及用户服务意识;具备良好的团队协作精神、沟通协调能力。\r\n职业素养:高度责任心、工作积极性;执行力强，抗压能力强。\r\n择优条件:大专及以上，应届毕业生;体态匀称，五官端正', '', 6500, 8000, 50, '全职', NULL, 1, 442, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1285, '2025-04-08 15:21:27.808306', '2025-04-08 15:21:27.808306', NULL, '区域总监', '1、负责所辖区域的新客户开拓，客户信息的搜集；\r\n2、定期拜访客户，销售公司产品；\r\n3、与客户进行沟通，及时掌握客户需要，了解客户状态；\r\n4、组建团队并进行团队管理\r\n5、拓展营销渠道', '', 8000, 100000, 2, '全职', NULL, 1, 443, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1286, '2025-04-08 15:21:28.035898', '2025-04-08 15:21:28.035898', NULL, '实习生（应届毕业生，有意向从业）', '1、会安排培训学习证券知识\r\n2、提供考证券从业证报名机会及考前培训\r\n3、根据用人单名需求协助处理一些后台工作\r\n4、服从安排，遵守考勤要求，参与培训', '', 1000, 1200, 10, '全职', NULL, 1, 443, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1287, '2025-04-08 15:21:28.345458', '2025-04-08 15:21:28.345458', NULL, '理财顾问', '1、负责拓展销售渠道，开发新客户，销售公司发行或代销的金融理财产品；\r\n2、负责维护销售渠道，维护老客户，为客户提供理财咨询等服务；\r\n3、负责收集市场信息和客户建议，向客户传递公司产品与服务信息；\r\n4、负责为客户提供金融理财的合理化建议为客户实现资产保值增值；\r\n5、负责向客户提供与证券经纪业务相关的服务工作；\r\n6、负责组织并策划高级营销活动，开发高端市场；\r\n7、负责为客户提供各种综合性基础理财咨询服务；\r\n8、负责完成销售任务目标，销售基金、债券、股票等金融产品；', '', 4500, 20000, 10, '全职', NULL, 1, 443, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1288, '2025-04-08 15:21:29.280096', '2025-04-08 15:21:29.280096', NULL, '前端助理实习生', '岗位职责：\r\n1、协助资深前端工程师，参与PC端、移动端的前端设计和研发的基础工作\r\n2、配合后端人员，完成简单页面元素的搭建和基础交互功能测试\r\n3、协助排查并记录项目中的简单界面问题和兼容性问题\r\n任职要求：\r\n1、了解 js、html、css 等前端技术，对页面架构和布局有初步认识\r\n2、了解前端 UI 框架相关概念，有学习意向\r\n3、学习过 ES6 基础知识，对 vue3、ts、tailwindCss 等有初步了解\r\n4、有学习 uni-app 框架应用的热情，愿意在指导下尝试简单移动端开发\r\n5、了解 git 基本操作，熟悉 npm 包的基础使用\r\n6、具有良好的学习态度，愿意主动沟通和学习，有团队合作意识', '', 3000, 5000, 5, '全职', NULL, 1, 444, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1289, '2025-04-08 15:21:29.504029', '2025-04-08 15:21:29.504029', NULL, '机械设计技术员', '工作内容：\r\n1.根据公司要求绘制2D,3D零件及机器设备图纸\r\n2.跟进外发件及设备装配效果确认\r\n3.使用solidworks或其它软件绘制零件的2D、3D图\r\n4.自动化设备出图及生成BOM表\r\n5.自动化设备的改进、升级\r\n6.参与项目的评估、设计、BOM整理以及装配、调试\r\n\r\n任职资格：\r\n1.自动化相关专业及应届毕业生\r\n2.大专或以上学历；机械设计或自动化设计相关专业\r\n3.熟练掌握机械制图基础\r\n4.掌握Office（Word，PPT，EXCEL）等办公软件\r\n\r\n5.能接受客户现场出差\r\n\r\n6.项目责任制，项目交付较急时，能主动加班推进项目', '', 4000, 8000, 5, '全职', NULL, 1, 444, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1290, '2025-04-08 15:21:29.734962', '2025-04-08 15:21:29.734962', NULL, '仓库管理员', '工作内容：\r\n1.根据订单发料\r\n2.物料整理分类\r\n3.库存及时更新，及时请购\r\n4.物料出入库登记\r\n5.签收货物，整理送货单\r\n6.物料返修登记及跟进\r\n7.完成上级领导安排的其他工作。\r\n任职资格：\r\n1、有一年以上电子厂工作经验优先\r\n2、工作积极主动，责任感强，能吃苦耐劳', '', 4500, 6500, 2, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1291, '2025-04-08 15:21:29.973155', '2025-04-08 15:21:29.973155', NULL, '测试系统项目工程师', '工作内容：\r\n1.承接客户需求, 消化吸收,整理并制定和验证可行性测试方案\r\n2.制作详细的测试逻辑, 系统方案, 硬件接线图\r\n3.制定项目schedule并负责推动项目进度\r\n4.协调软硬件等其他部门, 负责项目的交付\r\n5.必要的客户现场技术支持\r\n任职资格：\r\n1.熟练无线和音频类的产品的工作原理以及功能,音频, 射频测试\r\n2.需要英文读写能力，能够阅读datasheet(英文口语流利者优先)\r\n3.必要的模电数电基础，熟悉基本电路和电子元件\r\n4.具有较强的逻辑思维和严谨的推断分析能力\r\n5.熟悉常用的仪器仪表，如万用表/示波器/频谱仪等\r\n6.优秀的文档编写能力\r\n7.优秀的团队沟通协调能力\r\n8.能不断自我充电，积极迎接挑战', '', 10000, 20000, 5, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1292, '2025-04-08 15:21:30.226358', '2025-04-08 15:21:30.226358', NULL, '运动控制助理工程师', '工作内容：\r\n1.开发PC端测控软件(使用C#/Labview一种即可)\r\n2.集成应用各种仪器仪表，如控制器，机器人等\r\n4.代码维护及升级\r\n5.客户现场技术支持\r\n6.根据项目需求，选择合适的硬件（运动控制器、控制卡）编写软件程序最终实现控制功能；\r\n任职资格：\r\n1、本科以上学历，电子、电气自动化、电子信息，计算机软件等相关专业的应届毕业生\r\n2、需要编程基础，有LabVIEW或PLC编程基础优先考虑；\r\n3、有数字电路，模拟电路基础者优先考虑；\r\n4、工作积极主动，责任感强，能吃苦耐劳，思维敏捷；\r\n5、良好的团队意识和沟通能力', '', 4500, 8000, 5, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1293, '2025-04-08 15:21:30.474372', '2025-04-08 15:21:30.474372', NULL, '上位机开发工程师', '工作内容：\r\n1.主导测试方案的设计和论证\r\n2.进行测试系统的前期基础开发和Demo实现\r\n3.指导测试系统的升级和优化\r\n4.必要的技术支持和培训\r\n5.跟踪最新的ioT技术及探索。\r\n\r\n任职资格：\r\n1.本科或以上学历，理工科专业（资深者可放宽学历要求）\r\n2.有独立完成过至少一个Labview或C#大型项目的经验\r\n3.在射频/音频/软件/电路/算法/嵌入式等至少一项是强项，其知识及经验丰富\r\n4.有项目或团队管理经验优先\r\n5. 具有较强的工作和学习热情，能不断自我充电，更新知识\r\n6. 良好的数学建模能力和算法开发能力\r\n7. 优秀的团队沟通合作能力，和创新精神\r\n8. 优秀的文档编写能力，无障碍英文阅读或沟通能力。', '', 10000, 20000, 5, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1294, '2025-04-08 15:21:30.693949', '2025-04-08 15:21:30.693949', NULL, '自动化技术员', '工作内容：\r\n1、协助工程师对项目跟进验证和调试\r\n2、根据图纸及指导书对自动化设备调试组装\r\n3、设备装配过程中以及客户现场总结汇总反馈\r\n4、客户现场技术支持\r\n5、协助工程师分析验证，解决设备相关的技术质量等问题\r\n任职资格：\r\n1、自动化/电子信息等工科类专业；\r\n2、英语四级以上优先；\r\n3、专业课成绩需要中等水平以上；\r\n4、积极好学，有一定的抗压力\r\n5、良好的团队意识和沟通能力\r\n6、较强的动手能力，有开拓创新精神\r\n7、能接受客户现场出差', '', 4000, 7000, 10, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1295, '2025-04-08 15:21:30.972492', '2025-04-08 15:21:30.972492', NULL, 'TE技术员', '岗位职责：\r\n1、协助工程师按图纸架设测试设备\r\n2、日常对设备、设施进行安全检查\r\n3、产品相关测试平台的维修\r\n4、协助工程师对产品的相关复杂焊接搭接和实验工作\r\n5、完成领导交办其它的工作内容\r\n任职要求：\r\n1、电子/电气/仪表自动化或相关专业\r\n2、工作积极主动，责任感强，能吃苦耐劳，能适应加班\r\n3、能熟练使用办公软件\r\n4、有较强的动手维修能力\r\n5、有电子产品功能测试经验\r\n6、有耳机、音响、功放测试设备维护经验优先\r\n7、良好的团队意识和沟通能力', '', 6000, 10000, 5, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1296, '2025-04-08 15:21:31.119135', '2025-04-08 15:21:31.119135', NULL, '嵌入式开发工程师', '1.熟练使用C语言进行嵌入式系统(Cotex-M内核为主)的程序开发\r\n2.熟练掌握嵌入式系统常用硬件模块及接口，如供电/晶振/ADC/UART/SPI等\r\n3.具备一定的嵌入式系统的PCB设计和绘制能力，能够完成所需基本功能\r\n4.具备英文阅读能力，能阅读元器件英文手册等\r\n5.懂一点FPGA/DSP/ASIC等更好\r\n6.懂RTOS/协议栈/编译原理/上位机/Linux/FFT算法更好\r\n岗位职责:\r\n1.参与产品研发需求和计划的分析制定\r\n2.制定和实施软件设计方案，包括架构设计、代码编写、文档编制等\r\n3.负责软硬件联调，包括开发调试和现场技术支持\r\n4.负责产品维护、完善和升级\r\n大学生如符合相关专业和有浓厚兴趣的，可放宽能力要求，提供学习和传帮带机会\r\n\r\n面试及工作地址：惠州市惠城区陈江街道东星路56号大欣工业园指南测控技术有限公司', '', 4500, 6500, 10, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1297, '2025-04-08 15:21:31.346642', '2025-04-08 15:21:31.346642', NULL, '技术支持工程师FAE（售后工程师）', '工作内容：\r\n1、测试设备和系统的验证、送货、调试、现场培训\r\n2、客户现场的设备维护、异常处理、技术支持\r\n3、跟进、对接、协调解决设备现场使用问题\r\n4、编写设备操作方法\r\n5、反馈客户需求和产品改善信息\r\n6、配合工作安排出差或驻厂\r\n任职资格：\r\n1、积极的工作态度，良好的沟通能力和团队精神\r\n2、具备抗压和吃苦耐劳精神\r\n3、本科学历，理工科专业，(经验优秀者可放宽学历)\r\n4、应届毕业生有英语沟通能力优先\r\n5、有电子产品测试维护与电脑软硬件维护经验；电子线路基础\r\n6、有耳机、音响、功放测试设备维护经验优先', '', 6000, 12000, 5, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1298, '2025-04-08 15:21:31.778375', '2025-04-08 15:21:31.778375', NULL, '测试技术员/助工', '工作内容:           \r\n 1根据需求和计划，验证电子产品(耳机、音响、电子手表、路由 器等的功能和性能     \r\n 2.根据计划，进行软件的验证测试，需要编写一些简单的程序来 完成(如用C #/Python写 个小程序)    \r\n 3.操作测试仪器，测量出所需的结果，用于调研分析    \r\n 4.其他公司安排的工作\r\n  岗位要求：需要知晓并操作过以下内容: 欧姆定律，对数计算，波形的频率 ，命令行，串口通讯，万用表 。 一点都不懂的勿投此岗位。三年内毕业生不受限 制，此岗位为很好的锻炼岗位。不会有人带和教 ，可以接触到很多的新知识，非 常适合积累经验，以后转开发岗 。', '', 4500, 6500, 10, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1299, '2025-04-08 15:21:31.919216', '2025-04-08 15:21:31.919216', NULL, '业务员/销售员', '岗位职责：\r\n1、负责所属区域的客户开发、客户维护等工作\r\n2、负责所属区域的产品宣传、推广和销售，完成销售任务指标\r\n3、及时将企业新产品、新成果通报给用户，向用户介绍企业产品的性能、特色及技术参数\r\n4、定期拜访新老客户，与客户进行沟通，了解本企业产品在客户处的运行情况，探寻客户在设备使用中对我公司产品的意见和建议并及时反馈给公司\r\n5、调研责任区域竞争对手相关产品、价格、用户等信息。\r\n任职要求：\r\n1．学历：本科以上学历\r\n2．经历：有3C电子类、设备类销售工作经验者优先（应届毕业生无经验要求）\r\n3．专业要求：电子、计算机、机械自动化、市场营销等相关专业优先\r\n4. 良好的沟通能力，思维清晰敏捷，逻辑分析能力强\r\n5. 具备饱满的工作热情、较强的团队合作意识，对工作认真负责，有较强的事业心，能够承受一定工作压力\r\n6. 能适应经常出差，有驾照且能熟练开车\r\n工作及面试地址：广东省东莞市松山湖园区研发五路5栋301-304室', '', 15000, 30000, 5, '全职', NULL, 1, 444, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1300, '2025-04-08 15:21:33.023940', '2025-04-08 15:21:33.023940', NULL, 'python数据分析师', '岗位职责\r\n1、负责为财务和业务部门开发定制化的数据报表，确保数据的准确性和及时性，满足各部门的数据可视化需求。\r\n2、运用 Python 进行数据分析和处理，挖掘数据价值，为业务决策提供数据支持和洞察。\r\n3、与财务、业务团队紧密合作，深入理解业务需求，将业务问题转化为数据解决方案。\r\n4、优化现有数据处理流程和算法，提高数据处理效率和质量。\r\n5、维护和管理数据仓库，保障数据的安全和完整性。\r\n任职要求\r\n1、熟练掌握 Python 开发语言，具备扎实的编程基础和良好的代码规范。\r\n2、熟悉常用的数据分析和数据处理库，如 Pandas、Numpy、Matplotlib、Seaborn 等。\r\n3、有数据报表开发经验，能够根据业务需求设计和实现数据可视化报表。\r\n4、具备良好的沟通能力和团队协作精神，能够准确理解业务需求并提供有效的解决方案。\r\n5、对数据敏感，有较强的逻辑思维和问题解决能力。\r\n6、有财务或业务数据分析经验者优先考虑。', '', 6000, 8000, 5, '全职', NULL, 1, 445, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1301, '2025-04-08 15:21:33.646305', '2025-04-08 15:21:33.646305', NULL, '销售支持专员', '岗位职责：\r\n1、 了解公司销售规则和流程，协助部门完成相关销售链条中的流程梳理事务；\r\n2、 定期进行销售数据的收集统计、分析，配合部门输出相关数据报表等；\r\n3、 配合部门跟进销售渠道的执行情况，跟踪业务过程中的各项指标表现；\r\n4、 其他相关销售支持性工作，如会议组织等\r\n任职要求：\r\n1、 全日制本科学历，应届毕业生亦可；\r\n2、 熟练使用办公软件（数据透视表等），具备数据敏感度、以及数据处理和逻辑分析能力；\r\n3、 思维敏捷，学习能力和执行能力较强，有责任心；\r\n4、 有较强的沟通能力以及跨团队协助能力；\r\n5、 有自我驱动意识，有从从起点到独当一面的成长意愿；\r\n6、 有相关学生工作经历优先。', '', 6000, 8000, 5, '全职', NULL, 1, 445, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1302, '2025-04-08 15:21:33.876536', '2025-04-08 15:21:33.876536', NULL, '拍剪实习生', '岗位职责\r\n1. 负责视频内容的拍摄与剪辑工作；\r\n2. 协助完成视频项目的后期制作任务；\r\n3. 参与视频素材的收集和整理工作；\r\n任职要求\r\n1. 对视频拍摄和剪辑有浓厚兴趣；\r\n2. 具备基本的视频制作技能和工具操作知识；\r\n3. 能够高效协作，适应快节奏的工作环境；\r\n4. 大专以及以上学历，25、26届皆可。', '', 4000, 6000, 5, '全职', NULL, 1, 445, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1303, '2025-04-08 15:21:34.415207', '2025-04-08 15:21:34.416202', NULL, '总工程助理', '岗位职责：\r\n1、负责参与公司工厂端的项目规划及方案探讨，结合项目情况提出有效的方案；\r\n2、跟进各工程项目的开展情况，有效处理过程中发生的各种问题，确保工程项目高质量、高效率地推进；\r\n3、参与公司各工厂所有生产设备的选型、采购、合同谈判等相关工作工作，跟进好项目的合同签署、付款、收货、安装调试，验收等；\r\n4、与设备供应厂家保持良好沟通，根据实际需要联络厂家开展相关售后培训及售后维护；\r\n5、上级领导安排的其它任务。\r\n任职要求：\r\n1、粮食工程、机械类、自动化类等相关专业；\r\n2、熟悉CAD工程图的绘制，具备基础机械类、自动化类相关知识；\r\n3、具备一定项目管理经验，沟通协调能力强，细心谨慎，能推动项目进度；', '', 6000, 8000, 5, '全职', NULL, 1, 445, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1304, '2025-04-08 15:21:34.737070', '2025-04-08 15:21:34.737070', NULL, '生产管培生', '岗位职责：\r\n1、通过对供应链的了解，负责生产现场管理、生产计划等板块的的关键工作；\r\n2、协助上级对供应链数据统计分析，及时跟进跟单、物耗、成本费用等的统计；\r\n3、及时跟进相关任务的情况，在学习工作的过程中提出优化意见；\r\n4、上级领导安排的其他任务。\r\n任职资格：\r\n1、粮食工程、农业类、理工类、机电类、食品类专业优先；\r\n2、具备较好的学习能力和团队合作精神，能在压力下工作；\r\n3、具备强烈的求知欲，乐于挑战，能够发现问题解决问题；\r\n4、踏实稳重，有意愿长期往供应链方向发展。', '', 5000, 8000, 5, '全职', NULL, 1, 445, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1305, '2025-04-08 15:21:34.970785', '2025-04-08 15:21:34.970785', NULL, '销售管培生', '岗位职责：\r\n1. 操盘管辖区域内的销售业务，结合市场情况和产品情况对当地的业务进行规划，执行公司的销售策略；\r\n2. 负责公司现有销售渠道的支持、活动的执行，规划管辖区域系统的促销活动、陈列及进场的执行；\r\n3. 开发和维护管辖区域内的终端门店，负责公司主力产品的推广及新品的铺市工作，及时了解终端需求；\r\n4. 做好产品销量统计工作，整理重要信息并反馈给上级；\r\n5. 岗位定位：区域执行管理/渠道营销/客户谈判/销售发展\r\n\r\n任职资格：\r\n1. 专业不限，市场营销、工商管理类相关专业优先；\r\n2. 有意向往快消品行业发展，对营销管理感兴趣；\r\n3. 沟通表达能力强，能熟练操作办公软件；\r\n4. 性格开朗、重视效率、乐于接受挑战。', '', 6000, 12000, 30, '全职', NULL, 1, 445, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1306, '2025-04-08 15:21:35.789351', '2025-04-08 15:21:35.789351', NULL, '理财规划师', '岗位职责：\r\n1、负责客户市场的开发及维护；\r\n2、负责公司产品的销售和推广；\r\n3、为客户提供投资咨询服务；\r\n4、为客户制订资产配置方案，提供投资建议，满足客户的理财需求。\r\n\r\n任职条件：\r\n1、学历水平：应届毕业的大学本科及以上学历；\r\n2、能力要求：有较强的沟通能力和客户开发能力，具备团队协作精神；\r\n3、专业要求：经济、金融、数学、市场营销等专业优先；\r\n4、资格技能：通过证券从业资格考试、基金从业资格考试优先。\r\n\r\n薪酬待遇：\r\n1、所有员工一经录用即签订正式劳动合同；\r\n2、公司提供具有市场竞争力的薪酬待遇；\r\n3、公司按照国家规定为员工缴纳五险二金。', '', 5000, 10000, 2, '全职', NULL, 1, 446, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1307, '2025-04-08 15:21:36.379931', '2025-04-08 15:21:36.379931', NULL, '机电管培生', '岗位职责：\r\n\r\n1、负责生产设备的日常维护、保养，按技术要求维修、保养、调校生产设备；\r\n\r\n2、定期/不定期对设备运作状况进行巡检，寻找导致生产设备故障的成因，提出解决方案；\r\n\r\n3、当设备出现故障需要技术援助时，应及时到故障现场，进行故障排除抢修工作；\r\n\r\n4、督促落实设备技术操作规程的执行，及时制止违章作业，并上报有关领导；\r\n\r\n5、服从生产主任安排的设备维护、保养与管理工作；\r\n\r\n岗位要求：\r\n\r\n1、吃苦耐劳、工作踏实、责任心强；\r\n\r\n2、机电/自动化相关专业；2025届毕业生。\r\n\r\n发展路径：\r\n\r\n技术方向：管培生实习期→管培生1年→产线机修技术员→机修班长→机修主管\r\n\r\n管理方向：管培生实习期→管培生1年→产线管理者班长→生产科主管→生产科经理\r\n\r\n福利待遇：\r\n\r\n1、毕业即签订劳动合同，购买五险一金；（毕业前为实习协议）\r\n\r\n2、提供食宿（4人宿舍有热水、空调、衣柜、收纳柜等）；\r\n\r\n3、享受国家法定节假日，同时享有婚假、产假/陪产假、带薪年假等；\r\n\r\n4、公司发展迅速，每半年一次晋升机会；\r\n\r\n5、节日福利、高温补贴、餐费补贴、员工体检、活动等；', '', 7800, 9500, 4, '全职', NULL, 1, 447, 6, NULL, NULL, NULL, NULL, NULL, 0, '441500', '440000', '441521', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1308, '2025-04-08 15:21:37.261877', '2025-04-08 15:21:37.261877', NULL, '助理', '岗位职责：\r\n1、编辑、打印和归档，以及各类报告和文档的整理工作。\r\n2、 负责接听电话、接待来访客人，做好来访登记，引导客人至相关部门或人员处，维护良好的公司形象。\r\n3、为领导安排日程，包括会议安排、出差行程规划等，并及时提醒领导相关事宜，确保各项事务有序进行。\r\n4、作为领导与各部门之间的桥梁，传达领导指示，收集各部门信息和反馈，促进信息的及时传递与有效沟通，协调解决工作中的一些问题。\r\n5、协助领导开展各类项目工作，如参与项目策划、组织项目会议、跟踪项目进度、整理项目资料等，确保项目顺利推进。\r\n6、完成领导交办的其他临时性任务，如市场调研、数据收集与分析等，为领导决策提供支持。\r\n岗位要求：\r\n1、本科学历，逻辑思维强，条理清晰。\r\n2、有较好的沟通能力、学习能力、表达能力。', '', 6000, 8000, 1, '全职', NULL, 1, 448, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1309, '2025-04-08 15:21:37.908332', '2025-04-08 15:21:37.908332', NULL, '市区禁毒项目 实习生', '1、协助社工开展普法宣传活动\r\n2、日常行政工作，数据统计、收发文等', '', 800, 1000, 1, '全职', NULL, 1, 449, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1310, '2025-04-08 15:21:38.568363', '2025-04-08 15:21:38.568363', NULL, '妇联项目 实习生', '岗位职责：\r\n1、协助社工面向妇女、儿童及家庭提供个案、活动、小组及心理咨询发展领域内志愿者服务等全面的家庭服务；\r\n2、日常行政工作。\r\n\r\n\r\n岗位要求：\r\n1、社会工作、法学、社会学等专业，有社团、班干部经验的尤佳；\r\n2、性格开朗，具有责任心和良好的沟通能力；\r\n3、能提供至少为期三个月及以上实习时长者优先考虑。', '', 800, 1000, 1, '全职', NULL, 1, 449, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1311, '2025-04-08 15:21:39.047232', '2025-04-08 15:21:39.047232', NULL, '常平平安法治项目 实习生', '1、运用社区工作、小组工作、个案工作等专业手法，协助项目社工开展工作；\r\n2、日常行政工作。', '', 800, 1000, 1, '全职', NULL, 1, 449, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1312, '2025-04-08 15:21:39.772824', '2025-04-08 15:21:39.772824', NULL, '零售管培生', '招聘要求：\r\n*大专及以上学历，应届或往一届（2025/2026）；\r\n*工作经验一年内；\r\n*良好的英语听、说、读、写能力；\r\n*曾在高校任职学生干部或为党员身份优先考虑；\r\n*具有优秀的时间管理和情绪管理能力；\r\n*接受变革，能灵活解决突发问题；\r\n*具有快速学习新知识的能力和教学传承技能。\r\n\r\n加入项目您将：\r\n*专业测评及考核，助你挖掘无限潜力；\r\n*教练引导＋实践的培养方式，助你全面提升个人能力；\r\n*培训后量身定制的个人发展计划，助你展翅飞翔；\r\n*高层领导亲自指导及听取汇报，助你更受关注；\r\n*在领先零售企业工作，助你掌握前瞻性的行业管理经验。\r\n\r\n工作地点：广东省（广州、佛山、粤东、粤西）', '', 4000, 6500, 50, '全职', NULL, 1, 450, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440104', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1313, '2025-04-08 15:21:40.483005', '2025-04-08 15:21:40.483005', NULL, '生产管理岗', '1.招聘对象：23 届、24 届毕业生，专业不限，农林类/经管财会类/\r\n语言类优先；\r\n2.岗位职责:\r\n（1）岗位定位：项目部门中高层管理岗位；\r\n（2）工作内容：负责生产管理的计划、组织、沟通、协调和控制；\r\n3.福利待遇：\r\n（1）月薪：15K/月；参考年收入：首年达到 20 万，第二年 20-30\r\n万；\r\n（2）股份：企业处于快速发展期，平台广阔，入职满一年可获得股\r\n份配额；\r\n（3）晋升：最快晋升记录 3 个月，每年都有调薪和晋升机会；\r\n（4）保险：五险一金+海外商业保险；\r\n（5）休假：带薪年假 30 天+海外法定节假日；\r\n（6）福利：满足你对美好公司的一切幻想，专职厨师、精美下午茶\r\n满足你的味蕾，年度体检关注你的健康，专职司机保姆照顾你的起居，\r\n别墅、酒店式公寓让你住有所居，优秀的同伴助你飞速成长，超强导师\r\n带你分分钟起飞。\r\n4.工作地点：乌干达/坦桑尼亚/莫桑比克/中国·东莞\r\n\r\n联系我们：\r\n招聘主管：邵女士 13302644015（微信同号）\r\n加入我们：service@cfid-ug.com\r\n投递简历：1.投递方式：添加微信投递或邮箱投递\r\n2.邮件命名：姓名+学校专业+招聘信息了解渠道\r\n走近我们：广东省东莞市松山湖天安云谷 10 栋 11 层（欢迎大家线\r\n下参观和交流）', '', 15000, 17000, 20, '全职', NULL, 1, 451, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
