INSERT INTO `post` VALUES (1315, '2025-04-08 15:21:40.941953', '2025-04-08 15:21:40.941953', NULL, '会计助理', '1.招聘对象：25 届应届毕业生，会计学/财务管理等财务相关专业优\r\n先；\r\n2.岗位职责:\r\n（1）岗位定位：财务部门中高层管理岗位；\r\n（2）工作内容：①复核原始单据并核对银行流水；\r\n②全英做账和财务报表编制；\r\n③协助完成发票开具及进出口文件核对；\r\n④协助公司内部审计；\r\n⑤根据公司的运营模式对业务流程进行梳理。\r\n3.福利待遇：\r\n（1）月薪：8-12K/月；\r\n（2）股份：企业处于快速发展期，平台广阔，入职满一年可获得股\r\n份配额；\r\n（3）保险：五险一金；\r\n（4）休假：做五休二，并享受国家法定节假日；\r\n（5）福利：满足你对美好公司的一切幻想，精美下午茶满足你的味\r\n蕾，年度体检关注你的健康，酒店式公寓让你住有所居，优秀的同伴助\r\n你飞速成长，超强导师带你分分钟起飞。\r\n4.工作地点：广东·东莞\r\n\r\n联系我们：\r\n招聘主管：邵女士 13302644015（微信同号）\r\n加入我们：service@cfid-ug.com\r\n投递简历：1.投递方式：添加微信投递或邮箱投递\r\n2.邮件命名：姓名+学校专业+招聘信息了解渠道\r\n走近我们：广东省东莞市松山湖天安云谷 10 栋 11 层（欢迎大家线\r\n下参观和交流）', '', 15000, 17000, 20, '全职', NULL, 1, 451, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
