INSERT INTO `post` VALUES (1317, '2025-04-08 15:21:42.015470', '2025-04-08 15:21:42.015470', NULL, '跟单员', '主要职责：\r\n1、协助业务员对接客户沟通确认订单等信息；\r\n2、负责客户订单管理和服务跟踪反馈；\r\n任职要求：\r\n1、具备良好的沟通技巧\r\n2、具备良好的问题解决能力\r\n3、对工作充满热情，具有高度的责任心和团队合作精神\r\n4、专业不限', '', 5000, 7500, 2, '全职', NULL, 1, 452, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1318, '2025-04-08 15:21:42.445796', '2025-04-08 15:21:42.445796', NULL, '业务员', '岗位名称：业务员\r\n主要职责：\r\n1、负责客户开发和客户关系维护；\r\n2、负责客户订单开发，跟进订单交付相关事宜；\r\n任职要求：\r\n1、具备良好的沟通技巧、业务拓展能力、抗压能力\r\n2、能够迅速适应市场变化，具备良好的问题解决能力\r\n3、对工作充满热情，具有高度的责任心和团队合作精神\r\n4、专业不限', '', 5000, 12000, 10, '全职', NULL, 1, 452, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1319, '2025-04-08 15:21:43.220924', '2025-04-08 15:21:43.220924', NULL, '业务', '岗位职责\r\n1、具备优秀的市场推广能力，了解新能源行业技术与产品发展（家族储能、小型低速动力储能，如摩托车、电动车、平衡车、滑板车等）；\r\n2、有一定的团队领导能力，具备结果导向思维；\r\n3、有战略思维，能推动企业持续发展；\r\n4、与各部门协调合作，快速满足客户需求；\r\n任职要求\r\n1、教育背景：本科及以上，英文流利优先。\r\n2、行业经验：3年以上新能源行业工作经验，熟悉行业技术和市场，具备良好的市场思维与客户服务的理念。\r\n3、具备团队管理能力，职业稳定性好，有3-5年的奋斗计划，与团队共同成长，\r\n4、善于与各方沟通协作，能解决当下问题，能够预防问题。', '', 4500, 6000, 5, '全职', NULL, 1, 453, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1320, '2025-04-08 15:21:43.872424', '2025-04-08 15:21:43.872424', NULL, '助理工程师', '1.	负责新项目的调试、BOM资料制作确认、测试及验证等工作；\r\n2.	负责跟进各物料样品打样及确认；\r\n3.	负责新机种样机的试作、测试、调试以及本产品在客户方面的承认工作;\r\n4.	负责公司所有机种技术资料的输入、输出以及分析解决生产过程中出现的所有不良问题；\r\n5.	参与新项目原理设计及功能分析，技术文件编写以及PCB LAYOUT。\r\n招聘要求：\r\n   1、电子相关专业', '', 4500, 5500, 5, '全职', NULL, 1, 453, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1321, '2025-04-08 15:21:44.625463', '2025-04-08 15:21:44.625463', NULL, '机械装配技术员/学徒', '1、中专、中技、高中以上学历；\r\n2、机械设计与制造、数控技术、模具设计与制造、汽车检测与维修专业；\r\n3、能接受出差，有团队合作意识；\r\n4、语言表达清楚，能对生产厂家的设备操作者进行操作培训；\r\n5、有经验者优先，优秀实习生亦可；\r\n6、工作认真负责，踏实肯干；\r\n7、吃苦耐劳，忠诚度高，稳定性强。', '', 4000, 5000, 10, '全职', NULL, 1, 454, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1322, '2025-04-08 15:21:44.831611', '2025-04-08 15:21:44.831611', NULL, '电气装配技术员/学徒', '1、中专、中技、高中以上学历；\r\n2、机电一体化、自动化、机电工程、工业机器人、电气自动化专业；\r\n3、能接受出差，有团队合作意识；\r\n4、语言表达清楚，能对生产厂家的设备操作者进行操作培训；\r\n5、有经验者优先考虑，优秀实习生亦可；\r\n6、工作认真负责，踏实肯干；\r\n7、吃苦耐劳，忠诚度高，稳定性强。', '', 4000, 5000, 10, '全职', NULL, 1, 454, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1323, '2025-04-08 15:21:45.514318', '2025-04-08 15:21:45.514318', NULL, '电源助理工程师', '岗位职责：\r\n1.协助高级工程师进行开关电源类产品的研发工作；\r\n2.产品研发阶段调试、性能和可靠性测试；  \r\n3.生产技术支持、客户技术支持；  \r\n4.负责产品设计改良及更新升级。\r\n\r\n任职要求：\r\n1.电气工程及其自动化、电力电子与电力传动、自动化等相关专业；  \r\n2.具有较强的学习能力，积极乐观，有上进心；\r\n3.学历要求：本科以上。', '', 9000, 16000, 4, '全职', NULL, 1, 455, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1324, '2025-04-08 15:21:46.277999', '2025-04-08 15:21:46.277999', NULL, '业务员', '岗位职责：\r\n1、根据市场状况，市场行情定位公司客户群体，整合市场信息，制定新客户引进导入计划；制定年度、月度营销目标；\r\n2、各客户关系的维护及回访，客户各项款项的跟催；\r\n3、根据公司产品、价格及市场策略，独立处置询盘、报价、合同条款的协商及合同签订等事宜\r\n4、动态把握市场价格，了解市场动态和竞争对手的信息定期形成报告返给公司；\r\n任职要求:\r\n1、有一定的销售管理基础知识；有一定的商务管理知识；\r\n2、业务员具有1年以上销售工作经验，业务经理要求5年以上销售经验，且能带领销售团队开拓业绩，接受优秀的销售相关专业的应届生进行培养；\r\n3、有了解硅橡胶产品行业、汽配、医疗设备，阀门，机械行业等的优先录用;\r\n4、良好的沟通能力和商务素质；\r\n5、本科及以上学历，销售相关专业优先；\r\n6、适应出差、工作勤奋、主动、学习能力强，有挑战精神；\r\n7、公司有专用车开出去拜访客户、其它远地方费用有公司报销，新来有公司经理陪同去拜访客户。\r\n薪资待遇：业务员底薪5-6K，+业务提成：1%~3%，具体根据业务情况确定；公司包吃住。', '', 5000, 6000, 2, '全职', NULL, 1, 456, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1325, '2025-04-08 15:21:46.726854', '2025-04-08 15:21:46.726854', NULL, '会计助理', '1、负责对帐、开票、应收帐款跟催；\r\n2、负责部分应付款对帐及跟进工作；\r\n3、盘点帐务工作；\r\n4、税务相关工作；\r\n5、固定资产管理工作；\r\n6、其它财务部门的临时性工作等；\r\n任职要求：\r\n1、本科及以上学历，会计学、财务管理、审计等相关专业。\r\n2、具备扎实的财务基础知识，熟悉财务软件（如用友、金蝶等）和办公软件（如Excel、Word）的操作。\r\n3、熟练掌握成本核算方法，包括标准成本法、变动成本法等，能够准确进行成本归集与分配。\r\n4、具备较强的数据分析能力，能够运用财务分析工具（如Excel函数、数据分析模型）对成本数据进行深入分析。\r\n5、熟悉国家财务、税务法规，能够准确处理与成本相关的税务事项。\r\n6、工作细致、严谨，责任心强，具备良好的职业道德和保密意识。', '', 5000, 6000, 1, '全职', NULL, 1, 456, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1326, '2025-04-08 15:21:47.255693', '2025-04-08 15:21:47.255693', NULL, '新媒体运营专员', '岗位职责：\r\n1、负责AI短视频推广内容的策划与创意构思，结合公司产品特点和目标受众需求，制定吸引人的短视频脚本；\r\n2、协助团队利用AI工具生成短视频内容，包括视频剪辑、特效添加、字幕生成等，确保视频内容符合推广要求和创意标准；\r\n3、跟踪短视频行业动态和热门趋势，及时调整内容策略，保持公司短视频内容的创新性和吸引力；\r\n4、管理公司短视频账号（如抖音、快手、B站等），负责账号的日常运营和推广工作，包括视频发布、标签优化、互动管理等；\r\n5、负责短视频推广效果的数据收集与分析，通过AI工具和数据分析平台，监测视频的播放量、点赞量、评论量、分享量等关键指标；\r\n任职要求：\r\n1、本科及以上学历，市场营销、广告学、传媒学、计算机科学等相关专业优先；\r\n2、对AI技术有一定的了解，熟悉AI在短视频内容创作和推广中的应用场景；\r\n3、有短视频运营或内容策划相关经验者优先，熟悉抖音、快手、B站等主流短视频平台的运营规则和用户特点；\r\n4、对AI短视频推广有浓厚兴趣，愿意学习和探索新技术在推广中的应用；\r\n5、熟练掌握短视频编辑工具，如Adobe Premiere、剪映等，能够独立完成短视频的剪辑和特效制作；\r\n6、具备良好的数据分析能力，能够使用数据分析工具（如Excel、Google Analytics等）对短视频推广效果进行分析和评估；\r\n7、熟悉AI工具（如ChatGPT、文心一言等）在内容创作和推广中的应用，能够利用AI技术提升工作效率和内容质量；\r\n8、具备较强的创意能力和文案撰写能力，能够独立完成短视频脚本的策划和撰写；', '', 6000, 10000, 2, '全职', NULL, 1, 456, 6, NULL, NULL, NULL, NULL, NULL, 4, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1327, '2025-04-08 15:21:47.474095', '2025-04-08 15:21:47.474095', NULL, '软件工程师（应届生）', '岗位职责：\r\n1、负责对短视频内容进行技术支持，包括视频处理、特效添加和格式优化等；\r\n2、参与 AI 短视频生成及推荐算法的设计与实现，提升内容生成效率和用户推荐精准度；\r\n3、与市场、设计及内容创作团队协作，完成短视频推广及创意广告制作项目的技术需求；\r\n4、研究并应用最新的 AI 技术，优化短视频在各大平台的传播效果，如抖音、快手、B站等；\r\n5、根据运营规则和技术要求，开发互动功能，优化视频标签及格式适配，提升用户体验；\r\n\r\n任职要求：\r\n1、本科及以上学历，计算机科学与技术、软件工程、人工智能、数字媒体技术等相关专业优先；\r\n2、具备扎实的计算机基础知识，包括数据结构、算法、操作系统和计算机网络等；\r\n3、熟练掌握至少一种编程语言，如 Python、Java 或 C++，能够高效编写和调试代码；\r\n4、熟悉前端开发技术，包括 HTML5、CSS3、JavaScript，能够制作具有吸引力的网页和交互效果；\r\n5、了解 AI 技术的基础知识，如机器学习、深度学习、自然语言处理等，并熟悉 TensorFlow、PyTorch 等常见框架；\r\n6、了解视频处理技术，包括编辑、特效制作和格式转换，熟悉 OpenCV、FFmpeg 等常用工具；\r\n7、具备快速学习能力，能够通过多种方式更新知识体系，适应 AI 领域的快速发展；\r\n8、有良好的团队协作能力，能够与其他部门高效沟通，将技术与创意结合，推动项目落地；\r\n9、具备创新思维，能够提出新颖的推广策略和创意方案，为短视频及广告制作提供技术支持；\r\n10、有相关项目经验者优先，如 AI 短视频生成、视频推荐系统或创意广告制作等；', '', 8000, 15000, 1, '全职', NULL, 1, 456, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1328, '2025-04-08 15:21:47.911203', '2025-04-08 15:21:47.911203', NULL, '储备技术员', '1、主要学习设备的使用、模具调试、异常问题处理；学会后独立处理模具调试，新品打样，建立工艺标准；异常问题解决等工作；\r\n2、大专以上学历，机械或模具专业优先，能从基层工作开始学习，有较强的学习能力及上进心，做事细心、责任心强；\r\n3、该岗位做为公司重点岗位，培养具备潜力的新人，有较大的晋升空间；', '', 5000, 6000, 2, '全职', NULL, 1, 456, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1329, '2025-04-08 15:21:48.559757', '2025-04-08 15:21:48.559757', NULL, 'Android软件开发工程师', '工作职责:\r\n\r\n1、负责Android应用开发及项目软件需求的实现\r\n\r\n2、负责客户软件Bug的解决\r\n\r\n3、负责Framework接口开发及改造与问题解决 \r\n\r\n职位要求：\r\n\r\n1、自动化、电子、计算机等相关专业本科以上学历；\r\n\r\n2、有Android原生开发经验；\r\n\r\n3、具备C  C++  Java语言基础，熟悉Android框架以及各种特性，理解设计模式；\r\n\r\n4、良好的团队协作能力和沟通能力，具备优秀的学习能力；\r\n\r\n5、了解Android性能优化以及相关优化分析工具。', '', 6000, 8000, 10, '全职', NULL, 1, 457, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1330, '2025-04-08 15:21:48.760562', '2025-04-08 15:21:48.760562', NULL, 'Android驱动工程师', '工作职责：\r\n\r\n1：负责Android手机设备驱动的开发与调优\r\n\r\n2：负责Android手机底层的稳定性、功耗、性能等优化工作\r\n\r\n3：有一定的硬件和C，C++基础，能够很好的理解硬件电路原理和相关技术文档\r\n\r\n岗位要求：\r\n\r\n1：有强烈的责任心，遇到问题能够不断迭代，一查到底 \r\n\r\n2：扎实的编程能力，熟悉操作系统原理和数据结构 \r\n\r\n3：接受能力强，能很快学习和掌握新技术 \r\n\r\n4：勤于思考，善于总结，乐观自信，不断追求进步', '', 6000, 8000, 5, '全职', NULL, 1, 457, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1331, '2025-04-08 15:21:48.993883', '2025-04-08 15:21:48.993883', NULL, '硬件工程师', '工作职责：\r\n\r\n1. 负责硬件电路原理设计；\r\n\r\n2. 负责硬件布局和Layout评审及Layout指导；\r\n\r\n3. 负责硬件器件选型和方案评估；\r\n\r\n4. 负责硬件电路调试和善于处理各种疑难杂症；\r\n\r\n5. 编辑硬件测试文档；\r\n\r\n6. 熟悉生产制造工艺和生产流程；\r\n\r\n \r\n\r\n职位要求：\r\n\r\n1. 通信、电子相关专业，英语4级及以上本科应届毕业生；\r\n\r\n2. 会使用示波器、万用表、直流电源等测试仪器；\r\n\r\n3. 有模拟电子、数字电路和高频电路扎实的理论基础；', '', 6000, 8000, 5, '全职', NULL, 1, 457, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1332, '2025-04-08 15:21:49.625920', '2025-04-08 15:21:49.625920', NULL, '车险续保专员', '岗位职责：电话联系在微保、蚂蚁平台咨询车险价格的客户，提供车险报价服务，推荐公司理赔服务，协助客户完成汽车保险续保工作（室内上班、公司提供即将车险到期的客户）。\r\n岗位要求：\r\n1、本科及以上学历(实习生亦可)，年龄20-40周岁（实习生可放宽），男女不限； \r\n2、会电脑打字，掌握计算机基本操作；\r\n3、喜欢挑战高薪，有较强的抗压能力和和自我情绪调节能力；\r\n4、口齿清晰，普通话流利，具有良好的服务意识。', '', 4000, 14000, 10, '全职', NULL, 1, 458, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1333, '2025-04-08 15:21:49.948499', '2025-04-08 15:21:49.948499', NULL, '车险电话客服', '一、工作职责：\r\n主要针对车险已经到期的车主，提供下一年车险续期服务，我们有固定客源，客户也是有需求的，车主只要投保在我们公司，我们就可以得到对应的业绩提成，工作难度低，员工足不出户不需要与客户见面、不需要外出拓展业务，室内办公工作环境舒适。资源是公司这边提供给我们，我们只需要以电话的方式跟客户联系沟通就可以了。', '', 4000, 13000, 10, '全职', NULL, 1, 458, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1334, '2025-04-08 15:21:50.586184', '2025-04-08 15:21:50.586184', NULL, '保险内勤（企划岗）', '一、岗位职责：\r\n1.根据分公司要求，制定合理的企划和业务推动方案，促进营销队伍提升销售业绩；\r\n2.组织开展各项市场推广活动，助力业务发展；\r\n3.指导支公司、营业部各项营销活动的开展和落实；\r\n4.反馈机构各项业务活动进度和问题；\r\n5.按要求收集统计报送个险业绩指标；\r\n6.组织产品相关培训、训练\r\n\r\n\r\n二、任职要求：\r\n1.本科及以上学历，专业不限\r\n2.身体健康、有上进心、责任心强、执行力强；\r\n3.性格开朗，思维敏捷，学习能力强，具有较强的组织、沟通和协调能力；\r\n4.有较强的EXCEL数据处理能力、PPT制作技能；\r\n5.严格自律、品行良好、无不良社会记录', '', 5000, 9000, 3, '全职', NULL, 1, 459, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1335, '2025-04-08 15:21:50.871779', '2025-04-08 15:21:50.871779', NULL, '组训/讲师岗', '1、本科及以上学历\r\n2、具备良好的学习能力和适应能力，能够快速融入公司环境并适应多种培养方式。\r\n3、具有较强的团队合作精神，能够积极与同事、领导等进行沟通协作。\r\n4、熟悉运用办公软件。\r\n5、有上进心，渴望在个人职业素养、专业知识和技能、综合管理能力等方面得到全面发展。', '', 8000, 15000, 5, '全职', NULL, 1, 459, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1336, '2025-04-08 15:21:51.187181', '2025-04-08 15:21:51.187181', NULL, '保险内勤（组训）', '一、岗位职责：\r\n1、组织实施职场训练\r\n2、协助支公司经理制定营销发展计划和推动方案,协助组织策划各类激励活动和管理各类考核与业务统计报表\r\n3、落实总、分公司以及中支各项会议等工作\r\n4、组织策划方案、活动会议\r\n5、辅导外勤销售人员,提升销售人员销售及专业技能\r\n6、工作地除南城外，石龙、黄江、厚街、长安、石排、虎门均有服务网点\r\n\r\n二、任职要求：\r\n1.本科及以上学历，专业不限\r\n2.身体健康、有上进心、责任心强；\r\n3.性格开朗，思维敏捷，学习能力强，具有较强的组织、沟通和协调能力；\r\n4.有较好的书面和语言表达能力，具备电脑办公软件的基本使用知识和操作技能；\r\n5.严格自律、品行良好、无不良社会记录', '', 6000, 12000, 3, '全职', NULL, 1, 459, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1337, '2025-04-08 15:21:52.012059', '2025-04-08 15:21:52.012059', NULL, '奥比中光2025届秋季校园招聘', '奥比中光2025届秋季校园招聘\r\n奥比中光科技集团股份有限公司（688322.SH）成立于2013年，2022年7月在科创板上市，获称“3D视觉第一股”。基于自研芯片和全栈式系统技术，奥比中光为机器人、3D扫描、生物识别等行业客户及全球开发者提供高性能的3D视觉传感器及机器人与AI视觉方案，服务全球客户超1000家，助力新兴行业释放价值、推动传统行业智能化升级。\r\n奥比中光总部位于深圳，在佛山、上海、西安、美国均设有分支机构。是行业领先的机器人视觉及AI视觉科技公司，致力于构建机器人与AI视觉产业中台、打造机器人的“眼睛”，让所有终端都能看懂世界。\r\n【市场率第一】中国服务机器人3D传感器市占率超过70%，行业第一，服务全球超100家机器人客户\r\n【十万平㎡专业化园区】在佛山顺德投建10万平方米专业化园区，打造机器人与AI视觉示范园区\r\n【百万级量产】线下零售、智能手机领域百万级量产出货，累计量产超500万台传感器\r\n【国家级资质】国家高新技术企业、国家级“专精特新”小巨人企业、国家知识产权优势企业\r\n【国家重大项目】承担国家级、省级、市级多项重大项目建设任务\r\n【比肩苹果微软】3D视觉专利申请量超过1800件，授权量超过900件，比肩苹果、微软，位居世界前列\r\n【强大人才实力】以创始人为核心，公司搭建了一支以光学测量为基础，芯片设计、算法等多学科交叉的优秀核心团队，聚集海内外尖端人才和专家。研发人员占比超50%。\r\n工作在奥比\r\n行业顶尖的研发人才与你并肩作战，秉持长期主义的技术投入和工作理念，关注价值创造。\r\n恪守简单务实，崇尚多元包容的工作氛围。\r\n以“花名”相称，不讲 title，坦诚的沟通风格。\r\n具有行业竞争力的薪酬、福利；佛山提供公司宿舍，拥有自建食堂。\r\n成长在奥比\r\n1、每年持续运营优化的校招生培养项目“追光青年养成计划”，通过追光训练营、专业导师辅导和长期持续关注，帮助同学快速完成学生到奥比人的转身、融入团队并胜任岗位，成为主动进取的追光青年。\r\n2、1对1导师带教，资深导师，制定1对1辅导计划，持续半年带教。\r\n3、设有内部课程体系，有300门以上的内部专业课，帮助快速入门，提升技术能力。\r\n4、管理&技术双通道发展，更多可能等你来造。\r\n【校招岗位】\r\n工作地点	岗位类别	需求岗位名称	招聘人数\r\n佛山	        光学类	光学工程师	       5人\r\n	        算法类	GNSS/INS融合定位算法工程师、slam算法工程师、标定算法工程师、大模型算法工程师、点云算法工程师、路径规划与控制算法工程师、深度学习算法工程师、算法工程师、算法优化工程师	25人\r\n	         软件类	Android应用开发工程师、Camera调试工程师、机器人嵌入式工程师、嵌入式软件工程师、软件测试工程师、软件工程师、软件开发工程师、生产工具开发工程师	                                                30人\r\n	         硬件类	硬件测试工程师、硬件工程师、机械设计工程师、结构工程师	 \r\n                                                                 10人\r\n	        质量管理类	供应商质量管理、设计开发质量管理、生产制程质量管理	\r\n                                                                  5人\r\n	        工程类	NPI工程师、整机工程师	5人\r\n	      专业支持类	物控工程师	  5人\r\n深圳	        算法类	立体视觉算法工程师  5人\r\n	        销售类	销售经理	                  5人\r\n【校招需求】\r\n本硕均可：岗位详细信息详见招聘官网，欢迎大家积极投递。\r\n招聘对象：2025届全球高校应届毕业生（毕业时间为2024年11月-2025年8月期间）\r\n【校招流程】\r\n网申内推——面试沟通（线上/现场）——Offer签约\r\n*网申投递截至10月31日\r\n【投递通道】\r\n网申地址：http://job.orbbec.com.cn/campus\r\n招聘官微：奥比招聘\r\n咨询邮箱：campus@orbbec.com\r\n公司官网：www.orbbec.com.cn', '', 13000, 17000, 80, '全职', NULL, 1, 460, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440600', '440000', '440606', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1338, '2025-04-08 15:21:52.824088', '2025-04-08 15:21:52.824088', NULL, 'AI应用工程师', '1、本科及以上学历，计算机科学、人工智能、数据科学、电子商务等相关专业优先\r\n2、熟悉AI技术，包括但不限于机器学习、深度学习、自然语言处理等\r\n3、具备数据分析和数据挖掘能力，熟练使用相关工具\r\n(如Python、R、SQL等)\r\n4、了解跨境电商运营流程、跨境贸易流程，有亚马逊平台运营经验及B2B外贸业务从业经验者优先\r\n5、有跨境电商行业、跨境贸易AI应用经验者优先', '', 10000, 15000, 5, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1339, '2025-04-08 15:21:53.077127', '2025-04-08 15:21:53.077127', NULL, '国内电商运营', '1、本科及以上学历，电子商务或市场营销相关专业优先\r\n2、熟悉京东/天猫后台操作、活动规则及推广工具，有成功运营案例者优先\r\n3、熟练使用 Excel等工具，具备数据敏感性和逻辑分析能力\r\n4、能高效完成销售目标，适应电商行业高强度节奏\r\n5、擅长跨部门协作，与平台方、供应商等建立良好关系。', '', 6000, 12000, 5, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1340, '2025-04-08 15:21:53.291935', '2025-04-08 15:21:53.291935', NULL, '国内跟单', '1、负责与老客户对接，包括报价、下单、跟进订单情况、出库等工作。\r\n2、协助上级做好每日计划表、跟进客户报价情况\r\n3、定期与客户对账，及时开票\r\n4、不定期做客户回访调查\r\n5、处理客户投诉及异常订单的处理\r\n6、领导交办的其它事项等', '', 6000, 12000, 10, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1341, '2025-04-08 15:21:53.518842', '2025-04-08 15:21:53.518842', NULL, '国内销售', '1、本科及以上,英语四六级及以上\r\n2、负责公司产品线下或者线上产品销售\r\n3、开发客户，利用公司平台或网络其他平台主动开发客户\r\n4、询盘或邮件回复，跟踪客户，沟通，谈判，争取订单\r\n5、维护好老客户，做好业务相关资料的整理和归档', '', 6000, 12000, 10, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1342, '2025-04-08 15:21:53.744007', '2025-04-08 15:21:53.744007', NULL, '电子工程师', '1、本科及以上学历，电子相关专业优先\r\n2、有一定的电路分析能力，能看懂电路原理图\r\n3、熟悉常用软件及工具，熟练使用protel或AD等CAD软件\r\n4、熟悉电路板焊接，能够制作，检测样品，动手能力强\r\n5、勤奋，有责任心，富有团队合作精神，工作严谨', '', 10000, 15000, 5, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1343, '2025-04-08 15:21:53.988597', '2025-04-08 15:21:53.988597', NULL, '外贸业务助理', '1、本科及以上,英语四六级及以上\r\n2、可以熟练的用英文进行邮件与即时在线沟通\r\n3、电脑办公软件操作熟练,word ,excel,PPT', '', 6000, 12000, 5, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1344, '2025-04-08 15:21:54.286330', '2025-04-08 15:21:54.286330', NULL, '美工', '1、负责国外销售网站产品主图，A+页面设计，产品图片优化，美化产品图片\r\n2、拍摄公司产品并且进行后期处理，视频拍摄制作等\r\n3、具备一定的美术功底，熟练掌握各种设计软件如Photshop，lllustrator等adobe全家桶\r\n4、对于设计创意有深入的认识，设计具有吸引力和独特性的作品\r\n5、具备较强的沟通协调能力和团队合作精神', '', 6000, 12000, 5, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1345, '2025-04-08 15:21:54.520182', '2025-04-08 15:21:54.520182', NULL, '亚马逊运营', '6K-15K 专业不限\r\n1、本科及以上,英语四六级及以上\r\n2、可以熟练的用英文进行邮件与即时在线沟通\r\n3、电脑办公软件操作熟练,word ,excel,PPT\r\n4、有相关岗位运营经验者优先录用', '', 6000, 15000, 15, '全职', NULL, 1, 461, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
