INSERT INTO `post` VALUES (1348, '2025-04-08 15:21:55.989747', '2025-04-08 15:21:55.989747', NULL, '储备店长', '岗位职责：\r\n1.以身作则，带领团队执行公司各项要求、流程、制度，确保店面高\r\n质量运营；\r\n2.制作和提供品质如一的饮品和轻食，为所有顾客提供优质的服务；\r\n3.店面管理：包括店面，咖啡机，物料等的日常管理；\r\n4.运营管理：包括客户体验、成本控制/损耗、运营指标等的改善；\r\n5.外部沟通：包括但不限于物业、现场客户投诉等店面突发事件处理。\r\n招募对象：\r\n1.2025 届大专及以上应届毕业生，不限专业、经验；\r\n2.具有快速持续发展意愿，希望并适合在新零售赛道拓展职业生涯；\r\n3.热爱或对咖啡文化感兴趣，认同瑞幸咖啡的价值观及企业文化；\r\n4.优秀的沟通协调能力，高效的执行能力，抗压能力强，具备优秀的\r\n客户服务意识。', '', 5000, 7000, 30, '全职', NULL, 1, 463, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1349, '2025-04-08 15:21:56.730954', '2025-06-10 10:34:40.021317', NULL, '初级java开发工程师', '1. 本科或以上学历，计算机或软件相关类专业（硬性要求）；\r\n2. 热爱软件开发,视野开阔,有较强的创新意识，对新技术敏感并愿意致力于技术的探索和研究；\r\n3. 对知识有强烈的探索欲望，具有良好的学习能力。', '明丰', 6000, 8000, 2, '全职', NULL, 1, 464, 6, NULL, NULL, '东莞市', '广东省', '南城街道', 60, '441900', '440000', '441900004', '', 4, 'Java', 0);
INSERT INTO `post` VALUES (1350, '2025-04-08 15:21:56.994245', '2025-04-08 15:21:56.994245', NULL, 'Web前端工程师', '1. 本科或以上学历，计算机或软件相关类专业（硬性要求）；\r\n2. 热爱软件开发,视野开阔,有较强的创新意识，对新技术敏感并愿意致力于技术的探索和研究；\r\n3. 对知识有强烈的探索欲望，具有良好的学习能力。', '', 6000, 8000, 2, '全职', NULL, 1, 464, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1351, '2025-04-08 15:21:57.430515', '2025-04-08 15:21:57.430515', NULL, '外贸客服', '1.英文四级以上，书写与阅读能力流利；\r\n2.能吃苦耐劳，工作认真仔细，有责任心；\r\n3.善于沟通，优秀的语言表达能力和沟通能力。', '', 5000, 6000, 2, '全职', NULL, 1, 464, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1352, '2025-04-08 15:21:58.013488', '2025-04-08 15:21:58.013488', NULL, '采购开发', '1.印刷/包装/物流管理/采购管理等相关专业；\r\n2.良好的沟通及表达能力、具有谈判意识；\r\n3.熟练操作办公软件；英语四级以上。', '', 5000, 6000, 2, '全职', NULL, 1, 464, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
