INSERT INTO `post` VALUES (1360, '2025-04-08 15:22:02.124788', '2025-04-08 15:22:02.124788', NULL, '安全环保管理岗', '岗位职责：\r\n1、环保培训及台账管理\r\n2、负责环保设施设备运行状态监督、清洁生产过程监督\r\n3、负责环保隐患排查及整改监督、环保数据统计及分析\r\n4、组织环境自行监测及相关政府平台数据填报\r\n5、其它环保日常管理内容\r\n6、其它领导交办的临时任务\r\n任职要求：\r\n1、硕士学历，化工或环境工程相关专业\r\n2、有较强的责任心，吃苦耐劳，学习能力强，能承担和适应现场的调查与信息采集工作\r\n3、熟练掌握和运用办公软件', '', 7000, 9000, 2, '全职', NULL, 1, 466, 7, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1361, '2025-04-08 15:22:02.880539', '2025-04-08 15:22:02.880539', NULL, '安全环保管理岗', '岗位职责：\r\n1、环保培训及台账管理\r\n2、负责环保设施设备运行状态监督、清洁生产过程监督\r\n3、负责环保隐患排查及整改监督、环保数据统计及分析\r\n4、组织环境自行监测及相关政府平台数据填报\r\n5、其它环保日常管理内容\r\n6、其它领导交办的临时任务\r\n任职要求：\r\n1、本科及以上学历，化工或环境工程相关专业\r\n2、有较强的责任心，吃苦耐劳，学习能力强，能承担和适应现场的调查与信息采集工作\r\n3、熟练掌握和运用办公软件', '', 5000, 7000, 2, '全职', NULL, 1, 466, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1362, '2025-04-08 15:22:03.396091', '2025-04-08 15:22:03.396091', NULL, '研发专员', '岗位职责：\r\n1.在部门和科室主管领导下，落实科室技术开发与管理工作。\r\n2.贯彻执行有关安全生产管理制度，严格按照操作规程操作，对本岗位的安全生产和质量环保负责。\r\n3.负责日常基础工作，包括技术资料记录、整理、汇总、分析，建立科室相关档案。\r\n4.负责对新工艺研发、新产品试生产等研发工作的实施，及时汇报生产中出现的问题和难题。\r\n5.协助研发工程师完成产品技术标准和各类原材料、成品及生产工作标准等。\r\n任职要求：\r\n1.硕士及以上学历，高分子材料、应用化学、应用化工、化学分析、工业分析与检验、石油化工生产技术类专业。\r\n2.身心健康，品学兼优，积极主动，责任心强，吃苦耐劳，学习能力强，有团队协作精神。\r\n3.忠诚企业、诚实守信、爱岗敬业、遵章守纪、遵守公德、廉洁自律。', '', 8500, 11000, 4, '全职', NULL, 1, 466, 7, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1363, '2025-04-08 15:22:04.071628', '2025-04-08 15:22:04.071628', NULL, '理财顾问', '工作内容：\r\n1、负责互联网市场开发、客户投资咨询、公司产品销售等工作。\r\n2、配合团队完成基本工作目标，积极参与团队及公司组织的各项营销活动。\r\n3、定期对名下客户进行针对性回访与交流，为其提供理财规划与优化资产配置服务。\r\n\r\n任职要求：\r\n1、本科或以上学历。\r\n2、执业资格:一般证券从业资格，有基金从业资格优先。（大四生可通过券商渠道报名证从考试。）\r\n3、热爱证券经纪事业，热情活泼，善于与人交流。\r\n\r\n薪酬待遇：\r\n六险一金、底薪＋提成、业绩奖励。假日多，国家节假日不补假。\r\n\r\n工作地址:\r\n清溪镇聚富路柏思酒店4楼东莞证券', '', 4500, 8000, 5, '全职', NULL, 1, 467, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1364, '2025-04-08 15:22:04.585703', '2025-04-08 15:22:04.585703', NULL, '机电管培生', '岗位职责：\r\n1.定向培养，作为生产类、在线维修机电类储备管理干部培养；\r\n2.协助上级及时完成与维保相关的作业文件的编制与更新；\r\n3.协助对产线机器机台方面做跟踪管理；\r\n4.协助上级完成年度及阶段性维保方案的统计和分析工作；\r\n5.完成上级交办的其他事项。\r\n\r\n任职要求：\r\n1.本科及以上学历；\r\n2.机电一体化，机械等相关专业；\r\n3.持有食品检验工、检测分析工证书者优先；\r\n4.具备较强的执行力，高度的责任心、敬业精神与团队合作意识。\r\n岗位职责:\r\n1.负责机电业务相关工作，包括但不限于设备维护、故障排除等\r\n2.参与机电项目的规划和执行，确保项目按时完成\r\n3.协助上级领导完成相关业务报告和数据分析\r\n\r\n任职要求：\r\n1.具备良好的机电专业知识和技能，能够独立处理相关业务\r\n2.具备良好的沟通能力和团队合作精神，能够与团队成员有效协作\r\n3.具备较强的学习能力和问题解决能力，能够快速适应新环境和新任务', '', 6500, 9000, 4, '全职', NULL, 1, 468, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440118', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1365, '2025-04-08 15:22:05.162082', '2025-04-08 15:22:05.162082', NULL, '电气工程师', '岗位职责：\r\n1.配合自动化设备等项目的研发设计，设计绘制电气原理图、接线图、电控柜以及布局图，简单PLC程序编写和修改；\r\n2.负责装配现场电气接线规范实施监督，跟进项目进度；\r\n3.电气部件选型和物料清单输出；\r\n4.协助完成电气相关输出资料的编制、更改、整理更新、归档。\r\n岗位要求：\r\n1.有汇川、三菱、西门子中的任意一种PLC写程序的经验，能看懂PLC程序；\r\n2.熟悉常规步进、伺服电机、传感器工作原理；\r\n3.有过电气装配经验，熟悉各种电器原件的接线和原理；\r\n4.熟悉总线通讯原理，工控通讯协议，MODBUS，TCP/IP，profinet，ethercat等优先；\r\n5.较强的学习自我学习能力，逻辑思维清晰，会寻求各种资源解决问题；\r\n6.了解常规步进、伺服电机、传感器工作原理，了解Ethercat工业总线的使用。', '', 5000, 10000, 10, '全职', NULL, 1, 469, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1366, '2025-04-08 15:22:05.374056', '2025-04-08 15:22:05.374056', NULL, '机械工程师', '岗位职责：\r\n1.根据方案协助机械工程师进行结构设计\r\n2.负责机械部分设计，2D/3D工程图，BOM清单输出核对\r\n3.负责跟进新产品加工，组装，调试进度，发现问题及时记录和改善\r\n4.负责完善项目资料，如BOM完善，SOP制作等\r\n岗位要求：\r\n1、熟悉标准件的功能和选型，如气缸、轴承、电机、步进马达、视觉，感应器等；\r\n2、熟练掌握Solidworks ,AutoCAD常用2D/3D绘图软件及常用办公软件；\r\n3、了解各种机加原理、加工工艺、钣金加工工艺，了解机械常用材料及其特性； \r\n4、具备技术方案制作能力、良好的计划和执行、协调能力和人际沟通能力；\r\n5、对机械结构有较高的悟性和学习能力；\r\n6、为人正直，善良，无不良工作陋习，具备工作契约精神，热爱自动化行业。 ', '', 5000, 10000, 10, '全职', NULL, 1, 469, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1367, '2025-04-08 15:22:06.037761', '2025-04-08 15:22:06.037761', NULL, '电气工程师', '岗位职责\r\n1、根据订单信息，设计电路图；\r\n2、厂外协助工程师调试及跟机；\r\n3、根据订单编程，制作操作说明书；\r\n任职资格\r\n1、电气自动化专业，学历大专以上；\r\n2、会三菱、台达、松下、欧姆龙、西门子编程；\r\n3、逻辑思维敏捷清晰，善于分析问题，解决问题，学习能力强，有较强团队精神、责任心和积极的工作态度；\r\n4、学习过C#语言，VB语言', '', 5000, 8000, 2, '全职', NULL, 1, 470, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1368, '2025-04-08 15:22:06.342847', '2025-04-08 15:22:06.342847', NULL, '机械设计工程师', '岗位职责\r\n1、配合产品开发或产品改进，协助工程师按时完成结构设计任务，并保证质量；\r\n2、按要求完成各项机械设计中的辅助性工作，包括图纸设计，制图及校对等；\r\n3、听从领导安排；\r\n岗位要求\r\n1、本科及以上学历，机械相关专业；\r\n2、熟悉自动化设备等基本原理及工艺；\r\n3、有责任心，较强应变能力，良好的团队合作精神；\r\n4、熟悉使用2D和3D制图软件，如 AutoCAD/solidworks/PROE等；\r\n5、一年及以上经验者优先及优秀应届毕业生', '', 5000, 8000, 3, '全职', NULL, 1, 470, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1369, '2025-04-08 15:22:06.682264', '2025-04-08 15:22:06.682264', NULL, '市场营销', '岗位职责：\r\n1.定期进行基础性市场调研，建立系统的市场调研资料库；\r\n2.收集行业市场信息及行业动态，分类、管理、维护客户信息；\r\n3.对公司内部的产品和需求有深刻理解，并根据市场及客户需求整合制作销售策划方案；\r\n4.配合公司以及客户的市场活动策划，制订各阶段市场销售活动计划，并组织实施；\r\n5.配合销售人员与客户沟通，完成销售、商务提案及追踪项目实施结果，销售支持项目跨部门支持协调，执行效果支持；\r\n6.完成领导交代的其他任务。\r\n任职要求：\r\n1.本科以上学历，市场营销、广告、电子商务等相关专业背景；\r\n2.工作积极主动，能够承受一定工作压力，具有良好的职业素质及团队合作精神；\r\n3.善于思考，思路敏捷、性格活泼，有良好沟通能力，面对客户能深入了解客户需求；\r\n4.具备良好的行业、市场环境分析能力和较强的整合营销策划及提案能力', '', 5000, 8000, 2, '全职', NULL, 1, 470, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1370, '2025-04-08 15:22:07.284247', '2025-04-08 15:22:07.284247', NULL, '跨境电商亚马逊运营助理+餐补', '岗位内容\r\n1、协助运营进行日常店铺管理，包括商品上架、优化、推广等工作；\r\n2、监控店铺数据，如流量、转化率、销售额等，整理分析数据并形成日报/周报，为运营策略调整提供数据支持；\r\n3、完成运营交办的其他工作。\r\n\r\n岗位要求\r\n1、有英语4级，可线上英文沟通流利。\r\n2、具备良好的学习能力和执行力，能够快速上手工作；\r\n3、工作认真负责，细心耐心，具备良好的沟通能力和团队合作精神；\r\n4、熟练使用办公软件，如 Excel、Word 等；\r\n5、对跨境电商行业有浓厚兴趣，优先考虑了解主流跨境电商平台（如亚马逊、temu等）的基本规则和运营模式人员。', '', 4500, 6000, 2, '全职', NULL, 1, 471, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1371, '2025-04-08 15:22:07.483805', '2025-04-08 15:22:07.483805', NULL, '美工设计', '岗位内容：\r\n1.负责亚马逊平台产品图片的后期处理，包括抠图、精修、排版等，以提炼产品卖点。\r\n2.负责亚马逊平台套图、A+页面、活动推广图片的优化等详情设计。\r\n3.负责活动banner、主图优化、LOGO设计等。\r\n4.结合新媒体主流元素，提供视觉策划与方案创意。\r\n5.店铺促销期间的设计排版及促销宣传版面的设计。\r\n\r\n岗位要求：\r\n1.熟练使用C4D技能，熟悉使用PS、AE、PR，有过品牌视觉设计、海报、包装、排版等经验优先考虑。\r\n2.具备优秀审美能力及沟通理解能力，执行力强，热爱学习，思维灵活，善于创新；\r\n3.工作积极认真，执行力强，良好的沟通协调能力和团队合作意识。', '', 4500, 6000, 2, '全职', NULL, 1, 471, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1372, '2025-04-08 15:22:08.020362', '2025-04-08 15:22:08.020362', NULL, 'PE技术员（储备工程师）', '岗位职责：\r\n1、按照样品工单安排，准时完成样品打样，并严格控制样品质量。\r\n2、有一定制造业工艺流程工作经验优先；\r\n3、样品生产的跟进；\r\n4、上级领导交办的其它事项；\r\n任职要求：\r\n1、大专及以上学历；\r\n2、机械工程或材料分子专业。\r\n3、应届毕业生亦可。（待遇可面谈）；\r\n4、学习能力强，有向工程师发展愿望及动力。\r\n待遇：\r\n1、五险一金；\r\n2、大小周8小时/天工作制；\r\n3、环境优美、空调车间及办公区；\r\n4、餐补、学历补贴、法定节假日；\r\n5、各种特色员工活动。', '', 5000, 10000, 2, '全职', NULL, 1, 472, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1373, '2025-04-08 15:22:08.241147', '2025-04-08 15:22:08.241147', NULL, '储备干部', '职位类别： 储备干部\r\n\r\n1、培训生有专向的培训模式，通过培训能够快速、全面地了解企业运作的全过程流程。\r\n2、合格后将根据自身职业规划，并结合公司的实际安排管理职能职位。\r\n3、对公司管理理念认同，责任心强的培训生，将作为核心管理型员工重点培养。\r\n\r\n\r\n注：公司致力于医疗器械耗材用品的开发、生产、销售，为提升公司整体经营管理水平，结合未来的发展的规划。现对外招聘专科应届精英作为企业发展作提升。\r\n\r\n\r\n年龄要求： 不限 语言要求：不限', '', 5000, 8000, 5, '全职', NULL, 1, 472, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1374, '2025-04-08 15:22:08.442328', '2025-04-08 15:22:08.442328', NULL, 'MQE品质工程师', '岗位职责：（有模切行业岗位经验优先）\r\n1、供应商来料异常反馈和改善处理；\r\n2、制程原材料不合格处理；\r\n3、内部制造产线异常物料改善效果的跟进和反馈；\r\n4、负责材料可靠性的确认和验证；\r\n5、新材料导入评审资料和检验项目建立；\r\n6、协同对内部制程异常和客诉异常的处理和支持；\r\n7、负责试产物料的跟进；\r\n8、输出并跟踪来料、生产和市场上的不良表现数据，为公司的后期改进提供依据。\r\n\r\n任职要求：\r\n1、大专学历以上，有模切行业、模切材料相关经验优先；\r\n2、有较强的品质意识、沟通能力良好，具备一定的数据分析能力或有类似的数据分析经验；\r\n3、有责任心，有较强的品质意识，熟悉QC七大手法，并能熟练运用；\r\n\r\n\r\n年龄要求： 不限 语言要求：不限', '', 6000, 10000, 1, '全职', NULL, 1, 472, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1375, '2025-04-08 15:22:08.669452', '2025-04-08 15:22:08.669452', NULL, '业务员', '岗位职责：\r\n1、负责根据公司及部门销售任务开展销售工作，完成各项销售指标；\r\n2、负责对现有市场和客户进行分析，发现客户的潜在需求，引导相关客户的现有需求，达成销售目标；\r\n3、负责根据客户需求的特点，为客户提供最优产品解决方案；\r\n4、负责与客户之间的商务谈判，建立客户关系，提高合同额和利润率；\r\n5、负责协调各种内部、外部资源，解决在项目实施过程中出现的问题，提高客户满意度；\r\n6、负责对项目回款过程的监控和执行，提高回款率；\r\n7、负责通过客户回访，了解客户需求及潜在需求，以提高客户满意，促成客户二次开发。\r\n\r\n任职要求：\r\n1、熟练使用常用办公软件；\r\n2、良好的职业道德，高度的工作主动性和责任感；\r\n3、善于沟通，有良好的团队精神及强烈的销售热情。\r\n4、有医疗器械销售经验优先。\r\n注：\r\n1、工作地点：东莞松山湖。\r\n\r\n\r\n年龄要求： 不限 语言要求：不限', '', 5000, 15000, 2, '全职', NULL, 1, 472, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1376, '2025-04-08 15:22:09.309371', '2025-04-08 15:22:09.309371', NULL, '项目管理岗（住宅服务）', '岗位职责：\r\n1、负责所辖项目的物业管理工作，监督检查日常物业的服务品质、操作流程及运行情况；\r\n2、制定年度物业管理工作计划和项目预算方案；\r\n3、负责统筹和管理保安、客服、保洁、工程等方面工作；\r\n4、负责落实公司各类规章制度、决议与检查事项，并按规定向公司反馈过程与结果 ；\r\n5、负责定期检查物业管理服务费和其它有关费用的收缴情况，完成项目考核指标，如：管理费收缴及增值收入指标等。\r\n\r\n任职要求：\r\n1、学历专业：本科及以上学历，专业不限，物业管理等相关专业优先；\r\n2、工作经验：有社会实践管理经验者优先；\r\n3、专业技能：熟练运用office办公软件；\r\n4、性格特点：沟通能力较好，抗压能力强。\r\n\r\n校园招聘网申地址：https://app.mokahr.com/su/igr61', '', 6000, 7000, 2, '全职', NULL, 1, 473, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1377, '2025-04-08 15:22:09.529496', '2025-04-08 15:22:09.529496', NULL, '基础服务岗（管家）', '岗位职责：\r\n1、负责组织实施物业项目各服务环节的管理工作； \r\n2、维护小区/楼宇的日常物业管理服务，包括但不限于客户服务管理、环境管理、安全秩序管理、设施维修管理等工作； \r\n3、保持与客户业主的良好沟通，维护与客户业主之间的良好关系，树立公司良好的形象。 \r\n\r\n任职要求： \r\n1、学历专业：专科及以上学历，专业不限；\r\n2、工作经验：有相关社会实践经验者优先； \r\n3、性格特点：具有较强的亲和力、组织协调、人际理解、同理心等方面能力。', '', 5000, 6000, 5, '全职', NULL, 1, 473, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1378, '2025-04-08 15:22:10.064506', '2025-04-08 15:22:10.064506', NULL, '经营管理岗（网点负责人方向）', '岗位职责：\r\n1、资源投入：制定年度和月度规划,并根据内外部环境的变化及时调整；\r\n2、客户服务及业务开发：提供快速、安全、高效的客户服务，挖掘客户需求、分析竞争对手状况、提高业务收入提高市场占有率；\r\n3、质量管控：确保操作SOP及质量管理要求等有效落地，并对作业异常及时识别、有效干预。\r\n4、团队建设：及时向团队赋能宣导管理模式、运营目标等，激发员工效能，并营造积极向上创造良好的工作环境和高效的工作氛围，不断提高员工质量和员工满意度；\r\n5、内外部风险管控：维护所在区域的公共关系，塑造良好的社会和品牌形象。\r\n任职要求：\r\n1、本科及以上学历，理工科类、物流类、管理类等相关专业；\r\n2、有良好的沟通影响力、号召力、组织协调和执行能力；\r\n3、具备较强分析问题及解决问题能力；\r\n4、能承受一定压力，善于学习和积累；\r\n5、熟悉OFFICE办公软件。', '', 9000, 12000, 20, '全职', NULL, 1, 474, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1379, '2025-04-08 15:22:10.313723', '2025-04-08 15:22:10.314237', NULL, '新鹰实习生（网点负责人方向）', '加入新鹰计划，同学们可以通过“闯关升级”的形式，在校期间灵活实习（首次实习要求至少2个月），体验顺丰的各个不同岗位，积累实战经验，通关必得顺丰校招offer，毕业即可入职顺丰上任管理岗位，匹配管理者的待遇，快人一步，完成大学生到职场精英的华丽蜕变。\r\n岗位职责：\r\n1、掌握收派操作技能，负责收派快件的工作，保证快件时效和快件安全，提升客户体验；\r\n2、学习仓管员巴枪操作及智域系统操作，学习滞留、错分件、到件异常等问题件的处理步骤；\r\n3、了解市场销售基础知识，负责开展产品宣传和客户开发工作；\r\n4、协助任务巡检的开展，如防疫、6S管理、作业、设备、人员、目视化等；\r\n5、协助开展团队组织建设及管理，营造良好的组织气氛。\r\n岗位要求：\r\n1、2026届本科及以上学历，专业不限（26届毕业时间在2025年10月1日-2026年9月30日）\r\n2、有良好的沟通影响力、号召力、组织协调和执行能力；\r\n3、具备较强分析问题及解决问题能力；\r\n4、能承受一定压力，善于学习和积累；\r\n5、熟悉OFFICE办公软件。', '', 4500, 5500, 40, '全职', NULL, 1, 474, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1380, '2025-04-08 15:22:11.398230', '2025-04-08 15:22:11.398230', NULL, '管培生（机械/电子）', '岗位职责：\r\n1、编制样板的产品物料需求表初稿、工序安排建议、各工序的工效（工时、工价）建议；\r\n2、动手能力强，根据产品开发通知单、图纸、指令等完成制作出样品。\r\n\r\n任职资格：\r\n1、本科及以上学历，理工科专业，动手能力强；\r\n2、性格积极主动，有上进心，沟通协调能力强。', '', 5000, 6000, 2, '全职', NULL, 1, 475, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1381, '2025-04-08 15:22:11.781511', '2025-04-08 15:22:11.781511', NULL, '管培生（外贸）', '岗位职责：\r\n1、开拓国际市场新渠道，完成销售任务，跟进客户订单情况；\r\n2、参加展会并获取客户资源转化为订单；\r\n3、收集市场情况，提交市场信息及动态分析，进行周期性的总结及报告；\r\n4、维护良好的客情关系，保持与客户积极主动的日常沟通并提供高效服务。\r\n\r\n任职资格：\r\n1、本科及以上学历，英语或国贸相关专业；\r\n2、CET6及以上，英语口语流利，积极主动，学习能力强；\r\n3、有学生会或班级管理经验者优先。', '', 5000, 6000, 4, '全职', NULL, 1, 475, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1382, '2025-04-08 15:22:12.355216', '2025-04-08 15:22:12.355216', NULL, '管培生（财务）', '岗位职责：\r\n1、主要协助完成子公司财务工作；\r\n2、协助完成月末结帐及年终审计；\r\n3、有国外（子公司）出差机会。\r\n\r\n任职资格：\r\n1、本科及以上学历，财务相关专业，持有会计相关证书；\r\n2、CET4及以上，积极主动，工作细致，熟悉excel操作。', '', 5000, 6000, 2, '全职', NULL, 1, 475, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1383, '2025-04-08 15:22:12.870625', '2025-04-08 15:22:12.870625', NULL, '管培生（设计）', '岗位职责：\r\n1、完成目标任务分解书所下达的设计任务；\r\n2、设计产品外观三维效果图、平面图等资料；\r\n3、负责产品相关资讯的收集、整理、分析；\r\n4、负责产品宣传资料的收集整理及设计制作。\r\n\r\n任职资格：\r\n1、本科及以上学历，工业设计等相关专业；\r\n2、熟练使用犀牛、SDMAX、CAD等设计软件；\r\n3、具有较强的创造力，有想法和创新思维，沟通表达能力良好，有上进心。', '', 5000, 6000, 3, '全职', NULL, 1, 475, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1384, '2025-04-08 15:22:13.113999', '2025-04-08 15:22:13.115007', NULL, '管培生（化学）', '岗位职责：\r\n1、负责对公司所使用的聚醚多元醇各项指标按检验标准进行化验；\r\n2、负责发泡实验室及新产品的研发等工作；\r\n3、真实、准确地填写化验记录，记录内容保存完整；\r\n4、配合发泡实验室及模塑实验室做原料的测试工作。\r\n\r\n岗位要求：\r\n硕士及以上学历，化工专业，有聚氨酯研究经验者优先考虑。', '', 10000, 12000, 1, '全职', NULL, 1, 475, 7, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1385, '2025-04-08 15:22:13.655964', '2025-04-08 15:22:13.655964', NULL, '人伤调查岗', '工作内容：\r\n负责公司的人伤事故调查和处理，确保员工和公司利益不受损失。\r\n主要职责：\r\n- 负责调查并记录公司的人伤事故，确保所有事故都得到妥善处理。\r\n- 协助公司制定并完善人伤事故处理制度和流程，以确保公司员工的安全和公司利益的保障。\r\n- 负责收集、整理人伤事故相关数据，进行分析和汇报，以帮助公司制定更好的预防和减少人伤事故的措施。\r\n- 协助公司对外部合作伙伴，如政府、法律机构保持沟通，以获取更全面的信息，并确保公司遵守相关法规和规定。\r\n- 协助公司进行人伤事故的预防工作，以减少未来的人伤事故发生。\r\n职位要求：\r\n- 不限工作经验，欢迎应届毕业生，医学、保险类、法学类相关专业优先。\r\n- 具备良好的沟通能力和团队合作精神，能够胜任公司的人力资源部门。\r\n- 具有较强的逻辑思维能力，能够对复杂的人伤事故问题进行分析和处理。\r\n- 熟练掌握办公软件，如Office等。\r\n- 具备基本的了解和了解人伤事故处理法规的能力。', '', 5000, 8000, 1, '全职', NULL, 1, 476, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1386, '2025-04-08 15:22:13.949738', '2025-04-08 15:22:13.949738', NULL, '车险查勘定损岗', '1、负责辖区内出险案件中的查勘定损工作以及代查勘工作；\r\n2、完成现场施救任务以及其他相关服务，记录并处理客户所提出的意见；\r\n3、按公司规定的业务操作流程对现场进行查勘，在处理过程中需组织客户及相关人员准确高效地核定事故损失；\r\n4、负责重大出险案件的调查取证工作，收集，整理以及审核客户信息和其他相关资料，并将资料及时移交给其他相关的工作人员；\r\n5、为客户提供服务时需注意安抚客户的情绪。', '', 5000, 8000, 2, '全职', NULL, 1, 476, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1387, '2025-04-08 15:22:14.241342', '2025-04-08 15:22:14.241342', NULL, '非车险核保岗', '岗位职责：\r\n1、非车险核保定价、政策规划及费用政策的跟踪落实；\r\n2、组织开展培训宣导，推动和督导业务发展及效果检视；\r\n3、分析保险市场需求，开发非车险新产品。\r\n岗位要求：\r\n全日制本科及以上学历，保险学、审计学、法学等相关专业；熟练Excel、PPT、Word等办公软件；有保险实习经验党员优先。', '', 5500, 7000, 1, '全职', NULL, 1, 476, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
