INSERT INTO `post` VALUES (1399, '2025-04-08 15:22:20.063933', '2025-04-08 15:22:20.063933', NULL, '订单管理专员', '【工作内容】\r\n1.	订单产品的图纸确认\r\n2.	产品询价处理及制作报价单相关业务\r\n3.	产品货期调整及管理相关业务\r\n4.	系统中订单的录入及管理相关业务\r\n5.	系统维护和数据分析\r\n\r\n【职位要求】\r\n1.	统招大学本科学历\r\n2.	机械、自动化、电气、金属材料等理工类专业优先\r\n3.	细致认真，有责任心，沟通协调能力强\r\n\r\n【工作地点】大连（开发区）、深圳', '', 6000, 7000, 4, '全职', NULL, 1, 479, 6, NULL, NULL, NULL, NULL, NULL, 0, '210200', '210000', '210213', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1400, '2025-04-08 15:22:21.073041', '2025-04-08 15:22:21.073041', NULL, '总经理助理', '1、协助总经理处理日常行政事务，包括文件管理、会议安排、行程协调等。\r\n2、负责总经理与各部门之间的沟通协调工作，确保信息传递的及时性和准确性。\r\n3、协助总经理制定公司战略规划和年度工作计划，并跟踪执行情况。\r\n4、参与公司重要项目的策划和执行，为总经理提供决策支持。\r\n5、完成总经理交办的其他临时性工作。\r\n6、具备良好的组织协调能力、沟通能力和文字表达能力\r\n7、有较强的执行力和责任心，\r\n福利待遇：专业认证培训+年终奖+季度奖金+旅游\r\n熟悉运用AI工具，剪辑工具者优先', '', 5000, 8000, 1, '全职', NULL, 1, 480, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1401, '2025-04-08 15:22:21.390191', '2025-04-08 15:22:21.390191', NULL, '团队助理', '1、活动策划与执行：协助团队负责人策划并执行各类活动，包括市场推广、客户答谢、内部培训等。\r\n2、日常投保支持：协助团队成员处理客户投保流程，跟进投保进度。\r\n3、数据分析与报告：收集业务数据，生成分析报告，为团队决策提供支持。\r\n4、方案与海报制作：协助制作保险方案和宣传海报，确保专业性和吸引力。\r\n5、团队活动统计与联系：统计活动人数，协助与客户及合作伙伴沟通。\r\n6、责任心强，具备良好的沟通能力和团队合作精神\r\n福利待遇：专业认证培训+年终奖+旅游', '', 4500, 5000, 1, '全职', NULL, 1, 480, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1402, '2025-04-08 15:22:21.532740', '2025-04-08 15:22:21.532740', NULL, '保险经纪人', '1、负责为客户提供专业的保险咨询和方案设计，满足客户的保险需求，协同客户理赔服务。\r\n2、开拓新客户资源，维护现有客户关系，提升客户满意度和忠诚度。\r\n3、参与公司组织的市场推广活动，提升公司和团队品牌知名度。\r\n4、完成个人业绩目标，为团队业绩增长贡献力量。\r\n5、具备良好的沟通能力、客户服务意识和团队合作精神。\r\n6、有强烈的事业心和责任感，能够承受工作压力', '', 5000, 20000, 20, '全职', NULL, 1, 480, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
