INSERT INTO `post` VALUES (1404, '2025-04-08 15:22:22.149813', '2025-04-08 15:22:22.149813', NULL, '销售', '工作职责：负责产品销售，门店接待、维护客户；根据客户需求，介绍产品；具备良好的沟通能力、客户服务意识，认真负责。\r\n男女不限、交社保、销售提成。', '', 5000, 7000, 2, '全职', NULL, 1, 481, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1405, '2025-04-08 15:22:23.009760', '2025-04-08 15:22:23.009760', NULL, '销售工程师', '岗位职责：\r\n1、根据公司销售目标和个人任务，完成销售任务；\r\n2、负责收集市场动态、行业信息竞争对手及产品，加深分析、学习并与团队分享；\r\n3、负责开发客户资源，寻找潜在客户，增加产品销售范围；\r\n4、定期拜访客户，维护老客户，挖掘客户需求，；\r\n5、产品及系统方案市场推广宣传。\r\n\r\n岗位要求：\r\n1、大专及以上学历，理工类专业;\r\n2、对工业自动化行业有长期的职业规划，熟悉自动化行业及营销特点，有较强的自我实现愿望。\r\n3、善于捕捉、挖掘客户需求优先，善于市场调研者更佳。\r\n4、三观端正，有强烈的自我成就欲望；有良好的服务意识和能力，善于沟通组织协调，踏实，抗压，自驱。', '', 6000, 9000, 5, '全职', NULL, 1, 482, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1406, '2025-04-08 15:22:23.168670', '2025-04-08 15:22:23.168670', NULL, '软件工程师 (嵌入式)', '本科及以上学历，自动化、电气工程、电子信息、机电一体化等相关专业;具备Linux系统的C、单片机开发能力。', '', 7000, 9000, 2, '全职', NULL, 1, 482, 6, NULL, NULL, NULL, NULL, NULL, 2, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1407, '2025-04-08 15:22:23.383965', '2025-04-08 15:22:23.383965', NULL, '算法工程师 (机器视觉)', '硕士及以上学历，博士优先，自动化、图像处理、应用数学相关专业;具备图像处理常用算法、高级算法及基本理论能力，并能快速实现基本算法。', '', 12000, 14000, 2, '全职', NULL, 1, 482, 7, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1408, '2025-04-08 15:22:23.652960', '2025-04-08 15:22:23.652960', NULL, '应用工程师', '大专及以上学历，机电、数控、自动化、机器人、智能制造等相关专业: 有一定编程能力；掌握PLC、C/C++/C#/ST等语言编程能力，能接受短期外出工作。', '', 6000, 7000, 2, '全职', NULL, 1, 482, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1409, '2025-04-08 15:22:23.883999', '2025-04-08 15:22:23.883999', NULL, '技术/市场助理', '本科及以上学历，机电、自动化、机械等相关专业:掌握PLC、C/C++/C#/ST等语言编程能力，有一定编程能力，有接触硬件/电气接线的优先；文笔功底较好。', '', 5000, 7000, 2, '全职', NULL, 1, 482, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1410, '2025-04-08 15:22:24.149327', '2025-04-08 15:22:24.149327', NULL, '算法工程师 (机械手)', ':硕土及以上学历，博土优先，机器人工程、控制科学与工程或计算机相关专业:有机械手正逆解算法经验，具备动力学、运动学等理论基础。', '', 11000, 14000, 2, '全职', NULL, 1, 482, 7, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1411, '2025-04-08 15:22:24.408345', '2025-04-08 15:22:24.408345', NULL, '技术支持工程师', '本科及以上学历，机电、自动化、机械等相关专业:掌握PLC、C/C++/C#/ST等语言编程能力，有项目经验者优先。', '', 5000, 7000, 2, '全职', NULL, 1, 482, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1412, '2025-04-08 15:22:24.601468', '2025-04-08 15:22:24.601468', NULL, '软件工程师 (C++)', '本科及以上学历，计算机、软件工程等相关专业Windows下C++软件开发，有编辑器开发经验优先。', '', 9000, 12000, 5, '全职', NULL, 1, 482, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1413, '2025-04-08 15:22:25.048635', '2025-04-08 15:22:25.048635', NULL, '产品技术支持工程师（BASE：西安/东莞）', '【岗位职责】\r\n1.负责公司NPI软件产品线(含DFM,SMT,TEST,VSD,GERBER等)的售前技术交流和产品演示；\r\n2.协助销售为客户提供合理的产品应用技术方案;\r\n3.负责客户的软件安装、培训及技术支持;\r\n4.负责相关的培训教材、视频的编制;\r\n5.配合营业部拓展业务机会，提高客户对公司产品和方案的认知度;\r\n6.参与产品技术方案的制定.\r\n\r\n【任职要求】\r\n1.本科及以上应届毕业生，计算机/电子信息类相关专业;\r\n2.对电子设计与制造和工业软件行业感兴趣，能适应出差;\r\n3.沟通表达能力强、逻辑思维清晰、勤奋好学、具备团队合作精神;\r\n4.熟练的PPT演示能力和技巧.', '', 7000, 12000, 20, '全职', NULL, 1, 483, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1414, '2025-04-08 15:22:26.025983', '2025-04-08 15:22:26.025983', NULL, '2D/3D 设计师', 'AI PS熟练，对三维图有一定认识，有VR的工作经验最佳/会运用三维软件如：BLENDEV/3DMAX/C4D等', '', 4500, 5500, 2, '全职', NULL, 1, 484, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1415, '2025-04-08 15:22:26.262380', '2025-04-08 15:22:26.262380', NULL, '船务', '香港进口物料文件及物流安排，江西物流安排，客户船务工作\r\n依据客户业务提供的出货排程，安排订舱，制作出货文件，提供报关资料给报关同事，作SI/VGM，核对出货订单，', '', 5500, 7000, 2, '全职', NULL, 1, 484, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1416, '2025-04-08 15:22:26.477632', '2025-04-08 15:22:26.477632', NULL, '外贸跟单', '本科以上学历，客人订单系统下单，及交期，出货时间维护. 处理客人订单，核对单价，确认交期. ERP系统建入客人订单，ERP系统做出货通知. 与客人日常事项处理,  比如客人询问生产进度. 生产进度报表的更新及跟进，并提前将异常反馈客人. 跟进客人预告订单，并做分析. 出货后货款的跟催，及收款后ERP系统做完账.', '', 5000, 8000, 2, '全职', NULL, 1, 484, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1417, '2025-04-08 15:22:26.924812', '2025-04-08 15:22:26.924812', NULL, '外贸开发业务', '工作内容：\r\n\r\n1.根据图稿开发新产品，及创新新产品。\r\n\r\n2.按要求寄出样品。\r\n\r\n3.处理当天邮件内容。\r\n\r\n4.跨部门沟通相关工作。\r\n\r\n5.向上级汇报每天/每周进度。\r\n\r\n6.跟进订单，出货追踪，货款催收。\r\n\r\n7.维护客户关系，及时处理异常。\r\n\r\n岗位要求：\r\n\r\n1.大专以上学历，英语四级以上。\r\n\r\n2.数据观念强，熟练操作Office办公软件。\r\n\r\n3.工作认真负责，抗压能力强，沟通能力佳.', '', 5500, 8000, 6, '全职', NULL, 1, 484, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1418, '2025-04-08 15:22:27.502602', '2025-04-08 15:22:27.502602', NULL, '财富经理', '岗位要求：\r\n1、年龄：在21周岁以上（含21周岁），具有完全民事行为能力。\r\n2、学历要求：全日制本科（含）以上学历。\r\n3、资格：通过证券从业资格考试优先（公司提供考试培训）\r\n4、品德：品行端正，无不良诚信记录。具有良好的敬业精神、职业道德。\r\n5、公司认为需要的其他条件。\r\n\r\n岗位职责：\r\n1、负责财富管理客户的开发、服务及日常维护。\r\n2、为客户提供综合金融服务方案，满足客户多元化投资需求。\r\n3、开拓和维护区域业务渠道，推动业务渠道建设。\r\n4、参与公司组织的营销策划、市场推广等活动。', '', 5000, 8000, 4, '全职', NULL, 1, 485, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1419, '2025-04-08 15:22:28.340317', '2025-04-08 15:22:28.340317', NULL, '结构助理工程师', '岗位职责：\r\n1.根据产品的项目要求负责新产品的外观、工艺、结构等方面的设计和制作\r\n2.主动积极负责项目跟进,开模前评估,试模检讨以及试产\\模具验收\r\n3.负责产品维护,出相关产品技术资料(bom\\检验图)及签板,结案资料完整准确,有条理,重点突出\r\n4.处理生产异常及模具异常问题,准确迅速的分析问题并解决,与其他部门沟通顺畅;\r\n5.对产品持续优化,通过改进设计方案、改进材料、增加零件的通用性控制成本\r\n6.完成部门负责人安排的其他工作.\r\n\r\n任职资格：\r\n1、有相关水泵结构设计经验，有直流水泵、风扇结构开发经验优先，无刷水泵开发经验优先\r\n2、机械或机电或模具设计专业；熟练使用POER，Solidworks或CAD。\r\n3、熟悉产品开发流程,对产品结构设计认识深刻,能对产品结构及工艺提出有效改进方案,能独立完成设计,设计合理,思路清晰,考虑问题全面；结构可靠性及作业方便性进行分析评估;\r\n4、工作严谨细致,有良好的工作习惯及工作方法\r\n5、有相关水泵电机或电器工作经验优先。', '', 5000, 10000, 2, '全职', NULL, 1, 486, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1420, '2025-04-08 15:22:28.954636', '2025-04-08 15:22:28.954636', NULL, '销售管培生', '岗位职责： \r\n1、通过电话开发公司核心渠道圈定行业及客户，挖掘和引导客户需求； \r\n2、协调售前工程师为客户提供售前方案，并通过远程演示或电话给客户答疑解惑； \r\n3、定位圈定名单中的优质客户，通过定期EDM／市场活动／电话沟通持续影响； \r\n4、配合销售人员，并协调公司内部资源，推进销售项目，直至完成销售签单； \r\n5、对所负责的行业或区域进行业务数据分析，定期形成业务报告，并提出改进建议； \r\n6、对所负责的核心渠道进行支持与监督，配合外部销售经理共同提升渠道业务能力。 \r\n\r\n任职要求： \r\n1、大专以上学历，具备网络技术基础，有意在IT行业长期发展的优先； \r\n2、具备较强的目标意识和积极主动性； \r\n3、能够承受一定的工作压力，并且能够自我激励； \r\n4、普通话标准，声音甜美，表达清晰，具备较好的沟通能力； \r\n5. 有电话销售工作经验者优先考虑； \r\n6. 对生活有高品质的追求。\r\n\r\n福利待遇： \r\n1、公司实行每周5.5天8小时工作制； \r\n2、公司企业文化活动丰富多彩如：生日派对、年度聚餐、年终抽奖、年度旅游等； \r\n3、享国家劳动法各种带薪假期； \r\n4、公司提供可发展的职业培训计划； \r\n5、公司设立季度销售奖，年终奖； \r\n公司地址：东莞市南城区黄金路1号东莞天安数码城F区1号科研楼1101', '', 4500, 6000, 3, '全职', NULL, 1, 487, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1421, '2025-04-08 15:22:29.241019', '2025-04-08 15:22:29.241019', NULL, '客户经理', '职责描述：\r\n1、利用网络进行产品的销售及推广；\r\n2、通过网络进行渠道开发和业务拓展；\r\n3、负责客户的开发与维护，与客户建立良好的关系；\r\n4、通过在线聊天工具向现有和潜在客户提供卓越的售前、售中的咨询问题；\r\n5、向现有和潜在的客户提供产品的介绍和相关问题答疑，提高服务质量；\r\n6、按时完成销售任务。\r\n\r\n任职要求：熟悉互联网络，熟练使用网络交流工具和各种办公软件；\r\n2、普通话流利，具有良好的团队精神，能吃苦耐劳、沟通及理解能力强；\r\n3、精通各种网络销售技巧有积极向上的工作心态，极强的上进心。\r\n福利待遇： \r\n1、公司实行每周5天8小时工作制，即双休制； \r\n2、公司企业文化活动丰富多彩如：生日派对、年度聚餐、年终抽奖、年度旅游等； \r\n3、享国家劳动法各种带薪假期； \r\n4、公司提供可发展的职业培训计划； \r\n5、公司设立季度销售奖，年终奖； \r\n公司地址：东莞市南城区黄金路1号东莞天安数码城F区1号科研楼1101 ', '', 4500, 10000, 3, '全职', NULL, 1, 487, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1422, '2025-04-08 15:22:29.563080', '2025-04-08 15:22:29.563080', NULL, '销售助理', '岗位职责： \r\n1、通过电话开发公司核心渠道圈定行业及客户，挖掘和引导客户需求； \r\n2、协调售前工程师为客户提供售前方案，并通过远程演示或电话给客户答疑解惑； \r\n3、定位圈定名单中的优质客户，通过定期EDM／市场活动／电话沟通持续影响； \r\n4、配合销售人员，并协调公司内部资源，推进销售项目，直至完成销售签单； \r\n5、对所负责的行业或区域进行业务数据分析，定期形成业务报告，并提出改进建议； \r\n6、对所负责的核心渠道进行支持与监督，配合外部销售经理共同提升渠道业务能力。\r\n任职要求： \r\n1、大专以上学历，具备网络技术基础，有意在IT行业长期发展； \r\n2、具备较强的目标意识和积极主动性； \r\n3、能够承受一定的工作压力，并且能够自我激励； \r\n4、普通话标准，声音甜美，表达清晰，具备较好的沟通能力； \r\n5. 有电话销售工作经验者优先考虑； \r\n6. 对生活有高品质的追求。', '', 4500, 8000, 10, '全职', NULL, 1, 487, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1423, '2025-04-08 15:22:29.791918', '2025-04-08 15:22:29.791918', NULL, '销售实习生', '岗位职责： \r\n1、通过电话开发公司核心渠道圈定行业及客户，挖掘和引导客户需求； \r\n2、协调售前工程师为客户提供售前方案，并通过远程演示或电话给客户答疑解惑； \r\n3、定位圈定名单中的优质客户，通过定期EDM／市场活动／电话沟通持续影响； \r\n4、配合销售人员，并协调公司内部资源，推进销售项目，直至完成销售签单； \r\n5、对所负责的行业或区域进行业务数据分析，定期形成业务报告，并提出改进建议； \r\n6、对所负责的核心渠道进行支持与监督，配合外部销售经理共同提升渠道业务能力。 \r\n\r\n任职要求： \r\n1、大专以上学历，具备网络技术基础，有意在IT行业长期发展的优先； \r\n2、具备较强的目标意识和积极主动性； \r\n3、能够承受一定的工作压力，并且能够自我激励； \r\n4、普通话标准，声音甜美，表达清晰，具备较好的沟通能力； \r\n5. 有电话销售工作经验者优先考虑； \r\n6. 对生活有高品质的追求。\r\n\r\n福利待遇： \r\n1、公司实行每周5.5天8小时工作制； \r\n2、公司企业文化活动丰富多彩如：生日派对、年度聚餐、年终抽奖、年度旅游等； \r\n3、享国家劳动法各种带薪假期； \r\n4、公司提供可发展的职业培训计划； \r\n5、公司设立季度销售奖，年终奖； \r\n公司地址：东莞市南城区黄金路1号东莞天安数码城F区1号科研楼1101', '', 4500, 6000, 3, '全职', NULL, 1, 487, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1424, '2025-04-08 15:22:30.605437', '2025-04-08 15:22:30.605437', NULL, '理财顾问', '（1）本科以上学历，具备证券从业资格证，同时具备基金从业资格证者优先考虑；\r\n（2）具有一定的证券、股票和基金相关的金融基础知识；\r\n（3）性格开朗，品行端正，勤奋好学，善于沟通，具备主动营销服务意识，工作积极负责；\r\n（4）团结友善，能与团队成员有良好的协作精神；\r\n（5）遵守国家法律、法规和各项金融规章制度，无任何不良纪录，具有良好的职业操守和较强的工作。', '', 3500, 10000, 15, '全职', NULL, 1, 488, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1425, '2025-04-08 15:22:31.727632', '2025-04-08 15:22:31.727632', NULL, '房地产销售', '一、岗位职责\r\n1. 做好项目客户来访接待工作，介绍楼盘情况，为客户提出置业方案及促进成交；\r\n2. 寻找开发新客户，跟踪目标客户；\r\n3. 促进销售业务的一系列工作，包括周边踩盘、巡铺等；\r\n4. 楼盘销售的一系列跟进工作，包括认购、合同签订等；\r\n5. 完成销售经理安排的工作任务。\r\n\r\n二、任职要求\r\n1. 大专或以上学历，参加过销售相关培训者更佳；\r\n2. 3年及以上销售工作经验，有销冠业绩者优先考虑；\r\n3. 普通话流利，熟练运作各项办公自动化软件，会广东话者更佳。\r\n\r\n三、其他\r\n月休4天；包食宿；节日福利；五险一金等。（具体按照提成）', '', 6000, 6500, 5, '全职', NULL, 1, 489, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1426, '2025-04-08 15:22:32.066414', '2025-04-08 15:22:32.066414', NULL, '行政客服', '一、任职要求\r\n1.年龄： 18-25岁，身高1.65-170cm ；\r\n2.大专及以上文化，形象气质佳，有主动服务和沟通意识，性格开朗大方，有相关前台接待，礼仪工作经验者优先。\r\n\r\n二、工作内容\r\n1. 做好日常客户接待工作，包括饮品、餐点服务以及保持茶水间卫生等。\r\n2. 客户有需要时，负责介绍样板房。\r\n3. 负责管理样板房物品，设施设备、墙面等异常情况报修。\r\n4. 协助保持样板房内的清洁卫生和绿化长势良好。\r\n5. 完成领导交办的其他工作事项。\r\n\r\n三、其他\r\n月休4天、带薪年假、五险、定期体检、包食宿、节日福利等。', '', 6000, 6500, 5, '全职', NULL, 1, 489, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1427, '2025-04-08 15:22:32.631558', '2025-04-08 15:22:32.631558', NULL, '财富经理', '一、岗位职责\r\n依照公司授权从事下列活动：\r\n1.开发客户；\r\n2.金融产品配置和服务；\r\n3.向客户提供咨讯产品和投资咨询服务；\r\n4.做好营业部分配存量客户的服务；\r\n5.向客户介绍与证券交易有关的法律、法规、监管部门各种规定、自律 规则及公司的有关规章制度；\r\n6.公司授权的其他活动。\r\n\r\n二、岗位要求\r\n1、本科及以上学历；\r\n2、具备良好的学习能力、沟通能力及抗压能力；\r\n3、入职前通过证券从业资格考试。\r\n4、同等条件下，中共党员优先。\r\n\r\n三、待遇福利\r\n1.正式员工编制、五险二金\r\n2.年度体检、补充医疗\r\n3.多项补贴、工会福利\r\n4.业绩激励、专业培训\r\n5.各类人才梯队培养平台\r\n6.科学的晋升通道\r\n\r\n四、工作地点\r\n东莞辖区各营业部（南城、石龙、厚街、寮步、大朗、虎门、长安、常平、松山湖）\r\n\r\n职位亮点：世界500强集团，大型国企券商平台。', '', 5000, 10000, 10, '全职', NULL, 1, 490, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1428, '2025-04-08 15:22:33.312183', '2025-04-08 15:22:33.312183', NULL, '理财顾问', '1，服务营业部存量客户，做好业务推广，产生综合业务收入。\r\n2，按照公司指引及合作方案寻找互联网合作APP或其他渠道，互联网渠道客户开发，跟踪，服务，维护。\r\n3，引导客户完成开户，并交客户使用账户，后续的咨询跟踪。\r\n4，增值业务，产品销售，利用公司的产品：投顾产品，理财产品，公募基金，私募基金，期货期权，及一些企业业务的开发。', '', 4000, 10000, 10, '全职', NULL, 1, 491, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1429, '2025-04-08 15:22:33.450822', '2025-04-08 15:22:33.450822', NULL, '互联网渠道岗', '1，按照公司指引及合作方案寻找互联网合作APP或其他渠道，互联网渠道客户开发，跟踪，服务，维护。\r\n2，抖音，小红书等互联网平台账号创建及经营。\r\n3，互联网投顾销售，增值业务，产品销售。\r\n4，需要有一定的视频创作与剪辑的技能。\r\n5，协助完成互联网投教视频。\r\n6，通过证券从业资格考试。', '', 4000, 12000, 10, '全职', NULL, 1, 491, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1430, '2025-04-08 15:22:34.214399', '2025-04-08 15:22:34.214399', NULL, '社工助理（东坑镇）', '1、大专或以上学历，专业不限，社会工作及其它相关专业优先； \r\n2、认同社会工作专业价值，热爱社工行业；\r\n3、具备责任心，沟通能力及团队意识。\r\n4、工作地点：东部片区', '', 2500, 3000, 1, '全职', NULL, 1, 492, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1431, '2025-04-08 15:22:34.826222', '2025-04-08 15:22:34.826222', NULL, '公考实战助教', '一、公考实战助教（200名）\r\n180-320元/天/广东省内/免费培训\r\n岗位职责：\r\n1.协助讲师将学员进行分组讨论；\r\n2.对相关学员进行演练点评及辅导；\r\n3.颁发讲义以及跟进后期布置的作业等。\r\n任职要求：\r\n1.本科及以上学历，时间合适优先；\r\n2.接受高峰期需要省内或市内出差；\r\n3.带班前需要接受公司统一培训。\r\n\r\n面试实战老师可以获得什么？\r\n1.经过专业培训，提升你的逻辑及表达能力；\r\n2.提前了解公考面试以及大型企业面试方法,为自己面试提前加分；\r\n3.深度体验华图优秀老师面试课程\r\n4.收获很多优秀的伙伴和未来的公务员朋友；\r\n5.赚到一笔不错的兼职费。\r\n\r\n工作地点\r\n全省所有城市可选（21个）\r\n广州、深圳、佛山、江门、惠州、清远、肇庆、珠海、阳江、中山、湛江、茂名、东莞、潮州、汕头、揭阳、梅州、云浮、河源、汕尾、韶关', '', 4500, 3500, 200, '全职', NULL, 1, 493, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440104', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1432, '2025-04-08 15:22:35.136370', '2025-04-08 15:22:35.136370', NULL, '课程顾问', '【工作内容】\r\n1、根据公司提供有效意向资源邀约（无需陌拜，无需外出），负责校区内咨询招生工作，包括企业微信与学员一对一进行沟通，维护学员，挖掘需求，线下门店学员咨询及报名等工作；\r\n2、接待到访客户，根据客户需求提供学习方案，为客户提供专业的课程指导；\r\n3、针对潜在客户，主动引导客户进行报班学习；\r\n4、收集、整理、记录客户信息，及时回访跟进，促进达成。\r\n【任职要求】\r\n1、全日制专科及以上学历，有网络销售经验优先考虑；优秀实习生也非常欢迎投递！！！\r\n2、亲和力强，形象气质佳，口齿伶俐，性格开朗，乐观进取；\r\n3、责任心强，善于换位思考，具有良好的客户服务意识；\r\n4、热爱教育行业；\r\n【工作时间】\r\n早班08:30-18:00，12:00-13:30休息\r\n晚班13:30-21:30，18:00-19:00休息\r\n一周休息两天，排班轮休，法定节假日休息', '', 4500, 6000, 2, '全职', NULL, 1, 493, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1433, '2025-04-08 15:22:35.744159', '2025-04-08 15:22:35.744159', NULL, '课程顾问', '【工作内容】\r\n1、根据公司提供有效意向资源邀约（无需陌拜，无需外出），负责校区内咨询招生工作，包括企业微信与学员一对一进行沟通，维护学员，挖掘需求，线下门店学员咨询及报名等工作；\r\n2、接待到访客户，根据客户需求提供学习方案，为客户提供专业的课程指导；\r\n3、针对潜在客户，主动引导客户进行报班学习；\r\n4、收集、整理、记录客户信息，及时回访跟进，促进达成。\r\n【任职要求】\r\n1、全日制专科及以上学历，有网络销售经验优先考虑；优秀实习生也非常欢迎投递！！！\r\n2、亲和力强，形象气质佳，口齿伶俐，性格开朗，乐观进取；\r\n3、责任心强，善于换位思考，具有良好的客户服务意识；\r\n4、热爱教育行业；\r\n【工作时间】\r\n早班08:30-18:00，12:00-13:30休息\r\n晚班13:30-21:30，18:00-19:00休息\r\n一周休息两天，排班轮休，法定节假日休息', '', 4500, 6000, 1, '全职', NULL, 1, 493, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1434, '2025-04-08 15:22:36.473338', '2025-04-08 15:22:36.473338', NULL, '英语储备干部', '工作内容：\r\n1、综合培养：英语管培生通常从基层岗位开始，通过轮岗、导师指导等方式进行综合培养，储备干部方向发展；\r\n2、外贸业务流程：参与外贸业务流程，与国际客户进行有效沟通，维护并加强与客户的长期合作关系；\r\n3、对内对外沟通：负责型体研发工作，独立与客户进行对外沟通，负责对接客户，澄清需求和项目跟进；\r\n\r\n任职资格：\r\n1、本科及以上学历，英语或国贸类专业，英语听说读写能力良好，CET-4级或TEM-4级以上；\r\n2、英语熟练，能够进行中英文互译，具备良好的沟通、协调、理解能力，口语能力突出者尤佳；\r\n3、性格开朗、积极自信、学习能力强、抗压力强。', '', 5000, 8000, 5, '全职', NULL, 1, 494, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1435, '2025-04-08 15:22:36.971605', '2025-04-08 15:22:36.972737', NULL, '热管研发', '学习能力强，服从调配', '', 6000, 6500, 5, '全职', NULL, 1, 495, 6, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1436, '2025-04-08 15:22:37.633810', '2025-04-08 15:22:37.633810', NULL, '储备干部', '岗位职责：\r\n1、轮岗培养，与各业务部门以及职能模块定期轮岗，培养多维视角；\r\n2、管理岗位带教，开拓视野，快速历练成长。\r\n任职资格：\r\n1、全日制本科及以上学历；\r\n2、勇于进取、敏锐学习、非权利影响力、跨界思考能力、拥有同理心、立他心等；\r\n3、具有丰富的社团、学生会经历者优先，需要有驾照。', '', 6000, 6500, 3, '全职', NULL, 1, 496, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1437, '2025-04-08 15:22:38.423114', '2025-04-08 15:22:38.423114', NULL, '电机驱动应用工程师', '岗位职责：\r\n1. 电机驱动项目的软硬件开发；\r\n2. 电机驱动芯片的测试和验证；\r\n3. 电机驱动相关技术文档的编写；\r\n4. 客户应用方案的技术支持。\r\n\r\n任职要求：\r\n1. 自动化，电气，机电专业及相关专业。本科以上学历；\r\n2. 熟悉C语言编程，有一定的硬件基础；\r\n3. 掌握电机及其驱动原理，有过电机驱动开发经验者优先；\r\n4. 应届生，在校期间参加过电子竞技大赛和机器人大赛者优先。', '', 8000, 20000, 4, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1438, '2025-04-08 15:22:38.622802', '2025-04-08 15:22:38.622802', NULL, '销售工程师', '岗位职责：\r\n1.实施MCU产品的市场推广，执行公司区域发展规划；\r\n2.管理区域销售渠道和客户，协助销售渠道和客户及时处理各种问题；\r\n3.对重要行业做出客观的分析判断，制定区域运营策略；\r\n4.维护公司形象，执行公司策略，和渠道、客户保持良好的信息沟通。\r\n\r\n任职要求：\r\n1.电子相关专业本科以上学历，学生会成员优先； \r\n2.具备良好的问题分析解决能力和团队合作精神； \r\n3.具备良好的组织协调能力，积极主动，计划性强； \r\n4.具备良好的沟通能力，服务销售渠道和客户；\r\n5.服从公司根据工作需要跨区域的的工作安排。\r\n\r\n工作地点：可选杭州，佛山，合肥，深圳', '', 8000, 12000, 4, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '330100', '330000', '330106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1439, '2025-04-08 15:22:38.865132', '2025-04-08 15:22:38.865132', NULL, '系统应用工程师', '岗位职责：\r\n1.新产品规划及规格制定；\r\n2.新产品功能预研，针对技术点进行前期研究并提供方案支持；\r\n3.芯片验证，主要负责新产品验证测试方案的制定与执行；\r\n4.芯片出厂前批量测试、调校方案的制定及执行；\r\n5.产品推广阶段工具固件开发及日常量产固件维护等。\r\n\r\n任职要求：\r\n1.电子相关专业本科以上学历；\r\n2.具备扎实的软件、电子电路技术基础，逻辑思维清晰；\r\n3.具有单片机/嵌入式/电子类项目设计经验者优先；\r\n4.工作积极主动，良好的沟通协调能力，良好的团队合作精神。', '', 8000, 12000, 4, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1440, '2025-04-08 15:22:39.322908', '2025-04-08 15:22:39.322908', NULL, 'IC模拟电路设计工程师', '岗位职责：\r\n1. 协助并参与模拟/混合信号电路的指标确认以及系统仿真；\r\n2. 协助并参与项目中模拟/混合信号电路的设计，验证，测试，debug等工作；\r\n3. 积极发现设计、验证中的问题，并提出合理的解决方案。\r\n\r\n任职要求：\r\n1.微电子、电子、电气等相关专业本科及以上学历；\r\n2.有较强的数字、模拟基础知识，熟悉半导体工艺和IC开发流程者优先；\r\n3.有OPA、BGR、LDO、OSC、ADC/DAC、PLL等模块设计经验，有流片经验者优先。', '闵行区', 8000, 20000, 10, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '310100', '310000', '310112', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1441, '2025-04-08 15:22:39.623819', '2025-04-08 15:22:39.623819', NULL, 'IC数字电路设计工程师', '岗位职责：\r\n1. IC数字电路设计工作：RTL Coding、RTL 验证；\r\n2. IC数字电路验证工作：UVM 验证、FPGA 验证；\r\n3. IC 自动布局布线工作：时序收敛、面积优化。\r\n\r\n任职要求：\r\n1.电子、微电子相关专业本科以及以上学历；\r\n2.有较强的数字、模拟基础知识；\r\n3.有 verilog 、TCL 、汇编和 C 语言经验；\r\n4.有 示波器 、逻辑分析仪 等仪器使用经验；\r\n5.了解 BLDC 等无刷电机驱动芯片者优先；\r\n6.了解 ARM Cortex-M0/3/4 和 8051 MCU 者优先。', '闵行区', 8000, 20000, 10, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '310100', '310000', '310112', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1442, '2025-04-08 15:22:39.950305', '2025-04-08 15:22:39.950305', NULL, '技术支持工程师', '岗位职责：\r\n1.主导公司产品售前、售后的技术支持以及客诉主动跟踪解决；\r\n2.跟进客户端重点项目，保障客户项目顺利量产；\r\n3.参与市场调研以及产品推广；\r\n4.负责代理商以及客户工程师技术能力的培养；\r\n5.对典型案例进行总结整理并形成完整的指导文档。\r\n\r\n任职要求：\r\n1.电子相关专业本科以上学历；\r\n2.良好的沟通和逻辑分析能力，较强的事业心，责任心、服务意识以及团队协作精神；\r\n3.扎实的软硬件技术基础，熟悉C语言和单片机，能够运用绘图工具进行电路设计；\r\n4.大学期间有电子类项目设计经验者优先。\r\n\r\n工作地点：可选合肥或杭州', '', 8000, 12000, 4, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '340100', '340000', '340104', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1443, '2025-04-08 15:22:40.177332', '2025-04-08 15:22:40.177332', NULL, '工程应用工程师', '岗位职责：\r\n1.MCU各类特色应用（如大家电，IOT等）的软硬件开发及验证工作；\r\n2.MCU相关BSP包和底层应用驱动的开发及验证工作；\r\n3.触控相关底层算法及其延伸应用的开发及验证工作；\r\n4.MCU应用相关疑难问题的研究和解决。\r\n\r\n任职要求：\r\n1.电子相关专业本科以上学历；\r\n2.具备扎实的软件、电子电路技术基础，逻辑思维清晰；\r\n3.具有单片机/嵌入式/电子类项目设计经验者优先；\r\n4.工作积极主动，良好的沟通协调能力，良好的团队合作精神。', '', 8000, 12000, 4, '全职', NULL, 1, 497, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1444, '2025-04-08 15:22:40.807870', '2025-04-08 15:22:40.807870', NULL, '剪辑师', '岗位要求：\r\n1.熟练使用视频制作相关软件；\r\n2.具有良好的沟通能力和团队合作意识，较强的主动性和创造性，能吃苦耐劳，抗压性强；\r\n3.对镜头语言有独到的理解和认识，能够根据脚本独立剪辑画面并进行后期合成包装；\r\n4.拥有良好的美术功底，有独特的审美和乐感，会搜各种音效、素材、资源；\r\n5.具有后期剪辑包装经验， 熟练使用专业调色工具及特效制作优先考虑。', '', 4000, 6000, 3, '全职', NULL, 1, 498, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1445, '2025-04-08 15:22:41.052327', '2025-04-08 15:22:41.052327', NULL, '三维建模师', '1、有较好的美术功底、具备贴图手绘能力;\r\n2、熟练使用三维制作主流软件,能独立制作完成游戏场景的建模和贴图、并对游戏动画有一定的了解;\r\n3、有良好的自学能力和沟通能力，能与各环节完成交接工作；\r\n4、有良好的审美与构图能力，对场景的比例关系有清晰的认识，善于查找和使用各类素材资源以优化制作时间，善于场景拼装、排错以及渲染优化；能积极学习新技术。', '', 4000, 6000, 10, '全职', NULL, 1, 498, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1446, '2025-04-08 15:22:41.913780', '2025-04-08 15:22:41.913780', NULL, '技术助理', '岗位职责\r\n1、负责产品中心日常各类对外工作的对接、跟进、汇报、总结；\r\n2、负责产品订单的流转签发，按节点跟进、提醒订单执行，对实际执行情况进行汇报、总结；\r\n3、负责产品设计、工艺、生产文件的流转签发、存档；\r\n4、负责产品相关资料文档的编写、流转签发、存档；\r\n5、负责相关钉钉、微信群的管理，对各群工作进行提醒、跟进，对各群信息进行汇总、报告、存档；\r\n6、配合销售、技术、生产、售后、品质部做好产品相关工作的服务和问题处理；\r\n7、参与配合主管领导完成产品中心各项工作的组织、跟进、实施；\r\n8、完成领导临时交办的其他工作。\r\n\r\n招聘要求：\r\n1、具有较强的文字和语言表达能力。', '', 4500, 7000, 3, '全职', NULL, 1, 499, NULL, NULL, NULL, NULL, NULL, NULL, 0, '442000', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1447, '2025-04-08 15:22:42.464657', '2025-04-08 15:22:42.464657', NULL, '钣金结构工程师', '1．负责公司生产的各设备的钣金结构设计、板材及物料选型、加工生产过程跟进等；\r\n2．绘制详细的3D结构模型及2D零件图、部件图及展开、折弯、焊接、装配等加工制造图图纸，并提供材料清单；\r\n3．指导钣金加工人员、装配人员完成钣金件的加工、设备的装配；\r\n\r\n任职要求：\r\n1、熟练掌握机械原理，能胜任钣金结构非标设计及3D、2D图纸的绘制，熟悉钣金结构和机械传动；\r\n2、熟练运用Inventor及Auto CAD等制图软件；\r\n3、熟悉钣金加工工艺（切割、冲压、折弯）、焊接工艺、装配工艺，熟悉各类型板材特性及加工、焊接、装配要求，对所设计的产品的可加工性及成本有清晰的概念。', '', 4000, 6000, 5, '全职', NULL, 1, 499, NULL, NULL, NULL, NULL, NULL, NULL, 2, '442000', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1448, '2025-04-08 15:22:43.241290', '2025-04-08 15:22:43.241290', NULL, '物流文员', '1.处理物件的审单、上传单据图像等\r\n2.国际件的录单、物件核查及下单等\r\n3.协助外场检查货物尺寸大小、监督跟进每日货物数据等。\r\n4.有一定的英语基础水平，简单表格制作。', '', 4500, 6000, 6, '全职', NULL, 1, 500, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1449, '2025-04-08 15:22:43.832778', '2025-04-08 15:22:43.832778', NULL, '技术员或工程师', '产品生产/设备调试维护                 岗位要求： \r\n专业要求： 机械机电自动化相关专业\r\n工作内容：  1.Die Bond固晶设备的调试维护和操作\r\n2.主要维护芯片封装的ASM全自动点胶固晶机和桂林立德爱博共晶机；\r\n3.应届毕业生，公司可进行定向培养，完整的晋升体系。\r\n\r\n其    他： 1.具有良好的学习能力，沟通能力和团队精神；\r\n           2.做事踏实，抗压能力强；\r\n           3.机械机电自动化相关专业。', '', 6000, 8000, 4, '全职', NULL, 1, 501, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1450, '2025-04-08 15:22:44.530473', '2025-04-08 15:22:44.530473', NULL, '营业助理工程师', '1.协助营业主管制作成本分析；\r\n2.汇总项目成本情况，做出参考意见；\r\n3.部门日常管理报表和会议纪要输出；\r\n任职要求：\r\n1.24-30岁，大专以上学历，机械相关专业优先；\r\n2.会用3D或2D软件看图，分析加工工艺；\r\n3.有设计、工程文员工作经验优先。\r\n4.能熟练运用office办公软件，统计相关数据和做成本分析；', '', 7500, 8500, 2, '全职', NULL, 1, 502, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1451, '2025-04-08 15:22:44.665573', '2025-04-08 15:22:44.665573', NULL, '治具助理工程师', '1、大专毕业，会proe软件，年龄:18~30\r\n2、机械相关专业，如机电一体化和自动化相关专业毕业 应届毕业生也可；\r\n3 、良好的表达能力，良好的专业技能、团队沟通协调能力并有极强的执行力；\r\n4、在3C或者汽车行业实习过经验优先，如手机、手表、新能源汽车。', '', 5000, 8000, 5, '全职', NULL, 1, 502, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1452, '2025-04-08 15:22:45.374904', '2025-04-08 15:22:45.374904', NULL, '视频达人', '内容创作主脑：聚焦搞笑、生活记录、知识科普等擅长领域，独立完成从选题策划、脚本撰写到拍摄制作的全流程工作。确保视频内容新颖有趣、实用价值高，持续输出吸引粉丝的优质作品。\r\n \r\n粉丝运营担当：活跃于评论区、私信等互动场景，及时回复粉丝评论与私信，了解粉丝喜好与需求，策划并开展线上互动活动，增强粉丝粘性与活跃度，将粉丝转化为忠实拥趸。\r\n \r\n热点追踪先锋：时刻关注社会热点、网络流行趋势，快速捕捉适合融入视频的热点元素，巧妙结合自身风格进行创作，保证视频内容的时效性与话题性，提升账号曝光度。\r\n \r\n商业合作桥梁：与品牌方紧密沟通，深入理解品牌理念与产品特点，通过创意构思将品牌推广自然融入视频内容，实现内容与商业价值的双赢，在不影响粉丝观看体验的前提下，完成高效的品牌宣传。', '', 6000, 12000, 5, '全职', NULL, 1, 503, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1453, '2025-04-08 15:22:45.606739', '2025-04-08 15:22:45.606739', NULL, '摄影师', '创意拍摄先锋：根据不同项目需求，如时尚大片、商业广告、产品静物等，独立完成拍摄方案策划，从拍摄场景搭建、灯光布置到拍摄角度选取，都能融入独特创意，让每一张照片都独具魅力。\r\n \r\n后期修图大师：熟练运用Photoshop等后期软件，对拍摄素材进行精细修图，在保留照片真实质感的同时，提升画面美感，确保成品完美契合项目预期，无论是色彩调校还是细节优化，都能做到极致。\r\n \r\n设备管理行家：负责摄影设备的日常维护与管理，定期检查设备性能，及时发现并解决设备问题，确保拍摄工作顺利进行，保障每一次拍摄都能有最佳设备状态。\r\n \r\n团队协作能手：与创意团队、客户保持密切沟通，准确理解项目需求，提供专业摄影建议，协同完成拍摄任务，让拍摄过程高效流畅，产出优质作品。', '', 6000, 12000, 2, '全职', NULL, 1, 503, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1454, '2025-04-08 15:22:45.802671', '2025-04-08 15:22:45.802671', NULL, '小红书个人ip达人', '岗位职责\r\n \r\n内容创作担当：依据平台调性与粉丝喜好，策划并产出美妆、时尚、生活方式等垂直领域优质图文及视频内容，从选题构思到拍摄剪辑，全程把控，保证内容的趣味性、实用性与独特性，让粉丝秒变“自来水”。\r\n \r\n粉丝互动大师：活跃于评论区、私信等，与粉丝建立深厚情感连接，耐心解答疑问，认真倾听建议，举办线上互动活动，提升粉丝活跃度与忠诚度，让粉丝粘性直线上升。\r\n \r\n潮流追踪先锋：时刻紧盯行业动态、时尚潮流，迅速捕捉热门话题，融入内容创作，使账号始终走在时尚前沿，保持高曝光度与话题性。\r\n \r\n商务合作桥梁：与品牌方积极沟通，深度了解产品特点，巧妙将品牌推广融入优质内容，实现内容与商业的完美融合，在保证粉丝体验的同时，创造可观商业价值。', '', 6000, 12000, 5, '全职', NULL, 1, 503, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1455, '2025-04-08 15:22:46.305849', '2025-04-08 15:22:46.305849', NULL, '人事专员', '一、核心能力\r\n\r\n1. 组织协调：具备出色的组织协调能力，能妥善安排总经理的各项日程，合理协调公司内部各部门之间的工作关系，确保跨部门项目顺利推进。\r\n\r\n2. 沟通表达：拥有优秀的沟通表达能力，能与公司各级员工、外部合作伙伴、客户等进行有效沟通，准确传达信息，协调各方利益，解决矛盾冲突。\r\n\r\n3. 分析判断：具备敏锐的洞察力和较强的分析判断能力，能够快速理解复杂的业务问题，对市场动态、行业趋势进行准确分析，为总经理提供有价值的决策建议。\r\n\r\n4. 抗压应变：能在高强度、快节奏的工作环境中保持高效，应对突发情况和紧急任务时冷静沉着，迅速做出合理的应对措施。\r\n\r\n二、知识技能\r\n\r\n1. 办公软件：熟练掌握Office办公软件，如Word、Excel、PowerPoint等，能够运用这些工具进行文档处理、数据分析、演示文稿制作等工作。\r\n\r\n2. 行业知识：对所在行业的发展趋势、市场动态、竞争格局等有深入了解，熟悉公司业务领域的相关政策法规、技术发展等知识。\r\n\r\n3. 管理知识：掌握基本的管理学原理和方法，了解战略管理、人力资源管理、财务管理、市场营销等方面的知识，能够在实际工作中运用相关理论和方法辅助总经理进行管理决策。\r\n\r\n三、综合素质\r\n\r\n1. 责任心：具备高度的责任心和敬业精神，对工作认真负责，注重细节，积极主动承担工作任务，能够为公司的发展贡献自己的力量。\r\n\r\n2. 忠诚度：对公司忠诚，严守公司机密，维护公司利益，在工作中始终保持良好的职业道德和职业操守。\r\n\r\n3. 学习能力：具备较强的学习能力和自我提升意识，能够快速掌握新知识、新技能，不断适应公司发展和业务变化的需求。', '', 6000, 12000, 2, '全职', NULL, 1, 503, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1456, '2025-04-08 15:22:47.022233', '2025-04-08 15:22:47.022233', NULL, '技术培养岗（机械工程及设计，CNC工程师，模具设计）', '1、通用基本条件\r\n①全日制统招应届毕业学生，机械工程类及其相关专业；\r\n②与公司价值观相符：团结协作、精进创新、诚信务实、追求卓越。\r\n2、优先录用条件\r\n①学习成绩班级排名前20%；\r\n②参加国家级或省级重大校际大赛活动获奖、获得国家级、学校级奖学金。\r\n\r\n入职后可获得：\r\n1、师带徒教学，资深专业技术师傅以及人力培育机制为您的成长保驾护航。\r\n2、接触一批国内稀缺的进口机器，学习研发行业尖端产品，开拓前景无限的精密产品市场。', '', 5200, 7500, 10, '全职', NULL, 1, 504, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1457, '2025-04-08 15:22:47.598163', '2025-04-08 15:22:47.599170', NULL, '实习生', '实习生\r\n岗位职责：\r\n1、在项目经理的指导下完成部分简单科目底稿的编制，审计证\r\n据的搜集，审计资料的整理等；\r\n2、参加审计思维培训与审计项目的学习，协助审计团队完成专\r\n项审计等项目；\r\n3、在项目经理带领下，从事做账报税工作（包括装订凭证、学\r\n习代理记账，申报纳税等）；\r\n任职要求：\r\n1、会计相关专业，持有会计证，有志向从事会计工作，应届生\r\n亦可；\r\n2、熟练运用财务及 Office 办公软件，对金蝶、用友等财务系统\r\n熟练操作；\r\n3、接受能力强，有自我发展的主观愿望和学习能力，独立思考，\r\n善于总结工作经验；\r\n4、认真细致，爱岗敬业，吃苦耐劳，有良好的职业操守；\r\n5、要求性格稳重，勤恳，乐观积极，具有良好的沟通能力；\r\n6、实习期间表现优异，可在毕业后申请转为正式员工；\r\n7、工作地点蛤地地铁口，A5 级别办公环境，同事相处氛围和谐；\r\n8、实习补贴：2k；\r\n投递方式：（对事务所向往的你，快来投递哟~）\r\n应聘资料：简历+证书', '', 2000, 2500, 5, '全职', NULL, 1, 505, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1458, '2025-04-08 15:22:48.451408', '2025-04-08 15:22:48.451408', NULL, '运营实习生', '1、本科及以上学历，电子相关专业；\r\n2、良好的英语读写能力；\r\n3、能够熟练使用电脑、网络等办公设备。\r\n4、做事有条理、逻辑清晰；\r\n5、精通PS、会玩单反优先。', '', 5500, 6000, 5, '全职', NULL, 1, 507, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1459, '2025-04-08 15:22:48.697314', '2025-04-08 15:22:48.697314', NULL, '销售实习生', '1、本科及以上学历，市场营销、国际贸易等相关专业；\r\n2、普通话标准，口齿清楚，优秀的语言表达能力和沟通能力；\r\n3、能吃苦耐劳，工作认真仔细，有责任心，有高端客户服务经验者优先；\r\n4、熟练使用常用办公软件；\r\n5、良好的职业道德，高度的工作主动性和责任感；\r\n6、善于沟通，有良好的团队精神及强烈的销售创富欲望。', '', 5500, 6000, 5, '全职', NULL, 1, 507, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1460, '2025-04-08 15:22:48.939722', '2025-04-08 15:22:48.939722', NULL, '研发部实习生', '1、本科及以上学历，机械设计、模具设计等相关专业；\r\n2、会用CREO,SOLIDWORKS,CAD等3D/2D软件\r\n3、做事有条理、逻辑清晰', '', 5500, 6000, 15, '全职', NULL, 1, 507, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440306', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1461, '2025-04-08 15:22:49.434046', '2025-04-08 15:22:49.434046', NULL, '理财顾问', '职位描述：\r\n1.负责日常客户的维护、跟踪管理和新客户的开拓；\r\n2.利用公司提供的资源开发新的营销渠道进行新客户的拓展，以及金融产品的营销工作；\r\n3.利用公司良好的资源和平台为客户提供专业化的金融理财产品服务；\r\n4.为客户提供专业化的证券资讯服务、资产配置建议和投资理财规划等。\r\n\r\n任职要求：\r\n1.本科（含）以上学历，形象气质佳，谈吐得体大方；\r\n2. 应变和沟通能力强，团队协作意识强；\r\n3. 勤奋好学，有上进心，对在证券行业发展有强烈的兴趣和企图心；\r\n4.具备证券从业资格证，并有一定渠道和客户资源的应届毕业生优先录取', '', 4000, 10000, 3, '全职', NULL, 1, 508, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1462, '2025-04-08 15:22:50.211691', '2025-04-08 15:22:50.211691', NULL, '业务/市场/营销储干', '职责描述：\r\n1、协助客户经理，根据公司年度销售目标，完成客户销售、回款等商务事宜；\r\n2、负责老客户的维护及新客户的开发，建立和强化客户关系，定期或不定期拜访重大客户或项目业务开发；\r\n3、协助完成销售目标，维护企业形象；\r\n4、掌握市场动态，负责所辖市场信息收集及竞争对手的分析；\r\n5、维护客户关系以及客户间长期战略合作计划；\r\n6、配合客户前期项目开发需求提供良好的售前售后服务，协调公司资源，提高客户满意度；\r\n7、作为客户和公司的桥梁，及时传递客户需求信息，协调各部门满足客户要求；\r\n任职要求：\r\n1、本科及以上学历，英语六级，较强的口语及书面表达能力；\r\n2、有出色的的跨部门沟通、协作和推动能力；\r\n3、具有较强的责任心，工作细心、耐心，抗压能力强；\r\n4、思路清晰，对数字敏感，处理问题能力强；\r\n5、能接受出差', '', 6000, 7000, 2, '全职', NULL, 1, 509, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1463, '2025-04-08 15:22:50.676115', '2025-04-08 15:22:50.676115', NULL, '光学/光电专业储干', '任职资格：\r\n1、本科以上，光电类专业；\r\n2、熟练掌握基础光学设计、仿真软件，比如：Zemax/TFC等；\r\n3、具备英文文献的阅读与理解能力，口语能具备交流的能力；\r\n\r\n岗位要求：\r\n1、负责公司现有光学产品（镀膜AR/IR等）的设计工作；\r\n2、负责前沿新兴技术的学习及研究，为新产品、新项目中的光学技术提出可行性评估，提出新产品改进建议和新产品开发提议；\r\n3、协助工艺部门完成相应工作，并提供技术支持，使产品迅速导入量产或问题得以及时解决；\r\n4、为客户提供相应的技术支持与服务。\r\n6、具有较强的创造、专研能力、执行力；具有沉稳、细致的个性。', '', 6500, 8000, 5, '全职', NULL, 1, 509, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1464, '2025-04-08 15:22:51.225672', '2025-04-08 15:22:51.225672', NULL, '机械自动化专业储干', '岗位职责：\r\n1.制程良率改善；\r\n2.新产品制程评估；\r\n3.生产异常处理；\r\n4.生产作业员技能培训；\r\n\r\n任职资格：\r\n1、全日制本科以上学历；\r\n2、工艺制造、生产管理类专业；  \r\n3、实践、动手和接受能力强；数据和逻辑分析能力强；\r\n4、沟通表达口才好，可以独立做生产工艺及技能培训。', '', 6500, 8000, 5, '全职', NULL, 1, 509, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1465, '2025-04-08 15:22:51.523707', '2025-04-08 15:22:51.523707', NULL, '高分子材料储干', '岗位职责：\r\n1、会使用CAD绘图软件；\r\n2、进行技术文档的标准化检查、分发和回收；\r\n3、协助工程师实现部分工程图绘图；\r\n4、参与新产品或新项目设计研发过程中相关的文案类工作；\r\n5、完成部门分配的其他日常工作。\r\n\r\n任职资格：\r\n本科及以上学历；光电、工程、材料类相关专业，具有良好实验设计、归纳总结的实验能力，掌握行业内理论知识及行业发展最新动态', '', 6500, 8000, 5, '全职', NULL, 1, 509, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1466, '2025-04-08 15:22:52.102234', '2025-04-08 15:22:52.102234', NULL, '销售助理', '岗位职责:\r\n1、根据公司制定的全年及月度市场销售计划，在销售总监和销售副总监的指导下完成销售工作，包括销售合同签订、订单获取、下单、交货跟踪、开票及回款等销售工作；\r\n2、日常拜访及积极维护客户关系工作，保证与客户的正常沟通渠道的畅通，完善客户信息的日常收集工作并形成报告。\r\n岗位要求：\r\n1、本科以上学历，计算机通信、市场营销、外贸、经贸管理、外语等专业；\r\n2、具备较强的理解力和执行力，能自主处理工作上基本问题，具备良好的人际沟通协调能力和团队协作精神。', '', 6500, 9000, 1, '全职', NULL, 1, 510, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1467, '2025-04-08 15:22:52.327791', '2025-04-08 15:22:52.327791', NULL, '产测软件助理工程师', '岗位职责：\r\n1、使用BCB等可视化集成开发平台，C++语言开发生产线使用的多机测试软件/工具，满足试产和量产等上线生产需求，产品性能符合客户要求；\r\n2、协助工程师编写装备软件操作指导技术文档，产线相关问题支持等；\r\n3、配合业界新测试设备和新测试方案软件开发验证，提升生产测试效率。\r\n岗位要求：\r\n1、本科以上学历，计算机、通信等相关专业优先；\r\n2、擅长C++，C#等开发语言和环境，能够独立设计和开发软件模块；\r\n3、具备良好的沟通能力，有团队合作精神，较强的工作中自学习能力。', '', 6000, 10000, 1, '全职', NULL, 1, 510, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1468, '2025-04-08 15:22:52.570768', '2025-04-08 15:22:52.571793', NULL, '软件助理工程师', '岗位职责：\r\n1、负责嵌入式软件开发，主要在GPON/XGS-PON融合通信协议、路由器等网络设备上进行功能开发；\r\n2、负责产品需求分析，软件功能设计，软件编码，并进行综合测试、修改、代码走查工作；\r\n3、负责产品重要功能模块设计开发及维护；\r\n4、负责项目产品化过程中的对接开发和验证工作；\r\n5、使用BCB等可视化集成开发平台，C++语言开发生产线使用的多机测试软件工具，满足试产和量产等上线生产需求，产品性能符合客户要求；\r\n6、配合业界新测试设备和新测试方案软件开发验证，提升生产测试效率。\r\n岗位要求：\r\n1、计算机类、通信工程、软件工程、网络工程等相关专业，本科以上学历，熟悉C++、C#、C语言、Linux网络编程等开发语言和环境；\r\n2、工作态度要求认真、仔细，有高度责任心良好的沟通技巧和团队合作精神。', '', 6000, 10000, 2, '全职', NULL, 1, 510, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1469, '2025-04-08 15:22:52.788561', '2025-04-08 15:22:52.788561', NULL, '研发助理工程师', '岗位职责:\r\n1、负责公司各类产品（包括研发样品）性能测试，并编写测试报告；\r\n2、协助研发工程师开展研发打样；\r\n3、实验仪器保养与维护， 整理实验记录和数据，撰写和整理实验报告。\r\n岗位要求：\r\n1、本科以上学历，电子工程专业、通信、机械等相关专业；\r\n2、熟悉并了解相关实验仪器，有一定的分析能力，有专研精神，吃苦耐劳；\r\n3、培养发展方向：研发软件工程师，硬件工程师、结构工程师、BOM工程师、测试工程师、研发主管等发展。', '', 6000, 10000, 2, '全职', NULL, 1, 510, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1470, '2025-04-08 15:22:53.399560', '2025-04-08 15:22:53.399560', NULL, '项目助理工程师', '岗位要求：\r\n1、20-35岁，本科以上学历，机械、英语、外贸或相关专业，英语口语熟练更佳；\r\n2、有一定的机械技术基础，能识别机械图纸；\r\n3、有团队精神，沟通协调能力强。', '', 6000, 9000, 5, '全职', NULL, 1, 511, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1471, '2025-04-08 15:22:53.699240', '2025-04-08 15:22:53.699240', NULL, '技术储备干部', '职位要求：\r\n1、18-30岁，大专以上学历，数控、机械、机电、模具专业。\r\n2、头脑灵活，动手能力强，有责任心，数字灵敏。\r\n3、愿意往技术方向发展。', '', 6000, 9000, 50, '全职', NULL, 1, 511, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1472, '2025-04-08 15:22:54.224597', '2025-04-08 15:22:54.224597', NULL, '品质助理工程师', '任职要求：\r\n1、20-30岁，本科以上学历，机械工程/自动化/英语/国际贸易相关专业；\r\n2、应届毕业生，有英语基础。\r\n3、协助QE工程师处理客户问题；\r\n本岗位为人才梯队培养，晋升空间大。', '', 6000, 9000, 5, '全职', NULL, 1, 511, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1473, '2025-04-08 15:22:54.884782', '2025-04-08 15:22:54.884782', NULL, '外贸业务', '主要职责：\r\n-1、负责公司产品的出口业务，了解产品知识，与客户进行沟通，达成合作关系，完成销售任务。\r\n-2、负责收集客户信息，进行市场调研，了解客户需求，提供产品信息，以便更好地满足客户需求。\r\n3、负责公司产品出口合同的签约、履行及变更，协调公司内部资源，确保订单按时完成。\r\n4、负责公司产品出口报价及函电的草拟、发送，确保报价合理、准确，与客户沟通并及时答复。\r\n5、负责公司产品出口订单的跟踪、处理及结果反馈，与客户保持长期良好的合作关系。\r\n6、协助公司相关部门完成产品出口业务工作，完成销售目标。\r\n7、负责公司产品出口业务的拓展及维护，提高产品的市场占有率。\r\n8、学习和掌握公司产品知识，了解行业动态，为客户提供专业的产品建议。\r\n\r\n一、工作时间： \r\n7.5H/日，大小周工作制（小周周六6小时）。\r\n\r\n二、福利：\r\n购买五险，东莞提供免费宿舍（大学公寓式，有热水/空调/独立卫生间，深圳不提供），工作满一年享有年假，享有国家法定假，还有机会公费出国哟！\r\n诚聘岗位（深圳的工作地点在宝安新安，东莞的工作地点在大岭山镇）\r\n\r\n三、实习期4000-4500/月+提成，试用期5000-5500/月+提成，转正后5500-6000+提成，英语专四以上或口语精通（同时会日语且达到N1的额外+500岗补，并优先录取）。\r\n电话13414290512刘生（微信同号） 电子邮箱：ls@gaciron.com', '', 4000, 6000, 5, '全职', NULL, 1, 512, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1474, '2025-04-08 15:22:55.513840', '2025-04-08 15:22:55.513840', NULL, '不良资产管理员', '1、应届生，男女不限，有志从事金融行业者\r\n2、普通话标准，沟通表达良好，熟悉电脑操作\r\n3、具备抗压能力，团队协作精神', '', 5000, 12000, 30, '全职', NULL, 1, 513, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1475, '2025-04-08 15:22:56.324592', '2025-04-08 15:22:56.324592', NULL, '理财顾问', '一、职位描述： 1、利用公司渠道进行客户开发和维护； 2、通过与互联网、银行渠道合作，开拓市场； 3、及时了解金融市场的信息，并为客户提供合适的理财产品和基金等。\r\n\r\n二、职位要求： （1）本科及以上学历，具备证券从业资格； （2）热爱证券事业，具备基本的证券基础知识、客户服务和营销拓展技能； （3）具有良好沟通能力和团队协作精神，通过基金科目考试优先。（4）如若暂无通过证券从业资格考试，可先入职实习岗位，工作优秀者可提供相关考试资料协助通过证券从业资格考试，通过即可正式入职。\r\n\r\n三、岗位薪酬待遇: 1、薪酬结构:基本工资+绩效提成+社保+住房公积金等； 2、享受国家法定假期等各类休假(周末双休); 3、完善的培训体系和职业规划，有不断上升的发展空间。\r\n\r\n四、公平人才晋升模式： 理财顾问--区域总监--营销总监--总经理； 理财顾问--投资顾问--营运总监--总经理。', '', 5000, 8000, 50, '全职', NULL, 1, 514, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1476, '2025-04-08 15:22:57.218624', '2025-04-08 15:22:57.218624', NULL, '集控运行值班员', '岗位职责：\r\n（一）完成设备巡检、运行操作、安全管理、缺陷管理等各项任务，确保机组正常运行；\r\n（二）完成资料、交接班、工器具等管理；\r\n（三）完成领导交代的其他工作。\r\n岗位要求：\r\n（一）能源与动力工程、电气工程及其自动化、热能动力工程、火电厂集控运行等相关专业本科及以上学历应届毕业生；\r\n（二）对火电厂生产过程及电力生产基础理论知识有一定认识和了解；\r\n（三）专业基础扎实，好学上进，勤奋踏实，能吃苦耐劳；语言表达能力和沟通能力强；具有良好的写作能力及组织能力；\r\n（四）能接受倒班工作。', '', 8000, 10000, 10, '全职', NULL, 1, 515, 6, NULL, NULL, NULL, NULL, NULL, 1, '442000', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1477, '2025-04-08 15:22:57.722171', '2025-04-08 15:22:57.722171', NULL, '销售工程师（日语）', '岗位职责：\r\n1. 负责自有品牌SODICK沙迪克注塑机的销售；\r\n2. 负责客户开发与维护，分析、定位、创造并跟进客户需求；\r\n3. 与其他团队成员配合以满足客户需求和业务可持续发展;\r\n4.收集市场和行业信息，对产品、市场和业务发展提出建议。\r\n\r\n任职要求：\r\n1. 日语可工作交流，机械工程学院生优佳\r\n2. 注重自我形象，语言表达能力强\r\n3. 对销售工作感兴趣，乐观向上，抗压能力好\r\n\r\n其他：\r\n   公司提供技术和销售岗位培训 \r\n   设备销售工程师需要一定培养周期，应聘者对自己须有明确的职业规划，抱着试试看心态的建议不要尝试', '', 4500, 5500, 2, '全职', NULL, 1, 516, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1478, '2025-04-08 15:22:58.632097', '2025-04-08 15:22:58.632097', NULL, '品牌体验管培生', '一、岗位职责：\r\n1、参与迭代门店儿童友好体验，包括常规用餐体验、儿童生日会和披萨小学堂的活动体验；\r\n2、参与面向儿童家庭客群的品牌公关活动，以季度为单位策划话题性事件，维持品牌热度；\r\n3、与产品团队配合，落地并推广儿童偏好的新品和新场景，拉动品牌增长。\r\n\r\n二、核心能力要求：\r\n1、具有良好的审美能力；\r\n2、具有较强的项目管理能力和执行力；\r\n3、擅长洞察消费者需求；\r\n4、喜欢一切可爱有趣的事物。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1479, '2025-04-08 15:22:58.896150', '2025-04-08 15:22:58.896150', NULL, '整合营销管培生', '一、岗位职责：\r\n1、参与策划会员营销活动，包括会员日、积分体系、忠诚用户计划等；\r\n2、结合阶段性推广主题，策划用户喜闻乐见的社群传播方案，吸引复购；\r\n3、对企业微信进行数据追踪和分析，及时调整运营策略。\r\n\r\n二、核心能力要求\r\n1、有网感，擅长挖掘并应用热点；\r\n2、具备良好的文案功底，有一定的品牌感知；\r\n3、外向乐观，喜欢与消费者打交道。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1480, '2025-04-08 15:22:59.203733', '2025-04-08 15:22:59.203733', NULL, '财经管培生', '一、岗位职责：系统化参与公司财务体系和财经BP体系日常工作，目标培养懂经营、懂财务的高级管理者。\r\n\r\n二、核心能力要求\r\n1、强数学逻辑能力、问题分析能力、结构化思考和表达能力；\r\n2、强团队协作能力，具备感染力、能够带领和引导他人；\r\n3、强英语能力者优先。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1481, '2025-04-08 15:22:59.480748', '2025-04-08 15:22:59.480748', NULL, '开发与招商管培生', '一、岗位职责\r\n1、协助资产管理；\r\n2、协助新店前期调研信息收集；\r\n3、协助持牌人内外部对接。\r\n\r\n二、核心能力要求\r\n1、具有较强的逻辑思维能力和沟通能力；\r\n2、具有高强度抗压能力；\r\n3、最好有一定的法务意识。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1482, '2025-04-08 15:22:59.766815', '2025-04-08 15:22:59.766815', NULL, '培训管培生', '一、岗位职责\r\n1、HR体系培训模块各岗位轮岗培养机会，快速清晰职业发展方向；\r\n2、集团高管-导师带教，从深入了解门店业务到扎根培训模块参与落地人才培养项目，打破边界迅速成长。岗位包含两个阶段成长路径：\r\n一阶段见习经理期间：\r\n①扎根营运一线，为期六个月蓄能、完成岗位学习及晋升资深副理前的所有考核；\r\n②定期反馈，每月一次学习追踪和一对一学习跟进技能掌握情况。\r\n二阶段培训岗期间：\r\n①协助项目经理开展培养项目，负责项目运营落地，组织培训活动，监督培训过程，评估培训效果，组织培训考核等，确保项目顺利进行；\r\n②开发及讲授初级通用类课程，确保课程质量达到预计效果；\r\n③参与搭建案例体系，萃取组织经验输出案例故事；\r\n④负责维护培训物资及档案，确保各类培训资料、物品和档案完整准确；\r\n⑤协助公司司庆等文化活动落地。\r\n3、掌握课程开发与讲授、学习项目运营落地等培训专业知识和实操工具；\r\n4、了解连锁餐饮企业门店经营管理以及人才培养模式，对餐饮行业培训发展有更清晰的认知。\r\n\r\n二、核心能力要求\r\n1、具备优秀的沟通能力，爱分享、敢表达；具备一定的文字功底；\r\n2、具备团队合作能力，以及思考、分析、解决问题的能力；\r\n3、有志于长期在培训领域发展，抗压能力强，适应偶尔出差，有餐饮实习/兼职类经验优先。', '', 5500, 8500, 3, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1483, '2025-04-08 15:23:00.050800', '2025-04-08 15:23:00.050800', NULL, 'HR管培生', '一、岗位职责\r\n1、由招聘模块切入，拥有人力资源全模块培养轮岗机会，快速清晰职业发展方向；\r\n2、大厂背景团队负责人带教，参与人力资源项目打造，打破边界迅速成长；\r\n3、扎根各模块全链条工作细项，积累处理各种场景用工问题的实际经验；\r\n4、了解连锁经营行业用工模型及配套打法，对实体行业经营有更深入认知。\r\n\r\n二、核心能力要求\r\n1、清晰人力资源各模块内容，对数据有高度敏感性，熟悉常用办公软件。具备良好的沟通能力，以及思考、分析、解决问题的能力，有人力资源实习经验优先；\r\n2、有志于长期在人力资源领域发展，快速拓宽边界，抗压能力强。', '', 5500, 8500, 3, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1484, '2025-04-08 15:23:00.224177', '2025-04-08 15:23:00.224177', NULL, '寻源部管培生', '一、岗位职责\r\n1.针对自己负责的品类物料能够做好全面深入的理解和转化；\r\n2.对餐饮市场和相关物料市场进行深入调研和总结，有自己的看法；\r\n3.开拓并规划供应商资源，做好资源池储备及迭代；\r\n4.完全掌握采购管理流程并提出改进点；\r\n5.整理采购部全流程文件并归档。\r\n\r\n二、核心能力要求\r\n1、具有较强的逻辑思维能力和问题分析能力；\r\n2、对数据敏感、对ERP等软件及各Excel文档操作软件熟悉;\r\n3、对餐饮业怀有极大兴趣；\r\n4、市场敏感度强、外向且具有很好的沟通能力；\r\n5、总结汇报能力强；\r\n6、积极乐观，持续地自我驱动。', '', 5500, 8500, 1, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1485, '2025-04-08 15:23:00.504692', '2025-04-08 15:23:00.505198', NULL, '计划交付部管培生', '一、岗位职责\r\n1.制定并跟踪交付计划：负责制定交付计划，并确保计划的实施和更新，以协调内外部资源确保项目按时交付及质量符合要求；\r\n2.分析客户需求与解决问题：分析客户需求，解决客户问题，并提供解决方案，以优化内部流程的管理；\r\n3.协调资源与沟通协调：协调各种资源，负责材料选型，保障项目开发工作和开发进度，协调各供方、职能单位及门店的沟通；\r\n4.项目管理与文档整理：出入库台账建立，各sku品类及金额梳理及存档；\r\n5.客户交付管理。\r\n\r\n二、核心能力要求\r\n1、具有较强的逻辑思维能力和问题分析能力；\r\n2、对数据敏感、对ERP等软件及各Excel文档操作软件熟悉;\r\n3、具有良好的团队协作意识；\r\n4、踏实勤奋，具有良好的抗压能力；\r\n5、积极乐观，持续地自我驱动。', '', 5500, 8500, 1, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1486, '2025-04-08 15:23:00.765611', '2025-04-08 15:23:00.765611', NULL, '物流部管培生', '一、岗位职责\r\n1.处理各仓库运营异常问题；\r\n2.沟通各部门与门店，处理物料交付需求及异常问题；\r\n3.参与仓库每月盘点，核对库存差异；\r\n4.制作物流部相关报表，核对仓库费用。\r\n\r\n二、核心能力要求\r\n1、具有较强的逻辑思维能力和问题分析能力；\r\n2、对数据敏感、对ERP等软件及各Excel文档操作软件熟悉;\r\n3、具有良好的团队协作意识；\r\n4、踏实勤奋，具有良好的抗压能力；\r\n5、积极乐观，持续地自我驱动。', '', 5500, 8500, 1, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1487, '2025-04-08 15:23:01.027913', '2025-04-08 15:23:01.027913', NULL, '战略发展岗（海外业务）', '一、岗位职责\r\n1、市场调研：独立开展行业研究，收集并分析目标海外市场的行业趋势和相关信息数据、持续追踪竞品和行业前沿动态等；\r\n2、跟进公司规划进展：跟进业务线战略规划、年度经营计划及各阶段工作目标分解与执行进展，定期输出报告；                                                     \r\n3、战略VP指派的其它工作任务。\r\n\r\n二、核心能力要求\r\n1、工作自驱力强，细心靠谱对交付物有责任感，热爱生活；                                                                                            2、具备具备较强的学习能力、逻辑和表达沟通能力；\r\n3、英语听说读写熟练，写作能力佳，善用设计及AI工具，对数据敏感，有深度数据分析经验优先。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 2, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1488, '2025-04-08 15:23:01.222720', '2025-04-08 15:23:01.222720', NULL, '战略发展岗（特许业务）', '一、岗位职责\r\n1、根据公司特许业务的流程，以业务助理的角色协助跟进各模块工作的有序开展，包括重要会议的会务工作等；\r\n2、市场调研分析：监控管理和分析特许门店的经营情况，发现问题，总结优点，并促进优秀经验的分享，了解行业内特许相关业务的策略信息等；\r\n3、资料开发：协助梳理和开发面向特许经营业务的各类资料文档、宣传软文、营销视频、采访故事等；\r\n4、战略VP指派的其它工作任务。\r\n\r\n二、核心能力要求\r\n1、具备较强的学习能力和强烈的学习意愿；\r\n2、具备良好逻辑和表达沟通能力，较强的人际理解力；具备一定的投资经营知识背景或经验；\r\n3、曾累积市场营销类的实操经验、消费行业实操经验、活动策划/筹备/组织经验的优先考虑；\r\n4、性格开朗，能吃苦耐劳，成功导向，结果导向，热爱生活、对大消费行业有热情，善用设计及AI工具者为佳。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1489, '2025-04-08 15:23:01.615506', '2025-04-08 15:23:01.615506', NULL, '工程项目经理管培生', '一、岗位职责\r\n1、参与新店工程筹建（直营或加盟）：\r\n（1）参与新项目的前期准备工作，包括工程技术条件勘察、场地实际状况评估、项目投资预算提报，协助工程项目经理与业主/开发/加盟商沟通确认后整体汇报输出；\r\n（2）参与设计的对接及跟进：对接外部设计公司、跟进内部平面/效果图审核，跟进整套设计图纸完成节点及设计费用请款；\r\n（3）参与成本核算和控制，及时做好成本的预测和分析；\r\n（4）参与项目筹建期施工情况的跟进、调整、落实工作（包括设备功率核算、设备家私下单、施工工期节点管控、施工质量管控、把控整体设计落地效果、工程整体验收、维保等）；\r\n（5）参与项目管理施工过程中积极与外部及内部协调沟通，确保项目的正常推进，按期保质保量的完成交付；\r\n（6）参与项目移交及培训等项目管理工作；\r\n（7）参与项目施工过程中的问题记录及复盘总结汇报；\r\n（8）参与协助供应商办理相关政府部门证照，如消防申报，跟进政府部门审批工作。\r\n2、参与老店改造项目；\r\n3、参与区域门店的日常维修跟进工作工作，并配合工程项目/维修经理不定时巡店抽查验收；\r\n3、根据公司要求，参与对负责区域的供应商管理，定期反馈供应商的配合进度及完成结果；\r\n4、协助部门梳理优化营建标准、流程、体系，优化建店成本模型；\r\n5、协助部门做好文书工作；\r\n6、协助设计师完成项目落地。\r\n\r\n二、核心能力要求\r\n1、具备一定的工程管理相关专业知识；                                               \r\n 2、具备基本专业技能:能熟练掌握cad软件、office办公软件；\r\n3、具备一定的抗压能力，能够处理多线任务和时间管理；\r\n4、主动积极性强、 责任心强，有敬业精神；                                        \r\n5、性格外向并具备较强的沟通能力。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1490, '2025-04-08 15:23:01.858540', '2025-04-08 15:23:01.858540', NULL, '食品安全管培生', '一、岗位职责\r\n1、参与公司食品安全系统的维护和更新；                                  \r\n2、参与公司各分店QSC水平及食品安全的检查稽核；                        \r\n3、参与对食品安全风险供应商的管理；                                                \r\n4、参与政府食品安全相关政策的解读落地配合，并实时了解相关食品安全舆情提供公司管理参照；                                                    \r\n5、公司分店的食品安全培训及相关资料制作。\r\n\r\n二、核心能力要求\r\n1、具有较强的原则性和职业素养；\r\n2、具有良好的团队协作意识；\r\n3、踏实勤奋，具有良好的抗压能力；需要能接受长期出差；\r\n4、吃苦耐劳，需要先到门店做基础工作了解门店具体业务。', '', 5500, 8500, 2, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1491, '2025-04-08 15:23:02.195877', '2025-04-08 15:23:02.195877', NULL, '优才管培生', '【岗位职责】\r\n1、一线营运端轮岗学习，熟练操作各类营运岗位，为顾客提供良好的就餐体验；\r\n2、积极参与餐饮营运系统培训，掌握餐厅营运管理标准及流程目标，向优秀的营运管理者方向成长、用专业引领餐厅发展；\r\n3、协助餐厅经理落实值班管理等各项事务，为餐厅的持续高效营运保驾护航。\r\n\r\n【核心能力要求】\r\n1、良好的口头和书面沟通能力；\r\n2、具有快速学习新知识新技能的能力，愿意接受新的挑战并保持学习热情；\r\n3、具有较强的目标感和自驱力，有明晰的成长规划目标并努力实现；\r\n4、乐观开朗，抗压能力强，皮实，能够灵活应对工作中的各种挑战；\r\n5、认同乐凯撒文化，热爱美食、热爱服务业，愿意投身于连锁餐饮业的发展；\r\n6、有一定在校实践经历（如学生干部、校园活动比赛等），或社会实践经历（如实习）；\r\n7、有餐饮或服务业实习经历优先。', '', 5000, 9000, 100, '全职', NULL, 1, 517, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1492, '2025-04-08 15:23:02.847389', '2025-04-08 15:23:02.847389', NULL, '理财顾问', '岗位职责:\r\n 1.负责客户的开发工作；\r\n 2.以客户需求为导向，依托公司平台，整合资源开展客户服务工作；\r\n 3.负责与合作渠道建立紧密有效的合作关系，并组织各种营销活动；\r\n 4.掌握所在区域同业及竞争对手的动态；\r\n 5.完成上级领导安排的其他工作。', '', 6000, 12000, 5, '全职', NULL, 1, 518, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1493, '2025-04-08 15:23:03.545827', '2025-04-08 15:23:03.545827', NULL, '插画设计师', '1、有扎实的美术功底、良好的创意思维及理解能力，具备良好的审美意识，对图片渲染和视觉效果有较好的认识。\r\n2、熟练使用各种设计、制图软件，如photoshop、llustrat、CDR等;;\r\n3、工作细致耐心，有将强的沟通能力，执行能力，服从意识，抗压能力。\r\n4：对于IP衍生潮玩产品有经验者优先\r\n5：爱好熟悉王者荣耀游戏者优先\r\n6：可接受美术专业或视觉传达专业的优秀毕业生。', '', 4500, 5000, 3, '全职', NULL, 1, 519, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1494, '2025-04-08 15:23:03.764210', '2025-04-08 15:23:03.764210', NULL, '结构设计师', '1、大专及以上学历，产品设计相关专业。\r\n2、3年及以上潮玩产品或相关领域工作经验，有木质、纸质、亚克力、熟悉二次元、对IP、影游动漫或有相关行业运营经验的优先；\r\n3、优秀的应届毕业生，也可做人才储备，公司给与充分的成长空间。\r\n2、热爱潮玩设计，具备扎实的美术功底及较强的审美能力，能够准确把握需求相符的美术风格，对国内外设计风格有一定的了解和见解；\r\n3、具有丰富的艺术创意和设计表现能力，脑洞大、抗压、有网感，了解Z世代消费习惯，审美倾向及生活方式；有独立完成项目和较强的逻辑分析能力，参与创新产品品牌方向定位和探讨，打造有差异化和独特性的品牌符号；\r\n4. 善于沟通、规划工作，责任心强具备团队协作精神以及不断的创新与突破；\r\n5. 具备扎实美术功底，熟练操作熟练使用三维软件，至少会会一种，rhino、3Dmax、Blender、C4D、solidworks 均可，须会至少一款渲染出图软件,如keyshot等。平面软件ps、ai、cdr 等。\r\n6：熟悉王者荣耀游戏者可以优先考虑', '', 4500, 5000, 3, '全职', NULL, 1, 519, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1495, '2025-04-08 15:23:03.992010', '2025-04-08 15:23:03.992010', NULL, '视觉设计师', '1.可接受美术专业或视觉传达专业的优秀毕业生。\r\n2.有潮玩、快消品、文创等行业工作经验者优先;\r\n3.熟练Photoshop等软件，富有创新性思维，设计内容不局限于以往的工作经验；\r\n4.执行能力强，对色彩流行趋势有清晰的认知；\r\n5.有一定的图片处理能力，会产品精修经验优先；', '', 4500, 5000, 3, '全职', NULL, 1, 519, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1496, '2025-04-08 15:23:04.496308', '2025-04-08 15:23:04.496308', NULL, '销售助理', '岗位职责：\r\n1、跟单；\r\n2、销售事务协助；\r\n3、客户资源管理和关系维护等。\r\n\r\n任职要求：\r\n1、开朗外向；沟通、应变能力强；\r\n2、应知：组织架构和经营目标，销售相关制度和要求，上下游窗口和对接方式（岗前训）；\r\n3、应会：办公设备、电脑和移动终端办公App的操作、数据分析能力强、EXCEL函数熟练使用、PPT报告能力、商务礼仪等。', '', 6000, 8000, 1, '全职', NULL, 1, 520, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1497, '2025-04-08 15:23:04.646373', '2025-04-08 15:23:04.646373', NULL, '经营规划与分析专员', '岗位职责：\r\n1、经营数据监控与分析；\r\n2、现场问题的改善推进落地闭环。\r\n\r\n任职要求：\r\n1、财务分析或工业工程相关专业本科以上学历。', '', 5000, 7000, 1, '全职', NULL, 1, 520, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1498, '2025-04-08 15:23:04.859194', '2025-04-08 15:23:04.859194', NULL, '黄光助理工程师', '岗位职责：\r\n1、黄光/湿法刻蚀工艺及机台操作；\r\n2、按照工艺文件对制程进行工艺控制，跟踪执行改善问题的措施；\r\n3、负责产线产品品质保障，低良率产品处理及原因排查分析并改善；\r\n4、新产品的开发及工艺导入，Recipe编写及工艺参数标准化以利工序稳定；\r\n\r\n任职要求：\r\n1、本科及以上学历，材料、物理、化学、微电子、光电等相关专业应届生；\r\n2、良好的逻辑思维和沟通协调能力，并具备一定的管理能力；\r\n3、思维缜密，做事严谨、踏实、敬业、责任心强，服从领导安排；\r\n4、吃苦耐劳，能适应加班或倒班工作模式；', '', 6000, 8000, 3, '全职', NULL, 1, 520, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1499, '2025-04-08 15:23:05.071744', '2025-04-08 15:23:05.072863', NULL, '体系工程师', '岗位职责：\r\n1、协助上级建立健全体系文件建设；\r\n2、协协助上级开展内部审核工作；\r\n3、协协助上级对内、外部审核缺失进行改善追踪；\r\n4、协助上级开展二方和三方审核的工作；\r\n5、协助上级开展公司管理稽核工作；\r\n6、协助上级开展公司质量活动工作；\r\n7、负责上级安排的其他业务。\r\n\r\n任职要求：\r\n1、熟练使用办公软件，具备基本的网络知识；\r\n2、具有良好的职业道德，踏实稳重，工作细心，责任心强，有较强的沟通、协调能力，有团队协作精神；\r\n3、有0-1年工作经验，可接受23年度、24年度应届生。', '', 5000, 6000, 2, '全职', NULL, 1, 520, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1500, '2025-04-08 15:23:05.298052', '2025-04-08 15:23:05.298052', NULL, '设备采购工程师', '岗位职责：\r\n1、文案工作（合同拟定，会议纪要，部门文件整理归档）；\r\n2、会议待办事项跟进 及 协助领导跟踪整体项目进度；\r\n3、部门之间行政事宜对接，部门团队建设活动组织安排。\r\n\r\n任职要求：\r\n1、具备一定文案撰写编辑能力；\r\n2、具备EXCEL 、PPT办公软件 较为熟练使用；\r\n3、具备较强的学习能力、较强自我提升意愿，积极主动，工作态度严谨，细心。', '', 6000, 8000, 1, '全职', NULL, 1, 520, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1501, '2025-04-08 15:23:06.208441', '2025-04-08 15:23:06.208441', NULL, '理财顾问', '（1）本科以上学历，具备证券从业资格；\r\n（2）性格外向，积极主动，执行力强；\r\n（3）维护销售渠道，维护老客户，为客户提供理财咨询等服务；\r\n（4）热爱证券行业，具有良好的沟通能力，组织协调能力和团队协助精神；', '', 4000, 10000, 10, '全职', NULL, 1, 521, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1502, '2025-04-08 15:23:07.319662', '2025-04-08 15:23:07.319662', NULL, '采购助理专员', '岗位职责：\r\n1、负责根据部门的年度工作计划编制本部门的阶段工作计划，上报部门负责人审批；\r\n2、负责建立及完善采购工作手册，建立完善的采购资料库；\r\n3、负责组织采购市场调研工作，对相关采购价格、供应商资质、货物来源等数据进行分析，为制订采购计划提供帮助；\r\n4、负责参与采购物资的比价、议价及采购谈判，协议的洽谈与签订；\r\n5、负责对采购合同的执行情况进行严格管理，对物料供应进度进行有效控制；\r\n6、负责对采购订单制定及处理进行全程跟踪，确保订单处理周期符合采购要求；\r\n7、负责组织跟踪和控制供应物资质量、进度及交付情况，保证项目物资采购的进度符合。', '', 5000, 8000, 2, '全职', NULL, 1, 523, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1503, '2025-04-08 15:23:07.604104', '2025-04-08 15:23:07.604104', NULL, '质量助工', '1. 制定和执行产品设计和开发阶段的质量计划和策略。\r\n2.参与产品设计评审，识别和评估产品设计过程中的潜在风险，并提供相应的解决方案和改进措施。\r\n3.了解和熟悉适用的质量标准和规范，确保产品设计符合相关要求。', '', 5000, 8000, 4, '全职', NULL, 1, 523, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1504, '2025-04-08 15:23:07.839197', '2025-04-08 15:23:07.839197', NULL, '计划交付助理专员', '岗位职责：\r\n1、 负责生产计划的制定；\r\n2、 负责按生产计划分解物料，做出物料需求计划；\r\n3、 根据物料需求和物料的库存状况，制定物料申购计划；\r\n4、 跟催材料到货进度，确保物料准时到货，异常情况及时调整进度计划；\r\n5、 跟进不合格物料的退货与补货；\r\n6、 原材料控制与分析；\r\n7、 库存呆料统计分析与上报，并提出处理建议；', '', 5000, 8000, 2, '全职', NULL, 1, 523, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1505, '2025-04-08 15:23:08.120503', '2025-04-08 15:23:08.120503', NULL, 'PE助工', '1.新项目试产跟进\r\n2.SOP及相关工艺参数表的制定发行\r\n3.标准工时制定\r\n4.现场异常处理及良率提升\r\n5.人机比降低及成型周期缩减', '', 5000, 8000, 5, '全职', NULL, 1, 523, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1506, '2025-04-08 15:23:08.720995', '2025-04-08 15:23:08.720995', NULL, '行政助理', '一、岗位要求：\r\n1、大专及以上学历；\r\n2、熟练掌握Office办公软件；\r\n3、有较好的主动性、亲和力和抗压能力，服务意识强；\r\n4、服从公司安排，认可公司管理制度；\r\n5、责任心强，喜欢孩子，性格活泼开朗，有意愿进入教育行业。\r\n\r\n二、岗位职责：\r\n1、负责校区环境、卫生、物品、物业等日常管理，保障校区日常运营事宜顺畅进行；\r\n2、负责校区班务数据信息的统计、汇报、归档、上传，确保校区管理数据的准确性与及时性；\r\n3、担当学校与客户的沟通桥梁，与家长保持良好沟通，建立家校之间的情感交流，为家长传递正确的教育理念，促进家校的配合；\r\n4、配合并支持校区校长的团队管理工作，协同老师完成日常教学服务工作，做好管理的承接。\r\n\r\n三、职业发展空间：\r\n1、行政助理—校区行政主管—校区管理核心；\r\n2、学校实行独立校区管理制，有机会成为分校管理人才，企业核心成员；\r\n3、企业提供公平公正的成长平台，给员工清晰的职业规划和发展方向。\r\n\r\n四、薪资福利\r\n1. 贴心保障：社保缴纳、带薪年假；\r\n2. 温馨福利：节日礼品、旅游奖励、出游补助、团建聚会；\r\n3. 培训晋升：提供新员工培训、系统的专业培训，良好的学习成长氛围；\r\n4. 文化氛围：团队朝气蓬勃，和谐融洽，公平公正；\r\n5. 劳逸结合：不定期组织公司活动、部门团建。', '', 4000, 6000, 5, '全职', NULL, 1, 524, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1507, '2025-04-08 15:23:08.922896', '2025-04-08 15:23:08.922896', NULL, '营销客服', '一、岗位要求\r\n1、具备优秀的沟通技巧和表达能力；\r\n2、具有良好的主动服务意识和敬业精神；\r\n3、富有开拓精神和良好的团队合作意识，有较强的学习能力；\r\n4、热爱工作，乐观积极，不怕困难，适应高强度工作；\r\n5、五官端正，身体健康，形象气质佳。\r\n\r\n二、岗位职责：\r\n1、负责与在校生家长做电话服务沟通以及面对面沟通，为家长传递正确的教育观念，解答家长对教育、教学的疑问，协助老师做好班级课前、课中、课后服务，保障学员学习秩序与效果，提升教学口碑；\r\n2、负责开拓市场，完成团队及个人每月招生目标；\r\n3、参与企业各项产品的推广与服务；\r\n4、负责大行政系统其他工作配合与协助。\r\n\r\n三、职业发展空间：\r\n1、营销客服专员—分校营销客服负责人—分校营销客服主管；\r\n2、企业实行分公司管理制，与分校校长、副校长共同经营一家学校，服务于一家分校的运营管理；\r\n3、根据营销服务效益的创造，入选企业合伙人。\r\n\r\n四、薪资福利：\r\n1. 贴心保障：社保缴纳、带薪年假；\r\n2. 温馨福利：节假日礼品、旅游奖励、出游补助、交通补助、团建聚会；\r\n3. 培训晋升：提供新员工培训、系统的专业培训，良好的学习成长氛围；\r\n4. 文化氛围：团队朝气蓬勃，和谐融洽，公平公正；\r\n5. 劳逸结合：不定期组织公司活动、部门团建。', '', 5000, 8000, 8, '全职', NULL, 1, 524, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1508, '2025-04-08 15:23:10.022458', '2025-04-08 15:23:10.022458', NULL, '仓储运营方向（物流管培生）', '岗位描述：\r\n1-从基层一线起步，从基层的打包、拣货、理货、盘点开始，逐步深入参与或负责物流业务模块的具体项目工作，通过实际项目管理和推动来锻炼、提升专业能力和个人经验，从而持续推动业务改善提升；\r\n2-深入参与地区运营质量管理，推广营运新业务和运作模式，持续优化创新物流相关业务流程，促进质量目标达成；\r\n3-以提升物流供应链体验、降低成本、提高效率为目标，持续创新优化物流相关业务流程。\r\n\r\n岗位要求：\r\n1-热爱物流行业并愿意长期深耕物流行业；认同京东的企业文化及发展方向，愿意深入一线从基层开始有志成为京东该行业领域领军人才；\r\n2-具有良好的逻辑思维和沟通能力，良好的担当和团队协作意识及团队管理能力；\r\n3-具备持续学习的热情，能够积极主动的思考解决问题；善于总结学习所得，不断优化流程。\r\n转正福利：\r\n1、入职购买五险一金，包住公寓式宿舍，空调、洗衣机、热水器齐全。有餐补360元/月，有饭堂。\r\n2、有全勤奖、各类补贴，绩效奖金等，法定节假日加班3倍工资，员工下午茶活动，生日宴，福利体检等等。', '', 4000, 6000, 50, '全职', NULL, 1, 525, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1509, '2025-04-08 15:23:11.386895', '2025-04-08 15:23:11.386895', NULL, '技术管培生', '1、本科学历，机械、自动化等相关专业；\r\n2、可以看懂机械或电路图纸；\r\n3、具有良好的分析能力、沟通能力，具备团队合作精神。\r\n岗位职责：\r\n1、根据机械图纸对激光设备进行安装组装；\r\n2、根据电气图纸对激光设备的线路进行排线布线调试；\r\n3、激光设备的光路调试，通过调试设备器件调试最佳出厂状态；\r\n4、激光设备的出厂检测、到厂安装等。', '', 7500, 9000, 5, '全职', NULL, 1, 526, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1510, '2025-04-08 15:23:11.719625', '2025-04-08 15:23:11.719625', NULL, '机械工程师助理', '岗位职责：\r\n1、根据项目要求进行方案预研，确定机械设计指标，进行机械设计；\r\n2、对设计的结构进行相关的热效应、应力有限元分析和稳定性分析，根据结果优化结构设计；\r\n3、设计测试方案，对产品样机进行相关测试，结果优化结构设计；\r\n4、产品生产、装配、调试、工艺等相关问题的解决；\r\n5、机械图纸出图，BOM制定以及相关分析、设计文档的撰写；\r\n6、总结产品研发经验，持续产品的改进，并根据客户或公司有关部门的合理要求进行设计修改和设计改进，完成产品定型工作。\r\n任职要求:\r\n1、本科及以上学历，机械设计、机电一体化、自动化相关专业本科及以上学历，熟练使用SolidWorks、AutoCAD、Office办公软件。对关键结构及传动结构能够进行相应力学分析和热效应分析；\r\n2、熟悉工程材料的机械性能，了解机加、钣金、装配、热处理等制造工艺；\r\n3、对产品研发充满热情，富有创新意识、肯于钻研工作思路清晰，具有良好的团队精神和沟通能力。', '', 8000, 9000, 2, '全职', NULL, 1, 526, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1511, '2025-04-08 15:23:12.063274', '2025-04-08 15:23:12.063608', NULL, '电气工程师', '1、负责产品电气设计：包括电气图纸绘制、电气部件选型、独立进行plc编程等；\r\n2、负责电气部分评估，包括外来技术的引进和转化；\r\n3、优化产品性能，包括解决产品技术问题并估算成本和时间，提高工作效益效利；\r\n4、参与公司产品的组装或指导生产，参与现场试验并处理电气故障，提出产品改进措施，参与电气零件的选型与电气线路的设计；\r\n5、确定最终产品或系统的运作，并准备生产设备所使用的电气文件、使用手册等相关文件资料。\r\n任职要求：\r\n1.自动化、电子、无线电、电器类、机电一体化等相关专业，本科以上学历；\r\n2.熟悉相应的电路图软件，对市场上常用的OMRON、松下PLC软件至少会一种以上运用熟练熟悉；\r\n3.学习与创新能力强，具有良好的沟通、组织管理能力，工作严谨细致富有责任心；\r\n4.动手能力强，吃苦耐劳；能适应出差优先。', '', 8000, 9000, 3, '全职', NULL, 1, 526, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1512, '2025-04-08 15:23:12.306310', '2025-04-08 15:23:12.306310', NULL, '激光应用工程师', '岗位职责：\r\n1、负责激光打标和精密切割新材料及新工艺的开发；\r\n2、负责公司新的核心光学器件的测试与导入评估、资料整理推广及培训；\r\n3、负责重难点工艺样品制作及出具报告；\r\n4、负责对接重点客户售前技术支持；\r\n5、参与制定项目开发方案和设计,与机械、电气、软件工程师进行设备的研发。\r\n任职要求：\r\n1、统招本科及以上学历,光学、激光物理、材料学等专业优先考虑；\r\n2、熟悉工业激光加工原理,理解激光材料相互作用过程；\r\n3、熟悉激光器及激光设备的使用,掌握相关光学元器件造型、测试以及光路调试；\r\n4、熟练掌握材料的激光打标或精密切割工艺；\r\n5、熟练掌握CAD、CorelDraw、PS等绘图软件。', '', 8000, 9000, 5, '全职', NULL, 1, 526, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1513, '2025-04-08 15:23:12.922919', '2025-04-08 15:23:12.922919', NULL, '大树新秀', '全职人员，能接受公司的培训安排，与现有团队一起发展，有一定抗压能力。\r\n1、培训体系：一个月的专业保险理财需求分折和保险理财规划师培训；\r\n2、营销模式：以客户需求为导向的专业的第三方保险理财顾问模式；\r\n3、管理模式：实行扁平化矩阵式管理，提供“一对一”的教练式辅导；\r\n4、培训津贴+佣金+绩效+奖金**完善的支持专业360私人保险康健方案与保险财富规划师需求分析；为客户提供; 向专业保险财富管理，配置，等高端医疗资源服务。\r\n5、发展方向：专业培养保险财富规划师，MDRT，团队总监等事业发展平台。为高净值人群提供全方位保险健康方案和保险理财方案管理与服务', '', 5000, 30000, 3, '全职', NULL, 1, 527, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1514, '2025-04-08 15:23:13.725355', '2025-04-08 15:23:13.725355', NULL, '外贸助理', '1、大专及以上学历，国际贸易、商务英语类相关专业;\r\n2、英语4级或以上，能看懂和客户日常用线上沟通的英语对话或邮件\r\n3、具熟练运用各种办公软件\r\n4、具备较好的沟通、协调及执行能力，工作踏实认真、应对快捷敏锐，责任心强\r\n5、了解进出口业务流程，熟悉外贸进出口业务环节                                                                                                        6、 有独立思考的能力，能在工作中发现问题或提出自已的建议\r\n\r\n\r\n地址：南城第一国际商务大厦F座1812室', '', 4500, 5000, 1, '全职', NULL, 1, 528, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1515, '2025-04-08 15:23:13.942030', '2025-04-08 15:23:13.942030', NULL, '采购跟单助理', '1、本科及以上学历，专业不限\r\n2、具有较强的责任心，工作细心，能熟练使用相关办公软件(Offce)。\r\n3、具有较强的学习能力及沟通表达能力，独立处理业务及供应商的对接;\r\n\r\n\r\n地址：南城第一国际商务大厦F座1812室', '', 4500, 5000, 1, '全职', NULL, 1, 528, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1516, '2025-04-08 15:23:14.658849', '2025-04-08 15:23:14.658849', NULL, '外贸业务员', '要求:\r\n1、大专及以上学历，良好的英语听读写能力善于业务沟通表达!\r\n2、能通过google推广，Facebook、Linked inIns、Twitter、tiktok社媒等渠道开发客户;\r\n3、促成公司阿里巴巴国际站的询盘回复，客户沟通，促成订单，跟进及客户维护。\r\n4、月工资6000-50000，上不封顶（目前外贸月薪平均3万+）\r\n任职资格:\r\n1、热爱生活，正能量，对生活充满。\r\n2、1年以上外贸运营经验，英语四级以上，能及时到岗。\r\n3、对电子商务，跨境电子商务有极大的兴趣及热忱。\r\n4、做事果断，有事业心，有大数据分析能力', '', 6000, 50000, 2, '全职', NULL, 1, 529, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1517, '2025-04-08 15:23:14.803299', '2025-04-08 15:23:14.803299', NULL, '业务员', '工作方式：线下面对面陌拜式销售\r\n工作区域：可以根据公司发展需求作出调整，一般在分配市场后会固定区域销售（学习阶段会有变动），现阶段以东莞为主；\r\n关键要求：对数控刀具行业发展前景有较好的期待，对销售有浓厚的兴趣 (不限定技术型销售或人际型销售）；\r\n基本要求：\r\n1. 期望通过销售改变自己，为家人带来较好的生活条件或实现个人的人生抱负；\r\n2. 语言理解和表达能力好：能快速理解对方的表达重点和痛点，可以快速组织语言作出应对；\r\n3. 学习能力强：认真听取师傅的指导和建议，并能举一反三；\r\n4. 品行端正，时刻遵守和维护公司积极、正面的精神面貌；\r\n5. 性格稳重：业务是长期累计的事业,并非一朝一夕可以成功的，要做好2-3年的成长沉淀；\r\n6. 抗压能力强：面对客户的拒绝和另眼相待能自我调节，长期不开单依然可以作认真的总结与改善计划；\r\n7. 责任心强：对客户、对公司、对个人的目标、承诺能坚定的付诸行动并努力达成。\r\n工作内容：\r\n1. 根据公司需求学习相应的产品专业知识、销售技巧、活动方案；\r\n2. 积极参加公司组织的各项市场推广活动（如新客以旧换新、以多赠少优惠活动）；\r\n3. 每天开发新客户、回访老客户、跟进客户试用情况、了解客户使用问题、收集客户技术痛点反馈公司、协助客户解决技术难题(可以向公司优秀技术高手请教）；\r\n4. 每月积极参加公司总结分享会，学习和分享市场成功和失败的案例，让自己快速成长。\r\n薪酬福利：\r\n1. 基本工资6000元/月，根据销售额的成长采用阶梯型的提成方案，如销售额达在4万~6万时，另计2%*实际销售额的提成；达到，在6万~10万区间时另计5%*实际销售额的提成；超过10万销售额时，基本工资调整为6500元/月；\r\n2. 包吃包住（若因为区域人员数量问题无法提供时吃住时，根据当地市场生活条件作相应的补贴）\r\n3. 有电话费、车油费补贴、业务费用补贴；\r\n4. 公司专人理论、实操培训和带谈，只要有信心，总有实现梦想的一天；\r\n5. 公司现有70多家分店，全国连锁，10年内计划增开至300家门店，需要很多优秀的门店、区域管理人员，只要大家能坚定的跟着公司的步伐，公司的晋升平台非常广阔。店长月薪2万以上、区域经理3万以上，当能力和资金充足时，可自己独立开门店创业（5-8年时间）。', '', 6000, 15000, 10, '全职', NULL, 1, 529, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1518, '2025-04-08 15:23:15.882204', '2025-04-08 15:23:15.882204', NULL, '外贸业务员（英语&小语种精英）', '职位要求：\r\n语言能力：\r\n  - 英语流利，具备商务沟通能力。\r\n  - 掌握以下小语种之一者优先：日语、韩语、葡萄牙语、西班牙语、法语、俄语等。\r\n专业背景：国际贸易、商务英语、外语类等相关专业优先。\r\n其他要求：如良好的沟通能力、团队合作精神、抗压能力等。\r\n\r\n岗位职责\r\n  - 开发海外客户，维护客户关系。\r\n  - 处理外贸订单，跟进合同执行。\r\n  - 参与国际展会，拓展市场。\r\n  - 协助处理外贸单据及物流事宜。\r\n\r\n 福利待遇\r\n- 薪资：具有竞争力的底薪+销售额提成（1-3个点）\r\n- 福利：双休、五险一金、带薪年假、节日福利、培训机会、晋升空间', '', 6000, 15000, 10, '全职', NULL, 1, 530, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1519, '2025-04-08 15:23:16.801477', '2025-04-08 15:23:16.801477', NULL, '技术储干', '1.男女不限，本科及以上学历，理工科专业，如电子信息、自动化、机械工程等相关专业\r\n2.会Windows操作\r\n3.具备良好的学习能力和团队合作精神', '', 5000, 6000, 20, '全职', NULL, 1, 531, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1520, '2025-04-08 15:23:17.332299', '2025-04-08 15:23:17.332299', NULL, '律师助理', '北京德恒（东莞）律师事务所 证券与资本市场法律专业委员会 招收律师助理2名\r\n\r\n工作内容:全流程协助并购重组、IPO、股权投融资、私募基金、股权架构设计、股权激励、公司治理、常年法律顾问等非诉项目；兼顾处理民商事诉讼案件。客户包括但不限于大型国有企业、 上市公司、金融机构等。\r\n \r\n招收要求: \r\n(1)法律功底扎实，通过法律职业资格考试或有证券实习经历者优先； \r\n(2)长期热爱资本市场法律专业，善于学习、思考； \r\n(3)工作内容涉及较多材料分析及文字处理，需要细心、耐心，有较好的文字功底； \r\n(4)吃苦耐劳，适应到企业驻场及出差工作(项目地多在东莞)； \r\n(5)工作表现优异有提成与晋升机会。', '', 4500, 5000, 1, '全职', NULL, 1, 532, 6, NULL, NULL, NULL, NULL, NULL, 3, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1521, '2025-04-08 15:23:18.080150', '2025-04-08 15:23:18.080150', NULL, '行政文员', '1、应届生或有经验皆可；\r\n2、Word、Excel、PowerPoint等最基本的办公软件；\r\n3、良好的文字功底和表达能力，熟悉日常办公文体的写作和应用。\r\n4、积极进取；\r\n5、细心负责，善于和别人沟通；\r\n6、做事要有耐心；\r\n7、具有团队精神。', '', 4500, 5000, 1, '全职', NULL, 1, 533, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1522, '2025-04-08 15:23:18.355267', '2025-04-08 15:23:18.355267', NULL, '会计助理', '1、大专及以上学历，会计类专业。\r\n2、熟悉财务软件的使用基本技能。\r\n3、熟悉电脑操作、办公软件使用、会计核算流程；\r\n4、熟悉国家财经法律法规、会计法规及会计业务处理方法；\r\n5、熟悉公司与银行业务的流程；\r\n7、持有会计初级资格证及相关证件（会计证或助理会计师）优先。', '', 4500, 5000, 2, '全职', NULL, 1, 533, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1523, '2025-04-08 15:23:18.879591', '2025-04-08 15:23:18.879591', NULL, '资料员', '一、 收集整理齐全工程前期的各种资料。\r\n\r\n二、 按照文明工地的要求、及时整理齐全文明工地资料。\r\n\r\n三、 做好本工程的工程资料并与工程进度同步。\r\n\r\n四、 工程资料应认真填写，字绩工整，装订整齐。\r\n\r\n五、 填写施工现场天气晴雨、温度表。\r\n\r\n六、 登记保管好项目部的各种书籍、资料表格。\r\n\r\n七、 收集保存好公司及相关部门的会议文件。\r\n\r\n八、 及时做好资料的审查备案工作。', '', 4500, 5000, 4, '全职', NULL, 1, 533, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1524, '2025-04-08 15:23:19.090130', '2025-04-08 15:23:19.090130', NULL, '机电设计', '1、机电一体化或设备自动化专业及相关专业大专及以上文凭。有暖通机电专业知识和CAD绘图基础。应届毕业生亦可。\r\n\r\n2、相关专业应届毕业生能诚心到企业学习积累成长的优先考虑。公司提供良好的发展空间。\r\n\r\n3、公司重点培养2-3年后，主要负责公司的机电、暖通设计。可享受相应职务级别薪资待遇。\r\n\r\n4、真诚期待有意向的应届毕业生加入。', '', 4500, 5000, 3, '全职', NULL, 1, 533, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1525, '2025-04-08 15:23:19.571515', '2025-04-08 15:23:19.571515', NULL, '实习销售工程师', '一、岗位职责：\r\n\r\n1、负责公司产品推广和销售；\r\n\r\n2、负责客户的开发和维护；\r\n\r\n3、负责公司产品的技术交流和项目方案的提交和跟进；\r\n\r\n4、负责公司产品的售前、售后的技术支持服务。\r\n\r\n二、任职要求：1、学历：大专以上、化工专业毕业优先\r\n\r\n2、有1年以上电子半导体行业销售经验及电子行业硅胶、硅脂、锡膏锡线、润滑油等电子辅料销售经验，优秀者可放宽条件；\r\n\r\n3、具有良好的心理素质，开拓新市场，发展新客户；\r\n\r\n4、月薪和销售奖金面谈；\r\n\r\n5、工作地点：广东省东莞市东城同沙科技园\r\n\r\n福利丰富：双休、五险一金、丰富的团建活动等着您哦！', '', 5000, 8000, 5, '全职', NULL, 1, 534, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1526, '2025-04-08 15:23:20.144182', '2025-04-08 15:23:20.144182', NULL, '融资租赁客户经理（东莞）', '仲利能提供给你：\r\n大平台，ROE稳居业内前茅，专注助力中小企业发展；\r\n公司稳健发展，疫情期间薪资不降反涨，员工无后顾之忧；\r\n完善的培训体系及师徒制，手把手带金融小白成长为财务专家！\r\n你还在等什么，快来加入我们！！\r\n\r\n【工作内容】\r\n通过电话开发客户，现场了解客户资金需求，构建财务解决方案，谈判签约。\r\n【任职要求】：\r\n1.	本科及以上学历（接受应届生！）；\r\n2.	有冲劲，愿意从事销售岗位，愿意在金融行业长期发展。\r\n3.	喜欢与人打交道，良好的沟通表达能力，积极正面，良好的学习能力、执行力及韧性；\r\n【薪资】\r\n1.	无责底薪+餐补、话补\r\n2.	奖金（月度+季度）+月度之星奖金+案件协销奖金等\r\n3.	年底双薪（考勤奖+考绩奖）\r\n4.	另加年终绩效考核分红1-8个月\r\n5.	每年的两次调薪机会，完善的薪资体系，阶梯式上调薪资\r\n\r\n【福利】\r\n1.	餐补、话补、生活费补贴、职位补贴\r\n2.	舒适的办公环境，坐拥便利的市中心位置\r\n3.	月度团建、别墅轰趴、年度旅游、集体生日会、员工免费体检等\r\n4.	入职：社招：入职缴纳五险一金，转正六险一金\r\n校招：毕业前可签三方协议，提供全职实习，实习期时长可抵扣试用期时长\r\n5.	年假7~10天（优于法定，随年资增长）\r\n6.	出行公司商务车接送，无需为路程担忧。\r\n【新人培训】\r\n1.	专业的一对一师徒制配备，为你的培训保驾护航；\r\n2.	线上线下课程培训教学，包括线上网课、行业内部专业人士专项培训等；\r\n3.	良好的缓冲期，新人不会立刻设定业绩目标；\r\n4.	边工作边学习，技能成长速度快！\r\n【晋升】\r\n1.	每年年底均有晋升机会，有公开透明的晋升体系；\r\n2.	业务完善的晋升路线：业务专员—业务主任—业务组长—业务总监。', '', 5000, 7000, 10, '全职', NULL, 1, 535, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1527, '2025-04-08 15:23:20.670439', '2025-04-08 15:23:20.670439', NULL, '理财顾问', '1、本科及以上学历，男女不限；\r\n\r\n2、具备证券从业资格，除证券从业外，通过基金从业、投资顾问资格可优先录用；\r\n\r\n3、热爱金融证券行业，具备从事证券营销工作所必需的证券基础知识、客户服务和营销拓展技能，熟知证券法律法规；\r\n\r\n4、形象阳光开朗、性格外向、口条流利；\r\n\r\n5、具有较强的组织协调能力、工作责任感和事业心，有较强的服务意识。工作积极主动，勇于挑战，不怕挫折。有良好的沟通能力和团队协作精神。', '', 3500, 8000, 20, '全职', NULL, 1, 536, 6, NULL, NULL, NULL, NULL, NULL, 2, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1528, '2025-04-08 15:23:21.404948', '2025-04-08 15:23:21.404948', NULL, '海外市场专员-深圳', '岗位为深圳分公司，主营欧美亚马逊电商的厨房小家电类目，拥有自主品牌：zacme、newsets\r\n\r\n1、站在买家视角，对公司销售的厨师机、咖啡机等产品进行使用实测，记录过程及数据，协助市场营销经理输出目标用户更喜爱的食谱内容及用户手册。\r\n2、协助完成竞品海外社媒调研、官方社媒账号运营等基础工作。\r\n3、协助完成海外主流社媒的红人资源积累、海外电商促销资源的积累。\r\n\r\n岗位要求：\r\n1、大专或本科学历，专业不限；\r\n2、招收应届毕业生，可接受无经验小白；\r\n3、英语6级及以上，会使用基本办公软件；\r\n4、熟悉国外社交软件，有一定使用经验（如Facebook、TikTok、Instagram、YouTube）；\r\n5、热爱美食、烘焙，有一定的烘焙经验，喜欢制作网红美食。', '', 5000, 8000, 1, '全职', NULL, 1, 537, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1529, '2025-04-08 15:23:21.624184', '2025-04-08 15:23:21.624979', NULL, '硬件助理工程师-深圳', '此岗位为振中康集团分公司【深圳市知视智能技术有限公司】\r\n\r\n岗位职责：                                         \r\n1、负责厨房类项目的硬件电路设计、PCB制版、硬件电路调试；\r\n2、负责参与到整个产品开发和生产全过程；\r\n3、负责产品项目的BOM表及生产资料维护与更新；\r\n4、辅助规格书归集；\r\n 5、生产跟进。\r\n\r\n岗位要求：\r\n1、本科以上学历，电子信息、通信工程、应用电子、自动化，机电一体化等相关专业；\r\n2、1年以上电源、电机类产品硬件相关开发、调试、测试的工作经验优先；\r\n3、熟悉模拟电路﹑数字电路﹑高频电子电路，并能对问题进行分析；\r\n4、熟悉电子硬件电路，精通常规电子产品测试指标和方法，动手能力强，可以熟练使用烙铁和热风枪5。\r\n5、可以熟练使用示波器，万用表等仪器；\r\n6、精通PADS，ORCAR，DXP/PROTEL，AUTOCAD等应用软件来完成LAYOUT设计。', '', 6000, 12000, 1, '全职', NULL, 1, 537, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1530, '2025-04-08 15:23:22.177037', '2025-04-08 15:23:22.177037', NULL, 'PE助理工程师', '岗位职责：\r\n1.熟悉生产工艺、产品性能及结构；\r\n2.工装夹具设计，生产异常处理；\r\n3.完成工程师及上级交代其他事项。\r\n\r\n岗位要求：\r\n1.熟悉2D及3D制图软件，熟悉办公软件；\r\n2.有1年及以上小家电相关岗位经验；\r\n3.动手能力强，有责任心，听从领导安排。', '', 5000, 9000, 2, '全职', NULL, 1, 537, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1531, '2025-04-08 15:23:22.480477', '2025-04-08 15:23:22.480477', NULL, '国内业务员', '任职要求：\r\n1、本科及以上学历，市场营销相关专业优先；\r\n2、工作认真负责，有责任心；\r\n3、招收优秀应届生亦可；\r\n4、对小家电行业感兴趣。', '', 5000, 7000, 2, '全职', NULL, 1, 537, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1532, '2025-04-08 15:23:22.715295', '2025-04-08 15:23:22.715295', NULL, '外贸业务员', '岗位要求：\r\n1. 英语六级及以上，听说读写流利， 可作为工作语言。 \r\n2. 熟悉国际贸易的各个环节更佳。\r\n3.有外贸经验及展会参展经验优先，有厨房小家电行业经验者优先。\r\n4. 具图片处理， 视频处理， 电子商务操作的学习和使用能力。  \r\n5.保持乐观， 积极， 认真的工作状态，具体团队合作精神，有较强的抗压能力。\r\n\r\n岗位职责：\r\n1. 负责产品市场信息收集。 \r\n2. 负责新客户开发与跟进，并维护好新老客户关系。 \r\n3. 负责报价管理，做好订单跟进，并及时跟进和管理应收账款。 \r\n4. 达成营收目标和确保利润率。', '', 5000, 7000, 6, '全职', NULL, 1, 537, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1533, '2025-04-08 15:23:23.250964', '2025-04-08 15:23:23.250964', NULL, '研发助理工程师', '岗位要求：\r\n1、机械、机电专业优先，本科学历，英语四级及以上。\r\n2、学过PROE（CREO)、CAD、UG等绘图软件。\r\n\r\n岗位职责：\r\n1、协助跟进新产品开发设计方案的实施工作；\r\n2、协助跟进新产品的研发阶段的试产、测试和技术确认工作；编制新产品设计文件、控制设计质量；协助跟进新技术方案的专利申请工作；\r\n3、协助完成产品的量产问题点改善、标准化、技术降本工作。\r\n4、有相关小家电工厂实习或工作经验者优先。', '', 5000, 7000, 6, '全职', NULL, 1, 537, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1534, '2025-04-08 15:23:24.210556', '2025-04-08 15:23:24.210556', NULL, '生产储干', '岗位职责：\r\n 1、日常生产运行和采样工作；\r\n 2、负责本岗位的巡回检查工作，消除跑、冒、滴、漏，发现问题及时处理并报告值班长，做好岗位记录；\r\n 3、精心操作，杜绝安全环保事故发生； \r\n 4、熟练掌握工艺流程，熟悉现场设备性能，做好设备开停操作等日常运行维护工作；\r\n 5.  领导交办的其他事项；\r\n\r\n 任职要求： \r\n1、应用化学、化学工程与工艺、高分子材料与工程等化学相关专业；\r\n2、两班倒，两周转班一次；\r\n3、车间不允许带手机，香烟，打火机', '', 5000, 8000, 5, '全职', NULL, 1, 538, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1535, '2025-04-08 15:23:24.550548', '2025-04-08 15:23:24.550548', NULL, '销售专员', '岗位职责：\r\n1、负责根据公司及部门销售任务开展销售工作，完成各项销售指标；\r\n2、负责对现有市场和客户进行分析，发现客户的潜在需求，引导相关客户的现有需求，达成销售目标；\r\n3、负责根据客户需求的特点，为客户提供最优产品解决方案；\r\n4、负责与客户之间的商务谈判，建立客户关系，提高合同额和利润率；\r\n5、负责协调各种内部、外部资源，解决在项目实施过程中出现的问题，提高客户满意度；\r\n6、负责对项目回款过程的监控和执行，提高回款率；\r\n7、负责通过客户回访，了解客户需求及潜在需求，以提高客户满意，促成客户二次开发。\r\n\r\n任职要求：\r\n1、本科学历，应用化学、化学工程与工艺、高分子材料与工程等相关专业；\r\n2、持驾驶照。', '', 5000, 10000, 5, '全职', NULL, 1, 538, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1536, '2025-04-08 15:23:25.424789', '2025-04-08 15:23:25.424789', NULL, '工程师', '岗位职责：\r\n 1、负责组件加工的工艺设计，编排流程，制作BOM表，包装设计，SOP制作；\r\n 2、组件加工过程中质量控制，发现并解决质量隐患，并参与测试方案的优化； \r\n3、研发生产过程中需要的新工艺，新技术，提高生产效率；\r\n4、参与优化生产装配工艺，完善工序指导书，提高产品质量和降低成本 ； \r\n5、根据要求完成各种生产检测治具，工装夹具的设计与制作；                                                                          岗位要求： \r\n1、CAD熟练，三维建模软件熟悉；\r\n2、会运用电磁模拟软件，优化产品设计；\r\n3、、具有管理思维，成本概念； \r\n4、粉末冶金等材料专业、模具设计与制造、机械设计、机电一体化专业优先考虑；\r\n5、较强的执行力，良好的沟通力，学习能力强，极强的团队精神。', '', 5000, 7000, 5, '全职', NULL, 1, 539, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1537, '2025-04-08 15:23:25.802677', '2025-04-08 15:23:25.802677', NULL, '业务员销售', '1. 认真贯彻执行公司销售管理规定和实施细则，努力提高自身业务水平；                                                            2. 积极完成规定或承诺的销售量指标、为客户提供主动、热情、满意、周到的服务；                                           3. 办理各项业务工作，要做到积极联系，事前请示、事后汇报、忠于职守、廉洁奉公；                                        4. 负责产品的销售及推广，市场信息的收集及竞争对手的分析，挖掘客户需求等；', '', 5000, 10000, 5, '全职', NULL, 1, 539, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1538, '2025-04-08 15:23:26.085902', '2025-04-08 15:23:26.085902', NULL, '英语外贸业务员', '岗位职责：\r\n1、负责公司外贸平台的操作及管控；\r\n2、负责对外国客人的询问回复及详细说明，争取到客人理解及满意，从而转化为订单；\r\n3、负责客人要求的打样和品控要求的跟踪及寄送、追踪结果，并反馈给上级领导；\r\n4、负责外贸订单的统计并转化为公司内部生产；\r\n5、负责外贸订单交期的跟踪及不定时与客人进行沟通协调；\r\n6、负责客户投诉的接收、转化内部处理、反馈及跟踪结果；\r\n7、负责订单的出货安排、跟踪关务及货运情况，并及时与客户保持进度共享；\r\n8、负责月度订单进度请款及订单结果结款的处理，以保证公司的合法权益；\r\n9、负责协助上级领导及其他部门相关工作的处理。                                                                                            任职要求：\r\n1、精通英文', '', 5000, 10000, 5, '全职', NULL, 1, 539, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1539, '2025-04-08 15:23:26.404728', '2025-04-08 15:23:26.404728', NULL, '生产管理人员储备干部', '岗位要求：                                                                                                                                                         1、熟悉公司基本情况、了解部门制度与对应岗位的工作职责，掌握部门整体的工作流程；                                                                                                 \r\n2、完成公司对储干个人成长各阶段的规划目标；                                                                                               3、能通过学习迅速胜任各岗位工作；                                                                                                                4、为部门提供建设性的建议，协助直属上级做好岗位工作及团队管理工作', '', 5000, 7000, 5, '全职', NULL, 1, 539, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1540, '2025-04-08 15:23:27.118122', '2025-04-08 15:23:27.118122', NULL, '费用会计', '岗位职责\r\n1、负责核对部分门店各项营业款的回款；\r\n2、负责装修工程款、资产及物料采购付款单审核及核算；\r\n3、负责职能人员借款及费用报销的审核及核算；\r\n4、K3系统中处理与门店营业款、费用、资产、装修费、折旧等相关的所有账务凭证。\r\n\r\n岗位要求\r\n1.大专以上学历，财务管理等相关专业并取得初级证书优先；\r\n2.具有扎实的会计基础知识经验；\r\n3,工作认真细心、责任心强，有良好的职业道德，团队协作能力及意识强；\r\n4.熟练操作各类办公软件，如Word、Excel、Excel函数。', '', 5000, 6000, 1, '全职', NULL, 1, 540, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1541, '2025-04-08 15:23:27.844704', '2025-04-08 15:23:27.844704', NULL, '理财顾问', '一、本科及以上学历\r\n\r\n二、通过证券从业资格考试\r\n\r\n三、热爱金融证券行业，具备从事证券营销工作所必备的证券基础知识，客户服务和营销拓展技能有证券从业资格经验和营销经验者优先、有互联网营运经验和推广经验优先', '', 4500, 8000, 2, '全职', NULL, 1, 541, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1542, '2025-04-08 15:23:28.190101', '2025-04-08 15:23:28.190101', NULL, '实习生', '一、在读本科生\r\n二、有通过证券从业资格考试意向\r\n三、热爱金融证券行业，具备和了解一定金融证券基础知识', '', 1500, 2000, 2, '全职', NULL, 1, 541, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1543, '2025-04-08 15:23:28.809275', '2025-04-08 15:23:28.809275', NULL, '产品助理（周末双休）', '工作职责：\r\n1、收集客户反馈，对各竞品、数据统计进行分析，定期输出产品分析报告；\r\n2、编写产品需求文档，协助团队完成产品设计；\r\n3、熟悉需求分析文档编写、功能设计、原型制作、流程图制作；\r\n4、思维清晰，逻辑性强，良好的沟通能力；\r\n5、具备良好的责任心和团队精神，有较强的文档编写能力。\r\n\r\n岗位要求：\r\n1、大专以上学历，计算机或相关专业，具有产品经验优先；\r\n2、具备较强的沟通和协调能力，能承受的工作强度和压力；\r\n3、熟练使用Axure等原型设计工具，并有优秀的文档撰写能力；\r\n4、工作积极主动，具备强烈的进取心、求知欲及团队合作精神，对工作积极严谨，勇于承担压力；\r\n5、具备一定的产品设计、产品研发、产品测试等基础知识。', '', 4000, 6000, 1, '全职', NULL, 1, 542, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1544, '2025-04-08 15:23:29.475035', '2025-06-10 10:34:47.273265', NULL, 'JAVA开发工程师（周末双休）', '工作职责：\r\n1、按系统设计完成功能模块的编写;\r\n2、遵循工作规范和编写要求;\r\n3、编写模块详细设计文档和相关资料;\r\n4、按规范进行模块功能单元测试。\r\n\r\n任职要求：\r\n1、全日制本科或以上，有JAVA开发工作经验;\r\n2、熟悉面向对象编程、常见设计模式，具有较好的编码习惯及—定的文档编写能力;\r\n3、熟悉JAVA基础，对J2EE有较深的了解及应用，能够设计模块级解决方案,独立完成上级交办开发及测试任务;\r\n4、熟悉JAVA Web开发，熟悉 Spring Mvc、Spring Boot、Spring Could、Mybatis、Mybatis-plus、SSM、HTML、JQuery、LayUI等框架及工具;\r\n5、熟悉MySQL、SQLServer中的一种或多种数据库语言;\r\n6、掌握 Maven、GIT等工具，了解Linux下的常用命令;\r\n7、较强的学习能力、责任心、主动性和抗压能力，有团队意识及强烈的学习欲望和进取心。\r\n8、党员优先', '米饭', 4000, 6000, 1, '全职', NULL, 1, 542, 6, NULL, NULL, '东莞市', '广东省', '东城街道', 242, '441900', '440000', '441900003', '', 4, 'Java', 0);
INSERT INTO `post` VALUES (1545, '2025-04-08 15:23:30.423869', '2025-04-08 15:23:30.423869', NULL, '莞寓门店管家（2025届毕业生）', '1、工作职责：\r\n1.1 负责公寓招租工作，开展招租信息发布，来访客户接待、办理住户入住、退租、费用结算等。\r\n1.2 日常门店运营管理，定期查空房，在客户入住前确保房间可以入住。信息录入及整合；仓库、资产、公共设施设备管理及例行检查；催缴房租水电费等；监督保洁、保安、维修工1.3 接待客户投诉，并每日及时反馈。\r\n1.4 协助店长进行社群活动组织及策划。\r\n2、福利待遇：\r\n2.1 实习期间补贴：大专1500元/月；本科1800元/月；研究生2000元/月。另，如有成交签约公司发放签约奖励：6个月以下短租20元/套，6个月及以上长租40元/套，随实习补贴发放。\r\n2.2 毕业后正式录用薪资：目标年薪5.59万元/年+新签/续签业绩提成\r\n2.3 其他福利：公寓单间宿舍、员工饭堂（未配备饭堂的项目给与400元/月伙食补助）、年度体检、五险一金（社保金卡)、商业保险、节日福利。', '', 4500, 6000, 5, '全职', NULL, 1, 543, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1546, '2025-04-08 15:23:30.703155', '2025-04-08 15:23:30.703155', NULL, '莞寓门店销售（2025届毕业生）', '1、工作职责：\r\n1.1   负责拓展、管理和维护客户，邀约客户上门看房;\r\n2.2  负责客户接待、带看、咨询工作，为客户提供专业的人才房租赁咨询服务，完成销售任务;\r\n3.3 负责端口的更新、维护和标准化使用。\r\n2、福利待遇：\r\n2.1 实习期间补贴：大专1500元/月；本科1800元/月；研究生2000元/月。另，如有成交签约公司发放签约奖励：6个月以下短租20元/套，6个月及以上长租40元/套，随实习补贴发放。\r\n2.2 毕业后正式录用薪资：底薪（共三档3500元/4000元/4500元）+新签/续签业绩提成，综合月收入5k-10k。\r\n2.3 其他福利：公寓单间宿舍、员工饭堂（未配备饭堂的项目给与400元/月伙食补助）、年度体检、五险一金（社保金卡)、商业保险、节日福利。', '', 5000, 10000, 2, '全职', NULL, 1, 543, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1547, '2025-04-08 15:23:31.388249', '2025-04-08 15:23:31.388940', NULL, '外贸业务员', '岗位要求\r\n1、大专以上学历，商务英语、国际贸易、机电一体化、电气类相关专业或有相关工作经验。\r\n2、具备良好的沟通能力和商务意识，熟悉国际贸易流程。\r\n3、具备良好的英语听说读写能力，具备较好的口头和书面表达能力（英语四级以上）。\r\n4、具备良好的团队合作精神和责任心，具备较强的自我驱动力。\r\n5、 适应经常出差国外的工作节奏，具备一定的抗压能力。\r\n岗位职责\r\n1、负责公司国际贸易业务的拓展和维护，与国外客户进行沟通和交流，完成销售业务和项目合作。\r\n2、了解公司产品，熟悉国际贸易流程，具有良好的商务意识和沟通能力。\r\n3、负责编制并执行国际贸易业务计划，完成销售目标。\r\n4、负责公司国外客户的维护和开发，建立良好的合作关系。\r\n5、负责公司产品在国外市场的推广和销售，提高公司产品在国外市场的占有率。\r\n6、完成销售合同的谈判和签约，协调内外部资源，确保合同履约。\r\n7、负责公司国外客户的售后服务和支持，提高客户满意度。\r\n未毕业之前均为实习期，拿毕业证后可申请转正。', '', 4500, 6000, 4, '全职', NULL, 1, 544, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1548, '2025-04-08 15:23:32.036399', '2025-04-08 15:23:32.036399', NULL, '人力资源管培生（25年应届生）', '岗位职责：\r\n1、负责企业文化宣传工作，如撰写文化案例宣传稿、拍摄及剪辑内宣短视频、文化氛围布展；\r\n\r\n2、负责中心培训模块工作，完善新员工试用期管理；\r\n\r\n3、协助开展企业文化讲师建设工作；\r\n\r\n4、协助跟进基层岗位及校园招聘，包括简历筛选，人员面试安排等工作。\r\n\r\n\r\n任职要求：\r\n\r\n1、本科及以上学历，人力资源管理相关专业；\r\n\r\n2、具备较好文字功底，具备一定视频拍摄及剪辑能力；\r\n\r\n3、掌握人力资源管理专业知识，熟悉培训模块工作及人力资源管理工作流程。', '', 8000, 10000, 1, '全职', NULL, 1, 545, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1549, '2025-04-08 15:23:33.296042', '2025-04-08 15:23:33.296042', NULL, '物流管培生（2025年应届生）', '岗位职责：\r\n\r\n1、作为区域物流总经理梯队进行培养；\r\n\r\n2、负责物流业务的日常运营管理和质量提升（仓储、运输、配送）；\r\n\r\n3、拓展外部业务，负责物流项目的洽谈引进、落地实施与日常维护；\r\n\r\n4、协助进行团队人员的管理；\r\n\r\n5、协助对所在部门的成本和利润达成进行管理。\r\n\r\n\r\n任职要求：\r\n\r\n1、本科及以上学历，物流管理/工程、交通运输、供应链管理等相关专业优先；\r\n\r\n2、熟悉了解物流行业，对物流工作有热情，能吃苦耐劳；\r\n\r\n3、具有较好的沟通表达能力和组织统筹能力；\r\n\r\n4、具有较好的执行力和服从性，有一定创新意识。', '', 8000, 10000, 1, '全职', NULL, 1, 545, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1550, '2025-04-08 15:23:33.554976', '2025-04-08 15:23:33.554976', NULL, '店长管培生（25年应届生）', '岗位职责：\r\n1、通过终端实践学习，从协助到最终全面负责门店经营管理工作；\r\n2、通过学习，从自己销售、到管理销售最终承担整个团队的销售达成；\r\n3、通过用户研究、大数据分析以及互联网工具的运营，提升门店在当地市场的行业地位。\r\n\r\n任职要求：\r\n1、本科及以上学历，专业不限，经济管理类、电子商务、市场营销、数学与统计学、心理学、社会学等相关专业优先； 能接受单休优先考虑。\r\n2、热爱互联网，乐于分享，以及较强的学习能力；\r\n3、对社群运营、直播带货等互联网营销方式充满热情；\r\n4、有学生干部经历、社会实践经历、电商企业实习经历、校园创业经历者优先。', '', 8000, 10000, 5, '全职', NULL, 1, 545, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1551, '2025-04-08 15:23:33.997061', '2025-04-08 15:23:33.997061', NULL, '市场管培生（2025年应届生）', '岗位职责：\r\n\r\n1、负责东莞公司苏宁易购的营销活动的策划与发起，承担线上线下营销策划方案撰写与整理，抓住社会热点，引起消费者的共鸣，提升品牌影响力；\r\n2、负责门店广告宣传、品牌推广，根据品牌推广策略和目标，制定广告宣传、公关活动及品牌推广计划并组织实施；\r\n3、负责易拉宝、DM单等线下推广相关物料设计，门店节日大促重大活动视觉设计；\r\n\r\n任职要求：\r\n\r\n1、2025年本科及以上学历；\r\n2、有短视频拍摄、剪辑、设计相关工作经验优先。\r\n3、具有较好的敬业精神、注重团队合作，具有沟通能力和组织协调能力、责任心强；', '', 7000, 9000, 1, '全职', NULL, 1, 545, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1552, '2025-04-08 15:23:34.237068', '2025-04-08 15:23:34.237068', NULL, '运营管培生（25年应届生）', '岗位职责：\r\n1、协助负责所辖品类的经营管理指标达成（包括销售、毛利、损耗等）；\r\n2、协助负责各线下店面的运营管理工作，制定有效的门店运营策略；\r\n3、协助负责所辖品类运营管理标准的培训、落地执行、检查等；\r\n4、协助负责与对应商品管理中心的对接，协同公司品类经营策略在运营端的落地执行；\r\n5、负责对所辖品类的市场趋势，竞对情况进行调研和预判，并提出相应的经营管理建议。\r\n\r\n任职要求：\r\n1、本科及以上学历，经济管理类、电子商务、市场营销、数学与统计学、心理学、社会学等相关专业优先； 能接受单休优先考虑。\r\n2、热爱零售、互联网行业，有长期在零售、互联网行业发展意愿，良好的用户思维和营销意识；\r\n3、具备良好的沟通、谈判及团队合作能力，较强的创新能力与抗压能力，良好的学习与适应能力；\r\n4、掌握数据分析工具，具备一定的数据分析能力，总结归纳能力，对数据有一定敏感度；\r\n5、有学生干部经历、社会实践经历、电商企业实习经历、校园创业经历者优先。', '', 8000, 10000, 5, '全职', NULL, 1, 545, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1553, '2025-04-08 15:23:34.539505', '2025-04-08 15:23:34.539505', NULL, '采销管培生（25年应届生）', '岗位职责：\r\n1、协助负责进行商品品类或品牌的产品研究，参与供应商合同、促销资源、价格等的沟通谈判；\r\n2、协助负责商品采购、销售、库存管理等商品采销存管理，实施商品全生命周期管理；\r\n3、协助负责商品的全渠道整体市场调研工作，并制定有竞争力的商品营销策略，充分协调、利用公司运营、市场等部门资源，做好运营、推广工作。\r\n\r\n任职要求：\r\n1、本科及以上学历，管理学、经济学、工学、理学等专业优先；能接受单休优先考虑。\r\n2、热爱零售、互联网行业，有长期在零售、互联网行业发展意愿，良好的用户思维和营销意识；\r\n3、具备良好的沟通、谈判及团队合作能力，较强的创新能力与抗压能力，良好的学习与适应能力；\r\n4、掌握数据分析工具，具备一定的数据分析能力，总结归纳能力，对数据有一定敏感度；\r\n5、有学生干部经历、社会实践经历、电商企业实习经历、校园创业经历者优先。', '', 8000, 10000, 5, '全职', NULL, 1, 545, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440303', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1554, '2025-04-08 15:23:35.180484', '2025-04-08 15:23:35.180484', NULL, '钟表生产管理管培生', '1、大专学历，机械制造及自动化、机械、钟表技术开发等专业。\r\n2、能协助处理钟表产品生产管理工作。\r\n3、会看表壳表带结构图。', '', 3000, 7000, 4, '全职', NULL, 1, 546, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441300', '440000', '441302', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1555, '2025-04-08 15:23:36.021017', '2025-04-08 15:23:36.021017', NULL, '销售工程师', '一、基本要求：热爱业务事业，敢于挑战自我，挑战高薪，能吃苦耐劳，勤奋务实，积极主动，具有良好的团队合作精神，拥有高度的执行力，能承受较强的工作压力，稳定性强。\r\n二、学历要求：大专以上学历，工科，理科及相关专业。\r\n三、专业素质要求：语言表达及沟通能力强', '', 4500, 15000, 15, '全职', NULL, 1, 547, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1556, '2025-04-08 15:23:37.121110', '2025-04-08 15:23:37.121110', NULL, '工艺工程师', '一、主要职责：\r\n1、掌握市场动态及业务需求，对公司产品进行改进、提升、创新，开发高性能产品。\r\n2、针对特定的项目需求，提供相应的技术解决方案。\r\n3、负责新产品从研发阶段到量产过程的跟进及协调。\r\n4、负责监督下属同事日常工作的规划、实施、进度，质量。\r\n5、完成上级领导交付的其他工作。\r\n二、任职资格\r\n1、学历：本科以上学历，高分子材料专业。\r\n2、会编写工艺流程，制定作业指导书。\r\n3、熟练使用常用办公软件、CAD制图', '', 6000, 8000, 5, '全职', NULL, 1, 548, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1557, '2025-04-08 15:23:37.655816', '2025-04-08 15:23:37.656587', NULL, '储备干部（质量）', '任职要求\r\n1、本科及以上学历\r\n2、熟练应用WORD、EXCEL、PPT等日常办公软件；\r\n3、熟练应用品质统计分析工具，如：QC手法、8D及五大工具等。\r\n4、能够编制品质管理性文件，具有较强的沟通能力。', '', 6000, 8000, 5, '全职', NULL, 1, 548, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1558, '2025-04-08 15:23:37.982400', '2025-04-08 15:23:37.982400', NULL, '储备干部', '1.学习和掌握企业的生产流程、技术标准和管理制度，熟悉各个部门的工作内容和流程。\r\n2.参与企业的各项生产活动，包括现场管理、物资调配、质量控制等，积累实践经验。\r\n3.深入了解市场需求和竞争情况，为企业提供市场分析和产品开发建议。\r\n4.协助上级领导完成各种工作任务，并及时向上级汇报工作进展情况。\r\n5.参加企业内部培训和外部学习，提升自身综合素质和专业技能。', '', 5000, 7000, 5, '全职', NULL, 1, 548, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1559, '2025-04-08 15:23:38.261310', '2025-04-08 15:23:38.261310', NULL, '营销储备干部（业务助理）', '任职要求：\r\n1、市场营销、化学、材料类专业优先，其它专业的优秀应届生亦可；\r\n2、具备良好的沟通及表达能力，有意愿往销售类职业方向发展；\r\n岗位职业发展通道：\r\n业务助理--业务专员--业务主管--业务经理/总监', '', 5000, 6000, 2, '全职', NULL, 1, 548, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1560, '2025-04-08 15:23:38.639584', '2025-04-08 15:23:38.639584', NULL, '研发助理', '主要职责：\r\n1、协助研发工程师进行产品试验，包括原料的申领、预处理，小试样品的刮涂、测试；\r\n2、对实验室的各类仪器进行日常管理，确保仪器设备的正常运行；\r\n3参与公司质量体系建设，攥写各类质量体系文件，包括工艺流程、质量记录、验证报告等。\r\n任职资格；\r\n1、学历：本科及以上学历，高分子材料与化学相关专业；\r\n2、经验：不限\r\n3、技能：熟悉办公软件；\r\n4、素质：学习能力和自我驱动力强。\r\n5、培训：在本公司会接受系统培训，制度体系培训，安全培训，产品工艺培训等。', '', 5000, 6000, 5, '全职', NULL, 1, 548, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1561, '2025-04-08 15:23:39.285052', '2025-04-08 15:23:39.285052', NULL, '项目助理', '工作内容：\r\n1、策划跟进相关活动；\r\n2、协助对外交流；\r\n3、资料整理；\r\n工作要求：\r\n1、专科以上学历；\r\n2、沟通能力较强，有进取心，会开车；\r\n3、文字能力优秀优先；\r\n4、男女不限；', '', 4500, 6000, 2, '全职', NULL, 1, 549, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1562, '2025-04-08 15:23:40.082353', '2025-04-08 15:23:40.082353', NULL, '理财顾问', '【岗位职责】\r\n1. 负责公司金融产品的推广与销售，挖掘潜在客户并创建长期合作关系。\r\n2. 分析市场趋势，制定个人或团队销售策略，达成业绩目标。\r\n3. 通过电话、网络等方式开展精准营销活动，并定期汇报工作进展。可选择适合自身的方式开展工作\r\n【任职要求】\r\n1. 拥有本科学历及以上学历；\r\n2. 具备优秀的沟通技巧和服务意识，具备一定的理财知识；\r\n3. 一年以上金融产品销售经验，熟悉金融市场者加分；\r\n4. 对数据敏感，能有效管理客户关系管理系统；\r\n5.有证券从业资格证书及基金证书优先考虑。\r\n【福利待遇】\r\n1. 提供具有竞争力的基本薪酬加提成制度，月收入可达万元以上；\r\n2. 完善的社会保险及公积金；\r\n3. 高额年终奖及季度激励计划；\r\n4. 灵活的工作时间以及丰富的员工培训机会；\r\n5. 提供舒适办公环境及优秀的职业发展平台；\r\n6.双休，法定假期。', '', 5000, 10000, 50, '全职', NULL, 1, 550, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1563, '2025-04-08 15:23:40.883247', '2025-04-08 15:23:40.883247', NULL, '消费金融定向生（营销岗）', '宁银消金消费金融定向生\r\n1、岗位职责\r\n定位公司营销专业人才。为区域内优质客户提供消费金融服务，包括客户开发、渠道建联、产品推广、资质审查、客户维护等工作。\r\n2、学历及专业要求\r\n本科及以上学历，专业不限。\r\n3、工作地点\r\n广东省内六市（投递意愿优先，无明确城市意向的会结合业务部情况进行调剂），具体办公地址如下：\r\n广州：广州市黄埔区映日路凯德金融中心C4栋16楼\r\n惠州：惠州市江北文昌一路11号铂金府华贸大厦3号楼13层\r\n东莞：东莞市南城街道东莞大道116号轨道交通大厦8楼\r\n佛山：佛山市南海区桂城街道金融高新区中央大街智富大厦24楼\r\n中山：中山市东区街道利和国际金融中心21楼\r\n湛江：湛江市华都汇国际中心写字楼9楼\r\n4、工作时间\r\n工作日8:30-11:30，14:00-18:00，双休，节假日按国家规定执行。\r\n5、薪酬福利\r\n（1）每月税前收入：由底薪、补贴、绩效工资三部分构成；底薪2000-2500+补贴1600-2600+绩效工资（挂钩每月业绩完成情况，多劳多得）。\r\n（2）工资外福利：过节费、高温补贴、外出交通报销、生日福利、定制工服等。\r\n（3）试用期薪酬保护：入职签订三年合同，试用期6个月；试用期期间实行薪酬保护机制：保护入职半年内薪酬总包不低于税前6万元（含各类补贴、年终奖、风险金等）。\r\n招聘基本条件\r\n（一）遵纪守法，品行良好，认同宁银消金企业文化，愿意在消费金融领域长期发展。\r\n（二）性格开朗，乐于合作，具有较强的学习能力、沟通能力、创新意识和责任意识，具备良好的心理素质及身体素质。\r\n（三）国内外高校2025年应届毕业生（毕业时间为2024年9月1日-2025年8月31日，初次就业），并取得毕业证、学生证、报到证，开始全职工作。如为国外高校毕业生，必须于2025年8月底通过教育部学历认证。\r\n（四）有良好的口头表达和沟通能力，形象气质佳；心态积极，具备较好的营销和市场拓展能力；责任心强，踏实肯干，有良好的执行力；有销售实习工作经验的优先。\r\n招聘流程\r\n初面-测评-复试-一个月适岗实习（2000-2500元补贴）-终面-体检、背调-录用+一个月入职前实习\r\n注：各流程节点具体时间以我公司通知为准\r\n投递方式\r\n（一）电脑端投递\r\n登录宁银消金招聘官网（https://xjzhaopin.nbcb.com.cn），点击“校园招聘”-选择相应岗位。\r\n（二）手机端投递\r\n关注“宁银消金招聘”微信公众号-点击“我要应聘”-校园招聘-根据心仪岗位进行简历投递。\r\n（三）内推渠道\r\n通过在宁银消金工作的学长学姐进行内推，选择心仪岗位完成网申投递，优先筛选简历。', '', 7000, 12000, 50, '全职', NULL, 1, 551, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440112', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1564, '2025-04-08 15:23:41.671336', '2025-04-08 15:23:41.671859', NULL, '管培生-财务管理岗（NKP）', '岗位职责：\r\n1、进行财务日常基础账务核算及管理，账套核算、现金流管理、税务申报、内控风险、预算管控等；\r\n2、提供经营分析相关报告，监控日常经营现金流与利润，推进业务持续健康发展。\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n财务管理、会计学、审计学、经济学等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 2, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1565, '2025-04-08 15:23:41.895856', '2025-04-08 15:23:41.895856', NULL, '管培生-采购管理岗（NKP）', '岗位职责：\r\n1、计划管理：组织招采计划编制并跟进实施；\r\n2、供应商管理：开展供应商拓展考察、关系维护、履约评估等工作；\r\n3、招采管理：统筹协调内外部资源，推进招采及合同签订工作；\r\n4、计划运营管理：部门计划运营及数据分析等。\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n物流管理、采购管理、供应链管理、工程相关专业等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 2, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1566, '2025-04-08 15:23:42.193763', '2025-04-08 15:23:42.193763', NULL, '管培生-安全管理岗（NKP）', '岗位职责：\r\n1、学习与应用安全知识：学习物业管理中的安全法规和标准，参与实际的安全管理工作，如安全检查和风险评估。\r\n2、监督与执行安全措施：确保物业的安全规章制度得到有效执行，包括监控安全设备和消防设施，管理访客和车辆出入。\r\n3、事故处理与客户沟通：在发生安全事故时，负责初步处理和报告，同时与居民或租户沟通，提供安全指导和处理客户反馈。\r\n4、持续改进与团队协作：通过定期检查和评估，识别并实施安全改进措施，与物业管理团队协作，共同维护物业的安全和秩序。\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n安全工程、安全技术与管理、应急管理、土建工程、消防工程等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 5, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1567, '2025-04-08 15:23:42.328988', '2025-04-08 15:23:42.328988', NULL, '管培生-社区增值岗（NKP）', '岗位职责：\r\n1、协助经营职能完成公司社区增值业绩指标的达成，根据经营计划，对经营目标进行分解并落实执行；\r\n2、理解客户需求、分析业务内外部资源并加以利用，不断探索业务发展方向、拓展新的业务领域；\r\n3、负责社区增值业务在当地的运营、落地、渗透、推广、复盘分析等工作；\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n市场营销、电子商务、广告学、工商管理、物业管理等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 2, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1568, '2025-04-08 15:23:42.633630', '2025-04-08 15:23:42.633630', NULL, '管培生-工程管理岗（NKP）', '岗位职责：\r\n1、工程设施设备管理：包括供配电，给排水，电梯，消防，智能化系统运行及维保工作；\r\n2、能耗管理：熟悉设备功率及耗能计量方式，对管理区域定期统计分析，发现异常及时处理，实现节能降耗；\r\n3、工程服务：结合项目业态，为业户提供质价相符的工程维修及技术服务；对公共区域（如：设施设备、基建、装饰、景观等）定期开展品质提升及隐患整改，坚持常做常新，提升客户满意度；\r\n4、沟通协作：配合项目团队做好报事报修及后勤服务工作，对接地产及上级政务部门做好工程承接查验及接管验收工作，协调推动工程遗留问题整改；\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n楼宇智能化、智能科学与技术、建筑电气与智能化、电气工程、机电一体化、电气工程及自动化等、通信网络工程等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 5, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1569, '2025-04-08 15:23:42.840419', '2025-04-08 15:23:42.840419', NULL, '管培生-客户管理岗（NKP）', '岗位职责：\r\n1、接待业主来电、来访，及时解决客户报事报修和投诉，定期上门拜访维护客户关系，负责客户满意度管理。\r\n2、挖掘客户潜在需求，不断优化与创新物业服务体验。\r\n3、负责收取物业管理费及各项代收代交费用。\r\n4、组织策划开展社区文化活动，活跃社区氛围。\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n物业管理、旅游管理、酒店管理、工程管理、电气自动化、给水排水工程、消防工程、机电专业等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 5, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 6, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1570, '2025-04-08 15:23:43.103145', '2025-04-08 15:23:43.103145', NULL, '管培生-品牌管理岗（NKP）', '岗位职责：\r\n1、负责集团品牌的新媒体运营及下属机构媒体矩阵的内容审核，如：微信公众号、视频号、官网等；\r\n2、根据集团的品牌管理规定，制作符合品牌VI规范的物料及资料； \r\n3、负责品牌活动方案制定，统筹完成品牌形象物料(主视觉、展架、海报、视频、礼品等)设计制作；\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n传媒、电子商务、广告学、网络与新媒体等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 2, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1571, '2025-04-08 15:23:43.326443', '2025-04-08 15:23:43.326443', NULL, '管培生-人力资源岗（NKP）', '岗位职责：\r\n1、负责招聘工作执行，包括渠道维护、需求审核、招聘全流程、人力编制制定、招聘预算核控等；\r\n2、负责培训工作执行，包括培训需求调研，计划制定，课程开发、项目执行及评估等。\r\n3、负责员工关系管理，包括入离职、转正手续办理，员工沟通、人力资源系统维护等工作；\r\n4、负责组发工作，协助绩效管理、开展人才盘点、组织优化、架构调整，提高人效。\r\n5、负责企业文化、组织员工活动及其他人力资源相关工作。\r\n任职要求：\r\n1、较强的学习能力和抗压能力，善于思考，可塑性强；\r\n2、较好的团队意识和亲和力，有一定的成就导向；\r\n3、自信开朗、有亲和力，有责任心和风险精神；\r\n4、沟通表达良好，逻辑思路清晰，愿意表达和分享；\r\n5、有文体特长或担任学生会、社团、班级相关干部职务者优先。\r\n专业要求：\r\n心理学、人力资源管理、工商管理、行政管理、公共事业管理等\r\n备注：作为NKP，希望你对地域更加开放，接受全国工作地点的调动。', '', 5500, 7500, 2, '全职', NULL, 1, 552, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1572, '2025-04-08 15:23:43.977813', '2025-04-08 15:23:43.977813', NULL, '理财顾问', '1、具备证券从业资格证（可辅助考试报名）\r\n2、本科学历或以上，专业不限\r\n3、对A股、基金、期货、期权等有所了解\r\n4、对证券行业有浓厚的兴趣，热爱股票等投资事业，勤奋好学，有吃苦耐劳的精神\r\n5、沟通与应变能力较强，具有团队协作意识', '', 3500, 20000, 10, '全职', NULL, 1, 553, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1573, '2025-04-08 15:23:44.648635', '2025-04-08 15:23:44.648635', NULL, '营业练习生', '一、岗位职责\r\n1、通路渠道政策的推动、执行，以及通路策略的承接、转化、落实、执行\r\n2、持续完善辖区内通路布建\r\n3、承接品牌/通路策略，推动辖区内品牌布建及品牌形象的树立\r\n4、依辖区竞争态势，打击竞品，夺取市占，达成销售/利润目标\r\n\r\n二、成长路径\r\n储备干部—所长—部长—总经理\r\n\r\n三、岗位要求\r\n1、年龄22-25岁\r\n2、本科，应届生或具1-2年经验\r\n3、思维灵活，表达能力佳，抗压能力强\r\n4、乐观、积极，愿意从事快消品行业\r\n\r\n四、员工福利\r\n1、五险一金、带薪年假、年终奖、节假日福利、结婚贺礼、生育贺礼等齐全\r\n2、户外拓展、生日会、员工旅游等多样活动\r\n3、专业的导师团队、多元的晋升渠道、完善的培训体系、广阔的发展平台 \r\n4、每年两次晋升以及调薪机会\r\n\r\n\r\n四、工作时间：8:30-17:30  周一至周六\r\n\r\n五、工作地区：深圳（南山、福田、罗湖、盐田、宝安、光明） 东莞 惠州', '', 7000, 9000, 30, '全职', NULL, 1, 554, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1574, '2025-04-08 15:23:45.401269', '2025-04-08 15:23:45.401269', NULL, '理财顾问', '职位描述\r\n一、岗位职责\r\n1、依托公司平台及标准化投研服务体系，聚焦客户开发与服务；\r\n2、高净值客户开发与服务；\r\n3、依托公司平台、产品体系，为客户提供资产配置服务。\r\n二、岗位要求\r\n1、本科及以上学历；\r\n2、通过证券从业资格考试+基金从业资格考试优先；\r\n3、对证券投资分析或市场研究有独到见解，擅长利用自媒体开展投资者教育工作优先；\r\n4、较强的学习、沟通和组织协调能力，具备创新创业、团队合作精神，积极进取、勤奋敬业；\r\n5、无刑事处罚、未被市场禁入以及无不良诚信执业行为。\r\n\r\n\r\n职位福利：六险二金、绩效奖金、带薪年假、定期体检、节日福利、餐补', '', 6000, 10000, 2, '全职', NULL, 1, 555, 6, NULL, NULL, NULL, NULL, NULL, 2, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1575, '2025-04-08 15:23:45.902154', '2025-04-08 15:23:45.902154', NULL, '置业助理/25届/营销储干', '岗位职责\r\n1.新员工入职，熟悉了解所在的楼盘项目；\r\n2.学习业务相关知识，掌握豪宅交易流程，并且能够解决流程中出现的问题；\r\n3.与客户沟通，详细了解客户的需求，了解公司产品，高效匹配；\r\n4.与客户进行商务磋商、谈判，促成成交；为客户提供市场分析报告、价值对比分析等\r\n5.能够遵守公司管理制度的前提下开展业务，完成上级交代的任务\r\n\r\n岗位要求\r\n1.本科及以上学历\r\n2.有意向往管理上发展的优先考虑\r\n3.价值观正，简单真诚阳光透明\r\n4.能吃苦，不是只想拿底薪死工资的，有上进心敢于拼搏的，特别欢迎有持续行动力、有上进心的人加入。\r\n5.经验和专业不限，公司有完整的人才培养体系，要有一颗踏实肯学的心\r\n\r\n薪酬福利\r\n1、薪酬自主制\r\n本科前三月最高薪酬9000元 ：底薪补贴绩效6000+ 3000职务绩效，三个月后进入发展期，另享有55%-80%业绩奖励，入职1年以上平均薪酬水平在26230元\r\n2、五险一金，带薪年假，节假日福利等。\r\n3、更有业内的利润高分红，实现你的 “老板”梦。\r\n4、乐有家：百余名资深讲师，全方位课程培训，旨在打造房地产经纪专家。\r\n更多员工福利：有五险一金、导师带教和培训，提供宿舍，节日关怀礼、带薪年假、婚假、产假、陪产假、项目奖、创新奖、仁杰奖、荣誉奖等。\r\n【晋升机制】\r\n公平公正的平台，每月一次的竞聘机会，面向全员开放，鼓励纵向或横向发展\r\n置业顾问/营销管培生—置业经理—店长—营销副总经理—营销副总裁\r\n\r\n投递简历，现场/线上面试，可添加微信：13828464526王学姐 咨询面试\r\n投递简历邮箱：793183049@qq.com', '', 6000, 10000, 15, '全职', NULL, 1, 556, 6, NULL, NULL, NULL, NULL, NULL, 2, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1576, '2025-04-08 15:23:46.536426', '2025-04-08 15:23:46.536426', NULL, '储备对公客户经理（广州）', '岗位职责：\r\n1.开拓和维护企业客户，制定访客计划，撰写访客记录；\r\n2.提供法人顾客授信、国际贸易等产品与服务；\r\n3.协助资深客户经理维护顾客关系、征授信报告撰写及风险管理等。\r\n4.完成上级交办的其他事项。\r\n\r\n任职要求：\r\n1.本科或以上应届生，2024届亦可；\r\n2.积极热忱、乐于与人接触、具强烈企图心与学习力，有志于业务营销与拓展者。\r\n3.具有较强的营销意识、风险意识、自律意识及市场开拓能力；\r\n4.确保职业规范的遵循和道德、合规行为。\r\n\r\n工作地点：\r\n广州天河', '', 8000, 10000, 3, '全职', NULL, 1, 557, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1577, '2025-04-08 15:23:46.734008', '2025-04-08 15:23:46.734008', NULL, '储备对公客户经理（东莞）', '岗位职责：\r\n1.开拓和维护企业客户，制定访客计划，撰写访客记录；\r\n2.提供法人顾客授信、国际贸易等产品与服务；\r\n3.协助资深客户经理维护顾客关系、征授信报告撰写及风险管理等。\r\n4.完成上级交办的其他事项。\r\n\r\n任职要求：\r\n1.本科或以上，2024年应届毕业生亦可；\r\n2.积极热忱、乐于与人接触、具强烈企图心与学习力，有志于业务营销与拓展者。\r\n3.具有较强的营销意识、风险意识、自律意识及市场开拓能力；\r\n4.确保职业规范的遵循和道德、合规行为。\r\n\r\n工作地点：\r\n 东莞东城/长安', '', 7000, 9000, 5, '全职', NULL, 1, 557, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1578, '2025-04-08 15:23:46.980207', '2025-04-08 15:23:46.980207', NULL, '台商储备对公客户经理（深圳）', '【岗位职责】             \r\n1.开拓和维护企业客户，制定访客计划，撰写访客记录；\r\n2.提供法人顾客授信、国际贸易等产品与服务；\r\n3.协助资深客户经理维护顾客关系、征授信报告撰写及风险管理等；\r\n4..完成上级交办的其他事项。\r\n               \r\n【任职要求】               \r\n1.本科或以上，2024年优秀应届毕业生亦可；\r\n2.积极热忱、乐于与人接触、具强烈企图心与学习力，有志于业务营销与拓展者；\r\n3.具有较强的营销意识、风险意识、自律意识及市场开拓能力；\r\n4.确保职业规范的遵循和道德、合规行为；\r\n5.可接受出差华东地区。\r\n \r\n【工作地点】深圳前海', '', 8000, 10000, 5, '全职', NULL, 1, 557, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440305', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1579, '2025-04-08 15:23:47.607678', '2025-04-08 15:23:47.607678', NULL, '培训生', '一、公司简介\r\n    中信证券华南股份有限公司是中信证券股份有限公司的全资子公司，注册资本为50.91亿元。\r\n    公司的前身是广州证券股份有限公司，于1988年设立，是全国最早成立的证券公司之一。2020年1月，公司并入中信证券股份有限公司，并更名为中信证券华南股份有限公司。\r\n    公司经营范围：证券经纪；证券投资咨询（仅限于证券投资顾问业务）；与证券交易、证券投资活动有关的财务顾问；证券承销与保荐；证券自营；证券资产管理；融资融券；证券投资基金代销；代销金融产品。代理企业财产保险，家庭财产保险，机动车辆保险，人寿保险，年金保险，健康保险，意外伤害保险。\r\n\r\n二、2025年分支机构校园招聘计划安排\r\n（一）招聘需求\r\n1.招聘机构：中信证券华南（广东）辖区分支机构\r\n2.工作地点：广州（市区、番禺、增城、花都、南沙），佛山（市区、顺德），东莞（市区、松山湖），惠州，中山（市区、小榄），珠海，汕头，江门，揭阳，潮州，肇庆，梅州，清远，湛江。\r\n\r\n（二）招聘对象\r\n      有志于从事证券行业、服务实体经济，面向2024年下半年至2025年上半年期间毕业的境内外本科及以上学历的应届毕业生（以学位证/教育部留学服务中心认证的毕业时间为准）。\r\n\r\n（三）岗位介绍\r\n1.岗位名称：培训生\r\n2.岗位职责：\r\n      专注进行证券投资相关的客户开发与服务、金融产品销售以及其他投融资和资本中介业务，为全球客户提供财富保值增值的全方位金融服务。\r\n3.任职要求：\r\n（1）本科及以上学历应届毕业生；\r\n（2）热爱证券行业，具备良好的人际交往能力，喜欢主动与他人建立联系并进行分享交流；能够系统快速地掌握新知识，并加以运用；乐于团队协作，善于运用多种方式以促成结果达成；追求卓越，自驱力强，面对目标坚持不懈；\r\n（3）具备良好的职业道德与专业素质，已通过证券、基金等从业资格考试优先。\r\n\r\n（四）招聘流程\r\n1.宣讲与网申\r\n候选人可登录中信证券股份有限公司官网，网申投递简历；或选择扫描二维码进入移动端进行快速投递。\r\n2.简历筛选\r\n中信证券华南公司根据应聘者综合背景与应聘岗位的匹配度进行初步筛选。\r\n3.在线测评与面试\r\n对于符合岗位任职基本要求的应聘者，需参加中信证券华南公司组织的在线测评与面试考察。\r\n4.实习考察\r\n通过甄选流程的应聘者，进入中信证券华南（广东）辖区分支机构内进行实习。\r\n5.发放录用通知\r\n\r\n（五）申请方式\r\n有意者请登陆中信证券招聘官网（http:// careers.citics.com）加入我们 - 选择“分支机构校园招聘-2025年校园招聘”- 选择“中信华南（广东）”作为第一志愿，进行在线申请。\r\n\r\n（六）申请注意事项\r\n1.推荐使用IE、Chrome、Firefox等浏览器登录进行网申。\r\n2.每位应聘者限投2个岗位，以本人有效身份证件号码（中国大陆居民必须使用身份证号码）为准，多投岗位无效。完成岗位应聘后，将无法更改应聘岗位，务必谨慎操作。岗位投递前注意区分招聘分支机构、工作地点和招聘岗位，慎重选择应聘岗位。\r\n3.我司会通过短信、电话、邮件等方式通知面试和实习安排，请确保您填写的手机号码准确并保持畅通状态，且手机号码必须是中国大陆的运营商（中国移动、中国联通、中国电信）；邮箱推荐使用163、126邮箱；不推荐使用edu后缀、gmail、QQ等邮箱，以免出现邮件通知退信或拦截的情况。\r\n4.应聘者应对申请资料信息的真实性负责，如与事实不符，我司有权取消其应聘资格。\r\n5.我司从未成立或委托成立任何考试中心、命题中心等机构或类似机构，从未编辑或出版过任何招聘考试参考资料，从未向任何机构提供过招聘考试相关的资料和信息。\r\n6.我司从未委托任何机构及个人以中介形式内部推荐全职工作，公司招聘官网为本次校园招聘简历接收的唯一官方渠道。\r\n7.中信证券股份有限公司对本次校园招聘享有最终解释权。\r\n\r\n联系方式：\r\n联系人：隋小姐\r\n联系邮箱：suijing@citics.com', '', 10000, 12000, 150, '全职', NULL, 1, 558, 6, NULL, NULL, NULL, NULL, NULL, 0, '440100', '440000', '440104', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1580, '2025-04-08 15:23:49.448429', '2025-04-08 15:23:49.448429', NULL, '区域总监', '需求专业：\r\n金融学/经济学/投资学\r\n岗位职责：\r\n1、根据公司经纪业务营销战略，结合营业部情况制定并实施营业部年度、季度、月度的市场开发目标、计划和活动方案；\r\n2、建立营业部市场营销相关制度及业务流程，拟订各项业务及创新产品推广的营销策划方案并负责组织实施，提高营业部客户开发能力；\r\n3、积极拓展渠道，进行同业和跨业的合作交流，做好核心客户、重要客户的开发和维护，完成客户开发目标；\r\n4、做好营销人员的招聘、培训、督导、考核、优化等相关工作，提高营销团队的专业素质和综合能力；\r\n岗位要求：\r\n1、本科以上学历，有金融学以及管理经验优先\r\n2、有相关团队管理经验者优先录用；\r\n3、已考取证券从业，基金从业资格；；\r\n4、有一定的组织能力和活动策划能力；\r\n5、具有开拓精神，具备正能量，能带领团队完成考核\r\n福利待遇：\r\n1.带薪年假，节假日福利补贴\r\n2.单位签订正式劳动合同，缴纳五险一金（社保一档）\r\n3.薪资结构：基本工资+绩效提成+产品销售奖+营业部方案奖励+节假日慰问金\r\n4.周末双休，国家法定假期休假\r\n5.完善的职业规划，让员工拥有不断上升的空间，优秀员工享有储备干部培养优先权。', '', 6000, 15000, 20, '全职', NULL, 1, 559, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1581, '2025-04-08 15:23:49.657622', '2025-04-08 15:23:49.657622', NULL, '理财顾问', '岗位职责:\r\n1、与区域内合作渠道对接，负责区域内客户开发与维护，发掘潜在客户\r\n2、通过互联网寻找合作平台，对接开户合作业务，跟踪维护合作平台\r\n3、向客户提供与证券经纪业务相关的咨询、业务、售后等其它服务；\r\n4、做好客户服务，跟进已开发客户以及公司存量客户，为客户提供咨询，处理客户后期的账户问题\r\n5、了解客户需求，根据实际情况为客户提供适当的投资资讯 \r\n岗位要求:\r\n1、本科及以上学历，有金融学或经济学相关专业优先；\r\n2、熟悉中国证券市场，有丰富的证券客户资源，熟悉证券渠道销售，有销售经验优先；\r\n3、具备较强的组织、协调管理能力，强烈的市场营销意识，有敢于挑战自我，挑战高薪的能力；\r\n4、具有良好的服务意识，能吃苦耐劳，团队协作能力强\r\n5、有进取心，能承担工作的压力。', '', 6000, 15000, 20, '全职', NULL, 1, 559, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440307', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1582, '2025-04-08 15:23:50.416141', '2025-04-08 15:23:50.416141', NULL, '高分子材料技术员', '一、岗位职责\r\n1、负责高分子材料的工艺/制程开发、实施和优化，确保高分子材料产品具有高性能、高可靠性、高稳定性等特点。\r\n2、负责高分子材料的研发工作，包括调研、配方、试制等，确保产品具有高性能、高可靠性、高稳定性等特点。\r\n3、参与高分子材料工艺的改进和优化，采用自动化生产线、设备等，提高生产效率，降低生产成本。\r\n4、对高分子材料的生产过程进行指导和监督，确保生产过程的安全性和稳定性。\r\n5、与其他部门的沟通，协助解决产品开发过程中的技术问题，确保产品质量和生产效率。\r\n6、定期汇报项目进展和产品质量情况，制定并执行技术改进计划。\r\n7、保持对行业技术的关注，了解高分子材料市场的动态，为公司提供技术支持。\r\n\r\n二、岗位要求\r\n1、本科以上学历，高分子材料、化学工程、材料科学与工程等相关专业，具备扎实的化学基础知识。\r\n2、熟悉高分子材料的制备工艺，具有较强的实验操作技能和较强的分析能力。\r\n3、熟悉高分子材料的质量控制方法和设备，具有较强的设备维护和保养能力。\r\n4、具备良好的沟通能力和团队合作精神，善于与其他部门的同事合作。', '', 6000, 12000, 3, '全职', NULL, 1, 560, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1583, '2025-04-08 15:23:50.720363', '2025-04-08 15:23:50.720363', NULL, '外贸销售业务', '一、岗位职责\r\n1、负责公司产品的销售和推广工作；\r\n2、开发新客户，维护老客户，与客户保持良好的沟通；\r\n3、收集市场信息，及时反馈市场动态；\r\n4、完成公司下达的销售任务。\r\n\r\n二、岗位要求\r\n1、学历背景：本科及以上学历，英语，市场营销等相关专业；\r\n2、工作经验：有销售经验者优先考虑；\r\n3、知识技能：具备良好的沟通技巧和谈判能力，能够与客户建立良好的关系；具备一定的市场敏感性和洞察力，能够及时把握市场动态；\r\n4、身体素质：身体健康，能够适应出差和加班；\r\n5、工作态度：认真负责，勤奋努力，有良好的团队合作精神和服务意识；\r\n6、计算机能力：熟练使用办公软件；\r\n7、 具备良好的沟通能力，能够有效地向客户介绍公司的优势和产品特点；\r\n8、具备较强的谈判能力，能够与供应商和客户进行有效的沟通和协商，达成合作；\r\n9、具备较强的市场开拓能力，能够独立开展销售工作，并不断扩大市场份额；\r\n10 、具备较强的客户服务能力，能够及时响应客户的需求和问题，并提供有效的解决方案；\r\n11、具备一定的数据分析能力，能够通过数据分析和市场调查，及时把握市场动态，为销售决策提供依据；\r\n12、遵守公司规章制度，严格遵守职业道德规范；\r\n13、具备基本的英语听说读写能力，能够与外商进行基本的沟通；\r\n14、具备一定的财务知识，能够处理基本的财务事务。', '', 8000, 10000, 3, '全职', NULL, 1, 560, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1584, '2025-04-08 15:23:51.086732', '2025-04-08 15:23:51.086732', NULL, '储备干部', '一、岗位职责\r\n1、负责公司生产线的整体规划、组织、协调和控制，确保生产过程的顺利进行。负责制定和实施生产计划，合理分配生产任务，合理使用生产资源，确保生产目标的达成。负责现场管理和安全生产，协调各部门之间的工作，保证生产效率和产品质量。\r\n2、制定并实施生产计划，合理分配生产任务，确保生产目标的达成。\r\n3、负责现场管理和安全生产，协调各部门之间的工作，保证生产效率和产品质量。\r\n4、制定并完善生产流程，优化生产布局，提高生产效率。\r\n5、负责生产设备的维护和保养，确保设备的正常运行。\r\n6、制定并执行培训计划，提高员工的业务能力和技术水平。\r\n7、制定并执行生产数据和质量控制计划，确保产品质量。\r\n8、制定并执行员工绩效考核计划，提高员工的绩效。\r\n9、与其他部门的负责人协调，确保生产计划的顺利实施。\r\n\r\n二、岗位要求\r\n1、本科以上学历，工业自动化或机械工程专业，管理学背景。\r\n2、熟悉生产流程和生产管理理论知识。\r\n3、具有较强的组织、协调、控制和沟通能力，具备良好的团队合作精神。\r\n4、具有丰富的现场管理经验，能熟练使用生产数据分析工具进行数据分析。', '', 4500, 9000, 3, '全职', NULL, 1, 560, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1585, '2025-04-08 15:23:51.924746', '2025-04-08 15:23:51.924746', NULL, '设备技术员', '一、岗位职责\r\n1、负责生产过程中的各种机械设备的维护、保养和调试工作，确保生产线的顺利运转。\r\n2、负责对生产线上使用的机械设备进行日常的维护和保养，包括润滑、紧固、调整和清洁等。\r\n3、根据生产计划，定期对生产设备进行检修和调试，以确保设备处于良好的运行状态，并能够满足生产需要。\r\n4、负责制定并执行设备维护计划，并跟踪维护记录。\r\n5、负责对生产线上新购置的机械设备进行验收，并协助相关部门进行设备安装调试。\r\n6、参与生产线的风险评估，并提出相应的改进措施，以确保生产过程的安全性和可靠性。\r\n7、协助其他部门解决生产过程中的技术问题，提供技术支持。\r\n\r\n二、岗位要求\r\n1、具有相关领域的技术知识。\r\n2、熟悉各种机械设备的操作和维护方法，具备一定的机械原理知识。\r\n3、具备良好的沟通协调能力，能够与生产线上的其他部门有效地合作。\r\n4、具备一定的计划能力，能够维护并落实生产计划。\r\n\r\n三：岗位优势\r\n1.机械自动化设备操作\r\n2.完善的职业晋升通道\r\n3.师傅一对一培养，手把手教会', '', 6000, 8000, 5, '全职', NULL, 1, 560, NULL, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1586, '2025-04-08 15:23:52.294514', '2025-04-08 15:23:52.294514', NULL, '外贸销售助理', '一、岗位职责\r\n1、负责协助销售工程师完成公司产品的销售工作，包括市场调研、客户沟通、销售合同处理、订单管理等工作。\r\n2、负责公司产品的市场调研，收集并分析市场信息，为销售提供支持。\r\n3、协助销售工程师进行客户沟通，了解客户需求，提供产品信息，达成销售合同。\r\n4、负责销售合同的跟踪和管理，确保合同履行无误。\r\n5、协助销售工程师处理订单，包括订单确认、发货、客户满意度调查等。\r\n6、负责销售系统的维护和升级，及时跟进销售进展，提供数据支持。\r\n7、协助销售团队进行项目推进和跟踪，提高销售业绩。\r\n\r\n二、岗位要求\r\n1、本科以上学历，国际贸易专业或有相关工作经验。\r\n2、熟悉外贸业务流程，具有较强的英语听、说、读、写能力。\r\n3、具备良好的沟通技巧和团队合作能力，具备较强的责任心。', '', 5000, 8000, 3, '全职', NULL, 1, 560, NULL, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440304', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1587, '2025-04-08 15:23:52.853017', '2025-04-08 15:23:52.853017', NULL, '智能营销顾问', '岗位内容：\r\n1、通过电话、陌生拜访、新媒体等渠道寻找潜在客户，邀约并拜访客户。\r\n2、与客户面谈，现场提供专业的产品演示和解决方案，完成销售（当你还不能独立面谈的时候，经理会手\r\n把手带着你并演示给你看如何和客户面谈）。\r\n3、对老客户进行定期维护，及时了解客户需求，把握客户心理，实现销售机会到销售产能的最大转化。\r\n任职资格：\r\n1、本科及以上学历，不限专业，对互联网营销感兴趣者优先。\r\n2、接受无经验小白，公司有完整培训体系赋能。\r\n3、气质亲和，具有较强的沟通能力、良好的服务意识。\r\n4、具有换位思考能力，认可长期主义，具有较强的团队合作意识。\r\n5、具有拼搏进取的精神，热爱销售，有一定的抗压能力。', '', 7500, 15000, 20, '全职', NULL, 1, 561, 6, NULL, NULL, NULL, NULL, NULL, 1, '440100', '440000', '440106', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1588, '2025-04-08 15:23:53.105273', '2025-04-08 15:23:53.105273', NULL, '实习智能营销顾问', '工作内容：\r\n1、通过电话、陌生拜访、新媒体等渠道寻找潜在客户，邀约并拜访客户。\r\n2、与客户面谈，现场提供专业的产品演示和解决方案，完成销售（当你还不能独立面谈的时候，经理会手\r\n把手带着你并演示给你看如何和客户面谈）。\r\n3、对老客户进行定期维护，及时了解客户需求，把握客户心理，实现销售机会到销售产能的最大转化。\r\n任职资格：\r\n1、本科及以上学历，不限专业，对互联网营销感兴趣者优先。\r\n2、接受无经验小白，公司有完整培训体系赋能。\r\n3、气质亲和，具有较强的沟通能力、良好的服务意识。\r\n4、具有换位思考能力，认可长期主义，具有较强的团队合作意识。\r\n5、具有拼搏进取的精神，热爱销售，有一定的抗压能力。', '', 7500, 15000, 20, '全职', NULL, 1, 561, 6, NULL, NULL, NULL, NULL, NULL, 0, '440300', '440000', '440309', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1589, '2025-04-08 15:23:53.888286', '2025-04-08 15:23:53.888286', NULL, '业务员', '1、性别不限，本科或以上学历，意愿从业销售方面的工作；\r\n2、具良好的市场开拓和客户维系能力， 纸张、印刷、包装相关销售业务经验者更佳；\r\n3、注重形象，善与人沟通，人品端正，自信阳光，富有挑战精神；\r\n4、优秀的市场营销\\造纸\\工商管理\\印刷包装类应届毕业生可培训发展。\r\n5、工作地址可选择东莞、广州、深圳、惠州、佛山、江门、中山等地区。', '', 5000, 15000, 10, '全职', NULL, 1, 562, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1590, '2025-04-08 15:23:54.555258', '2025-04-08 15:23:54.555258', NULL, '储备项目PM', '岗位职责：\r\n1、本岗位为项目PM的储备岗位，需经历基层品质岗位、生管/订单中心/工程岗、实习PM岗位的历练后，并最终转为正式的项目PM。\r\n2、公司提供完善的培养计划，按照公司计划参加各个阶段的培养，并进行个人总结和历练汇报，展示个人培养阶段对专业知识和技能的掌握情况\r\n3、项目PM的岗位职责：\r\n①业务项目规划与管理：制定业务各阶段项目计划，明确项目目标、范围、时间表，监控项目进度。\r\n②客户关系管理：负责客户接待与服务，收集客户需求和意见，协调内外部相关部门解决客户需求，为客户提供优质的体验，提升客户满意度；同时，处理好客户的投诉和问题，促进后续服\r\n务的改进和提升；\r\n③风险管理：识别业务项目中的潜在风险，评估其影响程度和可能性，协助并反馈制定应对策略。\r\n④质量管理：协助拉通项目质量品质标准和要求，确保项目成果符合质量标准。\r\n⑤效率管理：确保客户交期达成，跟踪监管整个项目的交付达成。\r\n⑥业务项目收尾与总结：进行业务项目总结和评估，分析项目成功因素和改进空间，为未来的项目提供参考和借鉴。\r\n岗位要求：\r\n1、本科学历，特别优秀者放宽到大专；\r\n2、具备待人接物的技巧，掌握基本的商务接待礼仪，气质形象佳；\r\n3、性格外向，反应敏捷，沟通表达能力强、观察能力强，有亲和力；\r\n4、具备较强的抗压能力和冲突处理能力，能够及时有效化解各种冲突。', '', 6000, 8000, 3, '全职', NULL, 1, 563, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1591, '2025-04-08 15:23:55.019999', '2025-04-08 15:23:55.019999', NULL, '  储备工程师（产品/制工编程/DQE/PE/夹具）', '本岗位储备工程师岗位，具体分为三个方向一编程、DQE、夹具，请投递时务必备注清楚投递的方向。\r\n岗位职责：\r\n1、本岗位作为工程师（编程/DQE/夹具等方向）的储备，需经历基层岗位、技术相关岗位、助理工程师岗位的历练后，并最终转为正式工程师。\r\n2、公司提供完善的培养计划，按照公司计划参加各个阶段的培养，并进行个人总结和历练汇报，\r\n展示个人培养阶段对专业知识和技能的掌握情况。\r\n3、各个方向的具体职责如下：\r\n①编程工程师主要负责产品加工程序的设计与编写、优化，指导调试、协助解决技术问题，推动相关质量问题改善等；必要时协助对客户需求进行沟通和技术支持，提供加工技术和解决方案，满足客户需求。\r\n②DQE工程师主要负责新项目开发产品标准建立及品质管控流程建立、实施、点检、问题优化与反馈，开展制程能力分析与品质总结及异常结案。\r\n③夹具工程师主要负责新产品开发夹具方案设计、工艺评估、标准制定、夹具成本控制、夹具组装、自动化夹具设计与效益评估、辅助治具设计等。\r\n岗位要求：\r\n1、专业要求：数控编程专业（校内参加过代加工实操的优先考虑）、机械/材料类专业、模具/自动化专业等，每个专业侧重方向不同，对应的储备方向不同。\r\n2、技能要求：编程方向/夹具方向—熟练掌握CAD/CAM/UG软件，如AutoCAD、SolidWorks、Mastercam/UG等；DQE工程师熟悉CAD软件，能看懂相应图纸，了解IS09001/IATF16949质量体系、熟悉ROHS/REACH等基础知识。\r\n3、素质素养：专业技术扎实，抗压能力比较强，有较强的语言表达能力、分析能力和报告书写能力。身体健康，能吃苦耐劳，能够为公司长期服务，与公司共同发展。', '', 6000, 8000, 20, '全职', NULL, 1, 563, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1592, '2025-04-08 15:23:55.854326', '2025-04-08 15:23:55.854326', NULL, '理财顾问', '岗位职责：\r\n1、利用公司提供客户资源进行营销，向客户推广产品和服务，为客户提供良好的舒服体验，以促成客户重复消费；\r\n2、维护客户关系，掌握客户需求，提供良好售前服务和售后跟踪。\r\n\r\n任职要求：\r\n1、普通话标准，口齿清楚，优秀的语言表达能力和沟通能力；\r\n2、能吃苦耐劳，工作认真仔细，有责任心，有高端客户服务经验者优先；\r\n3、熟练使用常用办公软件；\r\n4、良好的职业道德，高度的工作主动性和责任感；\r\n5、善于沟通，有良好的团队精神及强烈的销售创富欲望。', '', 5000, 10000, 10, '全职', NULL, 1, 564, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1593, '2025-04-08 15:23:56.429149', '2025-04-08 15:23:56.429149', NULL, '外贸业务员 (90后年轻化团队+管理)', '公司简况：\r\n 1. 以玉石为主的工艺品+美妆个护产品+首饰品\r\n 2. 成交容易，询盘多，订单量大，涉及行业广，利润高20%-100%的产品都有\r\n 3. 多个批发和零售网站均有涉及且成熟，客户资源丰富\r\n 4. 公司业务员有两小时成交的案例\r\n 5. 接受没有经验的应届生，公司提供专业入职培训+师徒制\r\n 6. 90后年轻化团队+管理，每年安排升职加薪的机会\r\n 7. 提倡良性竞争和快乐工作的氛围，杜绝抢客户等不良风气\r\n 8. 入职两年以上公司支持内部创业\r\n\r\n\r\n岗位介绍：\r\n外贸业务员 - 接受应届生实习但不接受还需返校上课的实习生\r\n入职薪资4K-10K+浮动提成+全勤奖+产品奖+首单奖+目标奖(奖金+带薪假期)\r\n社保+年终奖+工龄奖+感恩金+带薪年假\r\n职责：\r\n 1. 负责销售及推广公司产品，及时跟进和维护客户需求\r\n 2. 负责进行订单的洽谈和签约，跟踪客户订单的具体落实和出货及售后\r\n 3. 相关资料的整理和归档及汇报\r\n 4. 完成上级交代的其他工作\r\n\r\n\r\n岗位要求：\r\n 1. 大专及以上学历，英语四级\r\n 2. 熟悉计算机操作及基本的office办公软件\r\n 3. 有强烈赚钱的欲望，积极向上，好学\r\n 4. 有志于电子商务外贸行业，意向销售这个职业愿意共同成长\r\n\r\n\r\n福利待遇：\r\n 1. 工作时间1天8小时，包住(宾馆式拎包入住)\r\n 2. 办公写字楼，卫生好及环境舒适\r\n 3. 完善的晋升机制 (业务员-业务精英-外贸主管-外贸经理-公司内部创业)\r\n 4. 每月意外下午茶，公司设有茶几、咖啡机、冰箱、微波炉\r\n 5. 团队活动聚餐、团建、年会、员工旅游、过节礼等 \r\n 6. 隔壁就是大型商场，生活配套设施齐全(购物、美食、娱乐)，满足日常生活的需求!\r\n 7. 镇区内有火车站、城轨且临近东莞南高铁站，方便快捷到达广深、惠州等地!\r\n\r\n\r\n联系方式：\r\n联系人: 赖小姐13543713806 或 李小姐18458016736\r\n联系邮箱: 782783791@qq.com\r\n工作地址: 东莞市樟木头镇长虹大厦办公楼\r\n网站: http://hzcrafts.en.alibaba.com\r\n         www.hzmassagetool.com\r\n         http://www.hydiygifts.com\r\n         https://dgifts.en.alibaba.com/\r\n         https://huiyinggifts.en.alibaba.com/', '', 5000, 10000, 5, '全职', NULL, 1, 565, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1594, '2025-04-08 15:23:57.229075', '2025-04-08 15:23:57.229585', NULL, '烘焙/面点师', '⭕ 定岗及晋升方向：店长、主播、后厨、客服、服务员（学徒期一个月后，结合实际情况及个人意愿定岗）⭕ 岗位职责：1、学习技艺：深入实践即食甜品、食养滋补品、手工养生食疗等产品制作，包括原料选择、配比、加工流程等，确保产品质量与口感。2、食品安全：严格执行食品安全标准，保证出品质量与时间。3、定岗后各岗位主要工作职责：➡ 店长：负责门店运营管理、顾客关系维护等。➡ 主播：负责直播策划、产品介绍、社交媒体运营等。➡ 后厨：负责产品制作、质量控制、原材料管理、创新研发等。➡ 客服：负责顾客咨询、售后服务等。➡ 服务员：负责顾客接待、店铺环境维护等。\r\n⭕岗位要求：1、接受无经验，有工作经验优先。2、刻苦耐劳讲求效率，有团队合作意识。3、服从上级安排，团结同事，相互帮忙。', '', 4000, 5000, 12, '全职', NULL, 1, 566, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1595, '2025-04-08 15:23:57.535613', '2025-04-08 15:23:57.535613', NULL, '储备店长', '⭕岗位职责：1、协助产品制作：在资深烘焙师的指导下，参与并学习面包等烘焙产品的制作过程，通过实践操作和理论学习不断提高自己的烘焙技艺。2、了解门店运营管理：快速学习有关烘焙店或连锁店的运营管理知识，如生产计划、质量控制、库存管理等方面的内容。3、保持工作环境整洁：确保工作区域的清洁卫生，维护良好的工作环境，保证食品安全标准。4、提供优质客户服务：与顾客互动，提供高质量的服务体验，处理顾客的问题和反馈。5、参与员工培训和发展：帮助新员工适应工作环境，分享自己的经验和技能，支持团队的成长和发展。6、配合其他工作任务：服从上级领导的工作安排，完成临时交给的任务或其他相关的管理工作。严格遵守公司的各项规定，包括安全规范、卫生要求等。\r\n⭕任职要求：1、大专以上学历女生，有经验者和食品科学与工程、烹饪工艺与营养等相关专业可优先考虑。2、主动性强，吃苦耐劳，具有良好的服务意识和服务能力；心态积极，愿意在终端沉淀学习。3、具备优秀的沟通能力和团队合作精神，热爱烘培，甜品手工制作，能够有效协作，完成烘焙产品制作、创新及改进。', '', 5000, 8000, 3, '全职', NULL, 1, 566, NULL, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1596, '2025-04-08 15:23:57.818497', '2025-04-08 15:23:57.819482', NULL, '业务助理', '◆ ◆ 岗位职责1、协助业务与客户之间的日常工作沟通和信息传递；2、订单处理，制定报价，跟踪生产交期；3、对于产品售后问题，及时地向相关部门反映，以得到更好的落实和改进；4、完成上级交付的其他工作任务。\r\n◆ ◆ 任职要求1、学历、专业不限，至少有1年以上销售跟单经验；2、工作积极，认真细心，责任心强；3、能熟练运用office办公软件；4、有良好的客户服务意识；5、对数字敏感，有一定逻辑思维能力。', '', 5000, 8000, 6, '全职', NULL, 1, 566, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1597, '2025-04-08 15:23:58.178003', '2025-04-08 15:23:58.178003', NULL, '管培生（业务拓展 业务跟单 生产跟单）', '【发展方向】\r\n业务拓展 业务跟单 生产跟单\r\n【岗位职责】\r\n1、市场调研与分析；\r\n2、业务跟单与流程管理；\r\n3、团队协作与跨部门沟通；\r\n4、数据分析与持续优化；\r\n5、文件归档与整理；\r\n6、产品知识学习。\r\n【岗位要求】\r\n1、2025年应届毕业生，专业不限；\r\n2、工作细心，责任心强，有上进心和学习力；\r\n3、具备良好的沟通能力和协调能力；\r\n4、具备良好的团队合作精神和服务意识；\r\n5、持续学习，愿意接受轮岗安排。', '', 4500, 5000, 10, '全职', NULL, 1, 566, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1598, '2025-04-08 15:23:58.830320', '2025-04-08 15:23:58.830320', NULL, '品检员 （电控技术员）', '任职要求：\r\n1、男女不限，大专以上学历，18-45岁以下；\r\n2、做事原则性强，细心有耐心，责任心强；有良好的沟通协调能力，有敬业精神、团队意识和创新精神；\r\n3、能熟悉使用测量工具（如卷尺、卡尺、千分尺）；能看懂钣金图纸优先。\r\n岗位职责：\r\n1、负责委外加工板材、烤漆等部分检查（测量及数据记录）；\r\n2、行使检验职责，填写相应的检验记录表单；\r\n3、对检验中发生的问题进行处理过程跟踪；\r\n4、完成领导交办的临时任务。（无经验者、应届毕业生亦可）', '', 4000, 6000, 3, '全职', NULL, 1, 567, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1599, '2025-04-08 15:23:59.336187', '2025-04-08 15:23:59.336187', NULL, '售后工程师', '任职要求：\r\n1、大专以上学历，机械设计制造及自动化专业、或机电一体化专业、电子专业,制冷专业等； 爱学习，动手能力强。\r\n岗位职责:\r\n1、负责我司销售设备的售后服务工作。（入职后在厂内培训3到6个月） \r\n (入职1年后综合收入7000～10000元/月)', '', 6000, 6000, 3, '全职', NULL, 1, 567, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1600, '2025-04-08 15:23:59.772251', '2025-04-08 15:23:59.772251', NULL, '仓库主管（储备干部）', '任职要求：\r\n1、	男，18-35岁，大专及以上学历；\r\n2、	熟练操作办公软件，熟悉5S/IS09001等质量认证管理体系;\r\n3、2年以上制造业仓库管理工作经验；\r\n4、熟悉仓库运作流程，5S知识:\r\n5、具有一定的领导能力、判断与决策能力、人际沟通能力和计划能力\r\n岗位职责：\r\n1、	负责仓库日常物流管理工作；\r\n2、监督检查仓库管理员对仓库物资的安全管理与库存管理；\r\n3、监督检查并指导各仓库管理摆放与5S执行情况；\r\n4、负责各仓库工程作业指导书的建立与下属的培训；\r\n5、负责仓库各种日常异常状况的及时处理；\r\n6、	负责对帐、卡、物的一致性进行抽查并记录;\r\n7、负责组织仓库月底/年底等盘点工作，并与财务核对账物卡的准确性。', '', 4000, 6000, 1, '全职', NULL, 1, 567, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1601, '2025-04-08 15:23:59.937913', '2025-04-08 15:23:59.937913', NULL, '业务员', '主要职责：\r\n1. 销售与推广公司产品。\r\n2. 建立维护客户关系，提供咨询服务。\r\n3. 完成销售目标，报告进度。\r\n4. 参与销售策略和市场计划制定。\r\n5. 确保客户满意度。\r\n\r\n应聘条件：\r\n1. 本科及以上学历，市场营销、商务管理专业优先。\r\n2. 二年以上制造业销售经验，丰富客户资源者优先。\r\n3. 独立处理复杂客户问题的能力。\r\n4. 抗压能力，自我激励，目标导向。\r\n5. 良好的团队合作精神。\r\n6. 市场分析能力。\r\n我们提供：\r\n1. 竞争力薪酬和业绩奖金。\r\n2. 培训和职业发展机会。\r\n3. 舒适工作环境。\r\n4. 其他福利。', '', 4000, 10000, 1, '全职', NULL, 1, 567, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1602, '2025-04-08 15:24:00.153408', '2025-04-08 15:24:00.153408', NULL, '电气工程师', '任职要求：1、大专以上学历、电子、电气或相关专业；2、具有1年以上电气自动化工作经验或优秀应届毕业生；3、熟练使用CAD绘图软件；\r\n岗位职责：1、配合产品开发或产品改进，按时完成电气设计任务，并保证质量；2、按要求完成各项目电气设计中的辅助工作，包括电路图和PLC程序优化；3、现场电气控制柜的安装及按图纸完成电路布控及线路连接配线；4、配合进行所设计的电路/传感器，线路输入/输出型号的检验；', '', 5000, 6000, 1, '全职', NULL, 1, 567, NULL, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1603, '2025-04-08 15:24:00.923539', '2025-04-08 15:24:00.923539', NULL, '嵌入式开发工程师', '1、负责公司测量板、运动控制卡等电路板的设计开发；\r\n2、负责功能模块代码的编写及调试；\r\n3、负责编写相关的技术文档', '', 7000, 10000, 3, '全职', NULL, 1, 568, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
