INSERT INTO `post` VALUES (1606, '2025-04-08 15:24:03.145717', '2025-04-08 15:24:03.145717', NULL, '普通经纪人', '岗位职责: \r\n1、完成公司授权内的各项客户招揽与客户服务工作；\r\n2、按照公司日常管理要求开展工作；\r\n3、参加并完成公司执业前培训、后续职业培训、在岗培训等；\r\n4、按照公司要求开展其他工作。\r\n\r\n应聘要求：\r\n1、通过证券从业人员资格考试者优先；\r\n2、学历原则上本科以上；\r\n3、身体健康，品行端正；\r\n4、表达能力和学习能力较强；\r\n5、认同招商证券文化与价值观，具有较强的风险合规意识；\r\n6、无不良从业记录、无违法犯罪记录，未持有证券监管机关禁止持有的证券资产；\r\n7、未同时与其他用人单位建立劳动关系或同时接受其他证券公司、银行、基金公司等金融证券机构或个人委托从事证券营销活动，或其他与公司要求的工作内容相同、相近的活动；\r\n8、具备能够按期保质完成公司授权的相关工作或公司下达的工作任务的能力；\r\n9、其他法律法规及公司规定的录用条件。\r\n\r\n岗位待遇：\r\n交通津贴+绩效津贴+补贴+交易提成+各类奖励+培训机会+晋级机会', '', 2000, 7000, 3, '全职', NULL, 1, 569, 6, NULL, NULL, NULL, NULL, NULL, 2, '441900', '440000', NULL, NULL, 4, NULL, 0);
