INSERT INTO `post` VALUES (1615, '2025-04-08 15:24:06.742485', '2025-04-08 15:24:06.742485', NULL, '教学岗', '1. 学历背景：不限专业，教育相关专业优先；\r\n2. 逻辑清晰，表达有条理，带领学生快速掌握知识要领，熟悉掌握相关学科的知识要点；\r\n3. 善于沟通：能够从学生和家长的角度思考问题，善于用不同的方式与家长和学生进行沟通；\r\n4. 抗压力强：可合理规划时间处理多项任务，心态积极，全力达成目标；\r\n5. 团队合作：与团队成员密切配合，共同打造品牌影响力。\r\n6.热爱教育，亲和力强。', '', 6000, 12000, 10, '全职', NULL, 1, 572, 6, NULL, NULL, NULL, NULL, NULL, 4, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1616, '2025-04-08 15:24:07.362476', '2025-04-08 15:24:07.362476', NULL, '理财顾问', '理财顾问\r\n 岗位职责：\r\n1、负责客户开发与渠道维护；金融产品销售； \r\n2、向客户提供投资咨询、大类资产配置、理财规划等在内的金融综合营销服务；\r\n3、处理客户投诉、反洗钱、适当性管理、投资者教育等基础性工作；\r\n4、分支机构安排的其他工作；\r\n5、有基金证券从业资格优先。', '', 3500, 20000, 10, '全职', NULL, 1, 573, 6, NULL, NULL, NULL, NULL, NULL, 2, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1617, '2025-04-08 15:24:07.971855', '2025-04-08 15:24:07.971855', NULL, '外贸业务员', '招聘岗位：外贸业务员（应届毕业生）\r\n招聘人数：若干\r\n工作地点：东莞市\r\n\r\n岗位职责：\r\n\r\n负责公司跨境电商平台（如Amazon、AliExpress、Shopee等）的日常运营及维护，包括产品上架、优化、推广等；\r\n\r\n协助处理国际客户的订单，跟进订单进度，确保订单顺利完成；\r\n\r\n与客户保持良好沟通，及时回复客户咨询，解决售后问题，提升客户满意度；\r\n\r\n收集市场信息，分析行业动态及竞争对手情况，协助制定销售策略；\r\n\r\n协助团队完成销售目标，参与公司产品的国际市场推广活动；\r\n\r\n完成上级交办的其他相关工作。\r\n\r\n任职要求：\r\n\r\n应届毕业生，本科及以上学历，国际贸易、商务英语、电子商务、市场营销等相关专业优先；\r\n\r\n英语四级及以上，具备良好的英语听说读写能力，能与国外客户流畅沟通；\r\n\r\n对跨境电商行业有浓厚兴趣，愿意在外贸领域长期发展；\r\n\r\n具备较强的学习能力、沟通能力和团队协作精神；\r\n\r\n熟练使用办公软件（如Word、Excel、PPT等），有跨境电商平台操作经验者优先；\r\n\r\n工作认真负责，抗压能力强，能适应快节奏的工作环境。\r\n\r\n我们提供：\r\n\r\n中餐＋晚餐 ，一周工作时间5.5天制 ，工作时间：早上8点到下午5：20，中午休息1.5个小时  。节假日随法定假期\r\n\r\n具有竞争力的薪资待遇：底薪+提成+绩效奖金，月薪范围：4K-10K（具体面议）；\r\n\r\n完善的培训体系：公司为应届毕业生提供系统的跨境电商及外贸业务培训，帮助快速成长；\r\n\r\n广阔的发展空间：公司处于快速发展阶段，为员工提供清晰的职业晋升通道；\r\n\r\n丰富的员工福利：五险一金、带薪年假、节日福利、定期团建等；\r\n\r\n舒适的工作环境：现代化办公场所，轻松愉快的团队氛围。\r\n\r\n\r\n—— 东莞市鑫瑞内衣有限公司 国际部人力资源部', '', 4500, 12000, 10, '全职', NULL, 1, 574, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1618, '2025-04-08 15:24:08.176564', '2025-04-08 15:24:08.176564', NULL, '跨境电商运营', '招聘岗位：跨境电商运营专员（应届毕业生）\r\n招聘人数：若干\r\n工作地点：东莞市\r\n\r\n岗位职责：\r\n\r\n负责公司跨境电商平台（如Amazon、AliExpress、Shopee等）的日常运营，包括产品上架、优化、推广及数据分析；\r\n\r\n协助制定并执行跨境电商平台的营销策略，提升产品曝光率和销售额；\r\n\r\n跟踪平台政策变化，及时调整运营策略，确保店铺合规运营；\r\n\r\n分析市场趋势和竞争对手动态，提出优化建议；\r\n\r\n协助处理客户咨询及售后问题，提升客户满意度；\r\n\r\n完成上级交办的其他相关工作。\r\n\r\n任职要求：\r\n\r\n应届毕业生，本科及以上学历，电子商务、国际贸易、市场营销、商务英语等相关专业优先；\r\n\r\n对跨境电商行业有浓厚兴趣，愿意长期发展；\r\n\r\n英语四级及以上，具备良好的英语读写能力，能熟练处理英文邮件及平台文案；\r\n\r\n具备较强的学习能力、逻辑思维能力和团队协作精神；\r\n\r\n熟练使用办公软件（如Word、Excel、PPT等），有数据分析能力者优先；\r\n\r\n工作认真负责，抗压能力强，能适应快节奏的工作环境。\r\n\r\n我们提供：\r\n\r\n中餐＋晚餐 ，一周工作时间5.5天制 ，工作时间：早上8点到下午5：20，中午休息1.5个小时 。节假日随法定假期\r\n\r\n一对一培训：公司将为每位新人提供一对一专属培训，由经验丰富的运营经理亲自指导，帮助你快速掌握跨境电商运营技能；\r\n\r\n具有竞争力的薪资待遇：底薪+提成+绩效奖金，月薪范围：4K-10K（具体面议）；\r\n\r\n广阔的发展空间：公司处于快速发展阶段，为员工提供清晰的职业晋升通道；\r\n\r\n丰富的员工福利：五险、带薪年假、节日福利、定期团建等；\r\n\r\n舒适的工作环境：现代化办公场所，轻松愉快的团队氛围。', '', 5000, 15000, 10, '全职', NULL, 1, 574, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1619, '2025-04-08 15:24:08.852256', '2025-04-08 15:24:08.852256', NULL, '消防员', '负责环保、应急管理局、市场监督管理局资料上报或系统填报;负责环境安全类文件起草;负责日常消防检点和巡查,防止和消除火灾隐患,做好相关记录;负责动火、局限空间、高处等t特殊作业许可管理,监督落实执行; 定期维护和充装、更换消防设备器材;负责员工的消防安全培训;完成上级交办的其他相关工作。', '', 5000, 5500, 1, '全职', NULL, 1, 575, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1620, '2025-04-08 15:24:09.701732', '2025-04-08 15:24:09.702364', NULL, '销售代表', '1.通过各种渠道（如展会、B2B平台、社交媒体等）寻找潜在客户。\r\n2.与现有客户保持良好关系，定期拜访客户，了解客户需求。\r\n3.向客户介绍公司产品和服务，解答客户的疑问，制定并执行销售计划，达成销售目标。\r\n4.参与销售谈判，签订销售合同，接收并处理客户的订单，确保订单信息准确无误。\r\n5.协调生产、采购、物流等部门，确保按时交货。\r\n6.参加公司组织的产品培训和技术培训，不断提高自身的专业知识和技能，学习最新的销售技巧和市场趋势，提升个人销售能力。\r\n7.维护客户关系，处理客户的投诉和建议，提高客户满意度。\r\n任职要求:\r\n教育背景：本科以上学历，机械、自动化、市场营销、电气工程及相关专业。\r\n语言能力：良好的沟通能力，能够清晰地表达销售信息，英语/日语/德语或其他语种听说读写流利者优先，特别是对于国际市场的销售。\r\n其他要求：性格外向、善于与人沟通、能接受全国各地出差。', '', 5000, 8000, 5, '全职', NULL, 1, 576, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1621, '2025-04-08 15:24:10.095343', '2025-04-08 15:24:10.095343', NULL, '助理机械工程师', '岗位职责\r\n1、协助机械工程师按客户要求进行设备开发、设计、改进与完善；\r\n2、协助机械工程师负责跟进项目的加工图纸、装配图的制作；\r\n3、负责零件加工跟进；\r\n4、与电气设计人员共同配合完成整机的设计工作。\r\n\r\n任职资格\r\n1、机械制造专业、自动化等相关专业，本科及以上学历；\r\n2、熟悉机械原理，机械基础知识扎实；\r\n3、精通计算机辅助设计；熟悉CAD、Solidworks或其他三维软件设计；\r\n4、工作认真负责，严谨细致，有良好的创新精神和团队精神；', '', 5000, 8000, 10, '全职', NULL, 1, 576, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1622, '2025-04-08 15:24:10.396437', '2025-04-08 15:24:10.396437', NULL, '外贸销售助理', '1.通过各种渠道（如展会、B2B平台、社交媒体等）寻找潜在客户。\r\n2.参与制定并执行市场开发计划，扩大市场份额。\r\n3.跟踪市场动态，了解客户需求，提供有针对性的产品和服务。\r\n4.通过电子邮件、电话或线上会议等形式与国外客户保持日常联系，必要时约国外客户进行面对面沟通交流。\r\n5.熟悉国际贸易流程及相关法律法规，接收并处理客户的订单，确保订单如期交付。\r\n6.具备一定的数据分析能力，能够进行市场调研和分析，收集并分析销售数据，编制销售报告。\r\n7.维护客户关系，处理客户的投诉和建议，提高客户满意度。\r\n任职要求:\r\n教育背景：本科以上学历，机械、自动化、市场营销、商务英语、国际经济与贸易，电子商务及相关专业。\r\n语言能力：英语听说读写流利，具备良好的商务英语沟通能力，掌握第二外语优先录用。\r\n其他要求：男女不限、性格外向、善于与人沟通、能接受全球各地出差，有意愿向外贸销售岗发展者。', '', 5000, 8000, 5, '全职', NULL, 1, 576, 6, NULL, NULL, NULL, NULL, NULL, 3, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1623, '2025-04-08 15:24:10.716244', '2025-04-08 15:24:10.717254', NULL, '商务助理', '1.协助销售团队与按客户保持密切联系，确保信息及时传达和跟进处理。\r\n2.跟进国内客户的询价、报价、订单等信息，确保订单信息准确无误。\r\n3.准备和审核各类商务合同，确保合同条款符合公司政策和法律法规，管理合同文件，确保所有文件归档有序。\r\n4.协助销售团队进行商务接待和客户拜访、产品演示和商务谈判，跟踪销售进度，准备销售报告。\r\n5.协助处理订单售前、售中、售后相关销售过程中的一切事宜。\r\n6.具备一定的数据分析能力，能够进行市场调研和分析，收集并分析销售数据，编制销售报告。\r\n7.维护客户关系，处理客户的投诉和建议，提高客户满意度。\r\n任职要求:\r\n教育背景：本科以上学历，机械、自动化、市场营销、商务英语、国际经济与贸易，电子商务及相关专业。\r\n语言能力：英语听说读写流利，具备良好的商务英语沟通能力，掌握第二外语优先录用。\r\n其他要求：男女不限、性格外向、善于与人沟通、能接受全国各地出差。', '', 5000, 8000, 5, '全职', NULL, 1, 576, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1624, '2025-04-08 15:24:11.024917', '2025-04-08 15:24:11.024917', NULL, '外贸跟单', '1.客户日常电邮的回复及客户来访的商务接待。\r\n2.跟进国外客户的询价、报价、订单等信息，确保订单信息准确无误。\r\n3.协调生产、采购、物流等部门，确保按时交货，并跟踪订单进度，及时向客户反馈订单状态。\r\n4.准备和审核各类外贸文件，如合同、发票、装箱单、提单等，确保所有文件符合国际贸易法规和公司内部流程要求。\r\n5.与货运代理和物流公司合作，安排货物的运输和报关，跟踪货物运输情况，处理运输过程中出现的问题。\r\n6.协助参加国内外展会，准备参展资料和样品，参与公司的线上和线下市场推广活动，扩大品牌影响力。\r\n7.维护客户关系，处理客户的投诉和建议，提高客户满意度。\r\n8.熟练使用办公软件（如Word, Excel, PPT）。', '', 5000, 8000, 5, '全职', NULL, 1, 576, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1625, '2025-04-08 15:24:11.736938', '2025-04-08 15:24:11.736938', NULL, 'Php后端开发工程师', '申请\r\n将简历及作品集发送到 hr@deepdev.pro\r\n职责\r\n负责云平台各个模块、后台应用、API接口的开发\r\n要求\r\n本科以上学历，计算机相关专业，211/985院校毕业生优先\r\n对php框架有了解，熟悉Yii2.0开发框架优先\r\n了解PSR4规范，有composer使用经验优先\r\n必须对面向对象要有一定了解\r\n熟悉MySQL数据库，了解MySQL的简单优化\r\n熟悉Linux，能使用Linux作为开发环境\r\n熟悉Docker/Kubernetes等容器化技术方案的优先\r\n熟悉TCP/IP协议，对Socket/WebSocket通信和HTTP/HTTPS协议有深刻理解优先\r\n上班\r\n五天工作制 早上8:30 ~11:30，下午 1:30~ 6:30\r\n福利\r\n五险一金入职后为员工购买社会保险（生育险、失业险、养老险、工伤险、医疗险）和住房公积金\r\n双休五天工作制，每天工作8小时\r\n加班费周六日加班按工作日计算加班费\r\n提供住房入职后为员工提供小区或公寓合租房，一般为2室~4室，位于公司半径2公里路程内，内有空调，电视，油烟机，洗衣机等，拎包即住\r\n有薪假法定节假日、年休假、产假、陪产假、婚假、病假、丧假等\r\n用餐公司楼宇内有食堂，食物种类多样就餐方便，此外园区内也有多个大型食堂\r\n员工关怀节日礼物、团建、聚餐、旅游等\r\n年终奖每年公司都会根据当年盈利情况发放奖金', '', 6000, 15000, 2, '全职', NULL, 1, 577, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
