INSERT INTO `post` VALUES (1631, '2025-04-08 15:24:13.044254', '2025-04-08 15:24:13.045249', NULL, '全栈工程師', '申请\r\n将简历及作品集发送到 hr@deepdev.pro\r\n职责\r\n负责云平台应用后台开发\r\n负责前端小程序端/H5端开发\r\n负责3d场景开发\r\n要求\r\n本科以上学历，计算机相关专业\r\n理解Web标准并熟练运用HTML5/CSS3/TypeScript构建高性能web应用\r\n熟练掌握React或Vue，并有相关实战经验\r\n熟练使用Vite获Webpack，并能根据项目实际情况定制构建工具\r\n熟练运用OOP(面向对象编程)核心思想进行编码，至少能熟练使用C++、Java、PHP、NodeJs、Go其中一种后端语言\r\n熟悉常规数据库命令，如：MySQL、MangoDB\r\n了解SSR服务端渲染，能根据实际情况制定服务器渲染策略\r\n了解Linux常规命令，能在Linux下进行简单开发\r\n熟悉微信开发体系，包括公众号、小程序、微信支付等\r\n熟悉WebGL, ThreeJs, BabylonJs优先\r\n上班\r\n五天工作制 早上8:30 ~11:30，下午 1:30~ 6:30\r\n福利\r\n五险一金入职后为员工购买社会保险（生育险、失业险、养老险、工伤险、医疗险）和住房公积金\r\n双休五天工作制，每天工作8小时\r\n加班费周六日加班按工作日计算加班费\r\n提供住房入职后为员工提供小区或公寓合租房，一般为2室~4室，位于公司半径2公里路程内，内有空调，电视，油烟机，洗衣机等，拎包即住\r\n有薪假法定节假日、年休假、产假、陪产假、婚假、病假、丧假等\r\n用餐公司楼宇内有食堂，食物种类多样就餐方便，此外园区内也有多个大型食堂\r\n员工关怀节日礼物、团建、聚餐、旅游等\r\n年终奖每年公司都会根据当年盈利情况发放奖金', '', 10000, 25000, 3, '全职', NULL, 1, 577, 6, NULL, NULL, NULL, NULL, NULL, 3, '441900', '440000', NULL, NULL, 4, NULL, 0);
