INSERT INTO `post` VALUES (1633, '2025-04-08 15:24:14.049113', '2025-04-08 15:24:14.049113', NULL, '销售培训生（珠三角）', '【岗位职责】\r\n百事饮品事业销售培训生项目旨在招募对销售工作充满热情与探索精神的高潜人才，销售管培生将在为期1-2年的时间内完成定制化的销售职业发展与学习路径，提供跨职能轮岗机会，激发自身潜力，提升销售专业能力和领导力，从而实现高速职业发展\r\n\r\n【任职要求】\r\n1、毕业两年内的潜力新星，本科及本科以上学历，专业不限，工商管理、市场营销等相关专业优先\r\n2.、对快速消费品饮料行业及销售岗位充满热情和兴趣\r\n3、能够接受且灵活适应公司业务区域内的轮岗或调动（工作地点覆盖广州、深圳、东莞、佛山、中山、珠海）\r\n4、具备学习敏锐度，沟通能力及良好的洞察能力\r\n\r\n【薪资福利】\r\n1、基本薪资+业绩奖金+交通补贴+电话补贴+培训生津贴+周六激励奖金，固定薪资5-6K，综合薪资7-9K；\r\n2、五险一金、丰富的文体活动、年度旅游、节日福利、生日福利等等......', '', 7000, 9000, 10, '全职', NULL, 1, 578, 6, NULL, NULL, NULL, NULL, NULL, 7, '440100', '440000', '440104', NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1634, '2025-04-08 15:24:14.949377', '2025-04-08 15:24:14.949377', NULL, '初级结构工程师', '岗位职责\r\n1、辅助方案工程师完成分公司的工位方案转化；\r\n2、使用NND标准周边设备拼装新原生方案；\r\n3、原生方案资料编辑及上传；\r\n4、辅助完成新产品量产资料。\r\n5、辅助方案工程师完成标准设备设计。\r\n任职要求\r\n1、机械设计制造及其自动化、自动化等专业;\r\n2、熟悉机械原理，机电传动，机械设计；\r\n3、精通使用Solidworks 3D软件及Auto CAD;\r\n4、熟悉常用金属和塑料的材料特性、机械加工、钣金工艺，及热处理知识;\r\n5、具备独立发现、分析和解决问题的能力，同时善于团队合作，具备一定的项目、团队管理能力;\r\n6、具备整体设计能力，有独立完成整机开发的成功案例，逻辑性强，创新意识强，具有良好的项目管理能力，有较强的成本控制意识;\r\n\r\n待实习学霸可优先考虑', '', 5000, 10000, 2, '全职', NULL, 1, 579, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1635, '2025-04-08 15:24:15.259848', '2025-04-08 15:24:15.259848', NULL, 'ai应用/研发工程师', '任职要求\r\n1.本科或以上应届毕业生， \r\n2.计算机，软件，数学，或自动化专业\r\n3.熟悉 python ,C/C++ , C#,  等编程语言\r\n4.熟悉 深度学习算法：如CNN、RNN、LSTM等，\r\n机器学习算法：包括SVM、Boosting等，\r\n自然语言处理：涉及语言模型、文本生成、语义理解等技术，\r\n 计算机视觉：包括图像识别、目标检测、图像分割等技术\r\n5.熟悉 软件架构设计：能够设计和实现模块化、可扩展的软件架构，支持AI系统的高效开发和部署。\r\n算法部署与优化：掌握算法部署的方法和技巧，能够将训练好的模型高效地部署到各种硬件平台上，并进行性能优化。\r\n版本控制与协作：熟悉Git等版本控制工具，能够进行团队协作开发，管理代码版本。\r\n6.其他技能与素质\r\n问题解决能力：具备优秀的逻辑思维能力和问题解决能力，能够快速定位和解决开发过程中遇到的问题。\r\n学习能力：对新技术有钻研兴趣，能够快速学习和掌握新的技术和知识。\r\n团队协作：具备良好的沟通和团队协作能力，能够与团队成员有效合作，共同完成项目。', '', 5000, 8000, 4, '全职', NULL, 1, 579, 6, NULL, NULL, NULL, NULL, NULL, 3, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1636, '2025-04-08 15:24:16.078394', '2025-04-08 15:24:16.078394', NULL, '班课初高化学', '1.负责小班教学相关工作，包括备课、授课和布置作业等；\r\n2.负责提供高质量的教学服务；\r\n3.保持与家长的沟通交流，及时反馈学生情况；\r\n4.积极参与公司和部门组织的各类培训、教研、会议等。\r\n\r\n任职要求：\r\n1.全日制本科，不限专业，对某一学科有优势或浓厚兴趣；\r\n2.有较强沟通能力，热爱教育事业，乐于分享，富有爱心；\r\n3.愿意接纳并学习新的事物，提升自己的职业素养；\r\n4.擅于与学生及家长进行交流互动；\r\n5.应聘英语学科者，需具备CET6或专四。\r\n\r\n薪资福利：\r\n1.首年保底10-18万\r\n2.福利：带薪学业假、带薪年假、年度体检、员工旅游、五险一金、住房补贴、、、\r\n\r\n晋升机制：\r\n1.职称教师：初级→中级→金牌教师\r\n2.管理层：教师→科组长→校区主任→ 区域经理\r\n3.职能部门：教研部/质控部/选聘部专员→高级部门专员→部门管理者\r\n工作时间：双休，周一周二休息\r\n工作地点：东莞29个校区，根据个人意愿以及实际需求就近安排。\r\n\r\n应聘流程：笔试考核—试讲考核—面谈—签约', '', 8000, 13000, 10, '全职', NULL, 1, 580, 6, NULL, NULL, NULL, NULL, NULL, 1, '441900', '440000', NULL, NULL, 4, NULL, 0);
