INSERT INTO `post` VALUES (1639, '2025-04-08 15:24:16.845882', '2025-04-08 15:24:16.845882', NULL, '个性化化学老师', '岗位职责：\r\n1.负责本学科的备课和教学工作；\r\n2.根据学生的实际情况，制定适宜的教学方案和教学计划，教学注重引导；\r\n3.培养学生良好的学习习惯，进行学习方法的指导和课后跟踪服务；\r\n4.主动与学生、家长保持良好的沟通，及时进行课后追踪服务，听取学生家长的反馈意见，不断提高教学服务质量；\r\n5.参加学科教研活动，提高教学水平，为公司提供高质量的教学资源/教案。\r\n\r\n任职要求：\r\n1.本科及以上学历，专业不限；\r\n2.具备科目扎实的理论基础，普通话标准、有亲和力、耐心有责任心、沟通表达能力强；\r\n3.热爱教育教学工作，具有良好的教师职业操守；\r\n4.擅长与学生进行交流沟通和学习心理疏导。\r\n\r\n薪资待遇：\r\n1、首年保底年薪8-11万,具体根据考核决定；\r\n2、五险一金，员工体检，带薪年假，出国旅游应有尽有。\r\n\r\n晋升机制：\r\n1.职称教师：3星级→7星级→金牌教师\r\n2.管理层：教师→科组长→校区主任→ 区域经理\r\n3.职能部门：教研部/质控部/选聘部专员→高级部门专员→部门管理者\r\n工作时间：双休，周一周二休息\r\n工作地点：东莞25个校区，根据个人意愿以及实际需求就近安排。\r\n\r\n应聘流程：笔试考核—试讲考核—面谈—签约', '', 5000, 8000, 10, '全职', NULL, 1, 580, 6, NULL, NULL, NULL, NULL, NULL, 3, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1640, '2025-04-08 15:24:17.063615', '2025-04-08 15:24:17.063615', NULL, '班课小学教师（语数英）', '1.负责小班教学相关工作，包括备课、授课和布置作业等；\r\n2.负责提供高质量的教学服务；\r\n3.保持与家长的沟通交流，及时反馈学生情况；\r\n4.积极参与公司和部门组织的各类培训、教研、会议等。\r\n\r\n任职要求：\r\n1.全日制本科，不限专业，对某一学科有优势或浓厚兴趣；\r\n2.有较强沟通能力，热爱教育事业，乐于分享，富有爱心；\r\n3.愿意接纳并学习新的事物，提升自己的职业素养；\r\n4.擅于与学生及家长进行交流互动；\r\n5.应聘英语学科者，需具备CET6或专四。\r\n\r\n薪资福利：\r\n1.首年保底10-18万\r\n2.福利：带薪学业假、带薪年假、年度体检、员工旅游、五险一金、住房补贴、、、\r\n\r\n晋升机制：\r\n1.职称教师：初级→中级→金牌教师\r\n2.管理层：教师→科组长→校区主任→ 区域经理\r\n3.职能部门：教研部/质控部/选聘部专员→高级部门专员→部门管理者\r\n工作时间：双休，周一周二休息\r\n工作地点：东莞29个校区，根据个人意愿以及实际需求就近安排。\r\n\r\n应聘流程：笔试考核—试讲考核—面谈—签约', '', 6000, 10000, 15, '全职', NULL, 1, 580, 6, NULL, NULL, NULL, NULL, NULL, 0, '441900', '440000', NULL, NULL, 4, NULL, 0);
