INSERT INTO `post` VALUES (1653, '2025-04-08 15:24:20.244234', '2025-04-08 15:24:20.244234', NULL, '学习规划师（双休+五险一金）', '岗位职责：\r\n1、有策略地接听和呼出电话、通过各种市场活动预约客户上门，并提供相关咨询；\r\n2、接待来访客户并现场咨询，对学生进行全面测试和分析，使家长认可；\r\n3、并根据客户的需求提供个性化辅导方案，引导和促成客户签约，完成销售任务；\r\n4、按时参加各项培训及学习提升咨询技能。\r\n任职要求：\r\n1、本科以上学历；\r\n2、1年以上相关工作经验；有同行业相关工作经验者优先；（同时也欢迎优秀的应届毕业生投递简历）\r\n3、积极乐观的人生态度，较强的抗压能力；\r\n4、综合素质良好，懂得基本的商务礼仪；\r\n5、工作认真负责，具备良好的职业道德。\r\n薪资介绍：\r\n1.入职签订保底年薪10-15万,具体根据考核决定；\r\n2.住房补贴，五险一金，员工体检，带薪年假，出国旅游应有尽有。\r\n晋升机制：专员-主管-副主任-主任-总监副校长\r\n工作时间：双休，周一周二休息\r\n工作地点：东莞20个校区，根据个人意愿以及实际需求就近安排。\r\n应聘流程：初试—复试—签约', '', 5000, 13000, 15, '全职', NULL, 1, 580, 6, NULL, NULL, NULL, NULL, NULL, 8, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1654, '2025-04-08 15:24:20.529807', '2025-04-08 15:24:20.529807', NULL, '学习管理师/班主任', '工作职责：\r\n1.负责建立学生档案资料和管理合同，落实学生的课时安排；\r\n2.跟踪记录学生的学习状况，电话回访与家长沟通学生学习情况；\r\n3.与学生及家长保持良好的沟通，提高教学服务满意度，减少投诉和退费；\r\n4.做好学生续费报名工作。\r\n任职要求：\r\n1.大专以上学历，专业不限；\r\n2.善于与人交流，亲和力强，性格活泼开朗；\r\n3.良好的沟通表达能力，应变能力强，具有良好的服务意识。\r\n薪资介绍：\r\n1.入职签订保底年薪8-12万,具体根据考核决定；\r\n2.住房补贴，五险一金，员工体检，带薪年假，出国旅游应有尽有。\r\n晋升机制：专员-主管-副主任-主任-总监副校长\r\n工作时间：双休，周一周二休息\r\n工作地点：东莞25个校区，根据个人意愿以及实际需求就近安排。\r\n应聘流程：初试—复试—签约', '', 5000, 10000, 15, '全职', NULL, 1, 580, 6, NULL, NULL, NULL, NULL, NULL, 20, '441900', '440000', NULL, NULL, 4, NULL, 0);
INSERT INTO `post` VALUES (1655, '2025-04-08 15:24:20.946427', '2025-06-05 07:37:03.622950', NULL, '销售储备学生', '薪酬福利：试用期6750元/月，定岗后8000-15000元/月\r\n工作地点：广东省、海南省（可推荐至全国各地）\r\n培养目标：营销总经理等管理级层（管理范围省级为单位）\r\n岗位职责：\r\n管理所辖区域市场销售工作，维护市场客情并保证销售产品质量，监督、协助经销商、执行公司促销推广活动的落地执行；完成公司布达的各项工作指标，最终成长为可独立管理市场的管理者。（多元化发展：传统销售、大卖场销售、新零售方向、国际化方向、渠道运营等）\r\n岗位优势：\r\n(1)岗位发展发展多元化：传统销售、大卖场销售、新零售方向、国际化方向、渠道运营等；\r\n(2)工作地点分配尊重本人意愿；\r\n公司提供平台与资源，员工的工作更多的是维护客情，制定销售策略提高市场占比；', '啊实打实', 6750, 15000, 10, '全职', NULL, 1, 581, 6, NULL, NULL, '东莞市', '广东省', '东城街道', 927, '441900', '440000', '441900003', '', 4, NULL, 0);
