INSERT INTO `post` VALUES (1659, '2025-05-28 15:48:04.317723', '2025-06-04 16:01:25.451761', NULL, '新媒体运营实习生', '本公司正在招聘：网络运营、新媒体运营、均可接受无经验实习生、应届生、毕业生的人员，可开实习证明的。\n（一旦录用待遇从优）\n一：日常工作内容\n1、主要公司主要以网络更新上架，线上软件运营，自媒体抖音短视频运营推广为主。\n2、会使用电脑，打字即可\n3、办公室坐班工作，无需外出\n\n二：薪资待遇\n1.薪资3000+提成+现金奖，0经验入职的新员工第一个月收入均为6000-8000元（包住不包吃）\n2.每周固定下午茶，每月有团队团建，每个季度有省内外旅游和年度国外精英游。\n3.我们宗旨：开心工作，快乐赚钱。\n\n三：职位要求\n1.年龄（18-30岁）\n2.工作细心，服务意识强，具较强的抗议压能力\n3.好学，想对自己有进一步能力上的提升，有上进心和责任心\n4.无经验者看向第3条，我们提供师徒制一对一指导\n\n四：上班时间\n工作时间.早9:30--晚18:00\n每月休息4天\n\nPS：\n1.用心一点:一般月收入可达10000+元\n2.专心一点:一般月收入可达20000+元\n3.收入可观，个人晋升空间大，绿色通道，新人三个月可从初级运营晋升高级运营，半年可晋升主管。\n\n欢迎各位小，哥哥小姐姐！来私聊我\n期待各位加入我们的团队~您值得拥有\n来源：BOSS直聘\n链接：https://www.zhipin.com/web/geek/jobs?city=101281600&query=%E6%96%B0%E5%AA%92%E4%BD%93%E8%BF%90%E8%90%A5', '东莞UCC寰宇汇金中心南城ucc寰宇汇金中心5号楼5楼509', 6000, 8000, 1, '实习', NULL, 1, 581, 2, 0, 0, '东莞市', '广东省', '东城街道', 81, '441900', '440000', '441900003', '', 4, NULL, 0);
