INSERT INTO `resume` VALUES (25, 299, '该简历信息不完整，缺少必要的联系方式、教育背景、工作经历、项目经验等核心内容，无法进行有效评估。建议补充完整的个人信息，包括学历背景、职业经历、技能专长和项目成果等内容，以体现个人竞争力。同时注意格式清晰、语言简洁，突出与目标岗位相关的经验和能力。', 0, '2025-07-16 17:18:02.943356', '2025-07-16 17:18:02.943356', NULL, NULL, '[\"信息不完整\",\"无法进行有效评估\",\"补充完整的个人信息\",\"突出与目标岗位相关的经验\"]');
INSERT INTO `resume` VALUES (26, 4909, '该简历信息不完整，无法进行有效评估。缺少姓名、教育背景、工作经历、技能等关键内容，建议补充完整信息后再进行评估。', 0, '2025-07-17 08:30:40.673685', '2025-07-17 08:30:40.674137', NULL, '求职者基本信息：未提供姓名、性别、年龄等信息\n\n教育背景：社会大学计算机专业，本科学历（预计2025年6月毕业）\n\n核心技能：未提供具体技术技能\n\n工作经历概述：未提供正式工作经历；曾于未来科技无限公司担任Java工程师职位（时间不足一个月），非实习岗位，具体职责描述不详\n\n项目经验：未提供\n\n专业成就：未提供\n\n求职意向：未提供', '[\"简历信息不完整\",\"无法进行有效评估\",\"补充完整信息\"]');
