INSERT INTO `resume_evaluation` VALUES (1, NULL, 18, 14, '一般', '该求职者基本信息不完整，缺乏教育背景、技能证书、项目经验及工作经历等关键信息。整体竞争力较弱，建议补充详细的职业背景信息以提升竞争力。', '{\"dimensions\": [{\"level\": \"一般\", \"score\": 3, \"reason\": \"简历中未提供任何学历或院校相关信息，无法判断其教育背景，按最差情况评分。\", \"dimension\": \"认知/知识\"}, {\"level\": \"一般\", \"score\": 4, \"reason\": \"未提供任何关于证书、项目经验、工作经验或奖项的信息，无法判断其专业技能与岗位匹配程度，评分基于最低标准。\", \"dimension\": \"技能/经验\"}, {\"level\": \"中等\", \"score\": 7, \"reason\": \"因无工作经历信息，无法判断其跳槽频率；但年龄26岁申请学徒工岗位，可能存在职业路径不稳定因素，故给予中等评分。\", \"dimension\": \"忠诚度/稳定性\"}], \"overallLevel\": \"一般\", \"overallScore\": 14, \"overallEvaluate\": \"该求职者基本信息不完整，缺乏教育背景、技能证书、项目经验及工作经历等关键信息。整体竞争力较弱，建议补充详细的职业背景信息以提升竞争力。\"}', '2025-06-27 18:43:37.703524', '2025-06-27 18:43:37.704562');
INSERT INTO `resume_evaluation` VALUES (2, 1, 1, 7, '中等', '该求职者适合意向岗位。简历可信度中。能力预估中。\n综合评价：具备扎实的Java和微服务开发技能，项目经验丰富，但学历信息缺失影响整体评估。', '{\"dimensions\": [{\"score\": 5, \"reason\": \"学校为普通本科（东华理工大学），专业未填写，学历信息缺失，仅能评为中等\", \"dimension\": \"认知/知识\"}, {\"score\": 8, \"reason\": \"掌握Java、Spring Boot、MySQL等核心技术，有3个较完整的项目经验，且曾获阿里技术之星奖项，技能评分优秀\", \"dimension\": \"技能/经验\"}, {\"score\": 6, \"reason\": \"工作经历跨度较长，项目时间连续性较好，但无明确公司任职信息，无法判断跳槽频率，暂评为中等\", \"dimension\": \"忠诚度/稳定性\"}], \"overallLevel\": \"中等\", \"overallScore\": 7, \"overallEvaluate\": \"该求职者适合意向岗位。简历可信度中。能力预估中。\\n综合评价：具备扎实的Java和微服务开发技能，项目经验丰富，但学历信息缺失影响整体评估。\"}', '2025-07-02 17:21:32.547684', '2025-07-10 09:49:12.996294');
