INSERT INTO `user_work_experience` VALUES (50, '2025-07-03 16:58:22.934492', '2025-07-03 16:58:22.934492', NULL, '东莞汇川金属家具制造有限公司', '', 'ERP系统开发', '负责公司ERP系统新增功能与优化过程，优化工厂生产流程，简化生产人员使用ERP系统。将Delphi桌面版ERP转换成react、vue与Django网页版ERP。熟练使用react、Vue与Django编写网页，编写相应网页组件降低代码量，封装组件，降低代码耦合性，提高组件使用率。编写使用新技术的技术文档供同事使用，将技术文档写至通俗易懂。编写新项目Tenant Cloud，使用一对多数据表、操作表、关系表，由0到1进行编写。', '2024-09-01', '2024-12-01', '', 0, 5001);
INSERT INTO `user_work_experience` VALUES (51, '2025-07-03 17:00:30.828921', '2025-07-03 17:00:30.828921', NULL, '东莞市大洋化工科技有限公司', '化学原料和化学制品制造业', '销售专员', '负责化工产品市场开拓，挖掘潜在客户；维护现有客户关系，提供技术支持和售后服务；跟进订单执行流程，协调生产、物流、财务等部门；处理客户投诉；制定销售策略，完成销售目标；讲解产品特性，协助解决技术疑问；收集行业动态，分析市场需求变化；与技术部门配合，提供定制化解方案；参与行业展会活动提升品牌曝光度。', '2024-02-01', '2025-02-01', '', 0, 5002);
INSERT INTO `user_work_experience` VALUES (52, '2025-07-03 17:00:30.828921', '2025-07-03 17:00:30.828921', NULL, '中国长安汽车集团有限公司', '汽车制造业', '销售专员', '接待到店客户，了解购车需求；线上线索跟进，邀约试驾；掌握车型配置及性能参数，解答技术疑问；根据客户需求推荐车型，结合促销政策推动决策；安排试驾，展示车辆优势；制定购车方案，说明费用明细；应对客户异议，强调品牌优势；协助完成合同签订及车辆交付；组织交车仪式，讲解使用技巧；定期回访客户，引导售后保养。', '2023-02-01', '2024-01-01', '', 0, 5002);
INSERT INTO `user_work_experience` VALUES (53, '2025-07-03 17:00:30.828921', '2025-07-03 17:00:30.828921', NULL, '华为技术有限公司', '计算机、通信和其他电子设备制造业', '半导体专员', '了解半导体材料的导电性能和能带结构；掌握载流子概念及其在半导体中的作用；熟悉芯片制造过程及晶体管工作原理；了解二极管和晶体管在电子电路中的应用；了解光电子器件和传感器的工作原理及应用。', '2022-06-01', '2023-02-01', '', 0, 5002);
